(1, 'VENOM', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'VENOM', '2023-05-04 18:12:00', '2023-06-04 18:12:00', NULL, 1, 1, NULL, '0.05', '0.00', '0.01', '0.000', 5, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2019-11-26 01:17:02', '2023-05-04 22:12:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 6, 2, 'VENOM', 'VENOM', 'VENOM', 'VENOM'),
(2, 'Ford против Ferrari', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'Сюжет повествует о группе американских инженеров и дизайнеров. В 1960-х под руководством конструктора Кэрролла Шелби и при поддержке британского гонщика Кена Майлса они должны были с нуля сделать абсолютно новый спорткар, способный опередить Феррари — непобедимого чемпиона 24-часовой гонки на выносливость Ле-Ман.\nПремьера: 2019 г. (США)\nРежиссер: Джеймс Мэнголд\nГод: 2019', '2023-05-06 18:11:00', '2023-06-06 18:11:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.01', '0.010', 6, NULL, NULL, '', 1, 1, 1, 1, 1, 0, 1, '2019-12-06 23:00:19', '2023-05-05 14:18:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 6, 2, 'herem', 'herem', 'herem', 'herem'),
(3, 'Рождество на двоих', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'Кейт, которая работает в магазине рождественских товаров, злоупотребляет выпивкой и давно бросила переживать из-за собственной жизни. Но всё меняется после знакомства с милым и очаровательным Томом.', '2023-05-04 18:08:00', '2023-06-04 18:09:00', NULL, 1, 1, NULL, '2.80', '0.38', '0.01', '0.000', 6, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2019-12-07 14:19:06', '2023-05-04 22:09:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 4, 'Рождество на двоих', 'Рождество на двоих', '**TM content**\nКейт, которая работает в магазине рождественских товаров, злоупотребляет выпивкой и давно бросила переживать из-за собственной жизни. Но всё меняется после знакомства с милым и очаровательным Томом.', 'Кейт, которая работает в магазине рождественских товаров, злоупотребляет выпивкой и давно бросила переживать из-за собственной жизни. Но всё меняется после знакомства с милым и очаровательным Томом.'),
(5, 'Classical Music Concert', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'Концерт классической музыки в исполнении струнного оркестра Тахира Атаева.\n', '2023-05-04 17:42:00', '2023-06-04 17:42:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 6, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2019-12-09 15:42:11', '2023-05-04 21:43:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 2, 7, 2, 'Classical Music Concert', 'Classical Music Concert', 'Концерт классической музыки в исполнении струнного оркестра Тахира Атаева.\n', 'Концерт классической музыки в исполнении струнного оркестра Тахира Атаева.\n'),
(6, 'Концерт "Русский романс. Золотой век"', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'Концерт "Русский романс. Золотой век". Вера Базарова (вокал).\nВладимир Мкртумов (фортепиано).\n', '2023-05-04 18:08:00', '2023-06-04 18:08:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 6, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2019-12-09 15:50:06', '2023-05-04 22:08:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 2, 7, 2, 'Концерт "Русский романс. Золотой век"', 'Концерт "Русский романс. Золотой век"', 'Концерт "Русский романс. Золотой век". Вера Базарова (вокал).\nВладимир Мкртумов (фортепиано).\n', 'Концерт "Русский романс. Золотой век". Вера Базарова (вокал).\nВладимир Мкртумов (фортепиано).\n'),
(7, 'Холодное сердце 2', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'Анна, Эльза, Кристоф, его верный олень Свен и никогда не унывающий снеговик Олаф должны будут покинуть уютное королевство Эренделл и отправиться ещё дальше на север, в путешествие, которое приведет их к истокам древних легенд и поможет раскрыть тайны, касающиеся прошлого их родной страны.', '2023-05-04 18:11:00', '2023-06-04 18:11:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 6, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2019-12-09 15:58:20', '2023-05-04 22:11:08', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Холодное сердце 2', 'Холодное сердце 2', 'Анна, Эльза, Кристоф, его верный олень Свен и никогда не унывающий снеговик Олаф должны будут покинуть уютное королевство Эренделл и отправиться ещё дальше на север, в путешествие, которое приведет их к истокам древних легенд и поможет раскрыть тайны, касающиеся прошлого их родной страны.', 'Анна, Эльза, Кристоф, его верный олень Свен и никогда не унывающий снеговик Олаф должны будут покинуть уютное королевство Эренделл и отправиться ещё дальше на север, в путешествие, которое приведет их к истокам древних легенд и поможет раскрыть тайны, касающиеся прошлого их родной страны.'),
(8, 'WONDER PARK', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', 'Маленькая выдумщица Джун обнаруживает посреди леса удивительный парк развлечений. Ее поражают чудо-аттракционы, местные говорящие животные… и царящая здесь разруха. Джун выясняет, что парк порожден ее собственной фантазией, а значит, она одна способна привести его в порядок.', '2023-05-04 18:10:00', '2023-06-04 18:10:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 6, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2019-12-10 15:50:44', '2023-05-04 22:10:54', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'WONDER PARK', 'WONDER PARK', 'Маленькая выдумщица Джун обнаруживает посреди леса удивительный парк развлечений. Ее поражают чудо-аттракционы, местные говорящие животные… и царящая здесь разруха. Джун выясняет, что парк порожден ее собственной фантазией, а значит, она одна способна привести его в порядок.', 'Маленькая выдумщица Джун обнаруживает посреди леса удивительный парк развлечений. Ее поражают чудо-аттракционы, местные говорящие животные… и царящая здесь разруха. Джун выясняет, что парк порожден ее собственной фантазией, а значит, она одна способна привести его в порядок.'),
