(15, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-05 17:00:00', '2020-02-05 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 15:13:39', '2020-02-11 05:43:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Свалка ', 'Свалка ', 'Бразильский беспризорник Рафаэль зарабатывает на жизнь тем, что вместе с другими бедняками разгребает мусор на гигантской свалке Рио-де-Жанейро в поисках всего, что можно было бы продать. Его жизнь кардинально меняется в один момент, когда парень находит в мусорке старый потертый бумажник. На первый взгляд, кроме денег, в нем нет ничего примечательного. Однако очень скоро за этой вещью начинают охотиться очень влиятельные и опасные люди, которые не остановятся ни перед чем для достижения своих целей. Рафаэль со своими друзьями Гардо и Габриэлем решает во чтобы это не стало узнать, какую тайну скрывает его находка.', 'Бразильский беспризорник Рафаэль зарабатывает на жизнь тем, что вместе с другими бедняками разгребает мусор на гигантской свалке Рио-де-Жанейро в поисках всего, что можно было бы продать. Его жизнь кардинально меняется в один момент, когда парень находит в мусорке старый потертый бумажник. На первый взгляд, кроме денег, в нем нет ничего примечательного. Однако очень скоро за этой вещью начинают охотиться очень влиятельные и опасные люди, которые не остановятся ни перед чем для достижения своих целей. Рафаэль со своими друзьями Гардо и Габриэлем решает во чтобы это не стало узнать, какую тайну скрывает его находка.'),
(16, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-06 17:00:00', '2020-02-06 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 15:58:01', '2020-02-11 05:42:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Безумная свадьба', 'Безумная свадьба', 'Главные герои фильма, мсье Верней и его жена - добропорядочная буржуазная французская супружеская пара, родители четырех красавиц-дочерей. Как известно, основная проблема всех подобных семей - выдать дочек замуж, чтобы не засиделись в девках. У семейства Верней такой проблемы нет. Три дочери уже нашли свое счастье, вот только мужья, по мнению родителей, подкачали: один - китаец, другой - араб, третий - еврей... Пришло время, и четвертая дочь сообщает радостную весть: она тоже выходит замуж! И ее жених... чернокожий.', 'Главные герои фильма, мсье Верней и его жена - добропорядочная буржуазная французская супружеская пара, родители четырех красавиц-дочерей. Как известно, основная проблема всех подобных семей - выдать дочек замуж, чтобы не засиделись в девках. У семейства Верней такой проблемы нет. Три дочери уже нашли свое счастье, вот только мужья, по мнению родителей, подкачали: один - китаец, другой - араб, третий - еврей... Пришло время, и четвертая дочь сообщает радостную весть: она тоже выходит замуж! И ее жених... чернокожий.'),
(17, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-06 19:00:00', '2020-02-06 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 16:07:10', '2020-02-11 05:40:59', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Прогулка', 'Прогулка', 'Вы боитесь высоты? А можете представить себя идущим по натянутому канату на высоте более 400м без всякой страховки? Потоки ветра обдувают вас, а внизу - город  и тысячи взволнованных взглядов, устремленных вверх. История о том, как французский канатоходец Филипп Пети отважился совершить легендарный трюк - пройти без страховки по канату, натянутому между небоскребами в Нью-Йорке.', 'Вы боитесь высоты? А можете представить себя идущим по натянутому канату на высоте более 400м без всякой страховки? Потоки ветра обдувают вас, а внизу - город  и тысячи взволнованных взглядов, устремленных вверх. История о том, как французский канатоходец Филипп Пети отважился совершить легендарный трюк - пройти без страховки по канату, натянутому между небоскребами в Нью-Йорке.'),
(18, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 15:00:00', '2020-02-16 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 16:19:33', '2020-02-11 05:52:55', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дом призраков', 'Дом призраков', 'Молодая пара отправляется в путешествие в Таиланд. В сельской местности они обнаруживают кладбище с находящимися на нем "домами призраков", где, по местным верованиями, духи обретают покой. Имевших неосторожность осквернить святыню влюбленных начинает преследовать жестокая сверхъестественная сила. Она погружает героев в пучину леденящего ужаса потустороннего мира, из которого нет выхода.', 'Молодая пара отправляется в путешествие в Таиланд. В сельской местности они обнаруживают кладбище с находящимися на нем "домами призраков", где, по местным верованиями, духи обретают покой. Имевших неосторожность осквернить святыню влюбленных начинает преследовать жестокая сверхъестественная сила. Она погружает героев в пучину леденящего ужаса потустороннего мира, из которого нет выхода.'),
(19, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 17:00:00', '2020-02-07 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 16:31:17', '2020-02-11 05:51:17', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Лёд', 'Лёд', 'С самого детства Надя верила в чудеса. Она представляла себе, как выходит на лед под овации публики и танцует свой самый красивый танец. И вот, благодаря вере и упорству, Надя становится знаменитой фигуристкой. Но когда ее мечты о громких победах, красивой жизни и прекрасном принце уже, кажется, готовы исполниться, судьба преподносит ей настоящее испытание. И чтобы его пройти, нужно будет снова, как в детстве, поверить в мечту. Ведь, может быть, победа не всегда должна быть громкой, а прекрасный принц не обязательно передвигается на белом коне?...', 'С самого детства Надя верила в чудеса. Она представляла себе, как выходит на лед под овации публики и танцует свой самый красивый танец. И вот, благодаря вере и упорству, Надя становится знаменитой фигуристкой. Но когда ее мечты о громких победах, красивой жизни и прекрасном принце уже, кажется, готовы исполниться, судьба преподносит ей настоящее испытание. И чтобы его пройти, нужно будет снова, как в детстве, поверить в мечту. Ведь, может быть, победа не всегда должна быть громкой, а прекрасный принц не обязательно передвигается на белом коне?...'),
(20, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 19:00:00', '2020-02-07 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 16:39:42', '2020-02-11 05:50:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Sarkar Raj', 'Sarkar Raj', 'Анита, президент международной фирмы, вносит предложения о постройке электростанции в деревне Махараштра, Шанкар ее поддерживает и едет с ней в деревню, чтобы мобилизовать поддержку масс. Его противник подстрекает миллионы людей против этого проекта, проект мечты Шанкара постепенно становится политическим минным полем. Злые силы собираются, чтобы стереть имя Шанкара с политического горизонта. Однако, на самом деле все не так, как кажется.', 'Анита, президент международной фирмы, вносит предложения о постройке электростанции в деревне Махараштра, Шанкар ее поддерживает и едет с ней в деревню, чтобы мобилизовать поддержку масс. Его противник подстрекает миллионы людей против этого проекта, проект мечты Шанкара постепенно становится политическим минным полем. Злые силы собираются, чтобы стереть имя Шанкара с политического горизонта. Однако, на самом деле все не так, как кажется.'),
(21, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 15:00:00', '2020-02-07 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 16:48:47', '2020-02-11 05:51:41', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Аннабель', 'Аннабель', 'Джон находит идеальный подарок для своей жены - это редкая старинная кукла в белом свадебном платье. Но восторг от подарка продлился недолго. Однажды ночью в их дом вторгаются члены сатанинского культа...', 'Джон находит идеальный подарок для своей жены - это редкая старинная кукла в белом свадебном платье. Но восторг от подарка продлился недолго. Однажды ночью в их дом вторгаются члены сатанинского культа...'),
(22, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 19:00:00', '2020-02-07 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 16:57:36', '2020-02-11 05:50:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Ты, мой дом', 'Ты, мой дом', 'Лейла вернулась в дом отца после предательства от любимого. Ее сердце разбито. С отцом у нее с детства были сложные отношения. Они пытаются решить свои проблемы.\nИскандер жил тяжелой жизнью. Он вырос в детском доме. Столкнувшись с неожиданным чувством любви, их отношения стали попыткой найти то, что они ищут.', 'Лейла вернулась в дом отца после предательства от любимого. Ее сердце разбито. С отцом у нее с детства были сложные отношения. Они пытаются решить свои проблемы.\nИскандер жил тяжелой жизнью. Он вырос в детском доме. Столкнувшись с неожиданным чувством любви, их отношения стали попыткой найти то, что они ищут.'),
(23, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-09 15:00:00', '2020-02-09 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 17:06:32', '2020-02-11 05:49:57', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Багровый пик', 'Багровый пик', 'Дурная слава преследует дом, что возвышается над городом. С приходом зимы он утопает в кровавых снегах. Говорят, дело в глине, проступающей на поверхность. Но ни единая душа не рискует ступить на ледяной склон ... кроме нее. Она влюблена в таинственного незнакомца, живущего в древних стенах со своей сестрой. Багровый пик пробудился и же не угаснет.', 'Дурная слава преследует дом, что возвышается над городом. С приходом зимы он утопает в кровавых снегах. Говорят, дело в глине, проступающей на поверхность. Но ни единая душа не рискует ступить на ледяной склон ... кроме нее. Она влюблена в таинственного незнакомца, живущего в древних стенах со своей сестрой. Багровый пик пробудился и же не угаснет.'),
(24, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-09 17:00:00', '2020-02-09 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 17:12:48', '2020-02-11 05:49:37', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Тренер', 'Тренер', 'Футболист национальной сборной Юрий Столешников в ответственный момент не забивает пенальти. После досадной ошибки Столешников покидает сборную, завершает карьеру и становится тренером маленькой провинциальной команды. Именно с этим клубом Столешникову предстоит совершить чудо и вновь поверить в себя.', 'Футболист национальной сборной Юрий Столешников в ответственный момент не забивает пенальти. После досадной ошибки Столешников покидает сборную, завершает карьеру и становится тренером маленькой провинциальной команды. Именно с этим клубом Столешникову предстоит совершить чудо и вновь поверить в себя.'),
(25, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-09 19:00:00', '2020-02-09 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 17:36:35', '2020-02-11 05:49:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Виртуальная любовь', 'Виртуальная любовь', 'Высокомерная красавица не замечает своего неуклюжего коллегу, который сгорает от чувств и теряет дар речи каждый раз, видя ее... Также симпатии героини добивается взрослый респектабельный мужчина, но профессиональная репутация и достоинство героини не позволяют ей принять ухаживания шефа. Убегая от реальности, она влюбляется в Интернете. В виртуальной реальности, возможно, все, Интернет стирает границы...но почему же ее таинственный избранник намеренно не показывает свое лицо? Как разгадать этот любовный треугольник и перенести виртуальные чувства в реальность?', 'Высокомерная красавица не замечает своего неуклюжего коллегу, который сгорает от чувств и теряет дар речи каждый раз, видя ее... Также симпатии героини добивается взрослый респектабельный мужчина, но профессиональная репутация и достоинство героини не позволяют ей принять ухаживания шефа. Убегая от реальности, она влюбляется в Интернете. В виртуальной реальности, возможно, все, Интернет стирает границы...но почему же ее таинственный избранник намеренно не показывает свое лицо? Как разгадать этот любовный треугольник и перенести виртуальные чувства в реальность?'),
(26, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-11 15:00:00', '2020-02-11 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 17:48:00', '2020-02-11 05:49:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Жизнь Пи', 'Жизнь Пи', 'Это история сына владельца одного индийского зоопарка, мальчика по имени Пи. Он познает мир, учится отстаивать свои принципы, ищет собственную дорогу к Богу, живя по канонам трех конфессий, влюбляется... Но волей судьбы его семья вынуждена эмигрировать. На полпути между Индией и Канадой корабль терпит крушение, и Пи остается в шлюпке вместе с бенгальским тигром, гиеной, зеброй и орангутаном. Вокруг безбрежная водная гладь,а впереди - неизвестность...', 'Это история сына владельца одного индийского зоопарка, мальчика по имени Пи. Он познает мир, учится отстаивать свои принципы, ищет собственную дорогу к Богу, живя по канонам трех конфессий, влюбляется... Но волей судьбы его семья вынуждена эмигрировать. На полпути между Индией и Канадой корабль терпит крушение, и Пи остается в шлюпке вместе с бенгальским тигром, гиеной, зеброй и орангутаном. Вокруг безбрежная водная гладь,а впереди - неизвестность...'),
(27, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-11 17:00:00', '2020-02-11 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 17:53:14', '2020-02-11 05:48:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Книга Джунглей', 'Книга Джунглей', 'Непримиримая борьба с опасным и страшным тигром Шерханом вынуждает маугли покинуть волчью стаю и отправиться в деревню к людям. На пути мальчика ждут удивительные открытия и захватывающие с пантерой Багирой, медведем Балу, питоном Кааи другими обитателями дремучих джунглей.', 'Непримиримая борьба с опасным и страшным тигром Шерханом вынуждает маугли покинуть волчью стаю и отправиться в деревню к людям. На пути мальчика ждут удивительные открытия и захватывающие с пантерой Багирой, медведем Балу, питоном Кааи другими обитателями дремучих джунглей.'),
(28, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-11 19:00:00', '2020-02-11 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:06:01', '2020-02-11 05:48:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Муки совести', 'Муки совести', 'Ашфак - парень из маленького городка, стремящийся стать кинозвездой Болливуда. Он вступает в театральную труппу под руководством бывшего преступника Сидху. Через свои уличные театральные постановки они пытаются побудить народ к действию. Ашфак старается выступать как можно лучше, чтобы его мечты сбылись. Вскоре его старания вознаграждаются и он попадает в киноиндустрию. Ему дают новое имя - Самир Кхан. Постепенно его роли становятся все лучше и лучше, и он достигает успеха за довольно короткое время. Он превращается в суперзвезду Самира Кхана, который может с блеском исполнить любую роль, с легкостью воплотить любой образ и получить восторженные отзывы зрителей.', 'Ашфак - парень из маленького городка, стремящийся стать кинозвездой Болливуда. Он вступает в театральную труппу под руководством бывшего преступника Сидху. Через свои уличные театральные постановки они пытаются побудить народ к действию. Ашфак старается выступать как можно лучше, чтобы его мечты сбылись. Вскоре его старания вознаграждаются и он попадает в киноиндустрию. Ему дают новое имя - Самир Кхан. Постепенно его роли становятся все лучше и лучше, и он достигает успеха за довольно короткое время. Он превращается в суперзвезду Самира Кхана, который может с блеском исполнить любую роль, с легкостью воплотить любой образ и получить восторженные отзывы зрителей.'),
(29, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-12 15:00:00', '2020-02-12 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:16:04', '2020-02-11 05:48:06', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Проклятие монахини', 'Проклятие монахини', 'Когда в уединенном монастыре в Румынии молодая монахиня совершает самоубийство,\nВатикан отправляет расследовать происшествие священника с туманным прошлым и послушницу на пороге невозвратных обетов. Рискуя не только жизнями, но и своими душами, они сталкиваются со злобной силой, принявшей облик демонической монахини, а монастырь становится полем битвы между живыми и проклятыми.', 'Когда в уединенном монастыре в Румынии молодая монахиня совершает самоубийство,\nВатикан отправляет расследовать происшествие священника с туманным прошлым и послушницу на пороге невозвратных обетов. Рискуя не только жизнями, но и своими душами, они сталкиваются со злобной силой, принявшей облик демонической монахини, а монастырь становится полем битвы между живыми и проклятыми.'),
(30, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-12 19:00:00', '2020-02-12 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:32:21', '2020-02-11 05:47:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дикий мёд', 'Дикий мёд', 'История страстной любви студентов университета Барыша и Фюсун. Барыш учится на факультете архитектуры в университете. Его хобби - игра на барабанах, от этого и от студенческой жизни он получает огромное удовольствие и наслаждение. Когда парень встречает Фюсун, его душа наполняется чувством, совершенно новым для него, подобного раньше Барыш не испытывал... Он понимает, что в этот раз настоящая любовь вошла в его сердце и в его жизнь. Кто эта девушка? Где она живет? Он должен найти ее, даже не зная имени незнакомки. Барыш ищет и находит, но у Фюсун есть только одно желание - закончить университет с отличием и продолжить обучение в Америки, получив степень магистра. Парень должен как-то добиться ее расположения.', 'История страстной любви студентов университета Барыша и Фюсун. Барыш учится на факультете архитектуры в университете. Его хобби - игра на барабанах, от этого и от студенческой жизни он получает огромное удовольствие и наслаждение. Когда парень встречает Фюсун, его душа наполняется чувством, совершенно новым для него, подобного раньше Барыш не испытывал... Он понимает, что в этот раз настоящая любовь вошла в его сердце и в его жизнь. Кто эта девушка? Где она живет? Он должен найти ее, даже не зная имени незнакомки. Барыш ищет и находит, но у Фюсун есть только одно желание - закончить университет с отличием и продолжить обучение в Америки, получив степень магистра. Парень должен как-то добиться ее расположения.'),
(31, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-13 17:00:00', '2020-02-13 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:47:32', '2020-02-11 06:07:06', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Трудности выживания', 'Трудности выживания', 'Начинающая журналистка Нина в погоне за сенсацией отправляется на необитаемый остров, где, по слухам, живет миллионер-затворник. Баркас со съемочной группой попадает в жуткий шторм, и Нина приходит в сознание уже на пустынном берегу. К счастью, это именно тот остров, который ей нужен, а значит, она оказалась в надежных руках молодого и симпотичного героя своего репортажа. Но только Нина не подозревает, что на самом деле это ее коллега, местный журналист, которому просто нужна была горячая тема, и он ее выдумал. А еще он ничего не смыслит в выживании.', 'Начинающая журналистка Нина в погоне за сенсацией отправляется на необитаемый остров, где, по слухам, живет миллионер-затворник. Баркас со съемочной группой попадает в жуткий шторм, и Нина приходит в сознание уже на пустынном берегу. К счастью, это именно тот остров, который ей нужен, а значит, она оказалась в надежных руках молодого и симпотичного героя своего репортажа. Но только Нина не подозревает, что на самом деле это ее коллега, местный журналист, которому просто нужна была горячая тема, и он ее выдумал. А еще он ничего не смыслит в выживании.'),
(32, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-13 19:00:00', '2020-02-13 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:50:08', '2020-02-11 06:06:51', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Шаг вперед 6: Год танцев', 'Шаг вперед 6: Год танцев', 'Новые движения. Новый этап. Новый баттл. Стань частью танцевальной вселенной, шагни навстречу приключениям месте с главными героями, которые отправляются в Китай. Ведь Пекин – главная столица новых побед. Парни и девушки из разных стран объединятся в одну семью, чтобы завоевать звание лучшего танцора планеты!', 'Новые движения. Новый этап. Новый баттл. Стань частью танцевальной вселенной, шагни навстречу приключениям месте с главными героями, которые отправляются в Китай. Ведь Пекин – главная столица новых побед. Парни и девушки из разных стран объединятся в одну семью, чтобы завоевать звание лучшего танцора планеты!'),
(33, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-14 15:00:00', '2020-02-14 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:51:44', '2020-02-11 06:07:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Малыш на драйве', 'Малыш на драйве', 'Молодой парень по прозвищу Малыш обожает стильную музыку, быструю езду и адреналин в крови. Вся его жизнь — это сплошные погони и перестрелки, ведь он работает водителем, который помогает бандитам скрыться с места преступления. Однажды он по-настоящему влюбляется и решает выйти из игры, но сначала ему предстоит выполнить ещё одно задание, которое вполне может оказаться последним в его жизни.', 'Молодой парень по прозвищу Малыш обожает стильную музыку, быструю езду и адреналин в крови. Вся его жизнь — это сплошные погони и перестрелки, ведь он работает водителем, который помогает бандитам скрыться с места преступления. Однажды он по-настоящему влюбляется и решает выйти из игры, но сначала ему предстоит выполнить ещё одно задание, которое вполне может оказаться последним в его жизни.'),
(34, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-14 17:00:00', '2020-02-14 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2020-02-10 18:53:30', '2020-02-11 06:07:22', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мотылёк', 'Мотылёк', 'Взломщик сейфов по прозвищу Мотылёк получает пожизненный срок и отправляется на каторгу за убийство, которого он не совершал. Когда вокруг враги, а надежда угасает с каждым днём заключения, лишь сила духа может помочь Мотыльку обрести свободу.', 'Взломщик сейфов по прозвищу Мотылёк получает пожизненный срок и отправляется на каторгу за убийство, которого он не совершал. Когда вокруг враги, а надежда угасает с каждым днём заключения, лишь сила духа может помочь Мотыльку обрести свободу.'),
(35, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-14 19:00:00', '2020-02-14 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:55:01', '2020-02-11 06:08:03', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дневник памяти', 'Дневник памяти', 'Это история отношений юноши и девушки из разных социальных слоев, живших в Южной Каролине. Ной и Элли провели вместе незабываемое лето, пока их не разделили вначале родители, а затем Вторая мировая война. После войны все изменилось: Элли обручилась с удачливым бизнесменом, а Ной жил наедине со своими воспоминаниями в старинном доме, который ему удалось отреставрировать. Когда Элли прочла об этом в местной газете, она поняла: ей нужно найти его и решить наконец судьбу их любви...', 'Это история отношений юноши и девушки из разных социальных слоев, живших в Южной Каролине. Ной и Элли провели вместе незабываемое лето, пока их не разделили вначале родители, а затем Вторая мировая война. После войны все изменилось: Элли обручилась с удачливым бизнесменом, а Ной жил наедине со своими воспоминаниями в старинном доме, который ему удалось отреставрировать. Когда Элли прочла об этом в местной газете, она поняла: ей нужно найти его и решить наконец судьбу их любви...'),
(36, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-15 15:00:00', '2020-02-15 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 18:56:50', '2020-02-11 05:54:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Конг: Остров черепа', 'Конг: Остров черепа', 'На неизвестный остров в Тихом океане попадает команда ученых, военных и искателей приключений. Они вторгаются во владения могучего Конга и тем самым развязывают сражение между человеком и природой. Очень скоро исследовательская миссия превращается в игру на выживание, ее участники вынуждены буквально прорубать себе путь к спасению.', 'На неизвестный остров в Тихом океане попадает команда ученых, военных и искателей приключений. Они вторгаются во владения могучего Конга и тем самым развязывают сражение между человеком и природой. Очень скоро исследовательская миссия превращается в игру на выживание, ее участники вынуждены буквально прорубать себе путь к спасению.'),
(37, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-15 17:00:00', '2020-02-15 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2020-02-10 18:59:35', '2020-02-11 05:54:17', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Рэмпейдж', 'Рэмпейдж', 'Приматолог Дэвис Окойи предпочитает держаться подальше от людей и дружит с Джорджем, удивительно умным самцом гориллы, которого он воспитывал с самого рождения. Но вышедший из-под контроля генетический эксперимент превращает послушную обезьяну в яростного монстра. Более того, вскоре обнаруживается, что существуют и другие модифицированные хищники. Пока свежесозданные чудовища превращают в руины Северную Америку, стирая с лица Земли все, что попадается у них на пути, Окойи вместе с опальным генным инженером пытается изобрести антидот, прорываясь по бесконечному полю боя не только, чтобы предотвратить глобальную катастрофу, но и спасти бесстрашное существо, которое когда-то было его другом.', 'Приматолог Дэвис Окойи предпочитает держаться подальше от людей и дружит с Джорджем, удивительно умным самцом гориллы, которого он воспитывал с самого рождения. Но вышедший из-под контроля генетический эксперимент превращает послушную обезьяну в яростного монстра. Более того, вскоре обнаруживается, что существуют и другие модифицированные хищники. Пока свежесозданные чудовища превращают в руины Северную Америку, стирая с лица Земли все, что попадается у них на пути, Окойи вместе с опальным генным инженером пытается изобрести антидот, прорываясь по бесконечному полю боя не только, чтобы предотвратить глобальную катастрофу, но и спасти бесстрашное существо, которое когда-то было его другом.'),
(38, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 15:00:00', '2020-02-16 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2020-02-10 19:01:42', '2020-02-11 05:53:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дом призраков', 'Дом призраков', 'Молодая пара отправляется в путешествие в Таиланд. В сельской местности они обнаруживают кладбище с находящимися на нём «домами призраков», где, по местным верованиями, духи обретают покой. Имевших неосторожность осквернить святыню влюблённых начинает преследовать жестокая сверхъестественная сила. Она погружает героев в пучину леденящего ужаса потустороннего мира, из которого нет выхода.', 'Молодая пара отправляется в путешествие в Таиланд. В сельской местности они обнаруживают кладбище с находящимися на нём «домами призраков», где, по местным верованиями, духи обретают покой. Имевших неосторожность осквернить святыню влюблённых начинает преследовать жестокая сверхъестественная сила. Она погружает героев в пучину леденящего ужаса потустороннего мира, из которого нет выхода.'),
(39, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 17:00:00', '2020-02-16 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:03:53', '2020-02-11 05:52:39', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Почему он?', 'Почему он?', 'Захватывающая комедия о нелегких отношениях между родителями и детьми. В данном случае описано недовольство отца женихом дочери.\n\nСтаршая дочь Неда Флеминга проживает в Стэнфорде. Однажды отец решает навестить ее, но удивляется наличию жениха. Речь идет о молодом миллионере Лэрде Мейхью. Проблемой самоуверенного парня является излишняя эксцентричность, которая не нравится консервативному Неду. Соперничество между мужчинами накаляется после того, как Лэрд решается сделать предложение дочери Флеминга. Смогут ли найти общий язык отец и будущий зять, предстоит еще выяснить.', 'Захватывающая комедия о нелегких отношениях между родителями и детьми. В данном случае описано недовольство отца женихом дочери.\n\nСтаршая дочь Неда Флеминга проживает в Стэнфорде. Однажды отец решает навестить ее, но удивляется наличию жениха. Речь идет о молодом миллионере Лэрде Мейхью. Проблемой самоуверенного парня является излишняя эксцентричность, которая не нравится консервативному Неду. Соперничество между мужчинами накаляется после того, как Лэрд решается сделать предложение дочери Флеминга. Смогут ли найти общий язык отец и будущий зять, предстоит еще выяснить.'),
(40, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 19:00:00', '2020-02-16 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:05:30', '2020-02-11 05:52:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мег: Монстр глубины', 'Мег: Монстр глубины', 'Глубоководный батискаф, осуществляющий наблюдение в рамках международной программы по изучению подводной жизни, был атакован огромным существом, которое все считали давно вымершим. Неисправный аппарат теперь лежит на дне глубочайшей впадины Тихого океана… с оказавшимся в ловушке экипажем. Их время на исходе. Китайский океанограф-новатор, несмотря на протесты его дочери Суинь, зовет спасателя-подводника Джонаса Тейлора, чтобы тот помог спасти команду и океан от невиданной угрозы – доисторической 23-метровой акулы, мегалодона. Никто и подумать не мог, что много лет назад Тейлор уже сталкивался с этим чудовищным созданием.', 'Глубоководный батискаф, осуществляющий наблюдение в рамках международной программы по изучению подводной жизни, был атакован огромным существом, которое все считали давно вымершим. Неисправный аппарат теперь лежит на дне глубочайшей впадины Тихого океана… с оказавшимся в ловушке экипажем. Их время на исходе. Китайский океанограф-новатор, несмотря на протесты его дочери Суинь, зовет спасателя-подводника Джонаса Тейлора, чтобы тот помог спасти команду и океан от невиданной угрозы – доисторической 23-метровой акулы, мегалодона. Никто и подумать не мог, что много лет назад Тейлор уже сталкивался с этим чудовищным созданием.');
