(41, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-18 11:00:00', '2020-02-18 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:07:55', '2020-02-11 05:52:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Эверест', 'Эверест', 'Эверест — великая неприступная гора, покорить вершину которой мечтают многие профессиональные альпинисты. Одна из экспедиций на ее вершину закончилась настоящей трагедией, однако этот факт не останавливает отважных альпинистов. Опытный инструктор Роб Холл, собрав группу из лучших альпинистов, собирается совершить восхождение на самую высокую вершину планеты. Все эти люди полны мужества и отваги и они не остановятся ни перед чем, пока не поднимутся на вершину Эвереста. Но даже если эта гора покорится им, смогут ли они вернуться обратно живыми и невредимыми?', 'Эверест — великая неприступная гора, покорить вершину которой мечтают многие профессиональные альпинисты. Одна из экспедиций на ее вершину закончилась настоящей трагедией, однако этот факт не останавливает отважных альпинистов. Опытный инструктор Роб Холл, собрав группу из лучших альпинистов, собирается совершить восхождение на самую высокую вершину планеты. Все эти люди полны мужества и отваги и они не остановятся ни перед чем, пока не поднимутся на вершину Эвереста. Но даже если эта гора покорится им, смогут ли они вернуться обратно живыми и невредимыми?'),
(42, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-18 15:00:00', '2020-02-18 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:11:52', '2020-02-11 06:05:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Малефисента: Владычица тьмы', 'Малефисента: Владычица тьмы', 'Принцесса Аврора выросла, и теперь принц Филип делает ей предложение. Наивные молодые люди уверены, что их брак сможет объединить два королевства и помирить людей с волшебными существами, но не тут-то было. На совместном ужине с родителями Филипа, королём Джоном и королевой Ингрит, куда была приглашена и крёстная Авроры, происходит ссора, в результате чего король слегает с недомоганием явно магического свойства, а Малифисента вынуждена спасаться бегством.', 'Принцесса Аврора выросла, и теперь принц Филип делает ей предложение. Наивные молодые люди уверены, что их брак сможет объединить два королевства и помирить людей с волшебными существами, но не тут-то было. На совместном ужине с родителями Филипа, королём Джоном и королевой Ингрит, куда была приглашена и крёстная Авроры, происходит ссора, в результате чего король слегает с недомоганием явно магического свойства, а Малифисента вынуждена спасаться бегством.'),
(43, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-18 17:00:00', '2020-02-18 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:14:24', '2020-02-11 06:05:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Терминатор: Тёмные судьбы', 'Терминатор: Тёмные судьбы', 'Мексика. Милая девушка Даниэла Рамос, а для друзей просто Дани, вместе с братом приходит с утра работать на завод, но там выясняется, что их вскоре заменят автоматикой. И это не единственная угроза, которую представляют для девушки машины: тут же на неё нападает присланная из будущего и практически неубиваемая модель терминатора REV-9. Но на защиту Дани встает Грэйс - тоже прибывшая из будущего женщина, модифицировавшая свои боевые характеристики до терминаторского уровня. Вскоре к ним на помощь придёт и Сара Коннор, которая теперь превратилась в настоящую охотницу на роботов-убийц.', 'Мексика. Милая девушка Даниэла Рамос, а для друзей просто Дани, вместе с братом приходит с утра работать на завод, но там выясняется, что их вскоре заменят автоматикой. И это не единственная угроза, которую представляют для девушки машины: тут же на неё нападает присланная из будущего и практически неубиваемая модель терминатора REV-9. Но на защиту Дани встает Грэйс - тоже прибывшая из будущего женщина, модифицировавшая свои боевые характеристики до терминаторского уровня. Вскоре к ним на помощь придёт и Сара Коннор, которая теперь превратилась в настоящую охотницу на роботов-убийц.'),
(44, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-18 19:00:00', '2020-02-18 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:16:41', '2020-02-11 06:05:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Любовь без слов', 'Любовь без слов', 'Богачу Радже на глаза попадается Гаури, деревенская красавица. Воспылав к девушке безумной страстью, он посылает ей предложение выйти замуж, вместе с фотографией Шанкара - своего безропотного слуги. Гаури влюбляется в Шанкара на фотографии. В день свадьбы Гаури узнает в толпе Шанкара, срывает свадебный покров с жениха и ужасается от старого и злобного лица Раджи, покрытого морщинами. Не желая жить со стариком, Гаури вместе с Шанкаром убегают в джунгли. Разгневанный Раджа посылает за беглецами вооруженных людей на вертолетах и джипах…', 'Богачу Радже на глаза попадается Гаури, деревенская красавица. Воспылав к девушке безумной страстью, он посылает ей предложение выйти замуж, вместе с фотографией Шанкара - своего безропотного слуги. Гаури влюбляется в Шанкара на фотографии. В день свадьбы Гаури узнает в толпе Шанкара, срывает свадебный покров с жениха и ужасается от старого и злобного лица Раджи, покрытого морщинами. Не желая жить со стариком, Гаури вместе с Шанкаром убегают в джунгли. Разгневанный Раджа посылает за беглецами вооруженных людей на вертолетах и джипах…'),
(45, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-19 15:00:00', '2020-02-19 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:17:56', '2020-02-11 06:04:58', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Миа и белый лев', 'Миа и белый лев', 'Миа вместе с семьей переезжает в Южную Африку из Лондона, где ее родители покупают ферму по разведению львов. Девочку ничего не радует на новом месте, ей хочется вернуться в Лондон, где остались ее друзья и беззаботная подростковая жизнь. Но внезапно на нее сваливается забота о маленьком белом львенке по имени Чарли, который остался без родителей. И вся ее жизнь круто меняется… Они становятся неразлучны, пока однажды Миа не узнает, что ее другу грозит серьезная опасность. Тогда она решает сбежать и найти для Чарли новый дом, где он будет счастлив и свободен.', 'Миа вместе с семьей переезжает в Южную Африку из Лондона, где ее родители покупают ферму по разведению львов. Девочку ничего не радует на новом месте, ей хочется вернуться в Лондон, где остались ее друзья и беззаботная подростковая жизнь. Но внезапно на нее сваливается забота о маленьком белом львенке по имени Чарли, который остался без родителей. И вся ее жизнь круто меняется… Они становятся неразлучны, пока однажды Миа не узнает, что ее другу грозит серьезная опасность. Тогда она решает сбежать и найти для Чарли новый дом, где он будет счастлив и свободен.'),
(46, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-19 17:00:00', '2020-02-19 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:19:24', '2020-02-11 06:04:45', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Годзилла 2: Король монстров', 'Годзилла 2: Король монстров', 'История рассказывает о героических усилиях криптозоологического агентства «Монарх» по сдерживанию гигантских монстров. В этот раз против могучего Годзиллы выступают Родан и ультимативный кайдзю — трёхголовый монстр Кинг Гидора. Когда эти древние суперхищники, со временем превратившиеся в полузабытые мифы, восстают снова, чтобы сойтись в схватке, человечеству остаётся отойти в сторонку и постараться не погибнуть.', 'История рассказывает о героических усилиях криптозоологического агентства «Монарх» по сдерживанию гигантских монстров. В этот раз против могучего Годзиллы выступают Родан и ультимативный кайдзю — трёхголовый монстр Кинг Гидора. Когда эти древние суперхищники, со временем превратившиеся в полузабытые мифы, восстают снова, чтобы сойтись в схватке, человечеству остаётся отойти в сторонку и постараться не погибнуть.'),
(47, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-19 19:00:00', '2020-02-19 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:21:56', '2020-02-11 06:04:30', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Только ты', 'Только ты', 'Один из главных героев этого фильма – молодой парень по имени Али, который ранее увлекался профессиональным боксом. Но его жизнь пошла колесом и свернула на опасную дорогу преступности, в результате чего, он оказался на скамье подсудимых и загремел в тюрьму... Хазал – молодая, довольно-таки привлекательная девушка, чья жизнь однажды случайно пересеклась с жизнью Али. Как бы это печально не прозвучало, но Хазал была слепа, но даже не смотря на это, Али полюбил её такой, какая она есть. На протяжении долгого времени они жили вместе и были счастливы... Но к несчастью, однажды беда постучалась в их скромный дом. Дело в том, что слепота Хазал начала прогрессировать...', 'Один из главных героев этого фильма – молодой парень по имени Али, который ранее увлекался профессиональным боксом. Но его жизнь пошла колесом и свернула на опасную дорогу преступности, в результате чего, он оказался на скамье подсудимых и загремел в тюрьму... Хазал – молодая, довольно-таки привлекательная девушка, чья жизнь однажды случайно пересеклась с жизнью Али. Как бы это печально не прозвучало, но Хазал была слепа, но даже не смотря на это, Али полюбил её такой, какая она есть. На протяжении долгого времени они жили вместе и были счастливы... Но к несчастью, однажды беда постучалась в их скромный дом. Дело в том, что слепота Хазал начала прогрессировать...'),
(48, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-20 15:00:00', '2020-02-20 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:24:14', '2020-02-11 06:04:15', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, '7 хранителей гробницы', '7 хранителей гробницы', 'Команда археологов отправляется в древние подземелья, чтобы найти потерянного товарища, но находит вместо него колонию разумных пауков-людоедов.', 'Команда археологов отправляется в древние подземелья, чтобы найти потерянного товарища, но находит вместо него колонию разумных пауков-людоедов.'),
(49, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-20 17:00:00', '2020-02-20 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:26:40', '2020-02-11 06:03:59', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Агент Джонни Инглиш 3.0', 'Агент Джонни Инглиш 3.0', 'Когда все агенты секретной службы Её Величества внезапно выходят из строя, в игру вступает запасной вариант. Образец английского стиля и любимец роковых красоток; король безвыходных ситуаций и хранитель аналоговых традиций в цифровом мире, агент Джонни Инглиш – боль и гордость британской разведки. Этому парню есть что взбалтывать, и он взболтает не по-детски.', 'Когда все агенты секретной службы Её Величества внезапно выходят из строя, в игру вступает запасной вариант. Образец английского стиля и любимец роковых красоток; король безвыходных ситуаций и хранитель аналоговых традиций в цифровом мире, агент Джонни Инглиш – боль и гордость британской разведки. Этому парню есть что взбалтывать, и он взболтает не по-детски.'),
(50, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-20 19:00:00', '2020-02-20 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:27:49', '2020-02-11 06:03:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Если я останусь', 'Если я останусь', 'Мия — талантливая девушка, влюбленная в классическую музыку, в свою виолончель и рокера Адама. Но после автокатастрофы Мия оказывается в коме. Пока тело девушки лежит в больнице, ее душа должна решить, хочет ли она жить дальше или же лучше отправиться в мир иной вслед за своими родными.', 'Мия — талантливая девушка, влюбленная в классическую музыку, в свою виолончель и рокера Адама. Но после автокатастрофы Мия оказывается в коме. Пока тело девушки лежит в больнице, ее душа должна решить, хочет ли она жить дальше или же лучше отправиться в мир иной вслед за своими родными.'),
(51, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-21 15:00:00', '2020-02-21 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:29:30', '2020-02-11 06:03:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Гори, гори ясно', 'Гори, гори ясно', 'Семейная пара фермеров Тори и Кайл уже долго и безуспешно пытаются завести ребёнка, когда вдруг из космоса в близлежащий лес падает капсула с младенцем. Пара усыновляет малыша и растит его как своего собственного сына. Брэндон растёт послушным, хорошо учится в школе и никогда не болеет. Но по достижении 12 лет характер мальчика резко меняется - он начинает дерзить родителям, и в нём просыпаются незнакомые доселе желания и способности.', 'Семейная пара фермеров Тори и Кайл уже долго и безуспешно пытаются завести ребёнка, когда вдруг из космоса в близлежащий лес падает капсула с младенцем. Пара усыновляет малыша и растит его как своего собственного сына. Брэндон растёт послушным, хорошо учится в школе и никогда не болеет. Но по достижении 12 лет характер мальчика резко меняется - он начинает дерзить родителям, и в нём просыпаются незнакомые доселе желания и способности.'),
(52, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-21 17:00:00', '2020-02-21 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:31:00', '2020-02-11 06:03:12', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Любовь в городе ангелов', 'Любовь в городе ангелов', 'В Лос Анджелесе, в самом романтичном городе в мире, встретились два самых неромантичных человека - она на первом свидании выбросила его букет в помойку, а он поил ее самым невкусным кофе в городе. Она пришла на второе свидание в одном нижнем белье, а он обманул ее, так и не решившись безрассудно своровать для нее платье в магазине. И тем не менее, это были самые красивые несколько дней в жизни каждого из них. Будет ли у этих отношений продолжение, ведь он даже имени ее не знает? В этом городе, на песочном берегу, конечно, возможно все. Океан нашепчет им мелодию любви и где, как не в Городе Ангелов поверить в настоящую любовь. Пусть даже и на несколько дней.', 'В Лос Анджелесе, в самом романтичном городе в мире, встретились два самых неромантичных человека - она на первом свидании выбросила его букет в помойку, а он поил ее самым невкусным кофе в городе. Она пришла на второе свидание в одном нижнем белье, а он обманул ее, так и не решившись безрассудно своровать для нее платье в магазине. И тем не менее, это были самые красивые несколько дней в жизни каждого из них. Будет ли у этих отношений продолжение, ведь он даже имени ее не знает? В этом городе, на песочном берегу, конечно, возможно все. Океан нашепчет им мелодию любви и где, как не в Городе Ангелов поверить в настоящую любовь. Пусть даже и на несколько дней.'),
(53, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-21 19:00:00', '2020-02-21 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:32:33', '2020-02-11 06:02:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Аватар', 'Аватар', 'Джейк Салли - бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.', 'Джейк Салли - бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.'),
(54, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 13:00:00', '2020-02-22 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:46:22', '2020-02-21 22:53:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Храброе сердце', 'Batyr ýürek', 'Filmdäki hereketler 1280-nji ýylda Şotlandiýada bolup geçýär. Ol patyşa Edward Uzynaýak döwründe ömrüni iňlislere garşy söweş alyp barmaga bagş eden milli gahryman Wilýam Uolles barada gürrüň berýär. Kakasy iňlisleriň elinden ir öldürilendigi üçin, Wilýam daýysynyň ýanynda ýaşap, gowy bilim alýar. Watanyna bolsa maşgala gurmagyň we asuda durmuşda ýaşamagyň arzuwyndaky adam bolup dolanýar. Emma hemme zat başgaça bolýar. Gelni iňlisler tarapyndan öldürilýär, Wilýam bolsa azatlyk ugrundaky haçly urşuny başlaýar. ', 'Действие фильма начинается в 1280 году в Шотландии. Это история легендарного национального героя Уильяма Уоллеса, посвятившего себя борьбе с англичанами при короле Эдварде Длинноногом. Он рано лишился отца, погибшего от рук англичан, и его забрал к себе дядя Оргайл, который дал ему хорошее образование в Европе. На родину Уильям возвращается уже взрослым человеком, мечтающим завести семью и жить мирной жизнью. Но судьба распорядилась иначе. Его невесту убили англичане, и он начал свой крестовый поход за свободу.'),
(55, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 15:00:00', '2020-02-22 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:48:32', '2020-02-21 22:52:31', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Рэмбо IV', ' Rembo IV', 'Wýetnamly weteran Jon Rembo Bankgogyň eteklerinde ýeke durmuş alyp barýar. Uruşdan we gandoküşlikden ýadap, ol derýanyň boýuna göçýär we köne gaýyklary, gämileri bejermek bilen meşgullanýar. Ýöne durmuş ony ýene-de eline ýarag almaga mejbur edýär. Rembo bäş adamdan ybarat topar düzüp, birman garakçylary tarapyndan basyp alynan taý obalarynyň we amerikan dindarlarynyň goragyna çykýar. ', 'Вьетнамский ветеран Джон Рэмбо ведет уединенный образ жизни на окраине Бангкока. Уставший от борьбы и кровопролития, скрываясь от проблем, он селится в небольшом доме у реки и проводит дни, ремонтируя старые лодки и катера. Однако судьба вновь заставляет его взяться за оружие. Собрав отряд из пяти наемников, Рэмбо встает на защиту жителей тайской деревни и американских миссионеров, которых захватили в заложники бирманские боевики.'),
(56, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 17:00:00', '2020-02-22 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:50:35', '2020-02-21 22:55:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Отмщение', 'Ar alyş', 'Jenaýatkär rugsat döwründe türmeden gaçýar we ony ganhor eden adamlardan ar almaga başlaýar. ', 'Преступнику дают в тюрьме отгул, во время которого он сбегает из-под наблюдения и начинает мстить людям, которые сделали его хладнокровным убийцей.'),
(57, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 19:00:00', '2020-02-22 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 19:52:27', '2020-02-21 22:57:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Голубая бездна', 'Mawy uçurym', 'Iki dost – Enso Molinari we Žak Maýýol grek adalarynyň birinde bile ösýärler. Ýyllar geçýär. Oglanlar ulaldylar we ençeme ýyldan soň ýene-de duşuşýarlar. Ikisi hem suwuň düýbüne çümüji. Çaga ýaryşlary indi dünýäniň çempiony adyna eýe bolmak ugrundaky söweşe öwrülýär. Emma her bir rekord ýeňip geçilip bilner... ', 'Два друга — Энцо Молинари и Жак Майоль — вместе росли на одном из греческих островов. Проходят годы, мальчики уже выросли и снова встречаются после нескольких лет разлуки. Оба стали ныряльщиками на глубину без воздуха, и детские соревнования переросли в напряженную борьбу за титул чемпиона мира. Но каждый рекорд может быть побит...'),
(58, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-06 15:00:00', '2020-02-06 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 20:03:42', '2020-02-11 05:42:24', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Вирус', 'Вирус', 'Сёстры Эмма и Стейси с отцом недавно переехали в новый город, и девушки теперь ходят в новую школу. По радио и телевидению всё время твердят про какой-то китайский вирус, у родителей, вроде бы, не ладятся отношения (мама застряла в другом городе и не возвращается), подруга Эммы серьёзно заболела, а сестёр больше волнуют интересные парни в новой школе. Когда отец уезжает встречать маму из аэропорта, в городе объявляют комендантский час, но это не останавливает девушек от посещения вечеринки.', 'Сёстры Эмма и Стейси с отцом недавно переехали в новый город, и девушки теперь ходят в новую школу. По радио и телевидению всё время твердят про какой-то китайский вирус, у родителей, вроде бы, не ладятся отношения (мама застряла в другом городе и не возвращается), подруга Эммы серьёзно заболела, а сестёр больше волнуют интересные парни в новой школе. Когда отец уезжает встречать маму из аэропорта, в городе объявляют комендантский час, но это не останавливает девушек от посещения вечеринки.'),
(59, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 15:00:00', '2020-02-23 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 20:05:37', '2020-02-24 18:58:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Король', 'Patyşa', 'Angliýa, XV asyryň başy, Ýüzýyllyk urşyň tutaşan wagty. Şazada Hel Uelskiý dosty Falstaf bilen ahlaksyz durmuş alyp barýar, tagt ymtylmak barada bolsa pikirem etmeýär. Emma kakasy Genrih IV ýarawsyzlyk sebäpli, jigisi bolsa söweşde  aradan çykandan soň Hel täji kabul etmeli bolýar. Genrih V bolmak bilen, ýaş hökümdar dildüwşiklerden, gozgalaňlardan ussat baş alyp çykýar. Şeýle hem fransuz monarhlar oňa ýeterlik sylag görkezmeýär diýen netijä gelýär.  \n\n', 'Англия, начало XV века, разгар Столетней войны. Принц Уэльский Хел ведёт распутный образ жизни со своим приятелем Фальстафом и не помышляет о притязаниях на трон. Но когда от болезни умирает его отец, король Генрих IV, а младший брат погибает на поле боя, Хелу приходится принять корону. Став Генрихом V, молодой правитель ловко разбирается с заговорами и восстаниями, а также решает, что французские монархи не проявляют к нему должного уважения.'),
(60, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 17:00:00', '2020-02-23 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 20:52:54', '2020-02-24 18:59:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Гори, гори ясно', 'Ýan, ýan aýdyň', 'Fermerleriň maşgalasy Tori we Kaýl uzyn ýyllardyr çaganyň arzuwynda. Günleriň birinde ýakyndaky tokaýa kosmosdan çagaly kapsula gaçýar. Çagany olar ýanyna alyp, öz perzendi ýaly seredýärler. Brendon akylly oglan bolup ýetişýär, gowy okaýar we hiç syrkawlamaýar. Emma 12 ýaşy dolanda onuň häsiýeti birden üýtgeýär – ene-atasy bilen gödek gürleşýär, üýtgeşik islegler we ukyplar ýüze çykýar. ', 'Семейная пара фермеров Тори и Кайл уже долго и безуспешно пытаются завести ребёнка, когда вдруг из космоса в близлежащий лес падает капсула с младенцем. Пара усыновляет малыша и растит его как своего собственного сына. Брэндон растёт послушным, хорошо учится в школе и никогда не болеет. Но по достижении 12 лет характер мальчика резко меняется - он начинает дерзить родителям, и в нём просыпаются незнакомые доселе желания и способности.'),
(61, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 19:00:00', '2020-02-23 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 20:54:16', '2020-02-24 19:00:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дневник памяти', 'Ýat gündeligi', 'Bu dürli sosial gatlakdan bolan Günorta Karolinaly oglan bilen gyzyň gatnaşygynyň taryhy. Noý we Elli bütin tomus bile bolýar, tä ene-atalary, soňra bolsa Ikinji jahan urşy aýyrýança. Uruşdan soň hemme zat üýtgeýär: Elli baý telekeçi bilen durmuş gurýar, Noý bolsa öz ýatlamalary bilen gadymy öýde ýaşaýar. Elli muny ýerli gazetden öwreneninde – Noýy tapyp söýgüsiniň ykbalyny çözmeli diýen netijä gelýär.        ', 'Это история отношений юноши и девушки из разных социальных слоев, живших в Южной Каролине. Ной и Элли провели вместе незабываемое лето, пока их не разделили вначале родители, а затем Вторая мировая война. После войны все изменилось: Элли обручилась с удачливым бизнесменом, а Ной жил наедине со своими воспоминаниями в старинном доме, который ему удалось отреставрировать. Когда Элли прочла об этом в местной газете, она поняла: ей нужно найти его и решить наконец судьбу их любви...'),
(62, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-27 15:00:00', '2020-02-27 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 20:59:39', '2020-02-24 19:05:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Годзилла 2: Король монстров', 'Godzilla2: Monstrlaryň şasy', 'Film «Monarh» kriptozoologik agentiliginiň äpet monstrlary saklamak boýunça gahrymançylykly hereketleri barada. Bu gezek güýçli Godzilla garşy Rodan we üçkelleli monstr King Gidora çykyş edýär. Gadymy, wagtyň geçmegi bilen rowaýata öwrülen superýyrtyjylar täzeden aýaga galanda, adamzat diri galmak üçin çetde galmaly bolýar. ', 'История рассказывает о героических усилиях криптозоологического агентства «Монарх» по сдерживанию гигантских монстров. В этот раз против могучего Годзиллы выступают Родан и ультимативный кайдзю — трёхголовый монстр Кинг Гидора. Когда эти древние суперхищники, со временем превратившиеся в полузабытые мифы, восстают снова, чтобы сойтись в схватке, человечеству остаётся отойти в сторонку и постараться не погибнуть.'),
(63, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-25 15:00:00', '2020-02-25 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:02:42', '2020-02-24 19:01:26', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Форсаж 9', 'Forsaž 9', 'Dominik ogluny kiberterrorist gyz Saýferiň elinden halas etmek üçin ýakynlarynyň garşysyna gitmeli bolýar. Saýfer Dominige uzak wagtlap diýenini etdirýär, batyr sürüji bolsa akylly gyzdan has ökde çykmagy başarýar. Emma Saýfer gaçýar. Wagtyň geçmegi bilen Toretto oglunyň talaňçysyna ýene-de duşýar. Bu bolsa birnäçe netijelere getirýär. Filmiň gahrymany hanym Şou – Dekard we Oueniň ejesi bilen hem gabatlaşýar. Duýdansyz duşuşyklar we wakalar meşhur sürüjileri rehimsiz duşmana garşy ýene-de birleşdirýär. Hyjuwly oglanlar we owadan gyzlar ýol foražyna taýýarlykly rola geçýär. Bu gezek olara nähili öwrümler garaşýar?', 'Совсем недавно Доминику пришлось пойти против любимых и родных, чтобы спасти своего сына из рук кибертеррористки Сайфер. Обворожительная блондинка долгое время могла "управлять" Домиником, однако отважный гонщик сумел перехитрить и одолеть злобную интеллектуалку. Вот только Сайфер сумела скрыться. Спустя некоторое время Торетто вновь встречает бывшую похитительницу своего сына, что влечёт за собой множество последствий. Также герою фильма приходится снова встретиться с миссис Шоу — матерью Декарда и Оуэна. Невероятные встречи и неожиданные события приводят к тому, что легендарным гонщикам внеочередной раз приходится объединить усилия и дать отпор беспощадному врагу. Импульсивные мужчины и обворожительные красотки вновь садятся за руль скоростных автомобилей, готовясь исполнять дорожный форсаж. Какие повороты ждут их впереди на этот раз?'),
(64, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-25 19:00:00', '2020-02-25 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:05:21', '2020-02-25 17:07:24', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 2, 'Виртуальная любовь', 'Hyýaly söýgi', 'Ulumsy gyz oňa çyndan aşyk, göreninde sözsiz galýan işdesine ýüz bermeýär. Gyzyň söýgüsini uly ýaşly ýolbaşçysy hem gazanjak bolýar, emma gahrymanyň at-abraýy muňa ýol bermeýär. Hakykatdan daşlaşyp, ol internetde aşyk bolýar. Hyýaly durmuşda hemme zat mümkin, Internet çäkleri aýyrýar...ýöne näme üçin gizlin adam ýüzüni görkezenok? Bu üçburçlygy nädip çözmeli we hyýaly duýgylary hakykata nähili getirmeli? ', 'Высокомерная красавица не замечает своего неуклюжего коллегу, который сгорает от чувств и теряет дар речи каждый раз, видя ее... Также симпатии героини добивается взрослый респектабельный мужчина, но профессиональная репутация и достоинство героини не позволяют ей принять ухаживания шефа. Убегая от реальности, она влюбляется в Интернете. В виртуальной реальности, возможно, все, Интернет стирает границы… но почему же ее таинственный избранник намеренно не показывает свое лицо? Как разгадать этот любовный треугольник и перенести виртуальные чувства в реальность?'),
(65, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-26 15:00:00', '2020-02-26 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:06:45', '2020-02-24 19:02:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Зелёный Шершень', 'Ýaşyl eşegary', 'Mediamagnatyň ogly durmuşyny serhoşlykda geçirýär. Emma kakasy duýdansyz aradan çykandan soň, ol maksatsyz ýaşaýanlygyna göz ýetirýär we muny düzeldýär. Kömekçisi bilen bilelikde jenaýatçylyga garşy göreşýän gahrymana öwrülýär. ', 'Сын медиамагната прожигает жизнь в вечных пьянках и бесчисленных случайных связях. Но после неожиданной смерти отца он наконец осознает бесцельность своего существования и решает это изменить. Вместе с верным помощником они становятся супергероями, которые борются с преступностью ее же методами, совершенно не считаясь с законом.'),
(66, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-26 17:00:00', '2020-02-26 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:08:12', '2020-02-24 19:03:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Каратэ-пацан', 'Karate-oglan', '12-ýaşly Dre Parker ejesi bilen Detroýtden nätanyş Pekine göçýär. Dili we ýerli däpleri hem bilmeýän Dre, Meý In atly hytaýly gyza duşýar. Emma dostlugy oňlamaýan kakasyndan başga olara bozgaklar topary päsgel berýär. Onuň başynda bolsa kung-fu sungatyny bilýän Çen dur. Ýeňmegiň ýeketäk usuly – ýakyndaky söweş sungaty boýunças ýaryşda  duşuşmak. Oglanjyga söweş sungaty boýunça ussat Han kömek edýär. ', 'Двенадцатилетний Дре Паркер вместе с матерью-одиночкой переезжает из Детройта в незнакомый Пекин, не зная языка и местных традиций. Здесь он встречает китайскую девочку Мей Ин. Однако кроме её отца, не одобряющего их дружбу из-за культурных предрассудков, на его пути встаёт банда хулиганов во главе с Ченом, владеющим искусством кунг-фу. Единственный способ победить его — встретиться с врагом на близящемся грандиозном турнире боевых искусств. В этом мальчику решает помочь знаток боевых искусств мистер Хан.'),
(68, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-26 19:00:00', '2020-02-26 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:12:57', '2020-02-25 17:07:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 2, 'Настоящий герой', 'Hakyky gahryman', 'Nobatdaky reportaž düşürilýän wagty ААС kanalyň jenaýatçylyk täzelikleri bölüminiň başlygy Bala Golwind nätanyş adamy halas edýär. Ol garakçylaryň toparbaşysy mafioziniň oglyny urýar. Indi olar Balany öldürmekçi bolýar. Bala bolsa halas bolmak üçin Hindistanyň çetine – Kulu Manali diýen ýere syýahatçylyk barada film düşürmäge gidýär. Bu ýerde ol Waýşali atly gyza- ýerli aşramyň gullukçysyna – duşýar we aşyk bolýar. Balu aşramyň ýolbaşçysyny Waýşalini  aýal edip almaga razy edýär. Heýderabada toý etmek üçin gaýdyp gelýärka bolsa Waýşali alyp gaçylýar...', 'Во время съемки очередного репортажа, молодой руководитель отдела криминальных новостей канала ААС Бала Говинд спасает незнакомца. При этом он избивает главаря банды - сына главы мафиозного клана. Клан решает убить Бала. Чтобы спастись от преследователей Бала отправляется в отдаленный уголок Индии - Кулу Манали для съемки сюжета о путешествиях. Здесь он встречает девушку Вайшали - послушницу в местном ашраме и без памяти влюбляется в нее, вызывая у нее ответные чувства. Балу уговаривает главу ашрама отдать Вайшали ему в жены. Во время, когда Бала возвращается в Хидерабад чтобы жениться на Вайшали, ее похищают...'),
(69, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-27 17:00:00', '2020-02-27 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:14:54', '2020-02-24 19:05:55', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Джон Уик', 'Jon Uik', 'Jon Uik, göräýmäge, parahat durşmuşda ýaşaýan adaty amerikan. Emma onuň ussat hakyna tutma ganhordygyny hemme bilenok. Garakçylar toparbaşysynyň ogly dostlary bilen 1969-njy ýylyň Mustangyny ogurlandan, şeýle hem merhum aýalynyň sowgady söýgüli iti Deýzini öldürenden soň Jon öňki kärine dolanmaly bolýar. Ol indi ýoluny geçenleri awlamaga başlaýar. Aryny almak üçin hemme zada taýýar.', 'Джон Уик - на первый взгляд, самый обычный среднестатистический американец, который ведет спокойную мирную жизнь. Однако мало кто знает, что он был наёмным убийцей, причём одним из лучших профессионалов в своём деле. После того как сынок главы бандитской группы со своими приятелями угоняет его любимый «Мустанг» 1969 года выпуска, при этом убив его собаку Дейзи, которая была подарком недавно почившей супруги, Джон вынужден вернуться к своему прошлому. Теперь Уик начинает охоту за теми, кто имел неосторожность перейти ему дорогу, и он готов на всё, чтобы отомстить.'),
(70, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-27 19:00:00', '2020-02-27 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:16:24', '2020-02-24 19:07:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Аватар', 'Awatar', 'Maýyp Jeýk Salli – öň pyýada deňiz esgeri bolan. Näsag bedenine garamazdan, ol ýüreginde entegem esger. Jeýka Pandora planetasynyň ýaşaýjylarynyň bazasyna syýahat etmek ýumuşy berilýär. Planetada Ýeri energiýa krizisinden çykarjak seýrek mineral gazyp alynýar.  ', 'Джейк Салли - бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.'),
(71, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-28 15:00:00', '2020-02-28 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:18:13', '2020-02-24 19:06:34', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Капитан Марвел', 'Kapitan Marwel', 'Başga planetadan gelenler bilen çaknyşykdan soň , harby-deňiz güýçleriniň uçarmany Kerol Denwers adatdan daşary güýje eýe bolýar. Ol güýçli duşmana garşy durmak üçin, täze ukyplaryndan baş alyp çykmaly bolýar.', 'После столкновения с враждующими инопланетными расами, пилот военно-воздушных сил Кэрол Дэнверс обретает суперсилу и становится неуязвимой. Героине предстоит совладать со своими новыми способностями, чтобы противостоять могущественному врагу.'),
(72, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-28 17:00:00', '2020-02-28 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:19:39', '2020-02-24 19:07:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Малефисента: Владычица тьмы', 'Malefisenta: Tümligiň eýesi', 'Ýetişen şa gyzy Awrora, şazada Filip söz aýdýar. Ýaşlar nikanyň iki patyşalygy birleşdirip, adamlary ýaraşdyrjagyna ynanýar. Emma bu başa barmaýar. Filipiň ene-atasy patyşa Jon we aýaly Ingrit bilen bilelikdäki naharda dawa bolýar. Agşamlyk nahara Awroranyň krestnisasy hem çagyrylýar. Netijede, patyşa jadyly häsiýetli kesele uçraýar, Malifisenta bolsa gaçmaly bolýar. ', 'Принцесса Аврора выросла, и теперь принц Филип делает ей предложение. Наивные молодые люди уверены, что их брак сможет объединить два королевства и помирить людей с волшебными существами, но не тут-то было. На совместном ужине с родителями Филипа, королём Джоном и королевой Ингрит, куда была приглашена и крёстная Авроры, происходит ссора, в результате чего король слегает с недомоганием явно магического свойства, а Малифисента вынуждена спасаться бегством.'),
(73, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-28 19:00:00', '2020-02-28 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:21:11', '2020-03-05 20:35:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Терминатор: Тёмные судьбы', 'Terminator: Garaňky ykballar', 'Meksika. Eýjejik Daniela Ramos, dostlary üçin bolsa Dani, irden dogany bilen zawoda işlemäge gidýär. Ýöne olaryň awtomatika bilen çalşyljakdygy belli bolýar. Bu maşynlaryň döredýän ýeketak howpy däl: gyza geljekden göýberilen,  terminatoryň öldürilmeýän REV-9 modeli hüjüm edýär. Danini Greýs goraýar. Ol hem geljekden gelen, öz söweş ukyplaryny terminatorlyk derejesine çenli ösdüren aýal. Soňra olara ganhor robotlaryň awçysy Sara Konnor hem goşulýar.  \n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Тим Миллер\n\n***Длительность:***   128 мин.', 'Мексика. Милая девушка Даниэла Рамос, а для друзей просто Дани, вместе с братом приходит с утра работать на завод, но там выясняется, что их вскоре заменят автоматикой. И это не единственная угроза, которую представляют для девушки машины: тут же на неё нападает присланная из будущего и практически неубиваемая модель терминатора REV-9. Но на защиту Дани встает Грэйс - тоже прибывшая из будущего женщина, модифицировавшая свои боевые характеристики до терминаторского уровня. Вскоре к ним на помощь придёт и Сара Коннор, которая теперь превратилась в настоящую охотницу на роботов-убийц.\n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Тим Миллер\n\n***Длительность:***   128 мин.'),
(74, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 17:00:00', '2020-02-29 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:24:55', '2020-02-24 19:09:12', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мой домашний динозавр', 'Öýdeçi dinozawrym', 'Bir dumanly säher şotland derýasynyň kenarynda oglanjyk uly ýumurtga tapýar. Ýumurtga ýarylandan soň içinden aždarha meňzeş täsin jandar çykýar. Gadymy rowaýatlaryň gahrymany çalt ösüp başlaýar, onuň bilen bile işdäsem artýar. Jandaryň häsiýeti bolsa kiçijik syryň şeýle bolup galjakdygyna şübhe döredýär. Oglanjyk jandary hüjünmlerden goramaga çalyşýar. Emma adamlaryň gözünden nädip gizlemeli?', 'Туманным утром на берегу шотландского озера обычный мальчишка находит загадочное крупное яйцо. Когда же яйцо раскрывается, на свет появляется мифическое существо, напоминающее дракона. Герой древнейших легенд начинает быстро расти, и его аппетит вместе с ним. А задорный характер существа оставляет все меньше шансов на то, что «маленькая» тайна так и останется таковой. Мальчик старается защитить своего подопечного от тех, кому он предоставляется угрозой. Но как укрыть его от людских глаз?'),
(75, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 19:00:00', '2020-02-29 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:27:42', '2020-02-24 19:09:46', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Папа', 'Kaka', 'Abram Şwarsyň bar zady ukyply ogly. Perzendi konserwatoriýanyň iň ökde talyby bolanda, ol üstünligini paýlaşmak üçin Moskwa gidýär. Emma ogul kakasyndan utanýar. ', 'Все, чем живет Абрам Шварц – его талантливый сын. И когда он становится лучшим учеником Консерватории, отец едет в Москву посмотреть на своего мальчика в минуты его славы. Но сын стыдится его.'),
(76, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 11:00:00', '2020-03-01 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:29:45', '2020-02-24 19:14:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Эверест', 'Ewerest', 'Ewerest – professional alpinistleriň basyp almak isleýän beýik dagy. Hatda ýokarky nokadyna goýberilen ekspedisiýalaryň biri pajygaly gutardy. Ýöne bu mert alpinistleri saklanok. Ussat tälimçi Rob Holl, planetanyň iň beýik nokadyna galmak üçin ökde alpinistlerden topar toplaýar. Olaryň ählisi edermenlikden doly, Ewerestiň ýokarysyna ýetmekden bolsa hiç zat saklamaz. Emma dagy boýun egdirseler-de, yzyna sag aman gelip bilermi?', 'Эверест — великая неприступная гора, покорить вершину которой мечтают многие профессиональные альпинисты. Одна из экспедиций на ее вершину закончилась настоящей трагедией, однако этот факт не останавливает отважных альпинистов. Опытный инструктор Роб Холл, собрав группу из лучших альпинистов, собирается совершить восхождение на самую высокую вершину планеты. Все эти люди полны мужества и отваги и они не остановятся ни перед чем, пока не поднимутся на вершину Эвереста. Но даже если эта гора покорится им, смогут ли они вернуться обратно живыми и невредимыми?'),
(77, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 15:00:00', '2020-03-01 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:31:37', '2020-02-24 19:16:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Из тьмы', 'Tümlügiň içinden', 'Maşgala tokaýyň etegindäki öýe göçýär. Gorkunç rowaýatlardan doly jeňňeliň  ilkidurmuş jandarlary ene-atadan perzendini aljak bolýar. \n\n', 'Семейная пара переезжает в новый дом на краю леса, окутанного жуткими легендами. Его первобытные существа пытаются забрать у родителей младенца.'),
(78, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 17:00:00', '2020-03-01 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:33:20', '2020-02-24 19:21:13', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 1, 11, 3, 'Ибица', 'Ibisa', 'Harper Barselona iş saparyna gidýär. Ýanynda joralary Lea we Nikki hem bar. Diýmek, arkaýin işlemek asla başartmaz. ', 'Харпер отправляется в рабочую командировку в Барселону. Но вместе с ней - её лучшие подруги Леа и Никки, так что спокойно поработать точно не получится.'),
(79, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 19:00:00', '2020-03-01 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:35:36', '2020-02-24 19:18:17', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 1, 11, 3, 'Жара', 'Gyzgyn', 'Moskwa, 2016-njy ýylyň tomusynyň gyzgyn güni. Dört sany mekdep dostlar -  gullukdan gelen Alekseý, Londonda okan gurply maşgalanyň ogly Kostýa, ýaş aktýor Artur we reper Timati uzak wagtdan soň duşuşýar. Şu günden soň durmuşlarynyň düýbünden üýtgejeginden entek habarlary ýok. Birnäçe wakalar bolup geçýär: biri söýgüsine duşýar, beýlekisi kärini tapýar, üçünjisi bolsa wajyp soraglara jogap tapýar...', 'Москва, жаркий день лета 2006. Четверо школьных друзей – Алексей, вернувшийся из армии, Костя – сын богатых родителей, отучившийся в Лондоне, Артур – начинающий амбициозный актер и рэпер Тимати – встречаются после долгой разлуки. Они еще не подозревают о том, что эта встреча круто изменит жизнь каждого из них… В круговороте столичной жизни сплетаются десятки сюжетов и человеческих судеб: один из приятелей находит свою любовь, другой обретает себя в профессии, третий получает ответы на давно мучившие его вопросы…');
