(80, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-01 17:00:00', '2020-02-01 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:48:18', '2020-02-11 05:46:58', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 1, 'Аватар', 'Аватар', 'Джейк Салли - бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.', 'Джейк Салли - бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.'),
(81, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-01 19:00:00', '2020-02-01 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 21:50:07', '2020-02-11 05:46:30', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Чёрная Пантера', 'Чёрная Пантера', 'С первого взгляда можно решить, что Ваканда - обычная территория дикой Африки, но это не так. Здесь, в недрах пустынных земель, скрываются залежи уникального металла, способного поглощать вибрацию. Многие пытались добраться до него, разоряя всё на своём пути и принося смерть аборигенам, но каждый раз таинственный дух саванны - Чёрная Пантера - вставал на защиту угнетённых. Спустя много лет беда снова приходит в Ваканду, и в этот раз враг заручился поддержкой современных технологий. Когда шансов почти не остаётся, Т\'Чалла, молодой принц Ваканды, узнаёт, что именно ему предстоит возродить легенду и продолжить вечную борьбу, надев маску Чёрной Пантеры.', 'С первого взгляда можно решить, что Ваканда - обычная территория дикой Африки, но это не так. Здесь, в недрах пустынных земель, скрываются залежи уникального металла, способного поглощать вибрацию. Многие пытались добраться до него, разоряя всё на своём пути и принося смерть аборигенам, но каждый раз таинственный дух саванны - Чёрная Пантера - вставал на защиту угнетённых. Спустя много лет беда снова приходит в Ваканду, и в этот раз враг заручился поддержкой современных технологий. Когда шансов почти не остаётся, Т\'Чалла, молодой принц Ваканды, узнаёт, что именно ему предстоит возродить легенду и продолжить вечную борьбу, надев маску Чёрной Пантеры.'),
(82, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-02 15:00:00', '2020-02-02 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-10 22:18:52', '2020-02-10 22:21:23', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Человек-паук: Возвращение домой', 'Человек-паук: Возвращение домой', 'После исторической встречи с командой Мстителей Питер Паркер возвращается домой, стараясь зажить обычной жизнью под опекой своей тёти Мэй. Но теперь за Питером приглядывает ещё кое-что… Тони Старк видел Человека-Паука в деле и должен стать его наставником. Когда новый злодей Стервятник угрожает уничтожить всё, что дорого Питеру, приходит время доказать всем, что такое настоящий супергерой.', 'После исторической встречи с командой Мстителей Питер Паркер возвращается домой, стараясь зажить обычной жизнью под опекой своей тёти Мэй. Но теперь за Питером приглядывает ещё кое-что… Тони Старк видел Человека-Паука в деле и должен стать его наставником. Когда новый злодей Стервятник угрожает уничтожить всё, что дорого Питеру, приходит время доказать всем, что такое настоящий супергерой.\n\n\n'),
(83, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-08 17:00:00', '2020-02-08 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 14:44:27', '2020-02-11 14:45:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 1, 'Алита: Боевой ангел', 'Алита: Боевой ангел', 'Действие фильма происходит через 300 лет после Великой войны в XXVI веке. Доктор Идо находит останки женщины-киборга. После починки киборг ничего не помнит, но обнаруживает, что в состоянии пользоваться боевыми приемами киборгов. Начинаются поиски утерянных воспоминаний.', 'Действие фильма происходит через 300 лет после Великой войны в XXVI веке. Доктор Идо находит останки женщины-киборга. После починки киборг ничего не помнит, но обнаруживает, что в состоянии пользоваться боевыми приемами киборгов. Начинаются поиски утерянных воспоминаний.'),
(84, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-08 19:00:00', '2020-02-08 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 14:46:38', '2020-02-11 14:47:23', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 1, 'Аквамен', 'Аквамен', 'Действие фильма разворачивается в необъятном и захватывающем подводном мире семи морей, а сюжет знакомит зрителей с историей происхождения получеловека-полуатланта Артура Карри и ключевыми событиями его жизни – теми, что заставят его не только столкнуться с самим собой, но и выяснить, достоин ли он быть тем, кем ему суждено… царем!', 'Действие фильма разворачивается в необъятном и захватывающем подводном мире семи морей, а сюжет знакомит зрителей с историей происхождения получеловека-полуатланта Артура Карри и ключевыми событиями его жизни – теми, что заставят его не только столкнуться с самим собой, но и выяснить, достоин ли он быть тем, кем ему суждено… царем!'),
(85, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-09 19:00:00', '2020-02-09 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 14:50:59', '2020-02-11 15:56:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 1, 'Форсаж: Хоббс и Шоу', 'Форсаж: Хоббс и Шоу', 'Люк Хоббс – американский элитный спецагент, он любит удобную спортивную одежду, большие пикапы и здоровое питание. Декард Шоу – британский пижон, бывший сотрудник разведки, предпочитает дорогие костюмы, спортивные авто и пабы. Эти двое терпеть друг друга не могут. Но если кто-то угрожает их семьям, они готовы пойти на всё. Даже на работу в команде.', 'Люк Хоббс – американский элитный спецагент, он любит удобную спортивную одежду, большие пикапы и здоровое питание. Декард Шоу – британский пижон, бывший сотрудник разведки, предпочитает дорогие костюмы, спортивные авто и пабы. Эти двое терпеть друг друга не могут. Но если кто-то угрожает их семьям, они готовы пойти на всё. Даже на работу в команде.'),
(86, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-15 17:00:00', '2020-02-15 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 14:53:35', '2020-02-11 21:20:55', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Терминатор: Тёмные судьбы', 'Терминатор: Тёмные судьбы', 'Мексика. Милая девушка Даниэла Рамос, а для друзей просто Дани, вместе с братом приходит с утра работать на завод, но там выясняется, что их вскоре заменят автоматикой. И это не единственная угроза, которую представляют для девушки машины: тут же на неё нападает присланная из будущего и практически неубиваемая модель терминатора REV-9. Но на защиту Дани встает Грэйс - тоже прибывшая из будущего женщина, модифицировавшая свои боевые характеристики до терминаторского уровня. Вскоре к ним на помощь придёт и Сара Коннор, которая теперь превратилась в настоящую охотницу на роботов-убийц.', 'Мексика. Милая девушка Даниэла Рамос, а для друзей просто Дани, вместе с братом приходит с утра работать на завод, но там выясняется, что их вскоре заменят автоматикой. И это не единственная угроза, которую представляют для девушки машины: тут же на неё нападает присланная из будущего и практически неубиваемая модель терминатора REV-9. Но на защиту Дани встает Грэйс - тоже прибывшая из будущего женщина, модифицировавшая свои боевые характеристики до терминаторского уровня. Вскоре к ним на помощь придёт и Сара Коннор, которая теперь превратилась в настоящую охотницу на роботов-убийц.'),
(87, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 17:00:00', '2020-02-16 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 14:56:15', '2020-02-11 21:22:00', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Книга джунглей', 'Книга джунглей', 'Непримиримая борьба с опасным и страшным тигром Шерханом вынуждает маугли покинуть волчью стаю и отправиться в деревню к людям. На пути мальчика ждут удивительные открытия и захватывающие с пантерой Багирой, медведем Балу, питоном Кааи другими обитателями дремучих джунглей.', 'Непримиримая борьба с опасным и страшным тигром Шерханом вынуждает маугли покинуть волчью стаю и отправиться в деревню к людям. На пути мальчика ждут удивительные открытия и захватывающие с пантерой Багирой, медведем Балу, питоном Кааи другими обитателями дремучих джунглей.'),
(88, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 19:00:00', '2020-02-16 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 14:57:43', '2020-02-11 21:21:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Алита: Боевой ангел', 'Алита: Боевой ангел', 'Действие фильма происходит через 300 лет после Великой войны в XXVI веке. Доктор Идо находит останки женщины-киборга. После починки киборг ничего не помнит, но обнаруживает, что в состоянии пользоваться боевыми приемами киборгов. Начинаются поиски утерянных воспоминаний.', 'Действие фильма происходит через 300 лет после Великой войны в XXVI веке. Доктор Идо находит останки женщины-киборга. После починки киборг ничего не помнит, но обнаруживает, что в состоянии пользоваться боевыми приемами киборгов. Начинаются поиски утерянных воспоминаний.'),
(89, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 15:00:00', '2020-02-22 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 15:00:35', '2020-02-21 22:54:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 1, 11, 3, 'Мушкетёры', 'Muşketýorlar', 'Ýaş d’Artanýan muşketýorlaryň hataryna kabul edilmek umydy bilen öýüni terk edip, Pariže gidýär. Tötanleýin ol birbada üç muşketýoryň – Atosyň, Portosyň we Aramisiň göwnüne degýär we duele çagyrylýar. Emma duel bölünýär. Kardinalyň esgerleri olary duelleriň gadaganlygy baradaky kanuny bozandyklary üçin tussag etjek bolýarlar. D’Artanýan we üç muşketýor güýçli garşydaşyndan üstün çykýar we dostlaşýar. Indi olar gaharly kardinal Rişelýeni saklamaly, gersog Bekingem we dönük Miledi de Winter bilen söweşmeli.', 'Молодой д’Артаньян покинул родной дом и отправился в Париж, надеясь на место в полку мушкетёров. По случайности в один день он обидел сразу троих мушкетёров — Атоса, Портоса и Арамиса — и получил от всех троих вызовы на дуэль. Но дуэль была прервана появлением гвардейцев кардинала, которые хотели арестовать их за нарушение указа о запрете дуэлей. Д’Артаньян и три мушкетера победили превосходящего силами противника и стали друзьями. Теперь они должны остановить злобного кардинала Ришелье и столкнуться с герцогом Бэкингемом и предательницей Миледи Де Винтер.'),
(90, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 17:00:00', '2020-02-22 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 15:02:27', '2020-02-21 22:56:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Книга джунглей', 'Jeňňelleriň kitaby', 'Howply we elhenç Şirhan bilen barlyşyksyz söweş Mauglini möjekleriň sürüsini terk edip, adamlaryň obasyna gitmäge mejbur edýär. Ýolda oglanjyga Bagira atly pantera, aýy Balu, Kaa diýen piton we jeňňeliň beýleki ýaşaýjylary bilen täsin açyşlardyr  başdangeçirmeler garaşýar.', 'Непримиримая борьба с опасным и страшным тигром Шерханом вынуждает Маугли покинуть волчью стаю и отправиться в деревню к людям. На пути мальчика ждут удивительные открытия и захватывающие приключения с пантерой Багирой, медведем Балу, питоном Каа и другими обитателями дремучих джунглей.'),
(91, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 17:00:00', '2020-02-23 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 15:04:24', '2020-02-24 18:59:42', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Аватар', 'Awatar', 'Maýyp Jeýk Salli – öň pyýada deňiz esgeri bolan. Näsag bedenine garamazdan, ol ýüreginde entegem esger. Jeýka Pandora planetasynyň ýaşaýjylarynyň bazasyna syýahat etmek ýumuşy berilýär. Planetada Ýeri energiýa krizisinden çykarjak seýrek mineral gazyp alynýar.  \n\n', 'Джейк Салли - бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.'),
(92, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 19:00:00', '2020-02-23 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 15:07:10', '2020-02-24 19:00:46', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Форсаж: Хоббс и Шоу', 'Forsaž: Hobbs we Şou', 'Lýuk Hobbs – ýörite amerikan agenti. Ol ykjam sport geýimleri, uly maşynlary we  dogry iýmitlenmegi gowy görýär. Dekard Şou bolsa baý iňlis ýigidi, öňki aňtawjy, gymmat eşikleri, sport maşynlary we klublary gowy görýär. Ikisem biri-birini ýigrenýär. Emma maşgalalaryna howp abananda, olar hemme zada taýýar. Hatda toparda işlemägede.', 'Люк Хоббс – американский элитный спецагент, он любит удобную спортивную одежду, большие пикапы и здоровое питание. Декард Шоу – британский пижон, бывший сотрудник разведки, предпочитает дорогие костюмы, спортивные авто и пабы. Эти двое терпеть друг друга не могут. Но если кто-то угрожает их семьям, они готовы пойти на всё. Даже на работу в команде.'),
(93, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 15:00:00', '2020-02-29 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2020-02-11 15:08:48', '2020-02-11 21:25:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Человек-паук: Возвращение домой', 'Человек-паук: Возвращение домой', 'После исторической встречи с командой Мстителей Питер Паркер возвращается домой, стараясь зажить обычной жизнью под опекой своей тёти Мэй. Но теперь за Питером приглядывает ещё кое-что… Тони Старк видел Человека-Паука в деле и должен стать его наставником. Когда новый злодей Стервятник угрожает уничтожить всё, что дорого Питеру, приходит время доказать всем, что такое настоящий супергерой.', 'После исторической встречи с командой Мстителей Питер Паркер возвращается домой, стараясь зажить обычной жизнью под опекой своей тёти Мэй. Но теперь за Питером приглядывает ещё кое-что… Тони Старк видел Человека-Паука в деле и должен стать его наставником. Когда новый злодей Стервятник угрожает уничтожить всё, что дорого Питеру, приходит время доказать всем, что такое настоящий супергерой.'),
(94, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 19:00:00', '2020-02-29 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2020-02-11 15:10:19', '2020-02-11 15:10:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 1, 'Аквамен', 'Аквамен', 'Действие фильма разворачивается в необъятном и захватывающем подводном мире семи морей, а сюжет знакомит зрителей с историей происхождения получеловека-полуатланта Артура Карри и ключевыми событиями его жизни – теми, что заставят его не только столкнуться с самим собой, но и выяснить, достоин ли он быть тем, кем ему суждено… царем!', 'Действие фильма разворачивается в необъятном и захватывающем подводном мире семи морей, а сюжет знакомит зрителей с историей происхождения получеловека-полуатланта Артура Карри и ключевыми событиями его жизни – теми, что заставят его не только столкнуться с самим собой, но и выяснить, достоин ли он быть тем, кем ему суждено… царем!'),
(95, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 17:00:00', '2020-03-01 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 15:12:35', '2020-02-24 19:17:25', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Чёрная Пантера', 'Gara Pantera', 'Göräýmäge, Wakanda ýabany Afrikanyň adaty territoriýasy, ýöne beýle däl. Bu çöllük toprakda unikal metallyň gorlary ýatyr. Adamlar oňa ýetjek bolup, ähli zady tozdurypdyrlar, hatda aboriginleri öldüripdirler. Emma her gezek Gara Pantera sawannanyň syrly ruhy ejir çekenleri gorapdyr. Ençeme ýyldan soň betbatçylyk Wakanda täzeden gelýär. Bu gezek duşman dörebap tehnologýalary ulanýar. Umyt galmadyk wagty, Wakandanyň ýaş şazadasy rowaýaty janlandyryp, Gara Panteranyň maksasynda söweşi dowam edýär. ', 'С первого взгляда можно решить, что Ваканда - обычная территория дикой Африки, но это не так. Здесь, в недрах пустынных земель, скрываются залежи уникального металла, способного поглощать вибрацию. Многие пытались добраться до него, разоряя всё на своём пути и принося смерть аборигенам, но каждый раз таинственный дух саванны - Чёрная Пантера - вставал на защиту угнетённых. Спустя много лет беда снова приходит в Ваканду, и в этот раз враг заручился поддержкой современных технологий. Когда шансов почти не остаётся, Т\'Чалла, молодой принц Ваканды, узнаёт, что именно ему предстоит возродить легенду и продолжить вечную борьбу, надев маску Чёрной Пантеры.'),
(96, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-04 11:00:00', '2020-02-04 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 18:48:59', '2020-02-11 18:50:18', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Королевский корги', 'Королевский корги', 'Любимая порода собак у очень богатых и влиятельных людей – это корги. Маленькие собачки полностью погружены в жизнь своих больших хозяев. Спасаясь от политических интриг, любимец Британской Королевы вынужден покинуть Букингемский дворец. Теперь ему предстоит не только познакомиться с тайной жизнью улиц Лондона, но и доказать, что он настоящий Королевский Корги…', 'Любимая порода собак у очень богатых и влиятельных людей – это корги. Маленькие собачки полностью погружены в жизнь своих больших хозяев. Спасаясь от политических интриг, любимец Британской Королевы вынужден покинуть Букингемский дворец. Теперь ему предстоит не только познакомиться с тайной жизнью улиц Лондона, но и доказать, что он настоящий Королевский Корги…'),
(97, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-05 13:00:00', '2020-02-05 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 18:54:01', '2020-02-11 18:55:06', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Монстры на каникулах 3: Море зовёт', 'Монстры на каникулах 3: Море зовёт', 'На этот раз Дракула вместе со своими друзьями отправляется в круиз на шикарном лайнере. Развлечения там на любой вкус: от монстробаскетбола и экзотических экскурсий, до лунных ванн. Неожиданно Дракула влюбляется в капитана корабля – загадочную и прекрасную Эрику, и его дочка Мэвис понимает, что поездка может превратиться в кошмар: ведь Эрика хранит ужасный секрет, который ставит под угрозу существование всех монстров!', 'На этот раз Дракула вместе со своими друзьями отправляется в круиз на шикарном лайнере. Развлечения там на любой вкус: от монстробаскетбола и экзотических экскурсий, до лунных ванн. Неожиданно Дракула влюбляется в капитана корабля – загадочную и прекрасную Эрику, и его дочка Мэвис понимает, что поездка может превратиться в кошмар: ведь Эрика хранит ужасный секрет, который ставит под угрозу существование всех монстров!'),
(98, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-06 11:00:00', '2020-02-06 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 19:55:51', '2020-02-11 19:56:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Волшебный парк Джун', 'Волшебный парк Джун', 'Однажды фантазерка Джун обнаруживает, что придуманный ею чудесный Парк развлечений реален! Но его существование под угрозой, и Джун нужен план спасения ее Мечты. Помогут девочке ее новые друзья – волшебные звери Парка.', 'Однажды фантазерка Джун обнаруживает, что придуманный ею чудесный Парк развлечений реален! Но его существование под угрозой, и Джун нужен план спасения ее Мечты. Помогут девочке ее новые друзья – волшебные звери Парка.'),
(99, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 13:00:00', '2020-02-07 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 20:00:13', '2020-02-11 20:00:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Сезон охоты 2', 'Сезон охоты 2', 'Буга и Элиота ждут новые безумные приключения! Элиот без памяти влюбился в Жизель, но ему приходится сойти с дороги, ведущей к алтарю, когда Мистера Уини похищают избалованные домашние животные, которые намерены вернуть его хозяевам. Буг, Элиот, Макскизи, Бадди и другие обитатели леса разворачивают полномасштабную спасательную операцию ради своего похожего на сосиску друга, и вскоре оказываются в лагере врага: в мире домашних питомцев. Домашние неженки под предводительством карликового пуделя Фифи не собираются отдавать Мистера Уини без боя.', 'Буга и Элиота ждут новые безумные приключения! Элиот без памяти влюбился в Жизель, но ему приходится сойти с дороги, ведущей к алтарю, когда Мистера Уини похищают избалованные домашние животные, которые намерены вернуть его хозяевам. Буг, Элиот, Макскизи, Бадди и другие обитатели леса разворачивают полномасштабную спасательную операцию ради своего похожего на сосиску друга, и вскоре оказываются в лагере врага: в мире домашних питомцев. Домашние неженки под предводительством карликового пуделя Фифи не собираются отдавать Мистера Уини без боя.'),
(100, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 11:00:00', '2020-02-07 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 20:03:12', '2020-02-11 20:03:38', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Облачно, возможны осадки в виде фрикаделек', 'Облачно, возможны осадки в виде фрикаделек', 'Главный герой мультфильма - странный ученый Флинт Локвуд, который всегда хотел изобрести что-то такое, что сделает его родной городок счастливым. И вот, у него получилось! Еды теперь хватает всем, и она просто падает с неба, создавая новые пейзажи вокруг: можно любоваться закатом с живописных холмов из фруктового желе. Но иногда вкусные осадки в виде фрикаделек могут превратиться в настоящий торнадо из аппетитных, но уже опасных спагетти! Гениальному ученому и его друзьям предстоит исправить положение дел в сытом городке.', 'Главный герой мультфильма - странный ученый Флинт Локвуд, который всегда хотел изобрести что-то такое, что сделает его родной городок счастливым. И вот, у него получилось! Еды теперь хватает всем, и она просто падает с неба, создавая новые пейзажи вокруг: можно любоваться закатом с живописных холмов из фруктового желе. Но иногда вкусные осадки в виде фрикаделек могут превратиться в настоящий торнадо из аппетитных, но уже опасных спагетти! Гениальному ученому и его друзьям предстоит исправить положение дел в сытом городке.'),
(101, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-07 13:00:00', '2020-02-07 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 20:05:31', '2020-02-11 20:06:00', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Кокоша – маленький дракон', 'Кокоша – маленький дракон', 'Дракончик Кокоша и его друг, дракончик Оскар, жили на Острове Драконов. Были они не такими, как все. Кокоша очень хотел стать летающим драконом, но летать у него не получалось. А Оскар, хищник по рождению, был убежденным вегетарианцем. Однажды вместе со своей подружкой, дикобразихой Матильдой, они решили отправиться в рискованное путешествие…', 'Дракончик Кокоша и его друг, дракончик Оскар, жили на Острове Драконов. Были они не такими, как все. Кокоша очень хотел стать летающим драконом, но летать у него не получалось. А Оскар, хищник по рождению, был убежденным вегетарианцем. Однажды вместе со своей подружкой, дикобразихой Матильдой, они решили отправиться в рискованное путешествие…'),
(102, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-09 11:00:00', '2020-02-09 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 20:07:41', '2020-02-11 20:08:17', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Моана', 'Моана', 'Бесстрашная Моана, дочь вождя маленького племени на острове в Тихом океане, больше всего на свете мечтает о приключениях и решает отправиться в опасное морское путешествие. Вместе с некогда могущественным полубогом Мауи им предстоит пересечь океан, сразиться со страшными чудовищами и разрушить древнее заклятие.', 'Бесстрашная Моана, дочь вождя маленького племени на острове в Тихом океане, больше всего на свете мечтает о приключениях и решает отправиться в опасное морское путешествие. Вместе с некогда могущественным полубогом Мауи им предстоит пересечь океан, сразиться со страшными чудовищами и разрушить древнее заклятие.'),
(104, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-09 13:00:00', '2020-02-09 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 20:18:54', '2020-02-11 20:19:30', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Миньоны', 'Миньоны', 'Миньоны живут на планете гораздо дольше нас. У них одна навязчивая идея – служить самой Гадкой личности из имеющихся в наличии. Динозавры, фараоны, Дракула, Наполеон – все они оказались недолговечны. И тогда миньоны рванули в Нью-Йорк. Их ждут деньги, власть, роковая суперзлодейка Скарлет Оверкилл и, конечно же, вкуснейшая “банана”! Во всяком случае, так им кажется.', 'Миньоны живут на планете гораздо дольше нас. У них одна навязчивая идея – служить самой Гадкой личности из имеющихся в наличии. Динозавры, фараоны, Дракула, Наполеон – все они оказались недолговечны. И тогда миньоны рванули в Нью-Йорк. Их ждут деньги, власть, роковая суперзлодейка Скарлет Оверкилл и, конечно же, вкуснейшая “банана”! Во всяком случае, так им кажется.'),
(105, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-11 11:00:00', '2020-02-11 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 20:21:39', '2020-02-11 21:01:37', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 1, 'Хороший динозавр', 'Хороший динозавр', 'Маленький динозавр Арло, который всего боится, потерялся, и чтобы выжить и вернуться домой ему предстоит многому научиться, и преодолеть свои страхи. Компанию ему составит дикий первобытный мальчик, с которым они становятся друзьями и помогают друг другу на их непростом, полном приключений и опасностей пути домой.', 'Маленький динозавр Арло, который всего боится, потерялся, и чтобы выжить и вернуться домой ему предстоит многому научиться, и преодолеть свои страхи. Компанию ему составит дикий первобытный мальчик, с которым они становятся друзьями и помогают друг другу на их непростом, полном приключений и опасностей пути домой.'),
(106, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-12 13:00:00', '2020-02-12 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:03:00', '2020-02-11 21:18:08', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Гринч', 'Гринч', 'Любой бы на месте Гринча позеленел и взбесился. Как порядочный интроверт он живёт в тёмной пещере на самой вершине горы подальше ото всех, но эти «все» готовят грандиознейшее празднование нового года. Они шумят, всё украшают и дико бесят. Кто бы отказал себе в удовольствии испортить праздник? Гринч решает украсть Новый год.', 'Любой бы на месте Гринча позеленел и взбесился. Как порядочный интроверт он живёт в тёмной пещере на самой вершине горы подальше ото всех, но эти «все» готовят грандиознейшее празднование нового года. Они шумят, всё украшают и дико бесят. Кто бы отказал себе в удовольствии испортить праздник? Гринч решает украсть Новый год.'),
(107, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-12 17:00:00', '2020-02-12 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:04:59', '2020-02-11 21:17:53', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Король Лев', 'Король Лев', 'История об отважном львенке по имени Симба. Знакомые с детства герои взрослеют, влюбляются, познают себя и окружающий мир, совершают ошибки и делают правильный выбор.', 'История об отважном львенке по имени Симба. Знакомые с детства герои взрослеют, влюбляются, познают себя и окружающий мир, совершают ошибки и делают правильный выбор.'),
(108, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-13 11:00:00', '2020-02-13 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:08:35', '2020-02-11 21:17:43', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Велотачки', 'Велотачки', 'Добро пожаловать в Споксвилль! Небольшой городок, затерявшийся среди живописных гор, лесов и озер, в котором живут самые разные... велосипеды. Это и горный велик Спиди – смелый и быстрый почтальон, и его лучшие друзья – байк Пиньон, мечтающий стать режиссером, веселый велосипедный насос Гэсси, владеющий автомастерской, и прелестная вело-леди Монтана, которая всегда говорит только то, что думает. Волшебный и образцовый городок, наполненный чистейшим воздухом, перестает быть идеальным, когда появляется незваный гость с двигателем…', 'Добро пожаловать в Споксвилль! Небольшой городок, затерявшийся среди живописных гор, лесов и озер, в котором живут самые разные... велосипеды. Это и горный велик Спиди – смелый и быстрый почтальон, и его лучшие друзья – байк Пиньон, мечтающий стать режиссером, веселый велосипедный насос Гэсси, владеющий автомастерской, и прелестная вело-леди Монтана, которая всегда говорит только то, что думает. Волшебный и образцовый городок, наполненный чистейшим воздухом, перестает быть идеальным, когда появляется незваный гость с двигателем…'),
(109, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-13 13:00:00', '2020-02-13 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:10:35', '2020-02-11 21:17:30', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Эпик', 'Эпик', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…'),
(110, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-14 11:00:00', '2020-02-14 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:12:29', '2020-02-11 21:17:13', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Рататуй', 'Рататуй', 'Крыс Реми обладает уникальным вкусом. Он готов рисковать собственной жизнью, чтобы посмотреть любимое кулинарное шоу и раздобыть какую-нибудь приправку или просто свежий продукт. Реми живет со своими сородичами, которые его не понимают и не принимают его увлечения кулинарией. Когда Реми случайно попадает на кухню шикарного ресторана, он решает воспользоваться выпавшим ему шансом и проверить свои навыки. На эту же кухню попадает и юный Лингвини. Всё, на что он может расчитывать - это должность уборщика. Но он тоже получает свой шанс...', 'Крыс Реми обладает уникальным вкусом. Он готов рисковать собственной жизнью, чтобы посмотреть любимое кулинарное шоу и раздобыть какую-нибудь приправку или просто свежий продукт. Реми живет со своими сородичами, которые его не понимают и не принимают его увлечения кулинарией. Когда Реми случайно попадает на кухню шикарного ресторана, он решает воспользоваться выпавшим ему шансом и проверить свои навыки. На эту же кухню попадает и юный Лингвини. Всё, на что он может расчитывать - это должность уборщика. Но он тоже получает свой шанс...'),
(111, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-15 11:00:00', '2020-02-15 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:14:28', '2020-02-11 21:31:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Снежная королева 3. Огонь и лед', 'Снежная королева 3. Огонь и лед', 'Редкий дар ввязываться во всевозможные неприятности - их семейная черта, да и что взять с тех, кто вырос среди снегов в компании троллей. Но повзрослев, Кай и Герда выходят на новый уровень - теперь они станут виновниками катастрофы мирового масштаба...', 'Редкий дар ввязываться во всевозможные неприятности - их семейная черта, да и что взять с тех, кто вырос среди снегов в компании троллей. Но повзрослев, Кай и Герда выходят на новый уровень - теперь они станут виновниками катастрофы мирового масштаба...'),
(112, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-15 13:00:00', '2020-02-15 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:29:56', '2020-02-11 21:30:25', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Ниндзя в клеточку', 'Ниндзя в клеточку', 'Когда Аске получает куклу ниндзя от своего дяди Стюарта, только что вернувшегося из Таиланда, он узнает, что кукла живая и может помочь ему с проблемами в школе. Аске хочет вернуть одолженное, но узнает, что клетчатый ниндзя одержим и находится на миссии, чтобы отомстить.', 'Когда Аске получает куклу ниндзя от своего дяди Стюарта, только что вернувшегося из Таиланда, он узнает, что кукла живая и может помочь ему с проблемами в школе. Аске хочет вернуть одолженное, но узнает, что клетчатый ниндзя одержим и находится на миссии, чтобы отомстить.'),
(113, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 11:00:00', '2020-02-16 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:33:05', '2020-02-11 21:33:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Аисты', 'Аисты', 'Аисты приносят детей... или, во всяком случае, раньше приносили. Теперь же они занимаются доставкой посылок для огромного сайта интернет-продаж. Джуниор, лучший аист в курьерской компании, должен пойти на повышение, но он случайно активирует машину для создания детей и получает очаровательную, но совершенно незапланированную девочку. Пытаясь доставить эту «посылку» до того, как босс узнает о произошедшем, Джуниор и его подруга Лютик, единственный человек на Горе Аистов, решаются на свою первую доставку ребёнка и отправляются в безумное и насыщенное удивительными открытиями приключение, благодаря которому многие семьи могут стать полными, а аисты – вернуться к своей истинной миссии на Земле.', 'Аисты приносят детей... или, во всяком случае, раньше приносили. Теперь же они занимаются доставкой посылок для огромного сайта интернет-продаж. Джуниор, лучший аист в курьерской компании, должен пойти на повышение, но он случайно активирует машину для создания детей и получает очаровательную, но совершенно незапланированную девочку. Пытаясь доставить эту «посылку» до того, как босс узнает о произошедшем, Джуниор и его подруга Лютик, единственный человек на Горе Аистов, решаются на свою первую доставку ребёнка и отправляются в безумное и насыщенное удивительными открытиями приключение, благодаря которому многие семьи могут стать полными, а аисты – вернуться к своей истинной миссии на Земле.'),
(114, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-16 13:00:00', '2020-02-16 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:34:46', '2020-02-11 21:35:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Суперсемейка 2', 'Суперсемейка 2', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.'),
(115, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-19 11:00:00', '2020-02-19 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:37:43', '2020-02-11 21:38:15', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Как приручить дракона', 'Как приручить дракона', 'Вы узнаете историю подростка Иккинга, которому не слишком близки традиции его героического племени, много лет ведущего войну с драконами. Мир Иккинга переворачивается с ног на голову, когда он неожиданно встречает дракона Беззубика, который поможет ему и другим викингам увидеть привычный мир с совершенно другой стороны…', 'Вы узнаете историю подростка Иккинга, которому не слишком близки традиции его героического племени, много лет ведущего войну с драконами. Мир Иккинга переворачивается с ног на голову, когда он неожиданно встречает дракона Беззубика, который поможет ему и другим викингам увидеть привычный мир с совершенно другой стороны…'),
(116, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-20 13:00:00', '2020-02-20 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:39:43', '2020-02-11 21:40:07', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Пришельцы в доме', 'Пришельцы в доме', 'У 12-летнего Луиса нет друзей, а у его отца постоянно не хватает на него времени. Тот страстно увлечен уфологией и даже не догадывается, что те, кого он так жаждет найти, находятся прямо у него перед носом. Луис становится единственным свидетелем аварийной посадки трех чудаковатых инопланетян рядом с их домом. Троица пришельцев быстро находит общий язык с мальчиком. Они ведут себя точь-в-точь как озорные подростки, и обладают к тому же совершенно удивительной способностью – перевоплощаться в любое живое существо. Луис еще никогда так не веселился, как рядом с ними. Но он быстро понимает, что если взрослые узнают о его тайне, ничем хорошим это не закончится. Поэтому он решает помочь им починить тарелку и улететь вместе с ними…', 'У 12-летнего Луиса нет друзей, а у его отца постоянно не хватает на него времени. Тот страстно увлечен уфологией и даже не догадывается, что те, кого он так жаждет найти, находятся прямо у него перед носом. Луис становится единственным свидетелем аварийной посадки трех чудаковатых инопланетян рядом с их домом. Троица пришельцев быстро находит общий язык с мальчиком. Они ведут себя точь-в-точь как озорные подростки, и обладают к тому же совершенно удивительной способностью – перевоплощаться в любое живое существо. Луис еще никогда так не веселился, как рядом с ними. Но он быстро понимает, что если взрослые узнают о его тайне, ничем хорошим это не закончится. Поэтому он решает помочь им починить тарелку и улететь вместе с ними…'),
(117, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-21 11:00:00', '2020-02-21 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:41:55', '2020-02-11 21:42:29', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Вилли и крутые тачки', 'Вилли и крутые тачки', 'Вилли - трижды чемпион по уличным гонкам в Гаскет-Сити, готовится к главному соревнованию в своей жизни. Весь мир у его колёс! Но в решающем заезде он не справился с управлением и упал в глубокую реку. Вилли приходиться стать обычным такси и лишь иногда соревноваться с обычными городскими машинами. Но после неожиданного столкновения с прекрасной итальянской машинкой Беллой, он начинает понимать, что помимо жажды скорости в жизни есть более важные вещи…', 'Вилли - трижды чемпион по уличным гонкам в Гаскет-Сити, готовится к главному соревнованию в своей жизни. Весь мир у его колёс! Но в решающем заезде он не справился с управлением и упал в глубокую реку. Вилли приходиться стать обычным такси и лишь иногда соревноваться с обычными городскими машинами. Но после неожиданного столкновения с прекрасной итальянской машинкой Беллой, он начинает понимать, что помимо жажды скорости в жизни есть более важные вещи…'),
(119, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-21 13:00:00', '2020-02-21 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:45:41', '2020-02-11 21:46:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Странные чары', 'Странные чары', 'Музыкальная сказка о гоблинах, эльфах, феях и бесах, рассказанная под мелодии популярных песен последних шести десятилетий.', 'Музыкальная сказка о гоблинах, эльфах, феях и бесах, рассказанная под мелодии популярных песен последних шести десятилетий.'),
(120, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-22 11:00:00', '2020-02-22 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:47:46', '2020-02-11 21:48:08', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Тачки 2', 'Тачки 2', 'Молния МакКуин и его друг Мэтр отправляются в международное путешествие — когда МакКуин получает шанс участвовать в соревнованиях для самых быстрых машин в мире, Мировом Гран-При. Этапы этих престижных гонок заведут друзей в Токио, на набережные Парижа, на побережье Италии, и на улицы туманного Лондона.', 'Молния МакКуин и его друг Мэтр отправляются в международное путешествие — когда МакКуин получает шанс участвовать в соревнованиях для самых быстрых машин в мире, Мировом Гран-При. Этапы этих престижных гонок заведут друзей в Токио, на набережные Парижа, на побережье Италии, и на улицы туманного Лондона.');
