(121, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 11:00:00', '2020-02-23 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:49:50', '2020-02-11 21:50:26', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Велотачки', 'Велотачки', 'Добро пожаловать в Споксвилль! Небольшой городок, затерявшийся среди живописных гор, лесов и озер, в котором живут самые разные... велосипеды. Это и горный велик Спиди – смелый и быстрый почтальон, и его лучшие друзья – байк Пиньон, мечтающий стать режиссером, веселый велосипедный насос Гэсси, владеющий автомастерской, и прелестная вело-леди Монтана, которая всегда говорит только то, что думает. Волшебный и образцовый городок, наполненный чистейшим воздухом, перестает быть идеальным, когда появляется незваный гость с двигателем…', 'Добро пожаловать в Споксвилль! Небольшой городок, затерявшийся среди живописных гор, лесов и озер, в котором живут самые разные... велосипеды. Это и горный велик Спиди – смелый и быстрый почтальон, и его лучшие друзья – байк Пиньон, мечтающий стать режиссером, веселый велосипедный насос Гэсси, владеющий автомастерской, и прелестная вело-леди Монтана, которая всегда говорит только то, что думает. Волшебный и образцовый городок, наполненный чистейшим воздухом, перестает быть идеальным, когда появляется незваный гость с двигателем…'),
(122, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-23 13:00:00', '2020-02-23 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 21:51:33', '2020-02-11 21:52:09', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Эпик', 'Эпик', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…'),
(123, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-25 13:00:00', '2020-02-25 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:09:58', '2020-02-11 22:10:26', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Кубо. Легенда о самурае', 'Кубо. Легенда о самурае', 'Кубо - наследник великого рода, но когда возвратились духи прошлого, жаждущие мести, на его защиту отважилась встать лишь странная парочка хранителей. И теперь для Кубо единственный шанс на спасение – найти магические доспехи отца, легендарного самурая.', 'Кубо - наследник великого рода, но когда возвратились духи прошлого, жаждущие мести, на его защиту отважилась встать лишь странная парочка хранителей. И теперь для Кубо единственный шанс на спасение – найти магические доспехи отца, легендарного самурая.'),
(124, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-26 11:00:00', '2020-02-26 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:14:25', '2020-02-26 20:49:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Снежинка', 'Garjagaz', 'Garjagaz – dünýäde ýeketäk ak gorilla, haýwanat bagynyň bolsa esasy gözelligi. Çagalar maýmyny gowy görýär, ýöne haýwanyň garyndaşlary onda näme üýtgeşikligiň bardygyna düşünmeýär. ', 'Снежок – единственная белая горилла в мире, он главная достопримечательность зоопарка. Дети очень любят необычную обезьяну, а вот собратья-гориллы никак не поймут, что же такого особенного в нем находят.'),
(125, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-27 11:00:00', '2020-02-27 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:16:06', '2020-02-26 20:50:54', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Гадкий я 3', 'Gorkunç men 3', 'Üçünji syýahat golaýlaýar. Köpçagaly superagent, görmegeý gyz we baky minýonlar ýetip gelýär. Taýýar boluň. Olar dünýäni dolandyrar. \n', 'Грядет третье пришествие. Многодетный суперагент, роковая красотка и бессмертные миньоны на подходе. Готовьтесь. Они будут править миром.'),
(126, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-28 11:00:00', '2020-02-28 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:18:06', '2020-02-26 20:54:34', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Велотачки', 'Welomaşynlar', 'Spokswile hoş geldiňiz! Gözel daglardyr, tokaýlaryň we kölleriň arasynda ýerleşen bu kiçijik şäherde welosipedleriň dürli görnüşleri bar. Dag welosipedi Spidi – batyr we çalasyn poçtalýon, onuň dostlary – režissýor bolmak isleýän motor Pinýon, şadyýan welosiped nasosy, ussahananyň eýesi Gessi, şeýle hem welo-ledi Montana. Ol hemişe näme pikir etse, şony aýdýar. Indi arassa howadan doly şäher dwigatelde işleýän myhman gelende nusgawy bolmaýar... \n', 'Добро пожаловать в Споксвилль! Небольшой городок, затерявшийся среди живописных гор, лесов и озер, в котором живут самые разные... велосипеды. Это и горный велик Спиди – смелый и быстрый почтальон, и его лучшие друзья – байк Пиньон, мечтающий стать режиссером, веселый велосипедный насос Гэсси, владеющий автомастерской, и прелестная вело-леди Монтана, которая всегда говорит только то, что думает. Волшебный и образцовый городок, наполненный чистейшим воздухом, перестает быть идеальным, когда появляется незваный гость с двигателем…'),
(127, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 11:00:00', '2020-02-29 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:20:14', '2020-02-26 20:55:15', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Облачно, возможны осадки в виде фрикаделек', 'Bulutly, frikadelka görnüşli ýagyn ýagmagy mümkin', 'Multfilmiň esasy gahrymany – geň alym Flint Lokwud. Ol hemişe dogduk mekanynyň bagtyýar bolmagy üçin bir zat oýlap tapmak isleýärdi. We bir gün bu oňa başartýar. Iýmit indi hemmelere ýetýär – ol asmandan gaçýar we daş töwereginde täze tebigaty döredýär. Mysal üçin, miweli depelerden günüň batyşyna syn edip bolýar. Ýöne käte frikadelka görnüşdäki süýji ýagynlar tagamly, emma howply aşlardan tüweleýe öwrülip biler. Akyldar alym dostlary bilen dok şäherdäki ýagdaýy düzeltmeli bolýar. \n', 'Главный герой мультфильма - странный ученый Флинт Локвуд, который всегда хотел изобрести что-то такое, что сделает его родной городок счастливым. И вот, у него получилось! Еды теперь хватает всем, и она просто падает с неба, создавая новые пейзажи вокруг: можно любоваться закатом с живописных холмов из фруктового желе. Но иногда вкусные осадки в виде фрикаделек могут превратиться в настоящий торнадо из аппетитных, но уже опасных спагетти! Гениальному ученому и его друзьям предстоит исправить положение дел в сытом городке.'),
(128, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 13:00:00', '2020-02-29 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:21:53', '2020-02-26 20:55:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Сезон охоты 2', 'Aw möwsümi 2', 'Bugi we Elioty täze başdangeçirmeler garaşýar. Eliot Žizele çyndan aşyk bolýar, emma ol altara eltýän ýoldan çekilmeli bolýar. Çünki jenap Uinini öý haýwanlary alyp gaçýar we eýesine tabşyrjak bolýar. Bug, Eliot, Makskizi, Baddi we tokaýyň beýleki ýaşaýjylary şöhlada meňzeş dostuny halas etmek üçin uly operasiýa geçirýär. Şeýlelikde, olar duşmanyň meýdanyna gelýär. Eýjejikler Fifi atly kiçijik pudeliň ýolbaşçylygynda jenap Uinini söweşsiz bermek islemeýär. \n\n', 'Буга и Элиота ждут новые безумные приключения! Элиот без памяти влюбился в Жизель, но ему приходится сойти с дороги, ведущей к алтарю, когда Мистера Уини похищают избалованные домашние животные, которые намерены вернуть его хозяевам. Буг, Элиот, Макскизи, Бадди и другие обитатели леса разворачивают полномасштабную спасательную операцию ради своего похожего на сосиску друга, и вскоре оказываются в лагере врага: в мире домашних питомцев. Домашние неженки под предводительством карликового пуделя Фифи не собираются отдавать Мистера Уини без боя.'),
(129, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 15:00:00', '2020-02-29 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:24:23', '2020-02-26 20:56:34', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Дамбо', 'Dambo', 'Sirk dolandyryjysy Maks Mediçi öňki ýyldyz Holt Ferrierany we çagalary Milli we Joýy täze dogulan piljagazyň hossary belleýär. Jandaryň uly gulaklarynyň üstünden Holtyň işdeşleri gülüp, degişýär. Dambonyň uçýandygyny bilip, sirkiň eýesi onuň täsin ukyplarynda prýdalanmakçy bolýar. Bu işe telekeçi W.A. Wendewer goşulýar we Dambodan «Täsin ýurt» atly täze işiniň esasy ýyldyzy edýär. ', 'Цирковой импресарио Макс Медичи назначает бывшую звезду цирка Холта Фэрриера и его детей Милли и Джо опекунами новорожденного слонёнка, чьи невероятно большие уши сразу становятся предметом для постоянных шуток и насмешек коллег Холта по цеху. Внезапно узнав, что Дамбо умеет летать, владелец цирка решает нажиться на необычных способностях слонёнка. К делу подключается энергичный предприниматель В.А.Вэндевер, который решает сделать из малыша Дамбо главную звезду своего нового грандиозного развлекательного предприятия «Сказочная страна».'),
(130, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 13:00:00', '2020-03-01 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-11 22:26:06', '2020-02-26 20:57:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Аисты', 'Aistler', 'Aistler çagalary getirýär... iň bolmanda öň getirýärdi. Indi bolsa olar internet-satuw saýty üçin posylkalary eltmek bilen meşgullanýar. Çapar kärhanasynyň iň gowy aisti Junior beýgelmeli bolanda çaga döredýän maşyny işe girizýär we meýilleşdirilmedik gyzly bolýar. Posylkany bolup geçenler barada başlyk habary bolmazdan öň eltip berjek bolup Junior we dosty, Aistler dagyndaky ýeketäk adam Lutik, çagany ilkinji gezek eltmegi ýüregine düwýär. Olar täsin, başdangeçirmelere baý syýahata ugraýar. Şeýlelikde, maşgalalar doly, aistler bolsa Ýer şaryndaky hakyky wezipesini ýerine ýetirer.\n', 'Аисты приносят детей... или, во всяком случае, раньше приносили. Теперь же они занимаются доставкой посылок для огромного сайта интернет-продаж. Джуниор, лучший аист в курьерской компании, должен пойти на повышение, но он случайно активирует машину для создания детей и получает очаровательную, но совершенно незапланированную девочку. Пытаясь доставить эту «посылку» до того, как босс узнает о произошедшем, Джуниор и его подруга Лютик, единственный человек на Горе Аистов, решаются на свою первую доставку ребёнка и отправляются в безумное и насыщенное удивительными открытиями приключение, благодаря которому многие семьи могут стать полными, а аисты – вернуться к своей истинной миссии на Земле.'),
