(141, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-04 18:13:00', '2023-06-04 18:14:00', NULL, 1, 1, NULL, '-110.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 16:26:30', '2023-05-04 22:14:05', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Моя ужасная няня', 'Arzyly enekäm', 'Попав в дом к недавно овдовевшему мистеру Брауну, няня-волшебница пытается усмирить его семерых непослушных детей. Эти сорванцы, возглавляемые Саймоном, уже избавились от 17 предыдущих нянь и поэтому не сомневаются, что и 18-ю ждет та же участь. Однако, когда няне Макфи все-таки удается взять ситуацию под контроль, детишки вдруг начинают замечать, что их ужасное поведение волшебным образом приводит к совершенно удивительным и непредсказуемым результатам…', 'Попав в дом к недавно овдовевшему мистеру Брауну, няня-волшебница пытается усмирить его семерых непослушных детей. Эти сорванцы, возглавляемые Саймоном, уже избавились от 17 предыдущих нянь и поэтому не сомневаются, что и 18-ю ждет та же участь. Однако, когда няне Макфи все-таки удается взять ситуацию под контроль, детишки вдруг начинают замечать, что их ужасное поведение волшебным образом приводит к совершенно удивительным и непредсказуемым результатам…'),
(142, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-04 18:13:00', '2023-06-04 18:13:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 17:02:50', '2023-05-04 22:13:34', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Телохранитель', 'Janpena', 'Лавли Сингх пунктуален и отлично выполняет свои служебные обязанности. Он гордится своей работой, в которой ему нет равных. Он телохранитель. Однажды ему поручают охранять Дивью, дочь финансового магната, красивую и богатую. Проводив ее до студенческого городка, Лавли даёт понять Дивье, что озабочен её безопасностью и будет следить за каждым, кто захочет к ней приблизиться. Девушка понимает, что её телохранитель будет мешать ей вести прежнюю жизнь. Чтобы избавиться от него, она разрабатывает гениальный план, который должен помочь заманить красавчика в ловушку. От лица несуществующей поклонницы Дивья донимает анонимными телефонными звонками. Но Сингх оказывается крепким орешком, которого не так просто взять голыми руками...', 'Лавли Сингх пунктуален и отлично выполняет свои служебные обязанности. Он гордится своей работой, в которой ему нет равных. Он телохранитель. Однажды ему поручают охранять Дивью, дочь финансового магната, красивую и богатую. Проводив ее до студенческого городка, Лавли даёт понять Дивье, что озабочен её безопасностью и будет следить за каждым, кто захочет к ней приблизиться. Девушка понимает, что её телохранитель будет мешать ей вести прежнюю жизнь. Чтобы избавиться от него, она разрабатывает гениальный план, который должен помочь заманить красавчика в ловушку. От лица несуществующей поклонницы Дивья донимает анонимными телефонными звонками. Но Сингх оказывается крепким орешком, которого не так просто взять голыми руками...'),
(143, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-29 18:00:00', '2020-02-29 20:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 17:21:22', '2020-02-25 17:06:12', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 2, 'Дочь султана', 'Şagyzy', 'Лишив престола сына, оказавшегося недостойным этой высокой чести, султан передает престол своей дочери Рази, чем вызывает неудовольствие знати. Однако Разиа оказывается достойной преемницей, проводящей разумную и справедливую политику. Но любовь к воеводе Якуту, бывшему рабу, получившему свободу от султана, ставит на карту все его могущество.', 'Лишив престола сына, оказавшегося недостойным этой высокой чести, султан передает престол своей дочери Рази, чем вызывает неудовольствие знати. Однако Разиа оказывается достойной преемницей, проводящей разумную и справедливую политику. Но любовь к воеводе Якуту, бывшему рабу, получившему свободу от султана, ставит на карту все его могущество.'),
(144, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 15:00:00', '2020-03-01 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 17:50:21', '2020-02-25 17:05:33', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 2, 'Огненный цветок', 'Gül we ot', 'Староста деревни Дэва делает все возможное для ее жителей: на строительство школ, больниц, храмов он выделяет немалые суммы. Результатом всех благодеяний Дэвы становится безмерное уважение со стороны земляков. Но однажды, спасая девушку от укуса змеи, Дэва навлекает на себя людской гнев...', 'Староста деревни Дэва делает все возможное для ее жителей: на строительство школ, больниц, храмов он выделяет немалые суммы. Результатом всех благодеяний Дэвы становится безмерное уважение со стороны земляков. Но однажды, спасая девушку от укуса змеи, Дэва навлекает на себя людской гнев...'),
(145, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 17:00:00', '2020-03-01 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 17:59:02', '2020-02-25 17:05:13', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 2, 'Жил-был тигр', 'Bir gaplañ ýaşapdyr', 'Индийский спецагент по прозвищу Тигр во время очередной миссии влюбляется в очаровательную танцовщицу Зою - помощницу ученого, который подозревается в продаже секретных технологий пакистанской разведке.', 'Индийский спецагент по прозвищу Тигр во время очередной миссии влюбляется в очаровательную танцовщицу Зою - помощницу ученого, который подозревается в продаже секретных технологий пакистанской разведке.'),
(146, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-01 11:00:00', '2020-03-01 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 18:05:08', '2020-02-25 17:06:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 2, 'Три брата', 'Üç dogan', 'Сатьядеви, офицер полиции и мать двух сыновей Шакти и Ананда, попавшая в тюрьму на длительный срок по ложному обвинению в убийстве, рожает здесь третьего сына, Роми. Не желая, находясь за решеткой, вмешиваться в жизнь своих сыновей, она переправляет новорожденного двум старшим братьям с наказом вырастить его в духе их семьи. При этом она просит брата сказать сыновьям, что она погибла. Взяв на себя заботу по воспитанию Роми, братья, имея разные взгляды на жизнь, ссорятся, и Ананд уходит из дому. Много лет спустя судьба вновь сводит их вместе. К этому времени выходит из тюрьмы и мать…', 'Сатьядеви, офицер полиции и мать двух сыновей Шакти и Ананда, попавшая в тюрьму на длительный срок по ложному обвинению в убийстве, рожает здесь третьего сына, Роми. Не желая, находясь за решеткой, вмешиваться в жизнь своих сыновей, она переправляет новорожденного двум старшим братьям с наказом вырастить его в духе их семьи. При этом она просит брата сказать сыновьям, что она погибла. Взяв на себя заботу по воспитанию Роми, братья, имея разные взгляды на жизнь, ссорятся, и Ананд уходит из дому. Много лет спустя судьба вновь сводит их вместе. К этому времени выходит из тюрьмы и мать…'),
(147, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-04 18:13:00', '2023-06-04 18:13:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 18:22:36', '2023-05-04 22:13:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Вир – герой народа', 'Wir - halk gahrymany', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...'),
(148, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-02-28 18:00:00', '2020-02-28 20:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 19:14:08', '2020-02-25 17:06:38', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 2, 'Игроки', 'Oýunçylar', 'Команда мошенников, состоящая из профессионального жулика, автомобильного эксперта, опытной соблазнительницы, волшебника-иллюзиониста, специалиста по взрывчатым веществам, компьютерного хакера и актера, умеющего до полной неузнаваемости изменять свою внешность, планирует совершить грандиозное ограбление. На кону 100 миллионов долларов. Их цель – поезд с золотыми монетами на борту, движущийся из России в Румынию.', 'Команда мошенников, состоящая из профессионального жулика, автомобильного эксперта, опытной соблазнительницы, волшебника-иллюзиониста, специалиста по взрывчатым веществам, компьютерного хакера и актера, умеющего до полной неузнаваемости изменять свою внешность, планирует совершить грандиозное ограбление. На кону 100 миллионов долларов. Их цель – поезд с золотыми монетами на борту, движущийся из России в Румынию.'),
(149, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-17 17:00:00', '2020-04-17 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-02-19 21:48:20', '2020-04-09 13:57:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Безумно влюбленные', 'Söýgi bulaşyklary', 'Девушка из богатой семьи Радха (Пуджа Бхатт) и бедный парень Манохар (Вивек Мушран) безумно любят друг друга, но их родители против их свадьбы. Тогда влюбленные убегают из дома и решают похитить сына (Джеки Шрофф) богатого промышленника, чтобы получить за него большой выкуп. Но в жизни не всегда бывает так, как планируешь.', 'Девушка из богатой семьи Радха (Пуджа Бхатт) и бедный парень Манохар (Вивек Мушран) безумно любят друг друга, но их родители против их свадьбы. Тогда влюбленные убегают из дома и решают похитить сына (Джеки Шрофф) богатого промышленника, чтобы получить за него большой выкуп. Но в жизни не всегда бывает так, как планируешь.\n'),
(151, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-08 18:00:00', '2020-03-08 20:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-03 15:48:20', '2020-03-03 17:45:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 2, 14, 4, '8 марта', '8 марта', 'Иcполнители: Эмир Яйлымов, Гульджахан Бекназарова, Рахман Худайбердыев, Джамал Гараева.', 'Иcполнители: Эмир Яйлымов, Гульджахан Бекназарова, Рахман Худайбердыев, Джамал Гараева.'),
(152, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-14 19:00:00', '2020-03-14 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-03 15:57:32', '2020-03-03 17:02:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 2, 7, 4, 'Bahar nagmalary', 'Bahar nagmalary', 'Исполнители: Атагельды Гарягдыев, Биби Аманова, Владимир Мкртумов, Аман Аманов, Сона Нурыева, Мерджен Аманова', 'Исполнители: Атагельды Гарягдыев, Биби Аманова, Владимир Мкртумов, Аман Аманов, Сона Нурыева, Мерджен Аманова'),
(153, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-15 15:00:00', '2020-03-15 17:00:00', NULL, 1, 1, NULL, '0.33', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-03 16:00:55', '2020-03-10 20:47:41', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 4, 'Малефисента: Владычица тьмы', 'Malefisenta: Tümligiň eýesi', 'Ýetişen şa gyzy Awrora, şazada Filip söz aýdýar. Ýaşlar nikanyň iki patyşalygy birleşdirip, adamlary ýaraşdyrjagyna ynanýar. Emma bu başa barmaýar. Filipiň ene-atasy patyşa Jon we aýaly Ingrit bilen bilelikdäki naharda dawa bolýar. Agşamlyk nahara Awroranyň krestnisasy hem çagyrylýar. Netijede, patyşa jadyly häsiýetli kesele uçraýar, Malifisenta bolsa gaçmaly bolýar. \n\n***Жанр:***  фэнтези, приключения, семейный\n\n***Страны:***  США, Великобритания\n\n***Режиссёр:***  Хоаким Роннинг\n\n***Длительность: *** 119 мин.', 'Принцесса Аврора выросла, и теперь принц Филип делает ей предложение. Наивные молодые люди уверены, что их брак сможет объединить два королевства и помирить людей с волшебными существами, но не тут-то было. На совместном ужине с родителями Филипа, королём Джоном и королевой Ингрит, куда была приглашена и крёстная Авроры, происходит ссора, в результате чего король слегает с недомоганием явно магического свойства, а Малифисента вынуждена спасаться бегством.\n\n***Жанр:***  фэнтези, приключения, семейный\n\n***Страны:***  США, Великобритания\n\n***Режиссёр:***  Хоаким Роннинг\n\n***Длительность: *** 119 мин.'),
(154, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-15 17:00:00', '2020-03-15 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-03 16:07:28', '2020-03-04 18:06:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 4, 'Форсаж: Хоббс и Шоу', 'Forsaž: Hobbs we Şou', 'Lýuk Hobbs – ýörite amerikan agenti. Ol ykjam sport geýimleri, uly maşynlary we  dogry iýmitlenmegi gowy görýär. Dekard Şou bolsa baý iňlis ýigidi, öňki aňtawjy, gymmat eşikleri, sport maşynlary we klublary gowy görýär. Ikisem biri-birini ýigrenýär. Emma maşgalalaryna howp abananda, olar hemme zada taýýar. Hatda toparda işlemägede.\n\n***Жанр:***  боевик, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Дэвид Литч\n\n***Длительность:***  137 мин.', 'Люк Хоббс – американский элитный спецагент, он любит удобную спортивную одежду, большие пикапы и здоровое питание. Декард Шоу – британский пижон, бывший сотрудник разведки, предпочитает дорогие костюмы, спортивные авто и пабы. Эти двое терпеть друг друга не могут. Но если кто-то угрожает их семьям, они готовы пойти на всё. Даже на работу в команде.\n\n***Жанр:***  боевик, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Дэвид Литч\n\n***Длительность:***  137 мин.'),
(155, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-15 13:00:00', '2020-03-15 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-03 17:04:45', '2020-03-04 18:03:50', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 4, 'Тайна печати дракона', 'Тайна печати дракона', 'Английский путешественник Джонатан Грин получает от Петра I заказ на изготовление карт Дальнего Востока России. Ему вновь предстоит долгий путь, полный невероятных приключений, который приведет его в Китай. Картограф столкнется с массой головокружительных открытий, неожиданных встреч с диковинными существами, китайскими принцессами, мастерами смертоносных боевых искусств и самим Лун-Ван, Царем всех драконов. Что может быть опаснее, чем посмотреть в глаза Вию? Разве что встретиться с ним вновь. Что на этот раз окажется сильнее – непоколебимый скептицизм ученого или древняя черная магия, уже давно захватившая власть в Восточных землях?\n\n***Жанр:***  приключения, фэнтези\n\n***Страны:***  Россия, Китай\n\n***Режиссёр:***  Олег Степченко\n\n***Длительность: *** 121 мин.', 'Английский путешественник Джонатан Грин получает от Петра I заказ на изготовление карт Дальнего Востока России. Ему вновь предстоит долгий путь, полный невероятных приключений, который приведет его в Китай. Картограф столкнется с массой головокружительных открытий, неожиданных встреч с диковинными существами, китайскими принцессами, мастерами смертоносных боевых искусств и самим Лун-Ван, Царем всех драконов. Что может быть опаснее, чем посмотреть в глаза Вию? Разве что встретиться с ним вновь. Что на этот раз окажется сильнее – непоколебимый скептицизм ученого или древняя черная магия, уже давно захватившая власть в Восточных землях?\n\n***Жанр:***  приключения, фэнтези\n\n***Страны:***  Россия, Китай\n\n***Режиссёр:***  Олег Степченко\n\n***Длительность: *** 121 мин.'),
