(160, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-11 18:00:00', '2020-03-11 20:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-04 14:47:32', '2020-03-04 18:00:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Султан', 'Султан', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Жанр:***  боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:***  170 мин.', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Жанр:***  боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:***  170 мин.'),
