(166, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-15 13:00:00', '2020-03-15 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-04 17:25:42', '2020-03-04 17:52:50', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Жизнь во имя любви 2', 'Жизнь во имя любви 2', 'Карьера некогда успешного музыканта Рахула Джейкара стремительно идёт на спад из-за его пристрастия к алкоголю. Его верный друг и по совместительству менеджер, Вивек всё ещё верит в талант Рахула и всячески пытается возродить его угасающую карьеру. После одного из своих неудачных концертов, Рахул идёт в бар, где видит выступление начинающей певицы Арохи. Очарованный талантом девушки, Рахул посредством своих связей, пытается сделать Арохи новой звездой тысячелетия, что в конечном итоге с успехом ему удаётся. В процессе знакомства и совместной работы, молодые люди сближаются...\n\n***Жанр:***  мюзикл, драма, мелодрама, музыка\n\n***Страна:*** Индия\n\n***Режиссёр:***  Мохит Сури\n\n***Длительность:*** 140 минут', 'Карьера некогда успешного музыканта Рахула Джейкара стремительно идёт на спад из-за его пристрастия к алкоголю. Его верный друг и по совместительству менеджер, Вивек всё ещё верит в талант Рахула и всячески пытается возродить его угасающую карьеру. После одного из своих неудачных концертов, Рахул идёт в бар, где видит выступление начинающей певицы Арохи. Очарованный талантом девушки, Рахул посредством своих связей, пытается сделать Арохи новой звездой тысячелетия, что в конечном итоге с успехом ему удаётся. В процессе знакомства и совместной работы, молодые люди сближаются...\n\n***Жанр:*** мюзикл, драма, мелодрама, музыка\n\n***Страна:*** Индия\n\n***Режиссёр:***  Мохит Сури\n\n***Длительность:*** 140 минут'),
(167, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-07 15:00:00', '2020-03-07 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 17:47:54', '2020-03-06 20:52:10', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'В поисках Дори', 'Doriniň gözleginde', 'Dori – hoşniýetli gök hirurg-balyk. Ol ýatkeşligindäki kemçiliginden gutulyp,\nmaşgala gurmaga çalyşýar.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Эндрю Стэнтон, Энгус МакЛэйн\n\n***Длительность:***  103 мин.', 'Дори — синяя доброжелательная рыбка-хирург, страдающая провалами в памяти. Она упорно стремится избавиться от своего недуга и найти свою семью.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Эндрю Стэнтон, Энгус МакЛэйн\n\n***Длительность:***  103 мин.\n'),
(168, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-07 17:00:00', '2020-03-07 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 17:54:07', '2020-03-05 17:55:38', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Гемини', 'Гемини', 'Первоклассный киллер Генри Броган становится мишенью таинственного оперативника, который, кажется, знает наперёд каждый его шаг.\n\n***Жанр:***  боевик, фантастика\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Энг Ли\n\n***Длительность:***  117 мин.', 'Первоклассный киллер Генри Броган становится мишенью таинственного оперативника, который, кажется, знает наперёд каждый его шаг.\n\n***Жанр:***  боевик, фантастика\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Энг Ли\n\n***Длительность:***  117 мин.\n'),
(170, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-07 19:00:00', '2020-03-07 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 18:04:04', '2020-03-05 18:06:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Бегущий по лезвию', 'Бегущий по лезвию', 'Отставной детектив Рик Декард вновь восстановлен в полиции Лос-Анджелеса для поиска возглавляемой Роем Батти группы киборгов, совершившей побег из космической колонии на Землю. В полиции считают, что киборги пытаются встретиться с Эндолом Тайреллом, руководителем корпорации, ставящей эксперименты над кибернетическим интеллектом. Рик Декард получает задание выяснить мотивы действий киборгов, а затем уничтожить их.\n\n***Жанр:***  фантастика, триллер, драма, мелодрама\n\n***Страны:***  США, Гонконг, Великобритания\n\n***Режиссёр:***  Ридли Скотт\n\n***Длительность:***  117 мин.', 'Отставной детектив Рик Декард вновь восстановлен в полиции Лос-Анджелеса для поиска возглавляемой Роем Батти группы киборгов, совершившей побег из космической колонии на Землю. В полиции считают, что киборги пытаются встретиться с Эндолом Тайреллом, руководителем корпорации, ставящей эксперименты над кибернетическим интеллектом. Рик Декард получает задание выяснить мотивы действий киборгов, а затем уничтожить их.\n\n***Жанр:***  фантастика, триллер, драма, мелодрама\n\n***Страны:***  США, Гонконг, Великобритания\n\n***Режиссёр:***  Ридли Скотт\n\n***Длительность:***  117 мин.'),
(171, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-08 15:00:00', '2020-03-08 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 18:11:17', '2020-03-05 18:12:39', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Эверест', 'Ewerest', 'Ewerest – professional alpinistleriň basyp almak isleýän beýik dagy. Hatda ýokarky nokadyna goýberilen ekspedisiýalaryň biri pajygaly gutardy. Ýöne bu mert alpinistleri saklanok. Ussat tälimçi Rob Holl, planetanyň iň beýik nokadyna galmak üçin ökde alpinistlerden topar toplaýar. Olaryň ählisi edermenlikden doly, Ewerestiň ýokarysyna ýetmekden bolsa hiç zat saklamaz. Emma dagy boýun egdirseler-de, yzyna sag aman gelip bilermi?\n\n***Жанр:***  боевик, триллер, драма, приключения, биография\n\n***Страны:***  Великобритания, США, Исландия\n\n***Режиссёр:***  Бальтасар Кормакур\n\n***Длительность:***  121 мин.', 'Эверест — великая неприступная гора, покорить вершину которой мечтают многие профессиональные альпинисты. Одна из экспедиций на ее вершину закончилась настоящей трагедией, однако этот факт не останавливает отважных альпинистов. Опытный инструктор Роб Холл, собрав группу из лучших альпинистов, собирается совершить восхождение на самую высокую вершину планеты. Все эти люди полны мужества и отваги и они не остановятся ни перед чем, пока не поднимутся на вершину Эвереста. Но даже если эта гора покорится им, смогут ли они вернуться обратно живыми и невредимыми?\n\n***Жанр:***  боевик, триллер, драма, приключения, биография\n\n***Страны:***  Великобритания, США, Исландия\n\n***Режиссёр:***  Бальтасар Кормакур\n\n***Длительность:***  121 мин.'),
(172, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-08 17:00:00', '2020-03-08 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 18:16:30', '2020-03-05 18:17:42', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Варкрафт', 'Варкрафт', 'Веками магия и неприступные стены защищали людей от любых напастей. Но древнее зло, побежденное и забытое тысячелетия назад, пробудилось. В самом сердце королевства открылся темный портал, и раса невиданных существ наводнила земли Азерота. Так начались события, призванные навсегда изменить судьбу этого мира.\n\n***Жанр:***  фэнтези, боевик, приключения\n\n***Страны:***  США, Канада, Китай, Япония\n\n***Режиссёр:***  Дункан Джонс\n\n***Длительность:***  123 мин.', 'Веками магия и неприступные стены защищали людей от любых напастей. Но древнее зло, побежденное и забытое тысячелетия назад, пробудилось. В самом сердце королевства открылся темный портал, и раса невиданных существ наводнила земли Азерота. Так начались события, призванные навсегда изменить судьбу этого мира.\n\n***Жанр:***  фэнтези, боевик, приключения\n\n***Страны:***  США, Канада, Китай, Япония\n\n***Режиссёр:***  Дункан Джонс\n\n***Длительность:***  123 мин.'),
(173, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-08 19:00:00', '2020-03-08 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 18:20:48', '2020-03-05 18:22:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Книга джунглей', 'Jeňňelleriň kitaby', 'Howply we elhenç Şirhan bilen barlyşyksyz söweş Mauglini möjekleriň sürüsini terk edip, adamlaryň obasyna gitmäge mejbur edýär. Ýolda oglanjyga Bagira atly pantera, aýy Balu, Kaa diýen piton we jeňňeliň beýleki ýaşaýjylary bilen täsin açyşlardyr  başdangeçirmeler garaşýar.\n\n***Жанр:***  фэнтези, драма, приключения, семейный, мультфильм\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:***  Джон Фавро\n\n***Длительность:***  105 мин.', 'Непримиримая борьба с опасным и страшным тигром Шерханом вынуждает Маугли покинуть волчью стаю и отправиться в деревню к людям. На пути мальчика ждут удивительные открытия и захватывающие приключения с пантерой Багирой, медведем Балу, питоном Каа и другими обитателями дремучих джунглей.\n\n***Жанр:***  фэнтези, драма, приключения, семейный, мультфильм\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:***  Джон Фавро\n\n***Длительность:***  105 мин.'),
(174, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-14 15:00:00', '2020-03-14 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 18:31:38', '2020-03-05 18:32:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Суперсемейка 2', 'Суперсемейка 2', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.\n\n***Жанр:***  мультфильм, фантастика, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Брэд Бёрд\n\n***Длительность:***  118 мин.', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.\n\n***Жанр:***  мультфильм, фантастика, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Брэд Бёрд\n\n***Длительность:***  118 мин.'),
