(185, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 15:00:00', '2020-03-28 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 20:10:41', '2020-03-05 20:46:51', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Эпик', 'Epik', 'Uzak wagtdan soň Meri Ketrin öýüne dolanýar. Öýde kakasy professor Bomba\nýeke özi ýaşaýar. Emma ol gyzyna üns bermän, tokaý dünýasiniň syrlaryny\nöwrenmek bilen meşgul. Meri adamzadyň aýak astynda gowy bilen erbediň\nugrunda müdimi göreş gidýändigine ynanmak islemeýär. Ol birden möçberde\nkiçelip, esgerler bilen tanyşýar. Indi diňe bir tokaý dünýäsiniň däl eýsem bütin\nadamzadyň halas bolmagy Meriýe bagly.\n\n***Жанр:***  мультфильм, фэнтези, приключения, комедия, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Крис Уэдж\n\n***Длительность:***  102 мин.', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…\n\n***Жанр:***  мультфильм, фэнтези, приключения, комедия, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Крис Уэдж\n\n***Длительность:***  102 мин.'),
(186, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 17:00:00', '2020-03-28 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 20:33:46', '2020-03-06 20:19:39', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Терминатор: Тёмные судьбы', 'Terminator: Garaňky ykballar', 'Meksika. Eýjejik Daniela Ramos, dostlary üçin bolsa Dani, irden dogany bilen zawoda işlemäge gidýär. Ýöne olaryň awtomatika bilen çalşyljakdygy belli bolýar. Bu maşynlaryň döredýän ýeketak howpy däl: gyza geljekden göýberilen,  terminatoryň öldürilmeýän REV-9 modeli hüjüm edýär. Danini Greýs goraýar. Ol hem geljekden gelen, öz söweş ukyplaryny terminatorlyk derejesine çenli ösdüren aýal. Soňra olara ganhor robotlaryň awçysy Sara Konnor hem goşulýar.  \n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Тим Миллер\n\n***Длительность:***   128 мин.', 'Мексика. Милая девушка Даниэла Рамос, а для друзей просто Дани, вместе с братом приходит с утра работать на завод, но там выясняется, что их вскоре заменят автоматикой. И это не единственная угроза, которую представляют для девушки машины: тут же на неё нападает присланная из будущего и практически неубиваемая модель терминатора REV-9. Но на защиту Дани встает Грэйс - тоже прибывшая из будущего женщина, модифицировавшая свои боевые характеристики до терминаторского уровня. Вскоре к ним на помощь придёт и Сара Коннор, которая теперь превратилась в настоящую охотницу на роботов-убийц.\n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Тим Миллер\n\n***Длительность:***   128 мин.\n\n'),
(187, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 19:00:00', '2020-03-28 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 20:38:26', '2020-03-05 20:38:49', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мег: Монстр глубины', 'Мег: Монстр глубины', 'Глубоководный батискаф, осуществляющий наблюдение в рамках международной программы по изучению подводной жизни, был атакован огромным существом, которое все считали давно вымершим. Неисправный аппарат теперь лежит на дне глубочайшей впадины Тихого океана… с оказавшимся в ловушке экипажем. Их время на исходе. Китайский океанограф-новатор, несмотря на протесты его дочери Суинь, зовет спасателя-подводника Джонаса Тейлора, чтобы тот помог спасти команду и океан от невиданной угрозы – доисторической 23-метровой акулы, мегалодона. Никто и подумать не мог, что много лет назад Тейлор уже сталкивался с этим чудовищным созданием.\n\n***Жанр:***  ужасы, фантастика, боевик, триллер\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Джон Тёртелтауб\n\n***Длительность:***  113 мин.', 'Глубоководный батискаф, осуществляющий наблюдение в рамках международной программы по изучению подводной жизни, был атакован огромным существом, которое все считали давно вымершим. Неисправный аппарат теперь лежит на дне глубочайшей впадины Тихого океана… с оказавшимся в ловушке экипажем. Их время на исходе. Китайский океанограф-новатор, несмотря на протесты его дочери Суинь, зовет спасателя-подводника Джонаса Тейлора, чтобы тот помог спасти команду и океан от невиданной угрозы – доисторической 23-метровой акулы, мегалодона. Никто и подумать не мог, что много лет назад Тейлор уже сталкивался с этим чудовищным созданием.\n\n***Жанр:***  ужасы, фантастика, боевик, триллер\n\n***Страны:***  США, Китай\n\n***Режиссёр:***  Джон Тёртелтауб\n\n***Длительность:***  113 мин.'),
(188, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-29 15:00:00', '2020-03-29 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 20:40:50', '2020-03-05 20:46:22', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Как приручить дракона', 'Как приручить дракона', 'Вы узнаете историю подростка Иккинга, которому не слишком близки традиции его героического племени, много лет ведущего войну с драконами. Мир Иккинга переворачивается с ног на голову, когда он неожиданно встречает дракона Беззубика, который поможет ему и другим викингам увидеть привычный мир с совершенно другой стороны…\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Дин Деблуа, Крис Сандерс\n\n***Длительность:***  98 мин.', 'Вы узнаете историю подростка Иккинга, которому не слишком близки традиции его героического племени, много лет ведущего войну с драконами. Мир Иккинга переворачивается с ног на голову, когда он неожиданно встречает дракона Беззубика, который поможет ему и другим викингам увидеть привычный мир с совершенно другой стороны…\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Дин Деблуа, Крис Сандерс\n\n***Длительность:***  98 мин.'),
(189, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-29 19:00:00', '2020-03-29 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 20:45:09', '2020-03-05 23:41:38', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Малефисента: Владычица тьмы', 'Malefisenta: Tümligiň eýesi', 'Ýetişen şa gyzy Awrora, şazada Filip söz aýdýar. Ýaşlar nikanyň iki patyşalygy birleşdirip, adamlary ýaraşdyrjagyna ynanýar. Emma bu başa barmaýar. Filipiň ene-atasy patyşa Jon we aýaly Ingrit bilen bilelikdäki naharda dawa bolýar. Agşamlyk nahara Awroranyň krestnisasy hem çagyrylýar. Netijede, patyşa jadyly häsiýetli kesele uçraýar, Malifisenta bolsa gaçmaly bolýar. \n\n***Жанр:  ***фэнтези, приключения, семейный\n\n***Страны:  ***США, Великобритания\n\n***Режиссёр:*** Хоаким Роннинг\n\n***Длительность:***  119 мин.', 'Принцесса Аврора выросла, и теперь принц Филип делает ей предложение. Наивные молодые люди уверены, что их брак сможет объединить два королевства и помирить людей с волшебными существами, но не тут-то было. На совместном ужине с родителями Филипа, королём Джоном и королевой Ингрит, куда была приглашена и крёстная Авроры, происходит ссора, в результате чего король слегает с недомоганием явно магического свойства, а Малифисента вынуждена спасаться бегством.\n\n***Жанр:  ***фэнтези, приключения, семейный\n\n***Страны:  ***США, Великобритания\n\n***Режиссёр:*** Хоаким Роннинг\n\n***Длительность:***  119 мин.'),
(190, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-10 11:00:00', '2020-03-10 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 20:58:22', '2020-03-05 20:59:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Хороший динозавр', 'Хороший динозавр', 'Маленький динозавр Арло, который всего боится, потерялся, и чтобы выжить и вернуться домой ему предстоит многому научиться, и преодолеть свои страхи. Компанию ему составит дикий первобытный мальчик, с которым они становятся друзьями и помогают друг другу на их непростом, полном приключений и опасностей пути домой.\n\n***Жанр:***  мультфильм, фэнтези, драма, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Питер Сон\n\n***Длительность:***  93 мин.', 'Маленький динозавр Арло, который всего боится, потерялся, и чтобы выжить и вернуться домой ему предстоит многому научиться, и преодолеть свои страхи. Компанию ему составит дикий первобытный мальчик, с которым они становятся друзьями и помогают друг другу на их непростом, полном приключений и опасностей пути домой.\n\n***Жанр:***  мультфильм, фэнтези, драма, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Питер Сон\n\n***Длительность:***  93 мин.'),
(191, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-10 13:00:00', '2020-03-10 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:00:59', '2020-03-05 21:02:37', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Аисты', 'Aistler', 'Aistler çagalary getirýär... iň bolmanda öň getirýärdi. Indi bolsa olar internet-satuw saýty üçin posylkalary eltmek bilen meşgullanýar. Çapar kärhanasynyň iň gowy aisti Junior beýgelmeli bolanda çaga döredýän maşyny işe girizýär we meýilleşdirilmedik gyzly bolýar. Posylkany bolup geçenler barada başlyk habary bolmazdan öň eltip berjek bolup Junior we dosty, Aistler dagyndaky ýeketäk adam Lutik, çagany ilkinji gezek eltmegi ýüregine düwýär. Olar täsin, başdangeçirmelere baý syýahata ugraýar. Şeýlelikde, maşgalalar doly, aistler bolsa Ýer şaryndaky hakyky wezipesini ýerine ýetirer.\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Даг Свитлэнд, Николас Столлер\n\n***Длительность:***  87 мин.', 'Аисты приносят детей... или, во всяком случае, раньше приносили. Теперь же они занимаются доставкой посылок для огромного сайта интернет-продаж. Джуниор, лучший аист в курьерской компании, должен пойти на повышение, но он случайно активирует машину для создания детей и получает очаровательную, но совершенно незапланированную девочку. Пытаясь доставить эту «посылку» до того, как босс узнает о произошедшем, Джуниор и его подруга Лютик, единственный человек на Горе Аистов, решаются на свою первую доставку ребёнка и отправляются в безумное и насыщенное удивительными открытиями приключение, благодаря которому многие семьи могут стать полными, а аисты – вернуться к своей истинной миссии на Земле.\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Даг Свитлэнд, Ник