(194, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-10 19:00:00', '2020-03-10 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:12:55', '2020-03-05 21:13:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Ангел мой', 'Ангел мой', 'Несколько лет Лиззи не может смириться с потерей дочери, погибшей при пожаре. Но однажды она знакомится с чужой девочкой и принимает ее за своего потерянного ребенка.\n\n***Жанр:***  триллер, драма, детектив\n\n***Страны:***  Австралия, США\n\n***Режиссёр:***  Ким Фаррант\n\n***Длительность:***  98 мин.', 'Несколько лет Лиззи не может смириться с потерей дочери, погибшей при пожаре. Но однажды она знакомится с чужой девочкой и принимает ее за своего потерянного ребенка.\n\n***Жанр:***  триллер, драма, детектив\n\n***Страны:***  Австралия, США\n\n***Режиссёр:***  Ким Фаррант\n\n***Длительность:***  98 мин.'),
(195, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-11 11:00:00', '2020-03-11 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:17:10', '2020-03-05 21:17:39', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Босс-молокосос', 'Босс-молокосос', 'Эта актуальная во все времена история для взрослых и детей рассказывается от лица семилетнего брата новорожденного – фантазера Тима, который ревнует его к родителям. Но главный герой – совсем не простой ребенок, он обладает лидерскими задатками, уже носит деловые костюмы и во всем видит бизнес-задачу. Однажды Тим узнает о готовящемся заговоре, целью которого является уничтожение любви, и организовал его директор компании «Puppy Co». Но одному Тиму не по силам его остановить. Мальчику предстоит объединиться со своим «нелюбимым» братом, чтобы спасти родителей и вернуть порядок на Земле.\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Том МакГрат\n\n***Длительность:***  87 мин.', 'Эта актуальная во все времена история для взрослых и детей рассказывается от лица семилетнего брата новорожденного – фантазера Тима, который ревнует его к родителям. Но главный герой – совсем не простой ребенок, он обладает лидерскими задатками, уже носит деловые костюмы и во всем видит бизнес-задачу. Однажды Тим узнает о готовящемся заговоре, целью которого является уничтожение любви, и организовал его директор компании «Puppy Co». Но одному Тиму не по силам его остановить. Мальчику предстоит объединиться со своим «нелюбимым» братом, чтобы спасти родителей и вернуть порядок на Земле.\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Том МакГрат\n\n***Длительность:***  87 мин.'),
(196, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-11 13:00:00', '2020-03-11 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:19:51', '2020-03-05 21:20:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Миньоны', 'Миньоны', 'Миньоны живут на планете гораздо дольше нас. У них одна навязчивая идея – служить самой Гадкой личности из имеющихся в наличии. Динозавры, фараоны, Дракула, Наполеон – все они оказались недолговечны. И тогда миньоны рванули в Нью-Йорк. Их ждут деньги, власть, роковая суперзлодейка Скарлет Оверкилл и, конечно же, вкуснейшая “банана”! Во всяком случае, так им кажется.\n\n***Жанр:***  мультфильм, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Пьер Коффин, Кайл Балда\n\n***Длительность:*** 91 мин.', 'Миньоны живут на планете гораздо дольше нас. У них одна навязчивая идея – служить самой Гадкой личности из имеющихся в наличии. Динозавры, фараоны, Дракула, Наполеон – все они оказались недолговечны. И тогда миньоны рванули в Нью-Йорк. Их ждут деньги, власть, роковая суперзлодейка Скарлет Оверкилл и, конечно же, вкуснейшая “банана”! Во всяком случае, так им кажется.\n\n***Жанр:***  мультфильм, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Пьер Коффин, Кайл Балда\n\n***Длительность:*** 91 мин.'),
