(198, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-11 17:00:00', '2020-03-11 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:25:03', '2020-03-05 21:25:28', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Овердрайв', 'Овердрайв', 'Эндрю и Гаретт Фостеры – братья-авантюристы, промышляющие угоном самых редких и роскошных автомобилей. До сих пор им легко удавалось избегать неприятностей, но во время очередного дела они попадают под прицел жестокого криминального босса. Теперь в обмен на свои жизни они должны украсть для него самый ценный автомобиль его злейшего врага.\n\n***Жанр:***  боевик, триллер\n\n***Страны:***  Франция, Бельгия, США\n\n***Режиссёр:***  Антонио Негрет\n\n***Длительность:***  93 мин.', 'Эндрю и Гаретт Фостеры – братья-авантюристы, промышляющие угоном самых редких и роскошных автомобилей. До сих пор им легко удавалось избегать неприятностей, но во время очередного дела они попадают под прицел жестокого криминального босса. Теперь в обмен на свои жизни они должны украсть для него самый ценный автомобиль его злейшего врага.\n\n***Жанр:***  боевик, триллер\n\n***Страны:***  Франция, Бельгия, США\n\n***Режиссёр:***  Антонио Негрет\n\n***Длительность:***  93 мин.'),
