(201, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-12 11:00:00', '2020-03-12 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:32:18', '2020-03-05 21:32:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Принцесса-русалка', 'Принцесса-русалка', 'На-ён - девушка, работающая на почте и уставшая от своих серых будней. Каждый день одно и то же: бранящаяся мать и ничего не делающий отец. На-ён терпеть не может своих родителей и считает, что их и родителями-то назвать нельзя. Единственная радость для неё - предстоящая поездка в Новую Зеландию. Но неожиданно девушка узнаёт, что её отец уже давно болен. Ни с того ни сего он увольняется с работы и куда-то уезжает. На-ён очень хочется поехать в путешествие, но она не может перестать думать о том, что где-то за её отцом даже некому ухаживать. Итак, ей приходится оставить свою мечту.\n\n***Жанр:***  фэнтези, драма\n\n***Страна:***  Республика Корея\n\n***Режиссёр:***  Пак Хын-щик\n\n***Длительность:***  110 мин.', 'На-ён - девушка, работающая на почте и уставшая от своих серых будней. Каждый день одно и то же: бранящаяся мать и ничего не делающий отец. На-ён терпеть не может своих родителей и считает, что их и родителями-то назвать нельзя. Единственная радость для неё - предстоящая поездка в Новую Зеландию. Но неожиданно девушка узнаёт, что её отец уже давно болен. Ни с того ни сего он увольняется с работы и куда-то уезжает. На-ён очень хочется поехать в путешествие, но она не может перестать думать о том, что где-то за её отцом даже некому ухаживать. Итак, ей приходится оставить свою мечту.\n\n***Жанр:***  фэнтези, драма\n\n***Страна:***  Республика Корея\n\n***Режиссёр:***  Пак Хын-щик\n\n***Длительность:***  110 мин.'),
(202, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-12 13:00:00', '2020-03-12 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:37:53', '2020-03-05 21:38:20', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Рататуй', 'Рататуй', 'Крыс Реми обладает уникальным вкусом. Он готов рисковать собственной жизнью, чтобы посмотреть любимое кулинарное шоу и раздобыть какую-нибудь приправку или просто свежий продукт. Реми живет со своими сородичами, которые его не понимают и не принимают его увлечения кулинарией. Когда Реми случайно попадает на кухню шикарного ресторана, он решает воспользоваться выпавшим ему шансом и проверить свои навыки. На эту же кухню попадает и юный Лингвини. Всё, на что он может расчитывать - это должность уборщика. Но он тоже получает свой шанс...\n\n***Жанр: *** мультфильм, фэнтези, драма, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Брэд Бёрд, Ян Пинкава\n\n***Длительность:***  111 мин.', 'Крыс Реми обладает уникальным вкусом. Он готов рисковать собственной жизнью, чтобы посмотреть любимое кулинарное шоу и раздобыть какую-нибудь приправку или просто свежий продукт. Реми живет со своими сородичами, которые его не понимают и не принимают его увлечения кулинарией. Когда Реми случайно попадает на кухню шикарного ресторана, он решает воспользоваться выпавшим ему шансом и проверить свои навыки. На эту же кухню попадает и юный Лингвини. Всё, на что он может расчитывать - это должность уборщика. Но он тоже получает свой шанс...\n\n***Жанр: *** мультфильм, фэнтези, драма, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Брэд Бёрд, Ян Пинкава\n\n***Длительность:***  111 мин.'),
(203, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-12 15:00:00', '2020-03-12 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:40:07', '2020-03-05 21:40:31', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Жмот', 'Жмот', 'Франсуа Готье — виртуозный скрипач. Но за талант, как водится, надо платить. У музыканта серьезный недостаток: он невероятно скуп. Мания экономить превращает его в одержимого, а любой платеж ввергает в панический ужас. Но однажды его жизнь резко меняется.\n\n***Жанр:*** комедия\n\n***Страна:*** Франция\n\n***Режиссёр:***  Фред Кавайе\n\n***Длительность:***  89 мин.', 'Франсуа Готье — виртуозный скрипач. Но за талант, как водится, надо платить. У музыканта серьезный недостаток: он невероятно скуп. Мания экономить превращает его в одержимого, а любой платеж ввергает в панический ужас. Но однажды его жизнь резко меняется.\n\n***Жанр:*** комедия\n\n***Страна:*** Франция\n\n***Режиссёр:***  Фред Кавайе\n\n***Длительность:***  89 мин.'),
(204, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-12 17:00:00', '2020-03-12 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:43:11', '2020-03-05 21:43:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Зачётный препод', 'Зачётный препод', 'Незадачливый грабитель банков Зеки Мюллер после тринадцати месяцев отсидки выходит из тюрьмы. Он отправляется на поиски награбленной добычи, которая была спрятана на стройке. Вместе с подружкой они думали, что там идёт всего-навсего прокладка труб. Каково же удивление горе-грабителя, когда он обнаруживает на нужном месте новенький школьный спортзал! Чтобы добраться до награбленного, Зеки пытается устроиться на место школьного сторожа. Но в результате лёгкого недопонимания вместо этого его берут в качестве учителя на замену. Ему достаётся самый буйный и ненормальный класс во всей школе — 10 «Б». Используя несколько необычные методы, бывший грабитель неожиданно находит общий язык с учениками...\n\n***Жанр:***  комедия\n\n***Страна:***  Германия\n\n***Режиссёр:***  Бора Дагтекин\n\n***Длительность:***  119 мин.', 'Незадачливый грабитель банков Зеки Мюллер после тринадцати месяцев отсидки выходит из тюрьмы. Он отправляется на поиски награбленной добычи, которая была спрятана на стройке. Вместе с подружкой они думали, что там идёт всего-навсего прокладка труб. Каково же удивление горе-грабителя, когда он обнаруживает на нужном месте новенький школьный спортзал! Чтобы добраться до награбленного, Зеки пытается устроиться на место школьного сторожа. Но в результате лёгкого недопонимания вместо этого его берут в качестве учителя на замену. Ему достаётся самый буйный и ненормальный класс во всей школе — 10 «Б». Используя несколько необычные методы, бывший грабитель неожиданно находит общий язык с учениками...\n\n***Жанр:***  комедия\n\n***Страна:***  Германия\n\n***Режиссёр:***  Бора Дагтекин\n\n***Длительность:***  119 мин.'),
(205, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-12 19:00:00', '2020-03-12 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:48:59', '2020-03-05 21:49:34', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Вместо нас двоих', 'Вместо нас двоих', 'В одном посёлке молодая девушка по имени Чичек живёт жизнью, которую навязала ей семья. Но однажды она влюбляется в таинственного учителя литературы Догана, приехавшего в их края. Да и сам Доган, как ни сопротивляется запретной любви, не может выбросить Чичек из головы. Эта чувство двух людей друг к другу изменит их и повлияет на судьбу целой семьи.\n\n***Жанр:***  мелодрама\n\n***Страна:***  Турция\n\n***Режиссёр:***  Умур Турагай\n\n***Длительность:***  126 мин.', 'В одном посёлке молодая девушка по имени Чичек живёт жизнью, которую навязала ей семья. Но однажды она влюбляется в таинственного учителя литературы Догана, приехавшего в их края. Да и сам Доган, как ни сопротивляется запретной любви, не может выбросить Чичек из головы. Эта чувство двух людей друг к другу изменит их и повлияет на судьбу целой семьи.\n\n***Жанр:***  мелодрама\n\n***Страна:***  Турция\n\n***Режиссёр:***  Умур Турагай\n\n***Длительность:***  126 мин.'),
(206, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-13 11:00:00', '2020-03-13 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:55:35', '2020-03-05 21:56:10', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Ральф против интернета', 'Ральф против интернета', 'На этот раз Ральф и Ванилопа фон Кекс выйдут за пределы зала игровых автоматов и отправятся покорять бескрайние просторы интернета, который может и не выдержать сокрушительного обаяния громилы.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный, фантастика\n\n***Страна:***  США\n\n***Режиссёры:*** Фил Джонстон, Рич Мур\n\n***Длительность:***  112 мин.', 'На этот раз Ральф и Ванилопа фон Кекс выйдут за пределы зала игровых автоматов и отправятся покорять бескрайние просторы интернета, который может и не выдержать сокрушительного обаяния громилы.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный, фантастика\n\n***Страна:***  США\n\n***Режиссёры:*** Фил Джонстон, Рич Мур\n\n***Длительность:***  112 мин.'),
(207, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-13 13:00:00', '2020-03-13 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 21:58:29', '2020-03-05 21:58:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Хранители снов', 'Хранители снов', 'Когда злой дух Кромешник посягает на самое дорогое – детские мечты, Северянин, Ледяной Джек, Кролик, Зубная Фея и Песочный Человек впервые объединяются, чтобы создать команду Хранителей снов...\n\n***Жанр:***  мультфильм, фэнтези, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Питер Рэмси\n\n***Длительность:***  97 мин.', 'Когда злой дух Кромешник посягает на самое дорогое – детские мечты, Северянин, Ледяной Джек, Кролик, Зубная Фея и Песочный Человек впервые объединяются, чтобы создать команду Хранителей снов...\n\n***Жанр:***  мультфильм, фэнтези, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Питер Рэмси\n\n***Длительность:***  97 мин.'),
(208, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-13 15:00:00', '2020-03-13 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 22:00:44', '2020-03-05 22:01:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Спасатели Малибу', 'Спасатели Малибу', 'Группа пляжных спасателей работает на побережье Тихого океана. Они всегда находятся на своем посту и охраняют отдыхающих от несчастных случаев на воде. Главный герой, опытный спасатель Митч Бьюкеннон, и его молодой коллега Мэтт Броди случайно узнают, что их пляж находится под угрозой исчезновения. Хозяйка пафосного ночного клуба, по совместительству местный «наркобарон», пытается прибрать побережье к рукам. Дамочка скупает всю недвижимость, не гнушаясь запугиваниями и убийствами владельцев земельных участков.\n\n***Жанр:***  боевик, комедия, преступление\n\n***Страны:***  Великобритания, Китай, США\n\n***Режиссёр:***  Сет Гордон\n\n***Длительность:***  116 мин.', 'Группа пляжных спасателей работает на побережье Тихого океана. Они всегда находятся на своем посту и охраняют отдыхающих от несчастных случаев на воде. Главный герой, опытный спасатель Митч Бьюкеннон, и его молодой коллега Мэтт Броди случайно узнают, что их пляж находится под угрозой исчезновения. Хозяйка пафосного ночного клуба, по совместительству местный «наркобарон», пытается прибрать побережье к рукам. Дамочка скупает всю недвижимость, не гнушаясь запугиваниями и убийствами владельцев земельных участков.\n\n***Жанр:***  боевик, комедия, преступление\n\n***Страны:***  Великобритания, Китай, США\n\n***Режиссёр:***  Сет Гордон\n\n***Длительность:***  116 мин.'),
(209, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-13 17:00:00', '2020-03-13 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 22:02:45', '2020-03-05 22:03:08', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, '5-я волна', '5-я волна', 'Первая волна оставила за собой мглу. От второй успели убежать только самые везучие. Но едва ли можно назвать везучими тех, кто уцелел после третьей. А четвертая волна стерла все человеческие законы, взамен же установила свой, один-единственный: хочешь жить — не верь никому. И вот уже накатывает пятая волна…\n\n***Жанр:***  фантастика, фэнтези, боевик, триллер, драма, приключения\n\n***Страны:***  США, Великобритания\n\n***Режиссёр:***  Дж. Блэйксон\n\n***Длительность:***  112 мин.', 'Первая волна оставила за собой мглу. От второй успели убежать только самые везучие. Но едва ли можно назвать везучими тех, кто уцелел после третьей. А четвертая волна стерла все человеческие законы, взамен же установила свой, один-единственный: хочешь жить — не верь никому. И вот уже накатывает пятая волна…\n\n***Жанр:***  фантастика, фэнтези, боевик, триллер, драма, приключения\n\n***Страны:***  США, Великобритания\n\n***Режиссёр:***  Дж. Блэйксон\n\n***Длительность:***  112 мин.'),
(210, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-13 19:00:00', '2020-03-13 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 22:06:36', '2020-03-05 22:06:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Комната желаний', 'Комната желаний', 'Влюбленная пара Кэйт и Мэтт переезжает в уединенный особняк. Занимаясь ремонтом старого дома, они обнаруживают замурованную комнату, которая, как выясняется, исполняет любые желания. Миллионы долларов, подлинник Ван Гога, самые роскошные наряды и украшения – что бы супруги ни захотели, моментально материализуется. Наигравшись вдоволь, Кэйт осмеливается пожелать себе долгожданного ребенка, даже не подозревая, к каким последствиям это может привести.\n\n***Жанр:***  триллер, фантастика, драма\n\n***Страны:***  Франция, Люксембург, Бельгия\n\n***Режиссёр:***  Кристиан Волькман\n\n***Длительность:***  100 мин.', 'Влюбленная пара Кэйт и Мэтт переезжает в уединенный особняк. Занимаясь ремонтом старого дома, они обнаруживают замурованную комнату, которая, как выясняется, исполняет любые желания. Миллионы долларов, подлинник Ван Гога, самые роскошные наряды и украшения – что бы супруги ни захотели, моментально материализуется. Наигравшись вдоволь, Кэйт осмеливается пожелать себе долгожданного ребенка, даже не подозревая, к каким последствиям это может привести.\n\n***Жанр:***  триллер, фантастика, драма\n\n***Страны:***  Франция, Люксембург, Бельгия\n\n***Режиссёр:***  Кристиан Волькман\n\n***Длительность:***  100 мин.'),
(211, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-14 11:00:00', '2020-03-14 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 22:09:23', '2020-03-05 22:10:28', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Фердинанд', 'Фердинанд', 'Фердинанд – самый добродушный бык во всей Испании. Несмотря на внушительные размеры и недюжинную силу, он с детства предпочитал сидеть на лужайке и любоваться цветами вместо того, чтобы бодаться с другими быками. По нелепой случайности Фердинанд был выбран среди других соплеменников для участия в бое быков в Мадриде. Фердинанду предстоит отстоять свои миролюбивые убеждения и напомнить нам о том, что даже перед лицом трудностей главное – остаться собой. Ведь только так и можно изменить мир вокруг.\n\n***Жанр:***  семейный, комедия, мультфильм\n\n***Страны:***  США, Испания\n\n***Режиссёр:***  Карлос Салдана\n\n***Длительность:***  108 мин.', 'Фердинанд – самый добродушный бык во всей Испании. Несмотря на внушительные размеры и недюжинную силу, он с детства предпочитал сидеть на лужайке и любоваться цветами вместо того, чтобы бодаться с другими быками. По нелепой случайности Фердинанд был выбран среди других соплеменников для участия в бое быков в Мадриде. Фердинанду предстоит отстоять свои миролюбивые убеждения и напомнить нам о том, что даже перед лицом трудностей главное – остаться собой. Ведь только так и можно изменить мир вокруг.\n\n***Жанр:***  семейный, комедия, мультфильм\n\n***Страны:***  США, Испания\n\n***Режиссёр:***  Карлос Салдана\n\n***Длительность:***  108 мин.'),
