(219, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-15 17:00:00', '2020-03-15 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 22:33:37', '2020-03-05 22:34:00', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Страшные истории для рассказа в темноте', 'Страшные истории для рассказа в темноте', 'Хэллоуин 1968 года. Старшеклассница Стелла, большая любительница страшных историй, и двое её друзей наряжаются в нелепые костюмы и идут гулять. Так получается, что ребята выводят из себя школьного задиру и хулигана Томми и, спасаясь от него, знакомятся с неместным парнем Рамоном, а после отправляются в старинный заброшенный особняк. Дом принадлежал семье Бэллоуз, все члены которой загадочно исчезли почти 100 лет назад, а про дочь семейства Сару до сих пор ходят жуткие легенды - якобы она может убивать, рассказывая истории. Друзья находят потайную комнату, и Стелла забирает домой книгу, где Сара писала свои рассказы, и на страницах которой этим же вечером появится новый, а хулиган Томми исчезнет без следа.\n\n***Жанр:***  ужасы, триллер\n\n***Страны:***  США, Канада\n\n***Режиссёр:***  Андре Овредал\n\n***Длительность:***  108 мин.', 'Хэллоуин 1968 года. Старшеклассница Стелла, большая любительница страшных историй, и двое её друзей наряжаются в нелепые костюмы и идут гулять. Так получается, что ребята выводят из себя школьного задиру и хулигана Томми и, спасаясь от него, знакомятся с неместным парнем Рамоном, а после отправляются в старинный заброшенный особняк. Дом принадлежал семье Бэллоуз, все члены которой загадочно исчезли почти 100 лет назад, а про дочь семейства Сару до сих пор ходят жуткие легенды - якобы она может убивать, рассказывая истории. Друзья находят потайную комнату, и Стелла забирает домой книгу, где Сара писала свои рассказы, и на страницах которой этим же вечером появится новый, а 