(220, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-15 19:00:00', '2020-03-15 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-05 22:36:03', '2020-03-05 22:36:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Ты, мой дом', 'Ты, мой дом', 'Лейла вернулась в дом отца после предательства от любимого. Ее сердце разбито. С отцом у нее с детства были сложные отношения. Они пытаются решить свои проблемы. Искандер жил тяжелой жизнью. Он вырос в детском доме. Столкнувшись с неожиданным чувством любви, их отношения стали попыткой найти то, что они ищут.\n\n***Жанр:***  драма, мелодрама\n\n***Страна:***  Турция\n\n***Режиссёр:***  Озджан Дениз\n\n***Длительность:***  105 мин.', 'Лейла вернулась в дом отца после предательства от любимого. Ее сердце разбито. С отцом у нее с детства были сложные отношения. Они пытаются решить свои проблемы. Искандер жил тяжелой жизнью. Он вырос в детском доме. Столкнувшись с неожиданным чувством любви, их отношения стали попыткой найти то, что они ищут.\n\n***Жанр:***  драма, мелодрама\n\n***Страна:***  Турция\n\n***Режиссёр:***  Озджан Дениз\n\n***Длительность:***  105 мин.'),
