(224, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-17 17:00:00', '2020-03-17 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 14:56:13', '2020-03-06 14:56:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Офелия', 'Офелия', 'Темные времена настали в королевстве. Правитель мертв, а его трон занял самозванец и убийца. Гамлет, законный наследник престола, клянется отомстить за отца. Сердце принца способна смягчить лишь прекрасная Офелия. Ради него она готова оставить двор и пойти против тирана. Но cмогут ли их чувства преодолеть саму смерть?\n\n***Жанр:***  мелодрама, история\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:***  Клэр Маккарти\n\n***Длительность:***  114 мин.', 'Темные времена настали в королевстве. Правитель мертв, а его трон занял самозванец и убийца. Гамлет, законный наследник престола, клянется отомстить за отца. Сердце принца способна смягчить лишь прекрасная Офелия. Ради него она готова оставить двор и пойти против тирана. Но cмогут ли их чувства преодолеть саму смерть?\n\n***Жанр:***  мелодрама, история\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:***  Клэр Маккарти\n\n***Длительность:***  114 мин.'),
