(227, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-18 13:00:00', '2020-03-18 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:06:20', '2020-03-06 15:06:41', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Делай ноги', 'Делай ноги', 'В музыкальном мире императорских пингвинов, которые находят себе пару благодаря пению, рождается пингвинёнок по имени Мамбл, который не может издать ни одной ноты… зато может отплясывать ту ещё чечетку. Его родители, Норма Джин и Мемфис, в отчаянии, но надеются, что их лишённый музыкального слуха малыш перерастёт своё нелепое танцевальное увлечение. Однако пытаясь пропеть хоть какую-то мелодию, он не может перестать отбивать чечётку даже ради того, чтобы завоевать любовь своей возлюбленной Глории.\n\n***Жанр:***мультфильм, мюзикл, мелодрама, комедия, приключения, семейный, музыка\n\n***Страны:***  США, Австралия\n\n***Режиссёры:***  Уоррен Коулмэн, Джордж Миллер, Джуди Моррис\n\n***Длительность:***  104 мин.', 'В музыкальном мире императорских пингвинов, которые находят себе пару благодаря пению, рождается пингвинёнок по имени Мамбл, который не может издать ни одной ноты… зато может отплясывать ту ещё чечетку. Его родители, Норма Джин и Мемфис, в отчаянии, но надеются, что их лишённый музыкального слуха малыш перерастёт своё нелепое танцевальное увлечение. Однако пытаясь пропеть хоть какую-то мелодию, он не может перестать отбивать чечётку даже ради того, чтобы завоевать любовь своей возлюбленной Глории.\n\n***Жанр:***мультфильм, мюзикл, мелодрама, комедия, приключения, семейный, музыка\n\n***Страны:***  США, Австралия\n\n***Режиссёры:***  Уоррен Коулмэн, Джордж Миллер, Джуди Моррис\n\n***Длительность:***  104 мин.'),
