(231, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-19 13:00:00', '2020-03-19 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:20:09', '2020-03-06 15:20:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Дозор джунглей', 'Дозор джунглей', 'Пингвин Морис тигрового окраса уверен, что он и в самом деле тигр – герой, в котором нуждаются джунгли. Вместе со своей энергичной командой разношерстных животных под названием «Дозор джунглей» он неусыпно стоит на страже справедливости и покоя. С переменным успехом, конечно, но они стараются. Однако вскоре ему предстоит столкнуться с невероятно коварным и безжалостным врагом – коалой Игорем и его армией туповатых бабуинов...\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  Франция\n\n***Режиссёр:***  Давид Ало\n\n***Длительность:***  97 мин.', 'Пингвин Морис тигрового окраса уверен, что он и в самом деле тигр – герой, в котором нуждаются джунгли. Вместе со своей энергичной командой разношерстных животных под названием «Дозор джунглей» он неусыпно стоит на страже справедливости и покоя. С переменным успехом, конечно, но они стараются. Однако вскоре ему предстоит столкнуться с невероятно коварным и безжалостным врагом – коалой Игорем и его армией туповатых бабуинов...\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  Франция\n\n***Режиссёр:***  Давид Ало\n\n***Длительность:***  97 мин.'),
(232, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-19 15:00:00', '2020-03-19 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:25:10', '2020-03-06 15:25:28', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мир Юрского периода', 'Мир Юрского периода', 'Тысячи людей спешат увидеть Мир Юрского периода, но безопасное на первый взгляд развлечение может обернуться угрозой для жизни.\n\n***Жанр:***  фантастика, приключения, боевик\n\n***Страна:***  США\n\n***Режиссёр:***  Колин Треворроу\n\n***Длительность:***  125 мин.', 'Тысячи людей спешат увидеть Мир Юрского периода, но безопасное на первый взгляд развлечение может обернуться угрозой для жизни.\n\n***Жанр:***  фантастика, приключения, боевик\n\n***Страна:***  США\n\n***Режиссёр:***  Колин Треворроу\n\n***Длительность:***  125 мин.'),
(233, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-19 17:00:00', '2020-03-19 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:27:21', '2020-03-06 15:27:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Шпион', 'Шпион', 'Сьюзан Купер всю свою жизнь мечтала стать секретным агентом и даже устроилась работать в ЦРУ. Однако, дальше сотрудника самой низкой ступени ей так и не удалось продвинуться. Понимая, что осуществить свою мечту практически невозможно, она все-таки продолжает надеяться на лучшее и с нетерпением ожидает своего шанса. И вскоре судьба дарит ей такую возможность. Лучший агент проваливает секретное задание, в ходе которого он должен был выяснить местонахождение ядерной бомбы, но, совершенно случайно, застрелил единственного человека, владеющего этой информацией. Через некоторое время службе разведки становится известно, что Рейна Боянова знает, где находится бомба, но она также знает в лицо всех секретных агентов ЦРУ...\n\n***Жанр:***  боевик, комедия, преступление\n\n***Страны:***  США, Великобритания, Франция, Венгрия, Германия\n\n***Режиссёр:***  Пол Фиг\n\n***Длительность:***  119 мин.', 'Сьюзан Купер всю свою жизнь мечтала стать секретным агентом и даже устроилась работать в ЦРУ. Однако, дальше сотрудника самой низкой ступени ей так и не удалось продвинуться. Понимая, что осуществить свою мечту практически невозможно, она все-таки продолжает надеяться на лучшее и с нетерпением ожидает своего шанса. И вскоре судьба дарит ей такую возможность. Лучший агент проваливает секретное задание, в ходе которого он должен был выяснить местонахождение ядерной бомбы, но, совершенно случайно, застрелил единственного человека, владеющего этой информацией. Через некоторое время службе разведки становится известно, что Рейна Боянова знает, где находится бомба, но она также знает в лицо всех секретных агентов ЦРУ...\n\n***Жанр:***  боевик, комедия, преступление\n\n***Страны:***  США, Великобритания, Франция, Венгрия, Германия\n\n***Режиссёр:***  Пол Фиг\n\n***Длительность:***  119 мин.');
