(234, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-19 19:00:00', '2020-03-19 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:29:45', '2020-03-06 15:30:07', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Пиксели', 'Пиксели', 'Очередное вторжение инопланетян на Землю... Вы скажете: «Что может быть банальнее?!». Да, если бы на этот раз они не предстали в виде героев вселенски популярных компьютерных игр. Сражаться с пришельцами призвана команда бывших геймеров, в числе которых: Президент Соединенных Штатов Америки; карлик-зэк, большой ценитель прекрасного пола; зануда-параноик, свято верящий в теорию вселенского заговора; профессиональный неудачник и циник, в детстве подававший большие надежды. А помогает новоиспеченным героям очаровательная ученая фея.\n\n***Жанр:***  фантастика, боевик, комедия\n\n***Страны:***  США, Китай, Канада\n\n***Режиссёр:***  Крис Коламбус\n\n***Длительность:***  106 мин.', 'Очередное вторжение инопланетян на Землю... Вы скажете: «Что может быть банальнее?!». Да, если бы на этот раз они не предстали в виде героев вселенски популярных компьютерных игр. Сражаться с пришельцами призвана команда бывших геймеров, в числе которых: Президент Соединенных Штатов Америки; карлик-зэк, большой ценитель прекрасного пола; зануда-параноик, свято верящий в теорию вселенского заговора; профессиональный неудачник и циник, в детстве подававший большие надежды. А помогает новоиспеченным героям очаровательная ученая фея.\n\n***Жанр:***  фантастика, боевик, комедия\n\n***Страны:***  США, Китай, Канада\n\n***Режиссёр:***  Крис Коламбус\n\n***Длительность:***  106 мин.'),
(235, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-20 11:00:00', '2020-03-20 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:34:07', '2020-03-06 15:35:07', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Зверополис', 'Зверополис', 'Добро пожаловать в Зверополис – современный город, населенный самыми разными животными, от огромных слонов до крошечных мышек. Зверополис разделен на районы, полностью повторяющие естественную среду обитания разных жителей – здесь есть и элитный район Площадь Сахары и неприветливый Тундратаун. В этом городе появляется новый офицер полиции, жизнерадостная зайчиха Джуди Хоппс, которая с первых дней работы понимает, как сложно быть маленькой и пушистой среди больших и сильных полицейских. Джуди хватается за первую же возможность проявить себя, несмотря на то, что ее партнером будет болтливый хитрый лис Ник Уайлд. Вдвоем им предстоит раскрыть сложное дело, от которого будет зависеть судьба всех обитателей Зверополиса.\n\n***Жанр:***  мультфильм, комедия, преступление, детектив, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Рич Мур, Байрон Ховард, Джаред Буш\n\n***Длительность:***  108 мин.', 'Добро пожаловать в Зверополис – современный город, населенный самыми разными животными, от огромных слонов до крошечных мышек. Зверополис разделен на районы, полностью повторяющие естественную среду обитания разных жителей – здесь есть и элитный район Площадь Сахары и неприветливый Тундратаун. В этом городе появляется новый офицер полиции, жизнерадостная зайчиха Джуди Хоппс, которая с первых дней работы понимает, как сложно быть маленькой и пушистой среди больших и сильных полицейских. Джуди хватается за первую же возможность проявить себя, несмотря на то, что ее партнером будет болтливый хитрый лис Ник Уайлд. Вдвоем им предстоит раскрыть сложное дело, от которого будет зависеть судьба всех обитателей Зверополиса.\n\n***Жанр:***  мультфильм, комедия, преступление, детектив, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Рич Мур, Байрон Ховард, Джаред Буш\n\n***Длительность:***  108 мин.'),
(236, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-20 13:00:00', '2020-03-20 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:37:05', '2020-03-06 15:37:29', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Ледниковый период 4: Континентальный дрейф', 'Ледниковый период 4: Континентальный дрейф', 'После приключений под землей прошло семь лет. Случился дрейф континентов. Главные герои мультфильма, отделённые от стада, вынуждены использовать айсберг в качестве плота. Они пересекают океан и попадают в неизвестные им ранее земли с экзотическими животными и пиратами, враждебно настроенными к ним. Скрэту удаётся получить свой жёлудь, но он перемещается в новые для него земли.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Стив Мартино, Майк Тёрмайер\n\n***Длительность:***  88 мин.', 'После приключений под землей прошло семь лет. Случился дрейф континентов. Главные герои мультфильма, отделённые от стада, вынуждены использовать айсберг в качестве плота. Они пересекают океан и попадают в неизвестные им ранее земли с экзотическими животными и пиратами, враждебно настроенными к ним. Скрэту удаётся получить свой жёлудь, но он перемещается в новые для него земли.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Стив Мартино, Майк Тёрмайер\n\n***Длительность:***  88 мин.'),
