(238, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-20 17:00:00', '2020-03-20 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:44:49', '2020-03-06 15:47:03', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Жара', 'Gyzgyn', 'Moskwa, 2016-njy ýylyň tomusynyň gyzgyn güni. Dört sany mekdep dostlar -  gullukdan gelen Alekseý, Londonda okan gurply maşgalanyň ogly Kostýa, ýaş aktýor Artur we reper Timati uzak wagtdan soň duşuşýar. Şu günden soň durmuşlarynyň düýbünden üýtgejeginden entek habarlary ýok. Birnäçe wakalar bolup geçýär: biri söýgüsine duşýar, beýlekisi kärini tapýar, üçünjisi bolsa wajyp soraglara jogap tapýar...\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***   Гигинеишвили Резо\n\n***Длительность:***  95 мин.', 'Москва, жаркий день лета 2006. Четверо школьных друзей – Алексей, вернувшийся из армии, Костя – сын богатых родителей, отучившийся в Лондоне, Артур – начинающий амбициозный актер и рэпер Тимати – встречаются после долгой разлуки. Они еще не подозревают о том, что эта встреча круто изменит жизнь каждого из них… В круговороте столичной жизни сплетаются десятки сюжетов и человеческих судеб: один из приятелей находит свою любовь, другой обретает себя в профессии, третий получает ответы на давно мучившие его вопросы…\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***   Гигинеишвили Резо\n\n***Длительность:***  95 мин.'),
(239, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-20 19:00:00', '2020-03-20 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:49:34', '2020-03-06 15:49:54', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Пункт назначения: Смайл', 'Пункт назначения: Смайл', 'В руки к нелюдимой старшекласснице Бёрд, работающей в антикварном магазине, попадает винтажный фотоаппарат Polaroid. Девушка тут же делает снимок коллеги, а позже подруга вытаскивает её на вечеринку, где все тоже очень любят фотографироваться. В этот же вечер Бёрд узнаёт, что парень из магазина мёртв, а когда погибает и хозяйка вечеринки, Бёрд начинает догадываться, кто умрёт следующим. Дьявольское устройство убивает любого, кто окажется на фотографии, сделанной с его помощью, и теперь группа подростков должна разрешить загадку проклятия, пока фотоаппарат не прикончил их всех.\n\n***Жанр:***  ужасы, триллер, детектив\n\n***Страны:***  США, Норвегия\n\n***Режиссёр:***  Ларс Клевберг\n\n***Длительность:***  88 мин.', 'В руки к нелюдимой старшекласснице Бёрд, работающей в антикварном магазине, попадает винтажный фотоаппарат Polaroid. Девушка тут же делает снимок коллеги, а позже подруга вытаскивает её на вечеринку, где все тоже очень любят фотографироваться. В этот же вечер Бёрд узнаёт, что парень из магазина мёртв, а когда погибает и хозяйка вечеринки, Бёрд начинает догадываться, кто умрёт следующим. Дьявольское устройство убивает любого, кто окажется на фотографии, сделанной с его помощью, и теперь группа подростков должна разрешить загадку проклятия, пока фотоаппарат не прикончил их всех.\n\n***Жанр:***  ужасы, триллер, детектив\n\n***Страны:***  США, Норвегия\n\n***Режиссёр:***  Ларс Клевберг\n\n***Длительность:***  88 мин.'),
(240, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-21 11:00:00', '2020-03-21 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 15:51:36', '2020-03-06 15:52:45', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 5, 9, 3, 'Холодное сердце 2', 'Холодное сердце 2', 'Анна, Эльза, Кристоф, его верный олень Свен и никогда не унывающий снеговик Олаф должны будут покинуть уютное королевство Эренделл и отправиться ещё дальше на север, в путешествие, которое приведет их к истокам древних легенд и поможет раскрыть тайны, касающиеся прошлого их родной страны.\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Дженнифер Ли, Крис Бак\n\n***Длительность:***  103 мин.', 'Анна, Эльза, Кристоф, его верный олень Свен и никогда не унывающий снеговик Олаф должны будут покинуть уютное королевство Эренделл и отправиться ещё дальше на север, в путешествие, которое приведет их к истокам древних легенд и поможет раскрыть тайны, касающиеся прошлого их родной страны.\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Дженнифер Ли, Крис Бак\n\n***Длительность:***  103 мин.'),
