(243, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-21 17:00:00', '2020-03-21 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:00:55', '2020-03-06 16:01:18', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Они', 'Они', 'Лукас и Клементина мирно живут в своем доме, но однажды ночью они просыпаются от странного ужасного звука. Они не одни... Действие происходит в Румынии: Клементина спешит домой, когда по пути ей встречается брошенный у дороги грязный автомобиль. Она не останавливается, а продолжает двигаться в сторону дома, не подозревая, что произошло с людьми в автомобиле — матерью и дочерью-подростком, прошлой ночью. О том, что случилось, она узнает сегодня вечером, когда ее и ее бойфренда Лукаса среди ночи разбудят странные телефонные звонки и внезапно включившийся телевизор… Но это только начало кошмарной ночи террора, когда телефоны перестанут звонить и не будет никакого спасения, потому что их преследуют ОНИ…\n\n***Жанр:***  ужасы, триллер\n\n***Страны:***  Франция, Румыния\n\n***Режиссёры:***  Давид Моро, Ксавьер Палю\n\n***Длительность:***  77 мин.', 'Лукас и Клементина мирно живут в своем доме, но однажды ночью они просыпаются от странного ужасного звука. Они не одни... Действие происходит в Румынии: Клементина спешит домой, когда по пути ей встречается брошенный у дороги грязный автомобиль. Она не останавливается, а продолжает двигаться в сторону дома, не подозревая, что произошло с людьми в автомобиле — матерью и дочерью-подростком, прошлой ночью. О том, что случилось, она узнает сегодня вечером, когда ее и ее бойфренда Лукаса среди ночи разбудят странные телефонные звонки и внезапно включившийся телевизор… Но это только начало кошмарной ночи террора, когда телефоны перестанут звонить и не будет никакого спасения, потому что их преследуют ОНИ…\n\n***Жанр:***  ужасы, триллер\n\n***Страны:***  Франция, Румыния\n\n***Режиссёры:***  Давид Моро, Ксавьер Палю\n\n***Длительность:***  77 мин.'),
(244, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-21 19:00:00', '2020-03-21 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:02:51', '2020-03-06 16:03:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дикий мёд', 'Дикий мёд', 'История страстной любви студентов университета Барыша и Фюсун. Барыш учится на факультете архитектуры в университете. Его хобби - игра на барабанах, от этого и от студенческой жизни он получает огромное удовольствие и наслаждение. Когда парень встречает Фюсун, его душа наполняется чувством, совершенно новым для него, подобного раньше Барыш не испытывал... Он понимает, что в этот раз настоящая любовь вошла в его сердце и в его жизнь. Кто эта девушка? Где она живет? Он должен найти ее, даже не зная имени незнакомки. Барыш ищет и находит, но у Фюсун есть только одно желание - закончить университет с отличием и продолжить обучение в Америке, получив степень магистра. Парень должен как-то добиться ее расположения...\n\n***Жанр:***  драма, мелодрама\n\n***Страна:***  Турция\n\n***Режиссёр:***  Али Билгин\n\n***Длительность:***  117 мин.', 'История страстной любви студентов университета Барыша и Фюсун. Барыш учится на факультете архитектуры в университете. Его хобби - игра на барабанах, от этого и от студенческой жизни он получает огромное удовольствие и наслаждение. Когда парень встречает Фюсун, его душа наполняется чувством, совершенно новым для него, подобного раньше Барыш не испытывал... Он понимает, что в этот раз настоящая любовь вошла в его сердце и в его жизнь. Кто эта девушка? Где она живет? Он должен найти ее, даже не зная имени незнакомки. Барыш ищет и находит, но у Фюсун есть только одно желание - закончить университет с отличием и продолжить обучение в Америке, получив степень магистра. Парень должен как-то добиться ее расположения...\n\n***Жанр:***  драма, мелодрама\n\n***Страна:***  Турция\n\n***Режиссёр:***  Али Билгин\n\n***Длительность:***  117 мин.'),
(245, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 11:00:00', '2020-03-22 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:04:37', '2020-03-06 16:05:01', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Моана', 'Моана', 'Бесстрашная Моана, дочь вождя маленького племени на острове в Тихом океане, больше всего на свете мечтает о приключениях и решает отправиться в опасное морское путешествие. Вместе с некогда могущественным полубогом Мауи им предстоит пересечь океан, сразиться со страшными чудовищами и разрушить древнее заклятие.\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Рон Клементс, Джон Маскер, Дон Холл, Крис Уильямс\n\n***Длительность:***  107 мин.', 'Бесстрашная Моана, дочь вождя маленького племени на острове в Тихом океане, больше всего на свете мечтает о приключениях и решает отправиться в опасное морское путешествие. Вместе с некогда могущественным полубогом Мауи им предстоит пересечь океан, сразиться со страшными чудовищами и разрушить древнее заклятие.\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Рон Клементс, Джон Маскер, Дон Холл, Крис Уильямс\n\n***Длительность:***  107 мин.'),
(246, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 13:00:00', '2020-03-22 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:07:11', '2020-03-06 16:07:51', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Эверест', 'Ewerest', 'Ewerest – professional alpinistleriň basyp almak isleýän beýik dagy. Hatda ýokarky nokadyna goýberilen ekspedisiýalaryň biri pajygaly gutardy. Ýöne bu mert alpinistleri saklanok. Ussat tälimçi Rob Holl, planetanyň iň beýik nokadyna galmak üçin ökde alpinistlerden topar toplaýar. Olaryň ählisi edermenlikden doly, Ewerestiň ýokarysyna ýetmekden bolsa hiç zat saklamaz. Emma dagy boýun egdirseler-de, yzyna sag aman gelip bilermi?\n\n***Жанр:***  боевик, триллер, драма, приключения, биография\n\n***Страны:***  Великобритания, США, Исландия\n\n***Режиссёр:***  Бальтасар Кормакур\n\n***Длительность:***  121 мин.', 'Эверест — великая неприступная гора, покорить вершину которой мечтают многие профессиональные альпинисты. Одна из экспедиций на ее вершину закончилась настоящей трагедией, однако этот факт не останавливает отважных альпинистов. Опытный инструктор Роб Холл, собрав группу из лучших альпинистов, собирается совершить восхождение на самую высокую вершину планеты. Все эти люди полны мужества и отваги и они не остановятся ни перед чем, пока не поднимутся на вершину Эвереста. Но даже если эта гора покорится им, смогут ли они вернуться обратно живыми и невредимыми?\n\n***Жанр:***  боевик, триллер, драма, приключения, биография\n\n***Страны:***  Великобритания, США, Исландия\n\n***Режиссёр:***  Бальтасар Кормакур\n\n***Длительность:***  121 мин.'),
(247, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 15:00:00', '2020-03-22 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:10:13', '2020-03-06 16:15:30', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, '13 часов: Тайные солдаты Бенгази', '13 часов: Тайные солдаты Бенгази', '2012 год. Бенгази, Ливия. Группа террористов решает «отпраздновать» события 11 сентября нападением на американское посольство. Шестерке бойцов из элитного спецотряда приказано вмешаться только в крайнем случае. Но когда под угрозой десятки жизней, долг и совесть берут верх над субординацией. И мужественные солдаты без колебаний вступают в бой с яростной группировкой боевиков. Бой, который для всех шестерых, скорее всего, станет последним.\n\n***Жанр:***  боевик, триллер, драма, военный, история\n\n***Страны:***  Мальта, Марокко, США\n\n***Режиссёр:***  Майкл Бэй\n\n***Длительность:***  144 мин.', '2012 год. Бенгази, Ливия. Группа террористов решает «отпраздновать» события 11 сентября нападением на американское посольство. Шестерке бойцов из элитного спецотряда приказано вмешаться только в крайнем случае. Но когда под угрозой десятки жизней, долг и совесть берут верх над субординацией. И мужественные солдаты без колебаний вступают в бой с яростной группировкой боевиков. Бой, который для всех шестерых, скорее всего, станет последним.\n\n***Жанр:***  боевик, триллер, драма, военный, история\n\n***Страны:***  Мальта, Марокко, США\n\n***Режиссёр:***  Майкл Бэй\n\n***Длительность:***  144 мин.'),
(248, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 17:00:00', '2020-03-22 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:12:19', '2020-03-06 16:14:31', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Изгоняющий дьявола', 'Изгоняющий дьявола', 'В семью известной актрисы приходит беда - ее несовершеннолетняя дочь начинает вести себя неадекватным образом. Мать полагает, что это следствие ее личной трагедии, врачи подозревают психическое заболевание и не в силах поставить диагноз. Специально приглашенный священник подозревает, что девочка одержима дьяволом.\n\n***Жанр:***  ужасы\n\n***Страна:***  США\n\n***Режиссёр:***  Уильям Фридкин\n\n***Длительность:***  122 мин.', 'В семью известной актрисы приходит беда - ее несовершеннолетняя дочь начинает вести себя неадекватным образом. Мать полагает, что это следствие ее личной трагедии, врачи подозревают психическое заболевание и не в силах поставить диагноз. Специально приглашенный священник подозревает, что девочка одержима дьяволом.\n\n***Жанр:***  ужасы\n\n***Страна:***  США\n\n***Режиссёр:***  Уильям Фридкин\n\n***Длительность:***  122 мин.'),
(249, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 19:00:00', '2020-03-22 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 16:13:47', '2020-03-06 16:15:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Дневник памяти', 'Ýat gündeligi', 'Bu dürli sosial gatlakdan bolan Günorta Karolinaly oglan bilen gyzyň gatnaşygynyň taryhy. Noý we Elli bütin tomus bile bolýar, tä ene-atalary, soňra bolsa Ikinji jahan urşy aýyrýança. Uruşdan soň hemme zat üýtgeýär: Elli baý telekeçi bilen durmuş gurýar, Noý bolsa öz ýatlamalary bilen gadymy öýde ýaşaýar. Elli muny ýerli gazetden öwreneninde – Noýy tapyp söýgüsiniň ykbalyny çözmeli diýen netijä gelýär.    \n\n***Жанр:***  драма, мелодрама\n\n***Страна:***  США\n\n***Режиссёр:***  Ник Кассаветис\n\n***Длительность:***  124 мин.', 'Это история отношений юноши и девушки из разных социальных слоев, живших в Южной Каролине. Ной и Элли провели вместе незабываемое лето, пока их не разделили вначале родители, а затем Вторая мировая война. После войны все изменилось: Элли обручилась с удачливым бизнесменом, а Ной жил наедине со своими воспоминаниями в старинном доме, который ему удалось отреставрировать. Когда Элли прочла об этом в местной газете, она поняла: ей нужно найти его и решить наконец судьбу их любви...\n\n***Жанр:***  драма, мелодрама\n\n***Страна:***  США\n\n***Режиссёр:***  Ник Кассаветис\n\n***Длительность:***  124 мин.'),
(250, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-24 11:00:00', '2020-03-24 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 19:34:37', '2020-03-06 20:01:07', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'История игрушек', 'История игрушек', 'Каждый ребенок верит, что когда он оставляет свои игрушки одни, они начинают заниматься своими делами. Этот мультипликационный фильм позволяет убедиться им в своей правоте. Основная идея фильма - каждая игрушка боится надоесть, стать забытой, замененной другой, так как весь смысл их существования - доставлять счастье своим хозяевам.\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Джон Лассетер\n\n***Длительность:***  81 мин.', 'Каждый ребенок верит, что когда он оставляет свои игрушки одни, они начинают заниматься своими делами. Этот мультипликационный фильм позволяет убедиться им в своей правоте. Основная идея фильма - каждая игрушка боится надоесть, стать забытой, замененной другой, так как весь смысл их существования - доставлять счастье своим хозяевам.\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Джон Лассетер\n\n***Длительность:***  81 мин.'),
(251, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-24 13:00:00', '2020-03-24 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 19:36:25', '2020-03-06 20:01:26', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Королевский корги', 'Королевский корги', 'Любимая порода собак у очень богатых и влиятельных людей – это корги. Маленькие собачки полностью погружены в жизнь своих больших хозяев. Спасаясь от политических интриг, любимец Британской Королевы вынужден покинуть Букингемский дворец. Теперь ему предстоит не только познакомиться с тайной жизнью улиц Лондона, но и доказать, что он настоящий Королевский Корги…\n\n***Жанр:***  мультфильм, комедия, семейный\n\n***Страны:***  Бельгия, США\n\n***Режиссёры:***  Бен Стассен, Винсент Кестелут\n\n***Длительность:***  85 мин.', 'Любимая порода собак у очень богатых и влиятельных людей – это корги. Маленькие собачки полностью погружены в жизнь своих больших хозяев. Спасаясь от политических интриг, любимец Британской Королевы вынужден покинуть Букингемский дворец. Теперь ему предстоит не только познакомиться с тайной жизнью улиц Лондона, но и доказать, что он настоящий Королевский Корги…\n\n***Жанр:***  мультфильм, комедия, семейный\n\n***Страны:***  Бельгия, США\n\n***Режиссёры:***  Бен Стассен, Винсент Кестелут\n\n***Длительность:***  85 мин.'),
