(253, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-24 17:00:00', '2020-03-24 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 19:58:57', '2020-03-06 20:02:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Любовь от всех болезней', 'Любовь от всех болезней', 'Роман Фобер – чудак и ипохондрик. Он никогда не был женат. Вся его жизнь сводится к тому, чтобы выискивать у себя симптомы страшных, на деле не существующих, болезней. Каждой находкой он стремится поделиться со своим единственным другом – доктором Димитрием Звенкой. Димитрий решает помочь Роману найти женщину и таким образом излечить его от постоянной ипохондрии, которая становится невыносимой.\n\n***Жанр:***  комедия\n\n***Страна:***  Франция\n\n***Режиссёр:***  Дэни Бун\n\n***Длительность:***  107 мин.', 'Роман Фобер – чудак и ипохондрик. Он никогда не был женат. Вся его жизнь сводится к тому, чтобы выискивать у себя симптомы страшных, на деле не существующих, болезней. Каждой находкой он стремится поделиться со своим единственным другом – доктором Димитрием Звенкой. Димитрий решает помочь Роману найти женщину и таким образом излечить его от постоянной ипохондрии, которая становится невыносимой.\n\n***Жанр:***  комедия\n\n***Страна:***  Франция\n\n***Режиссёр:***  Дэни Бун\n\n***Длительность:***  107 мин.'),
(254, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-24 19:00:00', '2020-03-24 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:00:23', '2020-03-06 20:04:41', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Другая женщина', '', 'Любовная связь с женатым мужчиной – это, конечно, не лучший вариант, но вполне допустимый. Гораздо хуже, если у него помимо тебя ещё несколько любовниц. Будучи не в силах смириться с таким положением дел, обманутая женщина жаждет крови и вынашивает план мести. Ради достижения своей цели она объединяется с женой изменника, и этот союз униженных и оскорблённых оказывается для казановы пострашнее атомной войны.\n\n ***Жанр:***   мелодрама, комедия**\n\n***Страна:***  США\n\n***Режиссёр:***  Ник Кассаветис\n\n***Длительность:***  109 мин.', 'Любовная связь с женатым мужчиной – это, конечно, не лучший вариант, но вполне допустимый. Гораздо хуже, если у него помимо тебя ещё несколько любовниц. Будучи не в силах смириться с таким положением дел, обманутая женщина жаждет крови и вынашивает план мести. Ради достижения своей цели она объединяется с женой изменника, и этот союз униженных и оскорблённых оказывается для казановы пострашнее атомной войны.\n\n ***Жанр:***   мелодрама, комедия**\n\n***Страна:***  США\n\n***Режиссёр:***  Ник Кассаветис\n\n***Длительность:***  109 мин.'),
