(258, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-25 17:00:00', '2020-03-25 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:13:43', '2020-03-06 20:17:46', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Переводчик', 'Переводчик', 'Эта история о том, как обыкновенный негероический человек, становится героем. Преподаватель химии Андрей Петрович Стариков - по прозвищу «Чарли Чаплин» - живет с женой и матерью в старом доме-колодце, в котором, как в ковчеге, собрался пестрый интернационал: украинцы, русские, евреи, татары и армяне. Но приход немцев резко меняет их жизнь. Чтобы спасти своих близких, Чарли вынужден служить переводчиком в фашистском штабе.\n\n***Жанр:***  военный, драма\n\n***Страна:***  Россия\n\n***Режиссёр:***  Андрей Прошкин\n\n***Длительность:***  69 мин.', 'Эта история о том, как обыкновенный негероический человек, становится героем. Преподаватель химии Андрей Петрович Стариков - по прозвищу «Чарли Чаплин» - живет с женой и матерью в старом доме-колодце, в котором, как в ковчеге, собрался пестрый интернационал: украинцы, русские, евреи, татары и армяне. Но приход немцев резко меняет их жизнь. Чтобы спасти своих близких, Чарли вынужден служить переводчиком в фашистском штабе.\n\n***Жанр:***  военный, драма\n\n***Страна:***  Россия\n\n***Режиссёр:***  Андрей Прошкин\n\n***Длительность:***  69 мин.'),
(259, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-25 19:00:00', '2020-03-25 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:15:02', '2020-03-06 20:18:00', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Прогулка', 'Прогулка', 'Вы боитесь высоты? А можете представить себя идущим по натянутому канату на высоте более 400м без всякой страховки? Потоки ветра обдувают вас, а внизу - город и тысячи взволнованных взглядов, устремленных вверх. История о том, как французский канатоходец Филипп Пети отважился совершить легендарный трюк - пройти без страховки по канату, натянутому между небоскребами в Нью-Йорке.\n\n***Жанр:***  драма, приключения, биография\n\n***Страна:***  США\n\n***Режиссёр:***  Роберт Земекис\n\n***Длительность:***  123 мин.', 'Вы боитесь высоты? А можете представить себя идущим по натянутому канату на высоте более 400м без всякой страховки? Потоки ветра обдувают вас, а внизу - город и тысячи взволнованных взглядов, устремленных вверх. История о том, как французский канатоходец Филипп Пети отважился совершить легендарный трюк - пройти без страховки по канату, натянутому между небоскребами в Нью-Йорке.\n\n***Жанр:***  драма, приключения, биография\n\n***Страна:***  США\n\n***Режиссёр:***  Роберт Земекис\n\n***Длительность:***  123 мин.'),
(261, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-26 11:00:00', '2020-03-26 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:24:38', '2020-03-06 20:25:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Сила девяти Богов', 'Сила девяти Богов', 'Непроглядная Тьма покрыла некогда процветающее царство Рамптеп. Но есть пророчество, что под созвездием Льва родится человек, который освободит свой народ от ига демонов. На острове Нок-Энн подрастает мальчик, которому предстоит постичь тайну магической силы Камня силы Девяти Богов и овладеть древним боевым искусством муай-тай. Теперь в его руках судьба царства.\n\n***Жанр:***  мультфильм, боевик, приключения, фэнтези\n\n***Страна:***  Таиланд\n\n***Режиссёры:***  Нат Йосватананонт, Понгса Корнсри, Гун Пхансувон\n\n***Длительность:***  105 мин.', 'Непроглядная Тьма покрыла некогда процветающее царство Рамптеп. Но есть пророчество, что под созвездием Льва родится человек, который освободит свой народ от ига демонов. На острове Нок-Энн подрастает мальчик, которому предстоит постичь тайну магической силы Камня силы Девяти Богов и овладеть древним боевым искусством муай-тай. Теперь в его руках судьба царства.\n\n***Жанр:***  мультфильм, боевик, приключения, фэнтези\n\n***Страна:***  Таиланд\n\n***Режиссёры:***  Нат Йосватананонт, Понгса Корнсри, Гун Пхансувон\n\n***Длительность:***  105 мин.'),
(262, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-26 13:00:00', '2020-03-26 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:27:54', '2020-03-06 20:39:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Тайная жизнь домашних животных', 'Тайная жизнь домашних животных', 'Что делают домашние животные, пока хозяева пропадают на работе? С тоской смотрят в окно? Смиренно дремлют на коврике у двери? Как бы не так. Они ведут свою тайную жизнь.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страны:***  Япония, США, Франция\n\n***Режиссёры:***  Крис Рено, Ярроу Чейни\n\n***Длительность:***  87 мин.', 'Что делают домашние животные, пока хозяева пропадают на работе? С тоской смотрят в окно? Смиренно дремлют на коврике у двери? Как бы не так. Они ведут свою тайную жизнь.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страны:***  Япония, США, Франция\n\n***Режиссёры:***  Крис Рено, Ярроу Чейни\n\n***Длительность:***  87 мин.'),
(263, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-26 15:00:00', '2020-03-26 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:35:51', '2020-03-06 20:40:06', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Обратный отсчёт', 'Обратный отсчёт', 'Ровно через 48 часов в Москве прогремит взрыв. Это последняя информация, которую успел передать перед смертью погибший агент. К расследованию подключаются все спецслужбы, но особые надежды возлагают на недавно созданную независимую оперативную группу. В нее входят: юная девушка-хакер, когда-то взломавшая сервер Пентагона; бывший спецназовец, любящий скорость и адреналин; женщина-психолог, чьи внешние достоинства для многих затмевают и ее ум, и ее звание майора; и слепой сапер, которому нюх и интуиция заменяют зрение… И Старший – единственный, сумевший собрать их вместе и научившийся их контролировать. Только эта команда способна, зная КОГДА, вычислить КТО, а главное ГДЕ…\n\n***Жанр:***  боевик, триллер\n\n***Страна:***  Россия\n\n***Режиссёр:***  Шмелев Вадим\n\n***Длительность:***  110 мин.', 'Ровно через 48 часов в Москве прогремит взрыв. Это последняя информация, которую успел передать перед смертью погибший агент. К расследованию подключаются все спецслужбы, но особые надежды возлагают на недавно созданную независимую оперативную группу. В нее входят: юная девушка-хакер, когда-то взломавшая сервер Пентагона; бывший спецназовец, любящий скорость и адреналин; женщина-психолог, чьи внешние достоинства для многих затмевают и ее ум, и ее звание майора; и слепой сапер, которому нюх и интуиция заменяют зрение… И Старший – единственный, сумевший собрать их вместе и научившийся их контролировать. Только эта команда способна, зная КОГДА, вычислить КТО, а главное ГДЕ…\n\n***Жанр:***  боевик, триллер\n\n***Страна:***  Россия\n\n***Режиссёр:***  Шмелев Вадим\n\n***Длительность:***  110 мин.'),
(264, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-26 17:00:00', '2020-03-26 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:37:29', '2020-03-06 20:40:23', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Он и Она', 'Он и Она', 'Виктор — начинающий писатель, Сара — магистр в области классической литературы, их общая слабость — Джойс и Достоевский. Они были свободны и беспечны, но их случайная встреча в баре затянется на долгие 45 лет. Как справятся они с успехом, богатством и банальной скукой? Кто получит все, а кто останется в тени? История одной семьи, большой любви, на фоне переполненных солнцем бульваров Парижа.\n\n***Жанр:***  мелодрама, комедия\n\n***Страны:***  Франция, Бельгия\n\n***Режиссёр:***  Николя Бедос\n\n***Длительность:***  120 мин.', 'Виктор — начинающий писатель, Сара — магистр в области классической литературы, их общая слабость — Джойс и Достоевский. Они были свободны и беспечны, но их случайная встреча в баре затянется на долгие 45 лет. Как справятся они с успехом, богатством и банальной скукой? Кто получит все, а кто останется в тени? История одной семьи, большой любви, на фоне переполненных солнцем бульваров Парижа.\n\n***Жанр:***  мелодрама, комедия\n\n***Страны:***  Франция, Бельгия\n\n***Режиссёр:***  Николя Бедос\n\n***Длительность:***  120 мин.');
