(265, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-26 19:00:00', '2020-03-26 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:39:21', '2020-03-06 20:40:48', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Страна чудес', 'Страна чудес', 'Герои фильма — жители самых разных уголков нашей страны, самые обычные люди, с которыми случаются самые необычные вещи, просто чудеса какие-то. Семье пожарных Семёну и Любе из Костромы выпадает шанс осуществить заветную мечту: поехать в Москву на любимую программу «Поле Чудес», где им предстоит сделать выбор всей жизни «приз или деньги?». Неопытный ППСник, но опытный неудачник Саня должен не только пережить свой первый день в патруле, но ещё принять роды у своей жены и реанимировать своего напарника. Четвёрка новоиспечённых приятелей должна во что бы то ни стало в нелётную погоду улететь в Москву, а пара юных влюблённых каким-то непостижимым способом - примирить своих непримиримых родителей...\n\n***Жанр:***  комедия, фантастика\n\n***Страна:***  Россия\n\n***Режиссёры:***  Дмитрий Дьяченко, Максим Свешников\n\n***Длительность:***  80 мин.', 'Герои фильма — жители самых разных уголков нашей страны, самые обычные люди, с которыми случаются самые необычные вещи, просто чудеса какие-то. Семье пожарных Семёну и Любе из Костромы выпадает шанс осуществить заветную мечту: поехать в Москву на любимую программу «Поле Чудес», где им предстоит сделать выбор всей жизни «приз или деньги?». Неопытный ППСник, но опытный неудачник Саня должен не только пережить свой первый день в патруле, но ещё принять роды у своей жены и реанимировать своего напарника. Четвёрка новоиспечённых приятелей должна во что бы то ни стало в нелётную погоду улететь в Москву, а пара юных влюблённых каким-то непостижимым способом - примирить своих непримиримых родителей...\n\n***Жанр:***  комедия, фантастика\n\n***Страна:***  Россия\n\n***Режиссёры:***  Дмитрий Дьяченко, Максим Свешников\n\n***Длительность:***  80 мин.'),
(266, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-27 11:00:00', '2020-03-27 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:44:31', '2020-03-06 20:57:26', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Человек-паук: Возвращение домой', 'Человек-паук: Возвращение домой', 'После исторической встречи с командой Мстителей Питер Паркер возвращается домой, стараясь зажить обычной жизнью под опекой своей тёти Мэй. Но теперь за Питером приглядывает ещё кое-что… Тони Старк видел Человека-Паука в деле и должен стать его наставником. Когда новый злодей Стервятник угрожает уничтожить всё, что дорого Питеру, приходит время доказать всем, что такое настоящий супергерой.\n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Джон Уоттс\n\n***Длительность:***  133 мин.', 'После исторической встречи с командой Мстителей Питер Паркер возвращается домой, стараясь зажить обычной жизнью под опекой своей тёти Мэй. Но теперь за Питером приглядывает ещё кое-что… Тони Старк видел Человека-Паука в деле и должен стать его наставником. Когда новый злодей Стервятник угрожает уничтожить всё, что дорого Питеру, приходит время доказать всем, что такое настоящий супергерой.\n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Джон Уоттс\n\n***Длительность:***  133 мин.'),
(267, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-27 13:00:00', '2020-03-27 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:46:47', '2020-03-06 20:50:49', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'В поисках Дори', 'Doriniň gözleginde', 'Dori – hoşniýetli gök hirurg-balyk. Ol ýatkeşligindäki kemçiliginden gutulyp,\nmaşgala gurmaga çalyşýar.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Эндрю Стэнтон, Энгус МакЛэйн\n\n***Длительность:***  103 мин.', 'Дори — синяя доброжелательная рыбка-хирург, страдающая провалами в памяти. Она упорно стремится избавиться от своего недуга и найти свою семью.\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Эндрю Стэнтон, Энгус МакЛэйн\n\n***Длительность:***  103 мин.'),
(268, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-27 15:00:00', '2020-03-27 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:48:33', '2020-03-06 20:53:39', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Доктор Сон', 'Доктор Сон', 'Прошло много лет с тех пор, как мальчик с паранормальными способностями Дэнни Торранс пережил кошмарный сезон в отеле «Оверлук», где стал свидетелем безумия и гибели своего отца. Повзрослев, Дэн вёл жизнь маргинала-алкоголика, а теперь пытается завязать и устроился на работу в дом престарелых. Там он безошибочно определяет, кому из постояльцев подошла очередь покинуть этот мир, за что и получил прозвище Доктор Сон. Однажды с Дэном устанавливает связь невероятно одарённая «сияющая» девочка Абра. Вскоре ей потребуется его помощь, чтобы противостоять членам организации «Истинный узел» – группы охотников за особенными детьми.\n\n***Жанр:***  ужасы, фэнтези, триллер, драма\n\n***Страны:***  Великобритания, Канада, США\n\n***Режиссёр:***  Майк Флэнеган\n\n***Длительность:***  152 мин.', 'Прошло много лет с тех пор, как мальчик с паранормальными способностями Дэнни Торранс пережил кошмарный сезон в отеле «Оверлук», где стал свидетелем безумия и гибели своего отца. Повзрослев, Дэн вёл жизнь маргинала-алкоголика, а теперь пытается завязать и устроился на работу в дом престарелых. Там он безошибочно определяет, кому из постояльцев подошла очередь покинуть этот мир, за что и получил прозвище Доктор Сон. Однажды с Дэном устанавливает связь невероятно одарённая «сияющая» девочка Абра. Вскоре ей потребуется его помощь, чтобы противостоять членам организации «Истинный узел» – группы охотников за особенными детьми.\n\n***Жанр:***  ужасы, фэнтези, триллер, драма\n\n***Страны:***  Великобритания, Канада, США\n\n***Режиссёр:***  Майк Флэнеган\n\n***Длительность:***  152 мин.'),
(269, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-27 17:00:00', '2020-03-27 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 20:59:20', '2020-03-06 21:01:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Бабушка лёгкого поведения', 'Бабушка лёгкого поведения', 'Мастер перевоплощений Саня по прозвищу Трансформер провернул кучу афер, точь-в-точь изображая десятки персонажей. Но в этот раз он украл не у тех… Теперь у парня на хвосте очень плохие люди с пистолетами. Саня решает залечь на дно в доме престарелых в образе пожилой тети. И когда ему казалось, что он попал в безвыходную ситуацию, новый поворот судьбы дарит ему любовь и надежду превратиться в приличного человека.\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***  Марюс Вайсберг\n\n***Длительность:***  86 мин.', 'Мастер перевоплощений Саня по прозвищу Трансформер провернул кучу афер, точь-в-точь изображая десятки персонажей. Но в этот раз он украл не у тех… Теперь у парня на хвосте очень плохие люди с пистолетами. Саня решает залечь на дно в доме престарелых в образе пожилой тети. И когда ему казалось, что он попал в безвыходную ситуацию, новый поворот судьбы дарит ему любовь и надежду превратиться в приличного человека.\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***  Марюс Вайсберг\n\n***Длительность:***  86 мин.'),
