(271, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 11:00:00', '2020-03-28 13:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 21:17:52', '2020-03-06 21:20:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Королевские каникулы', 'Королевские каникулы', 'Наследник миллионного состояния и кучки неблагодарных родственников, его псиятельство Принц вышел из зоны комфорта и оказался на улице. Теперь он мечтает вернуться домой. Для этого ему нужно найти новых друзей, избавиться от назойливых белок и сбросить с хвоста матерого охотника. Королевские каникулы начинаются.\n\n***Жанр:***  семейный, комедия, мультфильм\n\n***Страны:***  Канада, США, Острова Кайман\n\n**Режиссёр:**  Кевин Джонсон\n\n***Длительность:***  87 мин.', 'Наследник миллионного состояния и кучки неблагодарных родственников, его псиятельство Принц вышел из зоны комфорта и оказался на улице. Теперь он мечтает вернуться домой. Для этого ему нужно найти новых друзей, избавиться от назойливых белок и сбросить с хвоста матерого охотника. Королевские каникулы начинаются.\n\n***Жанр:***  семейный, комедия, мультфильм\n\n***Страны:***  Канада, США, Острова Кайман\n\n**Режиссёр:**  Кевин Джонсон\n\n***Длительность:***  87 мин.'),
(272, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 13:00:00', '2020-03-06 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 21:20:09', '2020-03-06 21:20:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Пришельцы в доме', 'Пришельцы в доме', 'У 12-летнего Луиса нет друзей, а у его отца постоянно не хватает на него времени. Тот страстно увлечен уфологией и даже не догадывается, что те, кого он так жаждет найти, находятся прямо у него перед носом. Луис становится единственным свидетелем аварийной посадки трех чудаковатых инопланетян рядом с их домом. Троица пришельцев быстро находит общий язык с мальчиком. Они ведут себя точь-в-точь как озорные подростки, и обладают к тому же совершенно удивительной способностью – перевоплощаться в любое живое существо. Луис еще никогда так не веселился, как рядом с ними. Но он быстро понимает, что если взрослые узнают о его тайне, ничем хорошим это не закончится. Поэтому он решает помочь им починить тарелку и улететь вместе с ними…\n\n***Жанр:***  мультфильм, фантастика, комедия, приключения, семейный\n\n***Страны:***  Германия, Люксембург, Дания\n\n***Режиссёры:***  Кристоф Лауэнштайн, Вольфганг Лауэнштайн, Шон МакКормак\n\n***Длительность:***  86 мин.', 'У 12-летнего Луиса нет друзей, а у его отца постоянно не хватает на него времени. Тот страстно увлечен уфологией и даже не догадывается, что те, кого он так жаждет найти, находятся прямо у него перед носом. Луис становится единственным свидетелем аварийной посадки трех чудаковатых инопланетян рядом с их домом. Троица пришельцев быстро находит общий язык с мальчиком. Они ведут себя точь-в-точь как озорные подростки, и обладают к тому же совершенно удивительной способностью – перевоплощаться в любое живое существо. Луис еще никогда так не веселился, как рядом с ними. Но он быстро понимает, что если взро