(273, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 15:00:00', '2020-03-28 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 21:22:36', '2020-03-06 21:24:39', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мотылёк', 'Мотылёк', 'Взломщик сейфов по прозвищу Мотылёк получает пожизненный срок и отправляется на каторгу за убийство, которого он не совершал. Когда вокруг враги, а надежда угасает с каждым днём заключения, лишь сила духа может помочь Мотыльку обрести свободу.\n\n***Жанр:***  драма, преступление, приключения, биография\n\n***Страны:***  Чехия, Испания\n\n***Режиссёр:***  Михаэль Ноер\n\n***Длительность:***  133 мин.', 'Взломщик сейфов по прозвищу Мотылёк получает пожизненный срок и отправляется на каторгу за убийство, которого он не совершал. Когда вокруг враги, а надежда угасает с каждым днём заключения, лишь сила духа может помочь Мотыльку обрести свободу.\n\n***Жанр:***  драма, преступление, приключения, биография\n\n***Страны:***  Чехия, Испания\n\n***Режиссёр:***  Михаэль Ноер\n\n***Длительность:***  133 мин.'),
(274, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-28 17:00:00', '2020-03-28 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 21:26:31', '2020-03-06 22:03:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Комната желаний', 'Комната желаний', 'Влюбленная пара Кэйт и Мэтт переезжает в уединенный особняк. Занимаясь ремонтом старого дома, они обнаруживают замурованную комнату, которая, как выясняется, исполняет любые желания. Миллионы долларов, подлинник Ван Гога, самые роскошные наряды и украшения – что бы супруги ни захотели, моментально материализуется. Наигравшись вдоволь, Кэйт осмеливается пожелать себе долгожданного ребенка, даже не подозревая, к каким последствиям это может привести.\n\n***Жанр:***  триллер, фантастика, драма\n\n***Страны:***  Франция, Люксембург, Бельгия\n\n***Режиссёр:***  Кристиан Волькман\n\n***Длительность:***  100 мин.', 'Влюбленная пара Кэйт и Мэтт переезжает в уединенный особняк. Занимаясь ремонтом старого дома, они обнаруживают замурованную комнату, которая, как выясняется, исполняет любые желания. Миллионы долларов, подлинник Ван Гога, самые роскошные наряды и украшения – что бы супруги ни захотели, моментально материализуется. Наигравшись вдоволь, Кэйт осмеливается пожелать себе долгожданного ребенка, даже не подозревая, к каким последствиям это может привести.\n\n***Жанр:***  триллер, фантастика, драма\n\n***Страны:***  Франция, Люксембург, Бельгия\n\n***Режиссёр:***  Кристиан Волькман\n\n***Длительность:***  100 мин.'),
