(278, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-29 13:00:00', '2020-03-29 15:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 22:05:54', '2020-03-06 22:13:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Пушистый шпион', 'Пушистый шпион', 'Избалованная рыжая кошечка Марни живет в доме со своей хозяйкой в тепле и уюте и в ус не дует. Но ее жизнь радикально меняется, когда она становится жертвой грабителей-преступников, которые отправляют ее в коробке в другой город. В дороге коробка теряется и Марни оказывается где-то в глухой деревне, один на один с реальной жизнью. Она встречает Пса, Петуха и Осла и тут начинаются приключения... Марни и ее новым друзьям предстоит найти того, кто стоит за загадочными ограблениями в городе и обезвредить эту банду.\n\n***Жанр:***  мультфильм, приключения, семейный\n\n***Страны:***  Германия, Бельгия\n\n***Режиссёры:***  Кристоф Лауэнштайн, Вольфганг Лауэнштайн\n\n***Длительность:***  92 мин.', 'Избалованная рыжая кошечка Марни живет в доме со своей хозяйкой в тепле и уюте и в ус не дует. Но ее жизнь радикально меняется, когда она становится жертвой грабителей-преступников, которые отправляют ее в коробке в другой город. В дороге коробка теряется и Марни оказывается где-то в глухой деревне, один на один с реальной жизнью. Она встречает Пса, Петуха и Осла и тут начинаются приключения... Марни и ее новым друзьям предстоит найти того, кто стоит за загадочными ограблениями в городе и обезвредить эту банду.\n\n***Жанр:***  мультфильм, приключения, семейный\n\n***Страны:***  Германия, Бельгия\n\n***Режиссёры:***  Кристоф Лауэнштайн, Вольфганг Лауэнштайн\n\n***Длительность:***  92 мин.'),
(279, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-29 15:00:00', '2020-03-29 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 22:07:56', '2020-03-06 22:13:41', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Аладдин', 'Аладдин', 'Молодой воришка по имени Аладдин хочет стать принцем, чтобы жениться на принцессе Жасмин. Тем временем визирь Аграбы Джафар намеревается захватить власть над Аграбой, а для этого он стремится заполучить волшебную лампу, хранящуюся в пещере чудес, доступ к которой разрешен лишь тому, кого называют «алмаз неограненный», и этим человеком является не кто иной, как сам Аладдин.\n\n***Жанр:***  мюзикл, фэнтези, мелодрама, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёр***:  Гай Ричи\n\n***Длительность:*** 128 мин.', 'Молодой воришка по имени Аладдин хочет стать принцем, чтобы жениться на принцессе Жасмин. Тем временем визирь Аграбы Джафар намеревается захватить власть над Аграбой, а для этого он стремится заполучить волшебную лампу, хранящуюся в пещере чудес, доступ к которой разрешен лишь тому, кого называют «алмаз неограненный», и этим человеком является не кто иной, как сам Аладдин.\n\n***Жанр:***  мюзикл, фэнтези, мелодрама, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёр***:  Гай Ричи\n\n***Длительность:*** 128 мин.'),
