(284, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-31 15:00:00', '2020-03-31 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 22:20:19', '2020-03-06 22:24:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Спрячь бабушку в холодильнике', 'Спрячь бабушку в холодильнике', 'Молодая художница Клаудия держит на плаву свою мастерскую только благодаря бабушкиной пенсии. И когда старушка умирает, Клаудии ничего не остается, как скрыть этот факт, чтобы продолжать получать деньги. Но девушку начинает преследовать дотошный и неподкупный полицейский Симоне, обожающий свою работу. Что же привлекло его внимание – сама Клаудия или ее «скелет в шкафу»?\n\n***Жанр:***  комедия\n\n***Страна:***  Италия\n\n***Режиссёры:***  Джанкарло Фонтана, Джузеппе Стази\n\n***Длительность:***  100 мин.', 'Молодая художница Клаудия держит на плаву свою мастерскую только благодаря бабушкиной пенсии. И когда старушка умирает, Клаудии ничего не остается, как скрыть этот факт, чтобы продолжать получать деньги. Но девушку начинает преследовать дотошный и неподкупный полицейский Симоне, обожающий свою работу. Что же привлекло его внимание – сама Клаудия или ее «скелет в шкафу»?\n\n***Жанр:***  комедия\n\n***Страна:***  Италия\n\n***Режиссёры:***  Джанкарло Фонтана, Джузеппе Стази\n\n***Длительность:***  100 мин.'),
(285, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-31 17:00:00', '2020-03-31 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 22:21:47', '2020-03-06 22:23:48', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Ты умеешь хранить секреты?', 'Ты умеешь хранить секреты?', 'Эмма с треском провалила совещание и возвращается из командировки самолётом. Настроение - хуже некуда, вдобавок девушка боится летать, поэтому хорошенько принимает на грудь перед посадкой. Сочувствующая стюардесса предлагает ей свободное место в первом классе, где разносят шампанское, и при первой же турбулентности от страха Эмма начинает вываливать все свои секреты сидящему рядом мужчине. Она рассказывает ему всё - от нюансов личной жизни до офисных взаимоотношений. И каково же было удивление девушки, когда на следующий день выяснилось, что тот самый сосед по самолёту - её босс и основатель компании - пришёл в их офис проверить работу отделения.\n\n***Жанр:***  мелодрама, комедия\n\n***Страна:***  США\n\n***Режиссёр:***  Элиз Дюран\n\n***Длительность:***  94 мин.', 'Эмма с треском провалила совещание и возвращается из командировки самолётом. Настроение - хуже некуда, вдобавок девушка боится летать, поэтому хорошенько принимает на грудь перед посадкой. Сочувствующая стюардесса предлагает ей свободное место в первом классе, где разносят шампанское, и при первой же турбулентности от страха Эмма начинает вываливать все свои секреты сидящему рядом мужчине. Она рассказывает ему всё - от нюансов личной жизни до офисных взаимоотношений. И каково же было удивление девушки, когда на следующий день выяснилось, что тот самый сосед по самолёту - её босс и основатель компании - пришёл в их офис проверить работу отделения.\n\n***Жанр:***  мелодрама, комедия\n\n***Страна:***  США\n\n***Режиссёр:***  Элиз Дюран\n\n***Длительность:***  94 мин.'