(286, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-31 19:00:00', '2020-03-31 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-06 22:23:15', '2020-03-06 22:23:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Девушки бывают разные', 'Девушки бывают разные', 'Это история о трёх друзьях, решивших покататься на серфе в Мексике. Все как полагается: океан, девушки и золотой песок. История не предвещает неожиданностей. Но не для наших героев, которые первым делом как следует отметили свой приезд. С трудом проснувшись наутро, парни обнаруживают себя посреди пляжа, они в замешательстве – не помнят, что же произошло накануне. Но вскоре появляются люди, которые освежают им память: оказывается, прошлой ночью парни страшно навредили международному криминальному авторитету Хуану, который по какой-то причине хочет их убить. Скрываясь от преследования, без денег и документов, они находят спасение – переодеваются в девушек и участвуют в женском турнире по сёрфингу...\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***  Сарик Андреасян\n\n***Длительность:***  90 мин.', 'Это история о трёх друзьях, решивших покататься на серфе в Мексике. Все как полагается: океан, девушки и золотой песок. История не предвещает неожиданностей. Но не для наших героев, которые первым делом как следует отметили свой приезд. С трудом проснувшись наутро, парни обнаруживают себя посреди пляжа, они в замешательстве – не помнят, что же произошло накануне. Но вскоре появляются люди, которые освежают им память: оказывается, прошлой ночью парни страшно навредили международному криминальному авторитету Хуану, который по какой-то причине хочет их убить. Скрываясь от преследования, без денег и документов, они находят спасение – переодеваются в девушек и участвуют в женском турнире по сёрфингу...\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***  Сарик Андреасян\n\n***Длительность:***  90 мин.'),
(287, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-03 15:00:00', '2020-04-03 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-13 16:58:07', '2020-03-27 16:51:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Бен 10: Инопланетное нашествие', 'Бен 10: Инопланетное нашествие', 'Прошло 5 лет с тех пор, как Бен Тенннисон нашел инопланетные часы Омнитрикс и превратился в супер-героя. Теперь Бену 15 лет, и он обычный подросток, который давно уже не надевал Омнитрикс. Его приключения и превращения в супер-героев остались в прошлом. После победы над злым Вилгаксом Бен снял свои супер-часы и с тех пор не прибегал к их помощи. Меньше всего Бену хочется снова попасть в опасное приключение, но неожиданно он узнает, что дедушка Макс пропал. Он спешит рассказать об этом своей кузине Гвен. Бен решает снова надеть Омнитрикс и выяснить, куда исчез дедушка Макс. Бен и Гвен начинают расследование и обнаруживают, что инопланетяне снова строят коварные планы...\n\n***Год:***  2009\n\n***Жанр:***  фантастика, боевик, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Алекс Уинтер\n\n***Длительность:***  70 мин.', 'Прошло 5 лет с тех пор, как Бен Тенннисон нашел инопланетные часы Омнитрикс и превратился в супер-героя. Теперь Бену 15 лет, и он обычный подросток, который давно уже не надевал Омнитрикс. Его приключения и превращения в супер-героев остались в прошлом. После победы над злым Вилгаксом Бен снял свои супер-часы и с тех пор не прибегал к их помощи. Меньше всего Бену хочется снова попасть в опасное приключение, но неожиданно он узнает, что дедушка Макс пропал. Он спешит рассказать об этом своей кузине Гвен. Бен решает снова надеть Омнитрикс и выяснить, куда исчез дедушка Макс. Бен и Гвен начинают расследование и обнаруживают, что инопланетяне снова строят коварные планы...\n\n***Год:***  2009\n\n***Жанр:**