(288, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-03 17:00:00', '2020-04-03 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-13 17:04:52', '2020-03-27 16:56:07', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Кто я для тебя?', 'Men seniň üçin kim ?', 'Это история о Преме и Ниши. Они знакомятся на свадьбе Раджеша, дяди Према, и Пуджи, старшей сестры Ниши. У молодых людей с первого взгляда возникает симпатия друг к другу, и вскоре они объясняются в любви. Не за горами свадьба. Однако судьба распоряжается по-иному. Трагически погибает Пуджа. Недавно родившийся малыш остается без мамы. На семейном совете принимается решение, что Ниша должна стать супругой Раджеша и заменить малышу мать. Прем и Ниша готовы пожертвовать своей любовью ради счастья близких. Однако примет ли эту жертву Раджеш, когда узнает об их любви?\n\n***Год:***  1994\n\n***Жанр:***  мюзикл, драма, мелодрама, комедия, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Сурадж Р. Барджатья\n\n***Длительность:*** 184 мин.', 'Это история о Преме и Ниши. Они знакомятся на свадьбе Раджеша, дяди Према, и Пуджи, старшей сестры Ниши. У молодых людей с первого взгляда возникает симпатия друг к другу, и вскоре они объясняются в любви. Не за горами свадьба. Однако судьба распоряжается по-иному. Трагически погибает Пуджа. Недавно родившийся малыш остается без мамы. На семейном совете принимается решение, что Ниша должна стать супругой Раджеша и заменить малышу мать. Прем и Ниша готовы пожертвовать своей любовью ради счастья близких. Однако примет ли эту жертву Раджеш, когда узнает об их любви?\n\n***Год:***  1994\n\n***Жанр:***  мюзикл, драма, мелодрама, комедия, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Сурадж Р. Барджатья\n\n***Длительность:*** 184 мин.'),
(289, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 19:00:00', '2020-03-22 21:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-13 17:18:48', '2020-03-13 17:20:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Незнакомец и незнакомка', 'Nätanyş we nätanyş zenan', 'Это история о двух незнакомцах. Два человека могут встретиться где угодно. В нью-йоркском такси в дождливый полдень, в баре по соседству, в очереди у банкомата, в самолете над облаками, глубоко под водой с аквалангом, в эпицентре землетрясения, сидя на лавочке у Тадж-Махала или стоя у подножия Египетских пирамид. Вы можете встретиться при самых обычных обстоятельствах или при весьма экзотических. Акаш и Киара встретились в самой необычной ситуации...\n\n***Жанр:***  мюзикл, драма, мелодрама, комедия, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Сиддхарт Ананд\n\n***Длительность:***  151 мин.', 'Это история о двух незнакомцах. Два человека могут встретиться где угодно. В нью-йоркском такси в дождливый полдень, в баре по соседству, в очереди у банкомата, в самолете над облаками, глубоко под водой с аквалангом, в эпицентре землетрясения, сидя на лавочке у Тадж-Махала или стоя у подножия Египетских пирамид. Вы можете встретиться при самых обычных обстоятельствах или при весьма экзотических. Акаш и Киара встретились в самой необычной ситуации...\n\n***Жанр:***  мюзикл, драма, мелодрама, комедия, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Сиддхарт Ананд\n\n***Длительность:***  151 мин.'),
