(291, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-04 18:14:00', '2023-06-04 18:14:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-13 17:42:31', '2023-05-04 22:14:23', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Тихая невестка', 'Ýuwaş gelin', 'Городская девушка-туркменка приехала в колхоз, чтобы выйти замуж за своего парня. Жених предложил уехать назад в город, чтобы не делать свадьбу по строгим туркменским обычаям. Девушка отказалась, чтобы понравиться матери жениха.\n\n***Год:***  1967\n\n***Жанр:***  комедия\n\n***Страна:***  СССР\n\n***Режиссёр:***  Сетдар Караджаев\n\n***Длительность:***  70 мин.', 'Городская девушка-туркменка приехала в колхоз, чтобы выйти замуж за своего парня. Жених предложил уехать назад в город, чтобы не делать свадьбу по строгим туркменским обычаям. Девушка отказалась, чтобы понравиться матери жениха.\n\n***Год:***  1967\n\n***Жанр:***  комедия\n\n***Страна:***  СССР\n\n***Режиссёр:***  Сетдар Караджаев\n\n***Длительность:***  70 мин.'),
(292, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-22 15:00:00', '2020-03-22 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-14 15:11:50', '2020-03-14 15:14:50', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Принцесса и пони', 'Принцесса и пони', 'Юную принцессу отправляют к родственникам в Америку, где она встречает удивительного пони, которого держит злобный американский аналог Карабаса Барабаса.\n\n***Жанр:***  преступление, семейный\n\n***Страна***:  США\n\n***Режиссёр:*** Рэйчел Голденберг\n\n***Длительность:***  88 мин.', 'Юную принцессу отправляют к родственникам в Америку, где она встречает удивительного пони, которого держит злобный американский аналог Карабаса Барабаса.\n\n***Жанр:***  преступление, семейный\n\n***Страна***:  США\n\n***Режиссёр:*** Рэйчел Голденберг\n\n***Длительность:***  88 мин.'),
(293, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-03-31 17:00:00', '2020-03-31 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-27 16:26:18', '2020-03-27 16:26:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'И в печали, и в радости...', NULL, '', 'У богатого бизнесмена и его жены два сына - приемный Рахул и родной Рохан. Рахул дружит с Нэйной, которая влюблена в него, и отец предполагает поженить их. Но Рахул встречает Анджали - симпатичную девушку, живущую в бедном районе, и влюбляется в нее. Несмотря на данное отцу обещание отказаться от девушки, Рахул тайно женится на ней, чем вызывает гнев и проклятия отца. Рахул покидает родной дом и уезжает в Лондон. Проходит 10 лет. Подросший Рохан, чудом превратившийся из неповоротливого толстяка и обжоры в атлета и красавца, узнает о конфликте между отцом и братом и клянется вернуть брата в семью.\n\n***Год:***  2001\n\n***Жанр:***  мюзикл, драма, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Каран Джохар\n\n***Длительность:***  210 мин.'),
(294, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-05 15:00:00', '2020-04-05 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-27 17:05:34', '2020-03-27 17:06:14', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Ом Шанти Ом', 'Om Shanti Om', 'Бомбей 70-х годов. Ом Пракаш Макхия и его друг Паппу хотят стать актёрами, но на данный момент исполняют только роли статистов в массовках. Мать Ома, бывшая исполнительница второстепенных ролей, убеждает сына, что когда-нибудь он станет героем большого проекта. Об этом он мечтает каждую минуту, поскольку влюблён в молодую звезду экрана Шанти. Когда во время съёмок случается пожар, Ом спасает Шанти жизнь и становится её другом...\n\n***Год:*** 2007\n\n***Жанр:***  мюзикл, боевик, триллер, драма, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр: *** Фара Кхан\n\n***Длительность:***  162 мин.', 'Бомбей 70-х годов. Ом Пракаш Макхия и его друг Паппу хотят стать актёрами, но на данный момент исполняют только роли статистов в массовках. Мать Ома, бывшая исполнительница второстепенных ролей, убеждает сына, что когда-нибудь он станет героем большого проекта. Об этом он мечтает каждую минуту, поскольку влюблён в молодую звезду экрана Шанти. Когда во время съёмок случается пожар, Ом спасает Шанти жизнь и становится её другом...\n\n***Год:*** 2007\n\n***Жанр:***  мюзикл, боевик, триллер, драма, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр: *** Фара Кхан\n\n***Длительность:***  162 мин.'),
(295, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-01 15:00:00', '2020-04-01 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-03-27 17:12:54', '2020-03-27 17:13:15', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Дели-6', 'Дели-6', 'Рошан приезжает в Индию, сопровождая больную бабушку, которая хочет провести последние дни на родной земле. Для Рошана Индия - чужая и незнакомая страна, но вскоре он начинает любить гремучую смесь культур и религий современного Дели. Кроме того, он знакомится с Битту, соседской девушкой, которая тоже стремится найти себя.\n\n***Год:***  2009\n\n***Жанр:*** драма, комедия\n\n***Страна:*** Индия\n\n***Режиссёр:*** Ракеш Омпракаш Мехра\n\n***Длительность:*** 140 мин.', 'Рошан приезжает в Индию, сопровождая больную бабушку, которая хочет провести последние дни на родной земле. Для Рошана Индия - чужая и незнакомая страна, но вскоре он начинает любить гремучую смесь культур и религий современного Дели. Кроме того, он знакомится с Битту, соседской девушкой, которая тоже стремится найти себя.\n\n***Год:***  2009\n\n***Жанр:*** драма, комедия\n\n***Страна:*** Индия\n\n***Режиссёр:*** Ракеш Омпракаш Мехра\n\n***Длительность:*** 140 мин.');
