(296, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-06 17:00:00', '2020-04-06 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-01 20:19:00', '2020-04-01 20:24:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Король Сингх', 'Король Сингх', 'Простой парень Рафтар не торопится со свадьбой, хотя родители то и дело подыскивают ему девушек. После очередного отказа сыну ставят ультиматум: либо Рафтар сочетается узами брака, либо ему придется отправиться работать вместе с другом отца в Гоа. Недолго думая, парень выбирает второй вариант.\n\n***Год:***  2015\n\n***Жанр:***  боевик, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Прабхудева\n\n***Длительность:***  141 мин.', 'Простой парень Рафтар не торопится со свадьбой, хотя родители то и дело подыскивают ему девушек. После очередного отказа сыну ставят ультиматум: либо Рафтар сочетается узами брака, либо ему придется отправиться работать вместе с другом отца в Гоа. Недолго думая, парень выбирает второй вариант.\n\n***Год:***  2015\n\n***Жанр:***  боевик, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Прабхудева\n\n***Длительность:***  141 мин.'),
(297, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-07 15:00:00', '2020-04-07 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-01 20:29:40', '2020-04-01 20:32:45', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Свадьба моего отца', 'Свадьба моего отца', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***   2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***   Приядаршан\n\n***Длительность:*** 150 мин.', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***   2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  