(301, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-11 17:00:00', '2020-04-11 19:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-01 20:58:38', '2020-04-01 20:59:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Падмавати', 'Падмавати', '1303 год. Могущественный султан Алауддин Хилджи, завоевавший половину Индии, поддается сладким речам изгнанного из Читторгарха бывшего королевского религиозного наставника, что его могущество только будет расти, если рядом с ним будет красавица Падмавати, жена правителя Раваны Сингха. С этого момента султан становится одержим идеей захватить Падмавати. Он приводит свои войска к стенам крепости Читторгарх и обещает её правителю не разрушать город, если тот отдаст ему собственную жену.\n\n***Год:***  2018\n\n***Жанр:***  драма, мелодрама, военный, история\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Лила Бхансали\n\n***Длительность:***  164 мин.', '1303 год. Могущественный султан Алауддин Хилджи, завоевавший половину Индии, поддается сладким речам изгнанного из Читторгарха бывшего королевского религиозного наставника, что его могущество только будет расти, если рядом с ним будет красавица Падмавати, жена правителя Раваны Сингха. С этого момента султан становится одержим идеей захватить Падмавати. Он приводит свои войска к стенам крепости Читторгарх и обещает её правителю не разрушать город, если тот отдаст ему собственную жену.\n\n***Год:***  2018\n\n***Жанр:***  драма, мелодрама, военный, история\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Лила Бхансали\n\n***Длительность:***  164 мин.'),
(302, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-12 15:00:00', '2020-04-12 17:00:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-01 21:46:50', '2020-04-01 21:50:00', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Беспечные близнецы 2', 'Беспечные близнецы 2', 'Действие фильма разворачивается в Лондоне, где после долгих лет разлуки воссоединяются братья-близнецы Прем и Раджа. Долгое время они даже не знали о существовании друг друга, поскольку когда-то давно в Индии Раджу похитил преступник Чарльз. Прибыв в Лондон, Раджа знакомится с прекрасной Алишкой, в которую влюбляется с первого взгляда. Каким-то непонятным образом судьба всё же сводит двух братьев в этом огромном городе. Радже и Прему предстоит впервые встретиться при весьма странных обстоятельствах. И, конечно же, эта важная встреча серьёзно повлияет на их жизни.\n\n***Год:***  2017\n\n***Жанр:***  боевик, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***   Дэвид Дхаван\n\n***Длительность:*** 145 мин.', 'Действие фильма разворачивается в Лондоне, где после долгих лет разлуки воссоединяются братья-близнецы Прем и Раджа. Долгое время они даже не знали о существовании друг друга, поскольку когда-то давно в Индии Раджу похитил преступник Чарльз. Прибыв в Лондон, Раджа знакомится с прекрасной Алишкой, в которую влюбляется с первого взгляда. Каким-то непонятным образом судьба всё же сводит двух братьев в этом огромном городе. Радже и Прему предстоит впервые встретиться при весьма странных обстоятельствах. И, конечно же, эта важная встреча серьёзно повлияет на их жизни.\n\n***Год:***  2017\n\n***Жанр:***  боевик, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***   Дэвид Дхаван\n\n***Длительность:*** 145 мин.'),
