(309, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-28 17:00:00', '2020-04-28 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-15 21:40:16', '2020-04-18 16:36:28', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Робот', 'Робот', 'Он умеет многое - драться, петь и танцевать, он водонепроницаемый и огнестойкий. Он может делать все, что может человек, и даже больше! Он дословно выполняет инструкции. Если человек может солгать, чтобы спасти себя, то этот робот лгать не умеет. У него острая как бритва память, и он запоминает весь телефонный справочник, едва пробежав по нему глазами. Его имя - Читти. Однажды доктор Васигаран, модернизируя процессор робота, добавляет ему имитатор человеческих эмоций. Читти полностью меняется. Теперь он может чувствовать, и первое чувство, которое он открывает для себя - это любовь.\n\n***Год***:  2010\n\n***Жанр:***  фантастика, боевик\n\n***Страна:***  Индия\n\n***Режиссёр:***  Шанмугам Шанкар\n\n***Длительность:***  177 мин.', 'Он умеет многое - драться, петь и танцевать, он водонепроницаемый и огнестойкий. Он может делать все, что может человек, и даже больше! Он дословно выполняет инструкции. Если человек может солгать, чтобы спасти себя, то этот робот лгать не умеет. У него острая как бритва память, и он запоминает весь телефонный справочник, едва пробежав по нему глазами. Его имя - Читти. Однажды доктор Васигаран, модернизируя процессор робота, добавляет ему имитатор человеческих эмоций. Читти полностью меняется. Теперь он может чувствовать, и первое чувство, которое он открывает для себя - это любовь.\n\n***Год***:  2010\n\n***Жанр:***  фантастика, боевик\n\n***Страна:***  Индия\n\n***Режиссёр:***  Шанмугам Шанкар\n\n***Длительность:***  177 мин.'),
