(311, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 17:00:00', '2020-04-19 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-15 21:54:09', '2020-04-16 14:32:13', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Тролли. Мировой тур', 'Тролли. Мировой тур', 'Поп-тролли в шоке – оказывается, мир музыки гораздо больше, чем они думали. Рейвы, оупен-эйры, классические концерты и, конечно, хип-хоп баттлы – впереди их ждет головокружительное веселье. Но неудержимая королева Рокс планирует уничтожить все… чтобы миром безоговорочно правил хард-рок! Розочка, Цветан и их новые друзья отправляются в невероятное путешествие: им предстоит объединить всех троллей и помешать Рокс.\n\n***Год:***  2020\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Уолт Дорн, Дэвид П. Смит\n\n***Длительность:***  90 мин.', 'Поп-тролли в шоке – оказывается, мир музыки гораздо больше, чем они думали. Рейвы, оупен-эйры, классические концерты и, конечно, хип-хоп баттлы – впереди их ждет головокружительное веселье. Но неудержимая королева Рокс планирует уничтожить все… чтобы миром безоговорочно правил хард-рок! Розочка, Цветан и их новые друзья отправляются в невероятное путешествие: им предстоит объединить всех троллей и помешать Рокс.\n\n***Год:***  2020\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Уолт Дорн, Дэвид П. Смит\n\n***Длительность:***  90 мин.'),
(312, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 15:00:00', '2020-04-19 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-15 22:02:00', '2020-04-16 14:32:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Красные туфельки и семь гномов', 'Красные туфельки и семь гномов', 'Давным-давно в сказочном королевстве жила-была девушка. И однажды она нашла пару волшебных туфелек: стоит их надеть – превращаешься в классическую красавицу-принцессу… Семь принцев, заколдованных злой ведьмой, стали уродливыми зелеными гномами. Чтобы вернуть себе человеческий облик, им нужен один поцелуй прекрасной девушки. В один день пути героев пересекутся, и они узнают, что такое настоящая дружба, любовь и красота.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, фэнтези, мелодрама, комедия, приключения, семейный\n\n***Страна:***  Республика Корея\n\n***Режиссёр:***  Хон Сон-хо\n\n***Длительность:***  92 мин.', 'Давным-давно в сказочном королевстве жила-была девушка. И однажды она нашла пару волшебных туфелек: стоит их надеть – превращаешься в классическую красавицу-принцессу… Семь принцев, заколдованных злой ведьмой, стали уродливыми зелеными гномами. Чтобы вернуть себе человеческий облик, им нужен один поцелуй прекрасной девушки. В один день пути героев пересекутся, и они узнают, что такое настоящая дружба, любовь и красота.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, фэнтези, мелодрама, комедия, приключения, семейный\n\n***Страна:***  Республика Корея\n\n***Режиссёр:***  Хон Сон-хо\n\n***Длительность:***  92 мин.'),
(313, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 13:00:00', '2020-04-19 15:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-15 22:06:20', '2020-04-16 14:32:28', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Тайна Мосли', 'Тайна Мосли', 'В далеком-далеком прошлом удивительные животные Торифанты восстают против жизни в рабстве людей и отправляются в опасное путешествие в поисках… свободы. Ведь их прошлое хранит невероятную тайну.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм\n\n***Страны:***  Новая Зеландия, Китай\n\n***Режиссёр:***  Кирби Эткинс\n\n***Длительность:***  96 мин.', 'В далеком-далеком прошлом удивительные животные Торифанты восстают против жизни в рабстве людей и отправляются в опасное путешествие в поисках… свободы. Ведь их прошлое хранит невероятную тайну.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм\n\n***Страны:***  Новая Зеландия, Китай\n\n***Режиссёр:***  Кирби Эткинс\n\n***Длительность:***  96 мин.'),
(314, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-03 15:00:00', '2020-05-03 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 14:00:21', '2020-04-18 16:30:09', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Султан', 'Султан', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Год:***  2016\n\n***Жанр:***  боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:***  170 мин.', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Год:***  2016\n\n***Жанр:***  боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:***  170 мин.'),
(315, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-26 17:00:00', '2020-04-26 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 14:20:53', '2020-04-16 14:41:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Рецепт любви: без сахара!', 'Рецепт любви: без сахара!', 'Два абсолютно разных человека, два противоположных мира, закоренелый холостяк Бадхадев и очаровательная, утонченная Нина, столкнувшись случайно несколько раз, чувствуют, что их взаимная симпатия усиливается и перерастает в нечто большее. Они решают пожениться, и Бадхадев едет в Индию просить руки своей возлюбленной у ее отца. Есть только одно небольшое препятствие - будущий тесть младше своего зятя на шесть лет...\n\n***Год:***  2007\n\n***Жанр:***  мелодрама, комедия\n\n***Страны:***  Индия, Великобритания\n\n***Режиссёр:***  Балки\n\n***Длительность:***  140 мин', 'Два абсолютно разных человека, два противоположных мира, закоренелый холостяк Бадхадев и очаровательная, утонченная Нина, столкнувшись случайно несколько раз, чувствуют, что их взаимная симпатия усиливается и перерастает в нечто большее. Они решают пожениться, и Бадхадев едет в Индию просить руки своей возлюбленной у ее отца. Есть только одно небольшое препятствие - будущий тесть младше своего зятя на шесть лет...\n\n***Год:***  2007\n\n***Жанр:***  мелодрама, комедия\n\n***Страны:***  Индия, Великобритания\n\n***Режиссёр:***  Балки\n\n***Длительность:***  140 мин'),
(316, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-29 17:00:00', '2020-04-29 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 14:27:34', '2020-04-18 16:38:48', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Бадшах', 'Бадшах', 'Весельчак и балагур Бадшах становится частным детективом для того, чтобы бороться с несправедливостью и помогать людям. Однажды, занимаясь розыском похищенного ребенка, он сталкивается с террористами, вынашивающими планы покушения на премьер-министра. Ситуация складывается так, что его ставят перед выбором: или он сам станет непосредственным исполнителем этой акции, или будут убиты его друзья, оказавшиеся в заложниках...\n\n***Год:*** 1999\n\n***Жанр:***  боевик, триллер, комедия, преступление\n\n***Страна:***  Индия\n\n***Режиссёры:***  Аббас Алибхай Бурмавалла, Мастан Алибхай Бурмавалла\n\n***Длительность:***  175 мин.', 'Весельчак и балагур Бадшах становится частным детективом для того, чтобы бороться с несправедливостью и помогать людям. Однажды, занимаясь розыском похищенного ребенка, он сталкивается с террористами, вынашивающими планы покушения на премьер-министра. Ситуация складывается так, что его ставят перед выбором: или он сам станет непосредственным исполнителем этой акции, или будут убиты его друзья, оказавшиеся в заложниках...\n\n***Год:*** 1999\n\n***Жанр:***  боевик, триллер, комедия, преступление\n\n***Страна:***  Индия\n\n***Режиссёры:***  Аббас Алибхай Бурмавалла, Мастан Алибхай Бурмавалла\n\n***Длительность:***  175 мин.'),
(317, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-02 17:00:00', '2020-05-02 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 14:40:43', '2020-04-18 16:33:30', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'В пылающем огне', 'В пылающем огне', 'Шекават не доволен, что все наследство родители оставили его сестре Сонали с мужем Прамодом. И когда она рожает сына Амита, Шекават нанимает киллеров. Прамод, случайно узнав об этом, бежит с сыном. Он успевает спрятать маленького Амита у супругов, у которых подрастает дочь Ауши. Шекават заставляет сестру переоформить наследство на свое имя, женится на набожной женщине Шобхе и вскоре становится отцом мальчика, которого назвали Бабла. Спустя годы Ауши и Бабла влюбились друг в друга.\n\n***Год:***  1988\n\n***Жанр:***  драма, мелодрама, преступление\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дж. Ом Пракаш\n\n***Длительность:***  154 мин.', 'Шекават не доволен, что все наследство родители оставили его сестре Сонали с мужем Прамодом. И когда она рожает сына Амита, Шекават нанимает киллеров. Прамод, случайно узнав об этом, бежит с сыном. Он успевает спрятать маленького Амита у супругов, у которых подрастает дочь Ауши. Шекават заставляет сестру переоформить наследство на свое имя, женится на набожной женщине Шобхе и вскоре становится отцом мальчика, которого назвали Бабла. Спустя годы Ауши и Бабла влюбились друг в друга.\n\n***Год:***  1988\n\n***Жанр:***  драма, мелодрама, преступление\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дж. Ом Пракаш\n\n***Длительность:***  154 мин.'),
(318, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-18 13:00:00', '2020-04-18 15:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 19:47:08', '2020-04-16 19:59:24', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Эпик', 'Эпик', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…\n\n***Год:***  2013\n\n***Жанр:***  мультфильм, фэнтези, приключения, комедия, семейный\n\n***Страна:***  США\n\n**Режиссёр:**  Крис Уэдж\n\n***Длительность:***  102 мин.', 'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей - изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…\n\n***Год:***  2013\n\n***Жанр:***  мультфильм, фэнтези, приключения, комедия, семейный\n\n***Страна:***  США\n\n**Режиссёр:**  Крис Уэдж\n\n***Длительность:***  102 мин.'),
(319, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-18 15:00:00', '2020-04-18 17:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 19:57:38', '2020-04-16 20:25:37', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Суперсемейка 2', 'Суперсемейка 2', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.\n\n***Год:***  2018\n\n***Жанр:***  мультфильм, фантастика, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Брэд Бёрд\n\n***Длительность:***  118 мин.', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.\n\n***Год:***  2018\n\n***Жанр:***  мультфильм, фантастика, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Брэд Бёрд\n\n***Длительность:***  118 мин.'),
