(322, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 13:00:00', '2020-04-19 15:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 20:11:54', '2020-04-16 20:11:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Смолфут', 'Смолфут', 'Молодой находчивый йети сталкивается с тем, кого, по его глубокому убеждению, не существует – человеком. Новости о «смолфуте» приносят ему славу и шанс завоевать девушку его мечты. А ещё – вызывают переполох среди простых йети, которые теперь гадают, кто же ещё обитает в большом мире за пределами их маленькой заснеженной деревушки.\n\n***Год:***  2018\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Кэри Киркпатрик, Джейсон Рейсиг\n\n***Длительность:***  96 мин.', 'Молодой находчивый йети сталкивается с тем, кого, по его глубокому убеждению, не существует – человеком. Новости о «смолфуте» приносят ему славу и шанс завоевать девушку его мечты. А ещё – вызывают переполох среди простых йети, которые теперь гадают, кто же ещё обитает в большом мире за пределами их маленькой заснеженной деревушки.\n\n***Год:***  2018\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Кэри Киркпатрик, Джейсон Рейсиг\n\n***Длительность:***  96 мин.'),
