(324, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 17:00:00', '2020-04-19 19:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 20:19:52', '2020-04-16 20:19:54', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Сайлент Хилл 2', 'Сайлент Хилл 2', 'Хизер терзается ночными кошмарами с одиннадцатилетнего возраста и вынуждена со своим отцом постоянно менять место жительства, скрываясь от таинственных сил. Накануне своего восемнадцатого дня рождения Хизер, вернувшись домой, обнаруживает, что её отец исчез. Единственное, что она нашла дома — нарисованный на стене оккультный символ с надписью «отправляйся в Сайлент Хилл».\n\n***Год:***  2012\n\n***Жанр:***  ужасы\n\n***Страны:***  Канада, Франция, США\n\n***Режиссёр:***  Майкл Дж. Бассетт\n\n***Длительность:***  95 мин.', 'Хизер терзается ночными кошмарами с одиннадцатилетнего возраста и вынуждена со своим отцом постоянно менять место жительства, скрываясь от таинственных сил. Накануне своего восемнадцатого дня рождения Хизер, вернувшись домой, обнаруживает, что её отец исчез. Единственное, что она нашла дома — нарисованный на стене оккультный символ с надписью «отправляйся в Сайлент Хилл».\n\n***Год:***  2012\n\n***Жанр:***  ужасы\n\n***Страны:***  Канада, Франция, США\n\n***Режиссёр:***  Майкл Дж. Бассетт\n\n***Длительность:***  95 мин.'),
(325, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 19:00:00', '2020-04-19 21:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 20:23:24', '2020-04-16 20:23:25', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Мир Юрского периода 2', 'Мир Юрского периода 2', 'На острове Нублар, где не так давно располагался парк развлечений с динозаврами, правит бал дикая природа, но внезапно пробудившийся вулкан угрожает стереть динозавров с лица земли. Бывшая управляющая парком Клэр Диринг переквалифицировалась в защитницу исчезающих видов и пытается сделать всё, чтобы спасти доисторических животных. На неё выходит Илай Миллс - доверенное лицо миллиардера Бенждамина Локвуда, который много лет назад был соратником профессора Хаммонда. Миллс предлагает Клэр, знакомой с системой безопасности парка, поехать на остров и помочь ему поймать нескольких особей, чтобы вывести их на другой безопасный остров...\n\n***Год:***  2018\n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Хуан Антонио Байона\n\n***Длительность:***  128 мин.', 'На острове Нублар, где не так давно располагался парк развлечений с динозаврами, правит бал дикая природа, но внезапно пробудившийся вулкан угрожает стереть динозавров с лица земли. Бывшая управляющая парком Клэр Диринг переквалифицировалась в защитницу исчезающих видов и пытается сделать всё, чтобы спасти доисторических животных. На неё выходит Илай Миллс - доверенное лицо миллиардера Бенждамина Локвуда, который много лет назад был соратником профессора Хаммонда. Миллс предлагает Клэр, знакомой с системой безопасности парка, поехать на остров и помочь ему поймать нескольких особей, чтобы вывести их на другой безопасный остров...\n\n***Год:***  2018\n\n***Жанр:***  фантастика, боевик, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Хуан Антонио Байона\n\n***Длительность:***  128 мин.'),
(326, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-17 15:00:00', '2020-04-17 17:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 20:56:40', '2020-04-16 20:56:42', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Джуманджи: Зов джунглей', 'Джуманджи: Зов джунглей', 'Четверо подростков оказываются внутри игры Джуманджи. Их ждет схватка с носорогами, черными мамбами, а на каждом шагу будет подстерегать бесконечная череда ловушек и головоломок. В игре они перевоплощаются: робкий и застенчивый Спенсер превращается в отважного и сильного исследователя, здоровяк Фридж – в коротышку-зоолога, модница и красавица Беттани – в полного профессора, а неуклюжая Марта становится бесстрашной и ловкой амазонкой. Друзьям придется привыкнуть к новым ролям, постараться не погибнуть и найти дорогу домой.\n\n***Год:***  2017\n\n***Жанр:***  фэнтези, боевик, комедия, приключения\n\n***Страны:***  США, Индия, Канада, Великобритания, Австралия, Германия\n\n***Режиссёр:***  Джейк Кэздан\n\n***Длительность***:  119 мин.', 'Четверо подростков оказываются внутри игры Джуманджи. Их ждет схватка с носорогами, черными мамбами, а на каждом шагу будет подстерегать бесконечная череда ловушек и головоломок. В игре они перевоплощаются: робкий и застенчивый Спенсер превращается в отважного и сильного исследователя, здоровяк Фридж – в коротышку-зоолога, модница и красавица Беттани – в полного профессора, а неуклюжая Марта становится бесстрашной и ловкой амазонкой. Друзьям придется привыкнуть к новым ролям, постараться не погибнуть и найти дорогу домой.\n\n***Год:***  2017\n\n***Жанр:***  фэнтези, боевик, комедия, приключения\n\n***Страны:***  США, Индия, Канада, Великобритания, Австралия, Германия\n\n***Режиссёр:***  Джейк Кэздан\n\n***Длительность***:  119 мин.');
