(327, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-17 11:00:00', '2020-04-17 13:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:00:41', '2020-04-16 21:00:43', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Хороший динозавр', 'Хороший динозавр', 'Маленький динозавр Арло, который всего боится, потерялся, и чтобы выжить и вернуться домой ему предстоит многому научиться, и преодолеть свои страхи. Компанию ему составит дикий первобытный мальчик, с которым они становятся друзьями и помогают друг другу на их непростом, полном приключений и опасностей пути домой.\n\n***Год:***  2015\n\n***Жанр:***  мультфильм, фэнтези, драма, комедия, приключения, семейный\n\n***Страна:*** США\n\n***Режиссёр:***  Питер Сон\n\n***Длительность:***  93 мин.', 'Маленький динозавр Арло, который всего боится, потерялся, и чтобы выжить и вернуться домой ему предстоит многому научиться, и преодолеть свои страхи. Компанию ему составит дикий первобытный мальчик, с которым они становятся друзьями и помогают друг другу на их непростом, полном приключений и опасностей пути домой.\n\n***Год:***  2015\n\n***Жанр:***  мультфильм, фэнтези, драма, комедия, приключения, семейный\n\n***Страна:*** США\n\n***Режиссёр:***  Питер Сон\n\n***Длительность:***  93 мин.'),
(328, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-17 13:00:00', '2020-04-17 15:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:04:01', '2020-04-16 21:04:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Головоломка', 'Головоломка', 'Райли — обычная 11-летняя школьница, и, как у каждого из нас, ее поведение определяют пять базовых эмоций: Радость, Печаль, Страх, Гнев и Брезгливость. Эмоции живут в сознании девочки и каждый день помогают ей справляться с проблемами, руководя всеми ее поступками. До поры до времени эмоции живут дружно, но вдруг оказывается, что Райли и ее родителям предстоит переезд из небольшого уютного городка в шумный и людный мегаполис. Каждая из эмоций считает, что именно она лучше прочих знает, что нужно делать в этой непростой ситуации, и в голове у девочки наступает полная неразбериха. Чтобы наладить жизнь в большом городе, освоиться в новой школе и подружиться с одноклассниками, эмоциям Райли предстоит снова научиться работать сообща.\n\n***Год:***  2015\n\n***Жанр:***  мультфильм, семейный, комедия\n\n***Страна:***  США\n\n***Режиссёры:***  Роналдо Дель Кармен, Пит Доктер\n\n***Длительность:***  95 мин.', 'Райли — обычная 11-летняя школьница, и, как у каждого из нас, ее поведение определяют пять базовых эмоций: Радость, Печаль, Страх, Гнев и Брезгливость. Эмоции живут в сознании девочки и каждый день помогают ей справляться с проблемами, руководя всеми ее поступками. До поры до времени эмоции живут дружно, но вдруг оказывается, что Райли и ее родителям предстоит переезд из небольшого уютного городка в шумный и людный мегаполис. Каждая из эмоций считает, что именно она лучше прочих знает, что нужно делать в этой непростой ситуации, и в голове у девочки наступает полная неразбериха. Чтобы наладить жизнь в большом городе, освоиться в новой школе и подружиться с одноклассниками, эмоциям Райли предстоит снова научиться работать сообща.\n\n***Год:***  2015\n\n***Жанр:***  мультфильм, семейный, комедия\n\n***Страна:***  США\n\n***Режиссёры:***  Роналдо Дель Кармен, Пит Доктер\n\n***Длительность:***  95 мин.'),
(329, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-17 17:00:00', '2020-04-17 19:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:07:48', '2020-04-16 21:07:49', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Однажды в Голливуде', 'Однажды в Голливуде', '1969 год, золотой век Голливуда уже закончился. Известный актёр Рик Далтон и его дублер Клифф Бут пытаются найти свое место в стремительно меняющемся мире киноиндустрии.\n\n***Год:***  2019\n\n***Жанр:***  драма, комедия\n\n***Страны: *** США, Великобритания, Китай\n\n***Режиссёр:***  Квентин Тарантино\n\n***Длительность:***  161 мин.', '1969 год, золотой век Голливуда уже закончился. Известный актёр Рик Далтон и его дублер Клифф Бут пытаются найти свое место в стремительно меняющемся мире киноиндустрии.\n\n***Год:***  2019\n\n***Жанр:***  драма, комедия\n\n***Страны: *** США, Великобритания, Китай\n\n***Режиссёр:***  Квентин Тарантино\n\n***Длительность:***  161 мин.'),
(330, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-17 19:00:00', '2020-04-17 21:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:10:52', '2020-04-16 21:10:54', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Ford против Ferrari', 'Ford против Ferrari', 'В начале 1960-х Генри Форд II принимает решение улучшить имидж компании и сменить курс на производство более модных автомобилей. После неудавшейся попытки купить практически банкрота Ferrari американцы решают бросить вызов итальянским конкурентам на трассе и выиграть престижную гонку 24 часа Ле-Мана. Чтобы создать подходящую машину, компания нанимает автоконструктора Кэррола Шэлби, а тот отказывается работать без выдающегося, но, как считается, трудного в общении гонщика Кена Майлза. Вместе они принимаются за разработку впоследствии знаменитого спорткара Ford GT40.\n\n***Год:*** 2019\n\n***Жанр:***  боевик, драма, биография\n\n***Страны:*** США, Франция\n\n***Режиссёр:***  Джеймс Мэнголд\n\n***Длительность:***  152 мин.', 'В начале 1960-х Генри Форд II принимает решение улучшить имидж компании и сменить курс на производство более модных автомобилей. После неудавшейся попытки купить практически банкрота Ferrari американцы решают бросить вызов итальянским конкурентам на трассе и выиграть престижную гонку 24 часа Ле-Мана. Чтобы создать подходящую машину, компания нанимает автоконструктора Кэррола Шэлби, а тот отказывается работать без выдающегося, но, как считается, трудного в общении гонщика Кена Майлза. Вместе они принимаются за разработку впоследствии знаменитого спорткара Ford GT40.\n\n***Год:*** 2019\n\n***Жанр:***  боевик, драма, биография\n\n***Страны:*** США, Франция\n\n***Режиссёр:***  Джеймс Мэнголд\n\n***Длительность:***  152 мин.'),
