(332, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-18 13:00:00', '2020-04-18 15:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:17:35', '2020-04-16 21:17:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Моана', 'Моана', 'Бесстрашная Моана, дочь вождя маленького племени на острове в Тихом океане, больше всего на свете мечтает о приключениях и решает отправиться в опасное морское путешествие. Вместе с некогда могущественным полубогом Мауи им предстоит пересечь океан, сразиться со страшными чудовищами и разрушить древнее заклятие.\n\n***Год:***  2016\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Рон Клементс, Джон Маскер, Дон Холл, Крис Уильямс\n\n***Длительность:***  107 мин.', 'Бесстрашная Моана, дочь вождя маленького племени на острове в Тихом океане, больше всего на свете мечтает о приключениях и решает отправиться в опасное морское путешествие. Вместе с некогда могущественным полубогом Мауи им предстоит пересечь океан, сразиться со страшными чудовищами и разрушить древнее заклятие.\n\n***Год:***  2016\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Рон Клементс, Джон Маскер, Дон Холл, Крис Уильямс\n\n***Длительность:***  107 мин.'),
(333, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-18 15:00:00', '2020-04-18 17:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:20:17', '2020-04-16 21:20:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Стражи Галактики', 'Стражи Галактики', 'Отважному путешественнику Питеру Квиллу попадает в руки таинственный артефакт, принадлежащий могущественному и безжалостному злодею Ронану, строящему коварные планы по захвату Вселенной. Питер оказывается в центре межгалактической охоты, где жертва — он сам. Единственный способ спасти свою жизнь — объединиться с четверкой нелюдимых изгоев: воинственным енотом по кличке Ракета, человекоподобным деревом Грутом, смертельно опасной Гаморой и одержимым жаждой мести Драксом, также известным как Разрушитель. Когда Квилл понимает, какой силой обладает украденный артефакт и какую опасность он представляет для вселенной, одиночка пойдет на все, чтобы сплотить случайных союзников для решающей битвы за судьбу галактики.\n\n***Год:***  2014\n\n***Жанр:***  фантастика, боевик, приключения, комедия\n\n***Страна***:  США\n\n***Режиссёр:***  Джеймс Ганн\n\n***Длительность:***  121 мин.', 'Отважному путешественнику Питеру Квиллу попадает в руки таинственный артефакт, принадлежащий могущественному и безжалостному злодею Ронану, строящему коварные планы по захвату Вселенной. Питер оказывается в центре межгалактической охоты, где жертва — он сам. Единственный способ спасти свою жизнь — объединиться с четверкой нелюдимых изгоев: воинственным енотом по кличке Ракета, человекоподобным деревом Грутом, смертельно опасной Гаморой и одержимым жаждой мести Драксом, также известным как Разрушитель. Когда Квилл понимает, какой силой обладает украденный артефакт и какую опасность он представляет для вселенной, одиночка пойдет на все, чтобы сплотить случайных союзников для решающей битвы за судьбу галактики.\n\n***Год:***  2014\n\n***Жанр:***  фантастика, боевик, приключения, комедия\n\n***Страна***:  США\n\n***Режиссёр:***  Джеймс Ганн\n\n***Длительность:***  121 мин.'),
(334, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-18 17:00:00', '2020-04-18 19:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:23:19', '2020-04-16 21:23:21', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Достать ножи', 'Достать ножи', 'На следующее утро после празднования 85-летия известного автора криминальных романов Харлана Тромби виновника торжества находят мёртвым. Налицо - явное самоубийство, но полиция по протоколу опрашивает всех присутствующих в особняке членов семьи, хотя, в этом деле больше заинтересован частный детектив Бенуа Блан. Тем же утром он получил конверт с наличными от неизвестного и заказ на расследование смерти Харлана. Не нужно быть опытным следователем, чтобы понять, что все приукрашивают свои отношения с почившим главой семейства, но Блану достаётся настоящий подарок - медсестра покойного, которая физически не выносит ложь.\n\n***Год:***  2019\n\n***Жанр:***  детектив, комедия, драма, преступление\n\n***Страна:***  США\n\n***Режиссёр:***  Райан Джонсон\n\n***Длительность:***  131 мин.\n', 'На следующее утро после празднования 85-летия известного автора криминальных романов Харлана Тромби виновника торжества находят мёртвым. Налицо - явное самоубийство, но полиция по протоколу опрашивает всех присутствующих в особняке членов семьи, хотя, в этом деле больше заинтересован частный детектив Бенуа Блан. Тем же утром он получил конверт с наличными от неизвестного и заказ на расследование смерти Харлана. Не нужно быть опытным следователем, чтобы понять, что все приукрашивают свои отношения с почившим главой семейства, но Блану достаётся настоящий подарок - медсестра покойного, которая физически не выносит ложь.\n\n***Год:***  2019\n\n***Жанр:***  детектив, комедия, драма, преступление\n\n***Страна:***  США\n\n***Режиссёр:***  Райан Джонсон\n\n***Длительность:***  131