(336, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 13:00:00', '2020-04-19 15:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-16 21:31:10', '2020-04-16 21:33:17', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 3, 'Вперёд', 'Вперёд', 'Когда-то давно в сказочном мире царила магия, но после открытия электричества маги стали не нужны, и развитие пошло по техногенному пути. Теперь эльфы, тролли, гоблины, мантикоры, феи, кентавры и единороги летают на самолетах, пользуются автомобилями и мобильниками и ведут в целом прозаичную жизнь. Братья-эльфы Иэн и Барли Лайтфуты воспитывались одной мамой, потому что их отец умер, когда они были ещё совсем маленькими. На 16-летие Иэну достаётся посох отца, и магическое заклинание, которое должно вернуть того к жизни на один день, но волшебный кристалл исчезает, воскресив только нижнюю половину папы. Барли, большой любитель квестов, невероятно рад - прихватив полупапу, братья отправляются в приключение на поиски другого кристалла.\n\n***Год:***  2020\n\n***Жанр:*** мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:*** США\n\n***Режиссёр:*** Дэн Скэнлон\n\n***Длительность:*** 102 мин.', 'Когда-то давно в сказочном мире царила магия, но после открытия электричества маги стали не нужны, и развитие пошло по техногенному пути. Теперь эльфы, тролли, гоблины, мантикоры, феи, кентавры и единороги летают на самолетах, пользуются автомобилями и мобильниками и ведут в целом прозаичную жизнь. Братья-эльфы Иэн и Барли Лайтфуты воспитывались одной мамой, потому что их отец умер, когда они были ещё совсем маленькими. На 16-летие Иэну достаётся посох отца, и магическое заклинание, которое должно вернуть того к жизни на один день, но волшебный кристалл исчезает, воскресив только нижнюю половину папы. Барли, большой любитель квестов, невероятно рад - прихватив полупа