(338, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-04-19 17:00:00', '2020-04-19 19:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2020-04-16 21:38:52', '2020-04-16 21:38:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Джентльмены', 'Джентльмены', 'Один ушлый американец ещё со студенческих лет приторговывал наркотиками, а теперь придумал схему нелегального обогащения с использованием поместий обедневшей английской аристократии и очень неплохо на этом разбогател. Другой пронырливый журналист приходит к Рэю, правой руке американца, и предлагает тому купить киносценарий, в котором подробно описаны преступления его босса при участии других представителей лондонского криминального мира - партнёра-еврея, китайской диаспоры, чернокожих спортсменов и даже русского олигарха.\n\n***Год:***  2019\n\n***Жанр:***  боевик, комедия\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:***  Гай Ричи\n\n***Длительность***:  113 мин.\n\n', 'Один ушлый американец ещё со студенческих лет приторговывал наркотиками, а теперь придумал схему нелегального обогащения с использованием поместий обедневшей английской аристократии и очень неплохо на этом разбогател. Другой пронырливый журналист приходит к Рэю, правой руке американца, и предлагает тому купить киносценарий, в котором подробно описаны преступления его босса при участии других представителей лондонского криминального мира - партнёра-еврея, китайской диаспоры, чернокожих спортсменов и даже русского олигарха.\n\n***Год:***  2019\n\n***Жанр:***  боевик, комедия\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:***  Гай Ричи\n\n***Длительность***:  113 мин.\n\n'),
(339, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-03 17:00:00', '2020-05-03 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-21 21:06:25', '2020-04-21 21:06:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Миньоны-скауты', 'Миньоны-скауты', 'Когда Марго, Агнес и Эдит возвращаются из лагеря скаутов, трое миньонов очарованы скаутскими значками, полученными девочками. Миньоны решают отправиться в лагерь, чтобы получить значки.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, короткометражка, комедия, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Guy Bar\'ely, Frank Baradat\n\n***Длительность:*** 4:00', 'Когда Марго, Агнес и Эдит возвращаются из лагеря скаутов, трое миньонов очарованы скаутскими значками, полученными девочками. Миньоны решают отправиться в лагерь, чтобы получить значки.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, короткометражка, комедия, семейный\n\n***Страна:***  США\n\n***Режиссёры:***  Guy Bar\'ely, Frank Baradat\n\n***Длительность:*** 4:00'),
