(341, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-03 15:00:00', '2020-05-03 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-21 21:11:02', '2020-04-21 21:11:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Тролли. Мировой тур', 'Тролли. Мировой тур', 'Поп-тролли в шоке – оказывается, мир музыки гораздо больше, чем они думали. Рейвы, оупен-эйры, классические концерты и, конечно, хип-хоп баттлы – впереди их ждет головокружительное веселье. Но неудержимая королева Рокс планирует уничтожить всё, чтобы миром безоговорочно правил хард-рок! Розочка, Цветан и их новые друзья отправляются в невероятное путешествие: им предстоит объединить всех троллей и помешать Рокс.\n\n***Год:***  2020\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:*** Уолт Дорн, Дэвид П. Смит\n\n***Длительность:***  90 мин.', 'Поп-тролли в шоке – оказывается, мир музыки гораздо больше, чем они думали. Рейвы, оупен-эйры, классические концерты и, конечно, хип-хоп баттлы – впереди их ждет головокружительное веселье. Но неудержимая королева Рокс планирует уничтожить всё, чтобы миром безоговорочно правил хард-рок! Розочка, Цветан и их новые друзья отправляются в невероятное путешествие: им предстоит объединить всех троллей и помешать Рокс.\n\n***Год:***  2020\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:*** Уолт Дорн, Дэвид П. Смит\n\n***Длительность:***  90 мин.'),
