(343, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-04 15:00:00', '2020-05-04 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 14:09:19', '2020-04-30 14:09:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Замужняя женщина', 'Замужняя женщина', 'События происходят в Калькутте в 1962 году, когда маленькая Лолита приезжает жить в семью своего дяди, где судьба сталкивает ее с мальчиком Шекхаром, способным музыкантом, сыном влиятельного бизнесмена. С этого времени они разделяют радости и печали. Незаметно для них их дружба перерастает в любовь, которую они даже не замечают. И только появление в их жизни нового человека, Гириша, раскрывает им настоящие чувства друг к другу.\n\n***Год:*** 2005\n\n***Жанр:***  мюзикл, драма, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Прадип Саркар\n\n***Длительность:***  130 мин.', 'События происходят в Калькутте в 1962 году, когда маленькая Лолита приезжает жить в семью своего дяди, где судьба сталкивает ее с мальчиком Шекхаром, способным музыкантом, сыном влиятельного бизнесмена. С этого времени они разделяют радости и печали. Незаметно для них их дружба перерастает в любовь, которую они даже не замечают. И только появление в их жизни нового человека, Гириша, раскрывает им настоящие чувства друг к другу.\n\n***Год:*** 2005\n\n***Жанр:***  мюзикл, драма, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Прадип Саркар\n\n***Длительность:***  130 мин.'),
(344, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-05 17:00:00', '2020-05-05 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 14:29:39', '2020-04-30 14:29:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Король Сингх', 'Король Сингх', 'Все начинается в тот день, когда жители маленькой пенджабской деревушки, решив отдохнуть от «благодеяний» Хэппи, чье постоянное стремление всем помогать приносит кучу неприятностей и массу разрушений, отсылают его в Австралию с заведомо невыполнимой миссией - вернуть на родную землю Лакхана Сингха, или Лаки, который несколько лет назад уехал из деревни и стал королем австралийских гангстеров. Но Хэппи, с которым вечно что-то приключается, садится не на тот самолет и вместо Австралии оказывается в Египте. В стране пирамид он встречает девушку своей мечты – Сонию. Кто мог подумать, что судьба приготовила им еще одну встречу – Сония приезжает в Австралию со своим женихом…\n\n***Год:***  2008\n\n***Жанр:*** боевик, драма, мелодрама, комедия, преступление\n\n***Страны:*** Австралия, Индия\n\n***Режиссёр:*** Анис Базми\n\n***Длительность:*** 135 мин.', 'Все начинается в тот день, когда жители маленькой пенджабской деревушки, решив отдохнуть от «благодеяний» Хэппи, чье постоянное стремление всем помогать приносит кучу неприятностей и массу разрушений, отсылают его в Австралию с заведомо невыполнимой миссией - вернуть на родную землю Лакхана Сингха, или Лаки, который несколько лет назад уехал из деревни и стал королем австралийских гангстеров. Но Хэппи, с которым вечно что-то приключается, садится не на тот самолет и вместо Австралии оказывается в Египте. В стране пирамид он встречает девушку своей мечты – Сонию. Кто мог подумать, что судьба приготовила им еще одну встречу – Сония приезжает в Австралию со своим женихом…\n\n***Год:***  2008\n\n***Жанр:*** боевик,