(345, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-04 17:00:00', '2020-05-04 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 14:49:33', '2020-04-30 14:49:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Встреча с тобой', 'Встреча с тобой', 'Основные действия картины «Встреча с тобой» разворачиваются во время страшного события, ужасного наводнения в Мумбае, которое произошло 26-го июля 2005 года… В результате сильного наводнения пострадали многие люди. Но жизнь интересна тем, что в любой ситуации, даже такой трагической есть что-то хорошее. Благодаря этому наводнению воссоединились два любящих сердца. Их пути разошлись еще шесть лет назад. Но сейчас, в этот сложный период они вынуждены быть вместе…  \n\n***Год:***  2009\n\n***Жанр:***  драма, мелодрама\n\n***Режиссер:***  Кунал Дешмукх\n\n***Страна:*** Индия\n\n***Длительность:*** 130 мин.', 'Основные действия картины «Встреча с тобой» разворачиваются во время страшного события, ужасного наводнения в Мумбае, которое произошло 26-го июля 2005 года… В результате сильного наводнения пострадали многие люди. Но жизнь интересна тем, что в любой ситуации, даже такой трагической есть что-то хорошее. Благодаря этому наводнению воссоединились два любящих сердца. Их пути разошлись еще шесть лет назад. Но сейчас, в этот сложный период они вынуждены быть вместе…  \n\n***Год:***  2009\n\n***Жанр:***  драма, мелодрама\n\n***Режиссер:***  Кунал Дешмукх\n\n***Страна:*** Индия\n\n***Длительность:*** 130 мин.'),
(346, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-05 15:00:00', '2020-05-05 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 14:59:13', '2020-04-30 14:59:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Когда Гарри встретил Седжал', 'Когда Гарри встретил Седжал', 'История путешествия Гарри и Седжал по всей Европе. Поиск обручального кольца Седжал заставляет Гарри лучше понять любовь и отношения. Седжал же наслаждается новообретённой свободой и чувством защищённости в компании Гарри.\n\n***Год:***  2017\n\n***Жанр:*** драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Имтиаз Али\n\n***Длительность:***  143 мин.', 'История путешествия Гарри и Седжал по всей Европе. Поиск обручального кольца Седжал заставляет Гарри лучше понять любовь и отношения. Седжал же наслаждается новообретённой свободой и чувством защищённости в компании Гарри.\n\n***Год:***  2017\n\n***Жанр:*** драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Имтиаз Али\n\n***Длительность:***  143 мин.'),
(347, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-06 15:00:00', '2020-05-06 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 15:10:48', '2020-04-30 15:10:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Вир – герой народа', 'Вир – герой народа', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...\n\n***Год:***  2010\n\n***Жанр: *** боевик, драма, мелодрама, приключения\n\n***Страна:***  Индия\n\n***Режиссёр:***  Анил Шарма\n\n***Длительность:***  163 мин.', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вир