(348, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-06 17:00:00', '2020-05-06 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 15:20:32', '2020-04-30 15:20:35', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Тайная суперзвезда', 'Тайная суперзвезда', '14-летняя девочка из Гуджарата хочет стать певицей. Отец против, но героиня не отказывается от своей мечты - она записывает видео с песней под гитару, где скрывает лицо паранджой, и выкладывает в Интернет. Ролик становится невероятно популярным.\n\n***Год:***  2017\n\n***Жанр:***  драма, семейный, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Адваит Чандан\n\n***Длительность***:  150 мин.', '14-летняя девочка из Гуджарата хочет стать певицей. Отец против, но героиня не отказывается от своей мечты - она записывает видео с песней под гитару, где скрывает лицо паранджой, и выкладывает в Интернет. Ролик становится невероятно популярным.\n\n***Год:***  2017\n\n***Жанр:***  драма, семейный, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Адваит Чандан\n\n***Длительность***:  150 мин.'),
(349, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-07 15:00:00', '2020-05-07 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 15:32:15', '2020-04-30 15:32:18', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Моя ужасная няня', 'Моя ужасная няня', 'Попав в дом к недавно овдовевшему мистеру Брауну, няня-волшебница пытается усмирить его семерых непослушных детей. Эти сорванцы, возглавляемые Саймоном, уже избавились от 17 предыдущих нянь и поэтому не сомневаются, что и 18-ю ждет та же участь. Однако, когда няне Макфи все-таки удается взять ситуацию под контроль, детишки вдруг начинают замечать, что их ужасное поведение волшебным образом приводит к совершенно удивительным и непредсказуемым результатам…\n\n***Год:***  2005\n\n***Жанр:*** фэнтези, комедия, семейный\n\n***Страны:***  США, Великобритания, Франция\n\n***Режиссёр:***  Кирк Джонс\n\n***Длительность:***  97 мин.', 'Попав в дом к недавно овдовевшему мистеру Брауну, няня-волшебница пытается усмирить его семерых непослушных детей. Эти сорванцы, возглавляемые Саймоном, уже избавились от 17 предыдущих нянь и поэтому не сомневаются, что и 18-ю ждет та же участь. Однако, когда няне Макфи все-таки удается взять ситуацию под контроль, детишки вдруг начинают замечать, что их ужасное поведение волшебным образом приводит к совершенно удивительным и непредсказуемым результатам…\n\n***Год:***  2005\n\n***Жанр:*** фэнтези, комедия, семейный\n\n***Страны:***  США, Великобритания, Франция\n\n***Режиссёр:***  Кирк Джонс\n\n***Длительность:***  97 мин.'),
