(351, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-10 15:00:00', '2020-05-10 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 16:18:17', '2020-04-30 16:18:20', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Беспечные близнецы', 'Беспечные близнецы', 'Разлученные с детства братья-близнецы росли в разных семьях. Один хотел стать певцом, другой же просто дурачил людей на улицах. Но волею судьбы их жизни пересеклись с жизнью двух очаровательных девушек. При встречах с девушками возникает множество комичных ситуаций, ведь братья похожи как две капли воды.\n\n***Дата:***  1997\n\n***Жанр:***  боевик, драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дэвид Дхаван\n\n***Длительность:***  137 мин.', 'Разлученные с детства братья-близнецы росли в разных семьях. Один хотел стать певцом, другой же просто дурачил людей на улицах. Но волею судьбы их жизни пересеклись с жизнью двух очаровательных девушек. При встречах с девушками возникает множество комичных ситуаций, ведь братья похожи как две капли воды.\n\n***Дата:***  1997\n\n***Жанр:***  боевик, драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дэвид Дхаван\n\n***Длительность:***  137 мин.'),
