(353, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-10 19:00:00', '2020-05-10 21:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-04-30 16:50:18', '2020-04-30 16:50:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Желаю удачи!', 'Желаю удачи!', 'Вики – начинающий певец. Саба – успешный менеджер по связям с общественностью в рекламном агентстве. Сколько бы Вики не старался, удача обходит его стороной. Чего не скажешь о Сабе – она с фортуной на «ты». Случайная встреча на вечеринке и непреднамеренный поцелуй полностью перевернули жизнь этих двоих...\n\n***Дата:***  2008\n\n***Жанр:***  драма, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Адитья Датт\n\n***Длительность:***  140 мин.', 'Вики – начинающий певец. Саба – успешный менеджер по связям с общественностью в рекламном агентстве. Сколько бы Вики не старался, удача обходит его стороной. Чего не скажешь о Сабе – она с фортуной на «ты». Случайная встреча на вечеринке и непреднамеренный поцелуй полностью перевернули жизнь этих двоих...\n\n***Дата:***  2008\n\n***Жанр:***  драма, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Адитья Датт\n\n***Длительность:***  140 мин.'),
(354, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-02 14:00:00', '2020-05-02 16:00:00', NULL, 11, 11, NULL, '0.00', '0.00', '0.00', '0.000', 13, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-01 15:00:29', '2020-05-01 15:00:31', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 4, 'Суперсемейка 2', 'Суперсемейка 2', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.\n\n***Год:***  2018\n\n***Жанр:***  мультфильм, фантастика, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Брэд Бёрд\n\n***Длительность:***  118 мин.', 'После событий первой части суперсемейка пользуется повышенным вниманием со стороны журналистов. Неожиданно оказалось, что обаятельная Миссис Исключительная гораздо лучше смотрится на экране телевизора, чем её муж. Мистеру Исключительному все чаще приходится сидеть дома и приглядывать за детьми, у каждого из которых есть свои причины быть недовольным собственными суперспособностями. Однако семейным проблемам предстоит отступить на второй план, когда окажется, что спокойствию Суперсемейки угрожает новый могущественный враг.\n\n***Год:***  2018\n\n***Жанр:***  мультфильм, фантастика, боевик, комедия, приключения, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Брэд Бёрд\n\n***Длительность:***  118 мин.'),
(355, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-02 16:00:00', '2020-05-02 18:00:00', NULL, 11, 11, NULL, '0.00', '0.00', '0.00', '0.000', 13, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-01 15:07:04', '2020-05-01 15:13:31', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 4, 'Снежная Королева: Зазеркалье', 'Снежная Королева: Зазеркалье', 'Могущественный король Харальд чуть не потерял семью из-за Снежной Королевы. Он находит способ очистить мир от волшебства – все обладатели магических способностей отныне заточены в Зазеркалье. Остановить его и не дать сказке навсегда исчезнуть из нашего мира может только Герда. Ведь ее главная сила не в волшебстве, а вере в добро и дружбу. В новом приключении на помощь Герде придут тролли, пираты и даже сама Снежная Королева.\n\n***Год:*** 2018\n\n***Жанр:***  мультфильм, комедия, приключения, семейный, фэнтези\n\n***Страна:***  Россия\n\n***Режиссёры:***  Алексей Цицилин, Роберт Ленс\n\n***Длительность:***  80 мин.', 'Могущественный король Харальд чуть не потерял семью из-за Снежной Королевы. Он находит способ очистить мир от волшебства – все обладатели магических способностей отныне заточены в Зазеркалье. Остановить его и не дать сказке навсегда исчезнуть из нашего мира может только Герда. Ведь ее главная сила не в волшебстве, а вере в добро и дружбу. В новом приключении на помощь Герде придут тролли, пираты и даже сама Снежная Королева.\n\n***Год:*** 2018\n\n***Жанр:***  мультфильм, комедия, приключения, семейный, фэнтези\n\n***Страна:***  Россия\n\n***Режиссёры:***  Алексей Цицилин, Роберт Ленс\n\n***Длительность:***  80 мин.'),
(356, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-02 12:00:00', '2020-05-02 14:00:00', NULL, 11, 11, NULL, '0.00', '0.00', '0.00', '0.000', 13, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-01 15:11:29', '2020-05-01 15:11:31', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 4, 'Тайная жизнь домашних животных 2', 'Тайная жизнь домашних животных 2', 'Хозяева Макса уезжают за город в гости на ранчо и берут его с собой. Тем временем, в городе у Снежка и Гиджет свои приключения.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страны:***  США, Франция, Япония\n\n***Режиссёры:***  Крис Рено, Джонатан дель Валь\n\n***Длительность:***  86 мин.', 'Хозяева Макса уезжают за город в гости на ранчо и берут его с собой. Тем временем, в городе у Снежка и Гиджет свои приключения.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, комедия, приключения, семейный\n\n***Страны:***  США, Франция, Япония\n\n***Режиссёры:***  Крис Рено, Джонатан дель Валь\n\n***Длительность:***  86 мин.'),
