(358, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-03 17:00:00', '2020-05-03 19:00:00', NULL, 11, 11, NULL, '0.00', '0.00', '0.00', '0.000', 13, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-01 15:22:14', '2020-05-01 15:22:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 4, 'Студент года 2', 'Студент года 2', 'В университете настаёт черёд проведения ежегодных соревнований на обладание Кубком Достоинства. Тысячи студентов участвуют в различных спортивных состязаниях. Один из вероятных кандидатов на победу Рохан внезапно узнаёт, что его исключили, и всё это результаты происков нечистого на руку соперника. Тогда парень решает подкачаться, привести себя в идеальную физическую форму и показать наглому выскочке, кто тут победитель, а кто - неудачник года.\n\n***Год:***  2018\n\n***Жанр:***  мелодрама, боевик\n\n***Страна:***  Индия\n\n***Режиссёр:***  Пунит Мальхотра\n\n***Длительность:***  146 мин.', 'В университете настаёт черёд проведения ежегодных соревнований на обладание Кубком Достоинства. Тысячи студентов участвуют в различных спортивных состязаниях. Один из вероятных кандидатов на победу Рохан внезапно узнаёт, что его исключили, и всё это результаты происков нечистого на руку соперника. Тогда парень решает подкачаться, привести себя в идеальную физическую форму и показать наглому выскочке, кто тут победитель, а кто - неудачник года.\n\n***Год:***  2018\n\n***Жанр:***  мелодрама, боевик\n\n***Страна:***  Индия\n\n***Режиссёр:***  Пунит Мальхотра\n\n***Длительность:***  146 мин.'),
