(362, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-10 12:55:00', '2020-05-10 14:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 14:48:15', '2020-05-05 14:48:57', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Домой', 'Домой', 'В эпицентре сюжета этой мультипликационной картины оказывается неуклюжий и проблемный Орк. Согласно сюжету "Домой" так сложились обстоятельства, что он остался сиротой и был усыновлен "идеальной" семьей эльфов. Кажется, что еще может быть лучше, когда в семье тебя любят, о тебе заботятся, переживают.\nОднако, наш герой решает сбежать из дома и понять, где же ему будет лучше. В поисках нового дома и новых родителей Орк встречает весьма разных персонажей. Он обретает новых друзей, но и наживает себе не мало врагов. А вот найдет ли Орк лучшее место, чем у него было остается вопросом.\n\n***Год:***  2020\n\n***Жанр:***   Мультфильмы, Приключения\n\n***Странa:***  США \n\n***Режиссёр:***  Michael Johnson\n\n***Длительность:***  82 мин.\n', 'В эпицентре сюжета этой мультипликационной картины оказывается неуклюжий и проблемный Орк. Согласно сюжету "Домой" так сложились обстоятельства, что он остался сиротой и был усыновлен "идеальной" семьей эльфов. Кажется, что еще может быть лучше, когда в семье тебя любят, о тебе заботятся, переживают.\nОднако, наш герой решает сбежать из дома и понять, где же ему будет лучше. В поисках нового дома и новых родителей Орк встречает весьма разных персонажей. Он обретает новых друзей, но и наживает себе не мало врагов. А вот найдет ли Орк лучшее место, чем у него было остается вопросом.\n\n***Год:***  2020\n\n***Жанр:***   Мультфильмы, Приключения\n\n***Странa:***  США \n\n***Режиссёр:***  Michael Johnson\n\n***Длительность:***  82 мин.\n'),
(363, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-10 14:55:00', '2020-05-10 16:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 14:54:09', '2020-05-05 14:54:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Кот под прикрытием', 'Кот под прикрытием', 'Два полицейских спецагента должны раскрыть дело о похищении секретного минерала. Проблема в том, что каждый из них привык работать исключительно своими, отличными от напарника, методами. Да и сами они, мягко говоря, совсем не похожи друг на друга.\n\n***Год:*** 2019\n\n***Жанр:*** мультфильм, приключения\n\n***Страны:***  Китай, Франция\n\n***Режиссёры:*** Гийом Ивернель, Чжан Чжии\n\n***Длительность:***  90 мин.', 'Два полицейских спецагента должны раскрыть дело о похищении секретного минерала. Проблема в том, что каждый из них привык работать исключительно своими, отличными от напарника, методами. Да и сами они, мягко говоря, совсем не похожи друг на друга.\n\n***Год:*** 2019\n\n***Жанр:*** мультфильм, приключения\n\n***Страны:***  Китай, Франция\n\n***Режиссёры:*** Гийом Ивернель, Чжан Чжии\n\n***Длительность:***  90 мин.'),
(364, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-10 18:55:00', '2020-05-10 20:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 14:58:36', '2020-05-05 14:58:37', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Лёд 2', 'Лёд 2', 'Что происходит в сказках после свадьбы принца и принцессы? Фигуристка Надя и хоккеист Саша поженились и теперь мечтают о ребенке. Правда, цена, которую им придется заплатить за эту мечту, будет невообразимо высока. Кажется, что после таких потрясений рассчитывать на счастливый конец уже невозможно. Но если вы так думаете, вы ничего не знаете о настоящих сказках.\n\n***Год:*** 2020\n\n***Жанр:***  мелодрама, драма\n\n***Страна:***  Россия\n\n***Режиссёр:***  Жора Крыжовников\n\n***Длительность:***  132 мин.', 'Что происходит в сказках после свадьбы принца и принцессы? Фигуристка Надя и хоккеист Саша поженились и теперь мечтают о ребенке. Правда, цена, которую им придется заплатить за эту мечту, будет невообразимо высока. Кажется, что после таких потрясений рассчитывать на счастливый конец уже невозможно. Но если вы так думаете, вы ничего не знаете о настоящих сказках.\n\n***Год:*** 2020\n\n***Жанр:***  мелодрама, драма\n\n***Страна:***  Россия\n\n***Режиссёр:***  Жора Крыжовников\n\n***Длительность:***  132 мин.'),
(365, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-10 16:55:00', '2020-05-10 18:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:03:25', '2020-05-05 15:03:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Тролли. Мировой тур', 'Тролли. Мировой тур', 'Поп-тролли в шоке – оказывается, мир музыки гораздо больше, чем они думали. Рейвы, оупен-эйры, классические концерты и, конечно, хип-хоп баттлы – впереди их ждет головокружительное веселье. Но неудержимая королева Рокс планирует уничтожить всё, чтобы миром безоговорочно правил хард-рок! Розочка, Цветан и их новые друзья отправляются в невероятное путешествие: им предстоит объединить всех троллей и помешать Рокс.\n\n***Год:***  2020\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Уолт Дорн, Дэвид П. Смит\n\n***Длительность:***  90 мин.', 'Поп-тролли в шоке – оказывается, мир музыки гораздо больше, чем они думали. Рейвы, оупен-эйры, классические концерты и, конечно, хип-хоп баттлы – впереди их ждет головокружительное веселье. Но неудержимая королева Рокс планирует уничтожить всё, чтобы миром безоговорочно правил хард-рок! Розочка, Цветан и их новые друзья отправляются в невероятное путешествие: им предстоит объединить всех троллей и помешать Рокс.\n\n***Год:***  2020\n\n***Жанр:***  мультфильм, мюзикл, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёры:***  Уолт Дорн, Дэвид П. Смит\n\n***Длительность:***  90 мин.'),
(366, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-17 17:00:00', '2020-05-17 19:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:13:50', '2020-05-05 15:13:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Элвин и бурундуки 3', 'Элвин и бурундуки 3', 'Приключения троицы непоседливых братьев-бурундуков продолжаются! Элвин, Саймон и Теодор, а также их подруги бурундушки, просто не могут оставаться в стороне от различного рода неприятностей, сулящих им новые увлекательные приключения. Что на этот раз уготовила судьба нашим героям, и как они выпутаются из очередной передряги — вот в чём вопрос.\n\n***Год:***  2011\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёр:***  Майк Митчелл\n\n***Длительность:***  84 мин.', 'Приключения троицы непоседливых братьев-бурундуков продолжаются! Элвин, Саймон и Теодор, а также их подруги бурундушки, просто не могут оставаться в стороне от различного рода неприятностей, сулящих им новые увлекательные приключения. Что на этот раз уготовила судьба нашим героям, и как они выпутаются из очередной передряги — вот в чём вопрос.\n\n***Год:***  2011\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёр:***  Майк Митчелл\n\n***Длительность:***  84 мин.'),
(367, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-16 17:00:00', '2020-05-16 19:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:23:11', '2020-05-05 15:23:12', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Постояльцы', 'Постояльцы', 'Главные герои фильма – молодые, амбициозные молодые люди, которые в данный момент активно заняты поиском жилья. Но вот только никто не хочет пускать таких постояльцев как эти четверо парней. И вот, кажется, они нашли квартиру, как раз как и хотели, но… Владелец дома согласен пустить постояльцев к себе, но у него есть одно условие. Его постояльцами могут быть только семейные пары. Что же делать парням: ночевать на улице или кому-то из них придется играть роль жен…  \n\n***Год:*** 2009\n\n***Жанр:***  драма, комедия\n\n***Страна:*** Индия\n\n***Режиссер:***  Паритош Паинтер\n\n***Длительность: *** 120 мин.', 'Главные герои фильма – молодые, амбициозные молодые люди, которые в данный момент активно заняты поиском жилья. Но вот только никто не хочет пускать таких постояльцев как эти четверо парней. И вот, кажется, они нашли квартиру, как раз как и хотели, но… Владелец дома согласен пустить постояльцев к себе, но у него есть одно условие. Его постояльцами могут быть только семейные пары. Что же делать парням: ночевать на улице или кому-то из них придется играть роль жен…  \n\n***Год:*** 2009\n\n***Жанр:***  драма, комедия\n\n***Страна:*** Индия\n\n***Режиссер:***  Паритош Паинтер\n\n***Длительность: *** 120 мин.'),
(368, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-17 19:00:00', '2020-05-17 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:26:53', '2020-05-05 15:26:55', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Мастер блефа', 'Мастер блефа', 'Рой – профессиональный аферист, который довел свою работу до уровня искусства. Единственное настоящее, что есть у него – это любовь к Симми, которая является такой честной и искренней, что молодой человек не может заставить себя сказать ей правду о том, кто он. Но когда прошлое настигает его, Симми не может простить его за обман в их отношениях и Рой теряет ее. Тогда в картине появляется Адитья, который является полной противоположностью Рою. У них есть только одна общая черта – Адитья тоже аферист. По крайней мере, так думает сам Адитья. Рой соглашается помочь парню стать настоящим аферистом и в ходе этого процесса полностью попадает под его очарование...\n\n***Год:*** 2005\n\n***Жанр:***  триллер, драма, мелодрама, комедия, преступление\n\n***Страна: *** Индия\n\n***Режиссёр:***  Рохан Сиппи\n\n***Длительность***:  137 мин.', 'Рой – профессиональный аферист, который довел свою работу до уровня искусства. Единственное настоящее, что есть у него – это любовь к Симми, которая является такой честной и искренней, что молодой человек не может заставить себя сказать ей правду о том, кто он. Но когда прошлое настигает его, Симми не может простить его за обман в их отношениях и Рой теряет ее. Тогда в картине появляется Адитья, который является полной противоположностью Рою. У них есть только одна общая черта – Адитья тоже аферист. По крайней мере, так думает сам Адитья. Рой соглашается помочь парню стать настоящим аферистом и в ходе этого процесса полностью попадает под его очарование...\n\n***Год:*** 2005\n\n***Жанр:***  триллер, драма, мелодрама, комедия, преступление\n\n***Страна: *** Индия\n\n***Режиссёр:***  Рохан Сиппи\n\n***Длительность***:  137 мин.'),
(369, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-17 15:00:00', '2020-05-17 17:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:30:49', '2020-05-05 15:30:51', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Беспечные близнецы', 'Беспечные близнецы', 'Разлученные с детства братья-близнецы росли в разных семьях. Один хотел стать певцом, другой же просто дурачил людей на улицах. Но волею судьбы их жизни пересеклись с жизнью двух очаровательных девушек. При встречах с девушками возникает множество комичных ситуаций, ведь братья похожи как две капли воды.\n\n***Год:*** 1997\n\n***Жанр:***  боевик, драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дэвид Дхаван\n\n***Длительность:*** 137 мин.', 'Разлученные с детства братья-близнецы росли в разных семьях. Один хотел стать певцом, другой же просто дурачил людей на улицах. Но волею судьбы их жизни пересеклись с жизнью двух очаровательных девушек. При встречах с девушками возникает множество комичных ситуаций, ведь братья похожи как две капли воды.\n\n***Год:*** 1997\n\n***Жанр:***  боевик, драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дэвид Дхаван\n\n***Длительность:*** 137 мин.'),
(371, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-16 15:00:00', '2020-05-16 17:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:36:47', '2020-05-05 15:36:49', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Падмавати', 'Падмавати', '1303 год. Могущественный султан Алауддин Хилджи, завоевавший половину Индии, поддается сладким речам изгнанного из Читторгарха бывшего королевского религиозного наставника, что его могущество только будет расти, если рядом с ним будет красавица Падмавати, жена правителя Раваны Сингха. С этого момента султан становится одержим идеей захватить Падмавати. Он приводит свои войска к стенам крепости Читторгарх и обещает её правителю не разрушать город, если тот отдаст ему собственную жену.\n\n***Год:*** 2018\n\n***Жанр:***  драма, мелодрама, военный, история\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Лила Бхансали\n\n***Длительность:***  164 мин.', '1303 год. Могущественный султан Алауддин Хилджи, завоевавший половину Индии, поддается сладким речам изгнанного из Читторгарха бывшего королевского религиозного наставника, что его могущество только будет расти, если рядом с ним будет красавица Падмавати, жена правителя Раваны Сингха. С этого момента султан становится одержим идеей захватить Падмавати. Он приводит свои войска к стенам крепости Читторгарх и обещает её правителю не разрушать город, если тот отдаст ему собственную жену.\n\n***Год:*** 2018\n\n***Жанр:***  драма, мелодрама, военный, история\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Лила Бхансали\n\n***Длительность:***  164 мин.'),
(372, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-14 17:00:00', '2020-05-14 19:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:43:48', '2020-05-05 15:43:50', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'И в печали, и в радости...', 'И в печали, и в радости...', 'У богатого бизнесмена и его жены два сына - приемный Рахул и родной Рохан. Рахул дружит с Нэйной, которая влюблена в него, и отец предполагает поженить их. Но Рахул встречает Анджали - симпатичную девушку, живущую в бедном районе, и влюбляется в нее. Несмотря на данное отцу обещание отказаться от девушки, Рахул тайно женится на ней, чем вызывает гнев и проклятия отца. Рахул покидает родной дом и уезжает в Лондон. Проходит 10 лет. Подросший Рохан, чудом превратившийся из неповоротливого толстяка и обжоры в атлета и красавца, узнает о конфликте между отцом и братом и клянется вернуть брата в семью.\n\n***Год:*** 2001\n\n***Жанр:*** мюзикл, драма, мелодрама, музыка\n\n***Страна:*** Индия\n\n***Режиссёр:***  Каран Джохар\n\n***Длительность:***  210 мин.', 'У богатого бизнесмена и его жены два сына - приемный Рахул и родной Рохан. Рахул дружит с Нэйной, которая влюблена в него, и отец предполагает поженить их. Но Рахул встречает Анджали - симпатичную девушку, живущую в бедном районе, и влюбляется в нее. Несмотря на данное отцу обещание отказаться от девушки, Рахул тайно женится на ней, чем вызывает гнев и проклятия отца. Рахул покидает родной дом и уезжает в Лондон. Проходит 10 лет. Подросший Рохан, чудом превратившийся из неповоротливого толстяка и обжоры в атлета и красавца, узнает о конфликте между отцом и братом и клянется вернуть брата в семью.\n\n***Год:*** 2001\n\n***Жанр:*** мюзикл, драма, мелодрама, музыка\n\n***Страна:*** Индия\n\n***Режиссёр:***  Каран Джохар\n\n***Длительность:***  210 мин.'),
