(374, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-12 17:00:00', '2020-05-12 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 15:56:08', '2020-05-05 15:56:10', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Король Сингх', 'Король Сингх', 'Все начинается в тот день, когда жители маленькой пенджабской деревушки, решив отдохнуть от «благодеяний» Хэппи, чье постоянное стремление всем помогать приносит кучу неприятностей и массу разрушений, отсылают его в Австралию с заведомо невыполнимой миссией - вернуть на родную землю Лакхана Сингха, или Лаки, который несколько лет назад уехал из деревни и стал королем австралийских гангстеров. Но Хэппи, с которым вечно что-то приключается, садится не на тот самолет и вместо Австралии оказывается в Египте. В стране пирамид он встречает девушку своей мечты – Сонию. Кто мог подумать, что судьба приготовила им еще одну встречу – Сония приезжает в Австралию со своим женихом…\n\n***Год:*** 2008\n\n***Жанр:*** боевик, драма, мелодрама, комедия, преступление\n\n***Страны:*** Австралия, Индия\n\n***Режиссёр:*** Анис Базми\n\n***Длительность:*** 135 мин.', 'Все начинается в тот день, когда жители маленькой пенджабской деревушки, решив отдохнуть от «благодеяний» Хэппи, чье постоянное стремление всем помогать приносит кучу неприятностей и массу разрушений, отсылают его в Австралию с заведомо невыполнимой миссией - вернуть на родную землю Лакхана Сингха, или Лаки, который несколько лет назад уехал из деревни и стал королем австралийских гангстеров. Но Хэппи, с которым вечно что-то приключается, садится не на тот самолет и вместо Австралии оказывается в Египте. В стране пирамид он встречает девушку своей мечты – Сонию. Кто мог подумать, что судьба приготовила им еще одну встречу – Сония приезжает в Австралию со своим женихом…\n\n***Год:*** 2008\n\n***Жанр:*** боевик, драма, мелодрама, комедия, преступление\n\n***Страны:*** Австралия, Индия\n\n***Режиссёр:*** Анис Базми\n\n***Длительность:*** 135 мин.'),
(375, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-15 15:00:00', '2020-05-15 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 17:54:57', '2020-05-05 17:54:59', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Пока я жив', 'Пока я жив', 'История о Самар Ананде, майоре индийской армии из отряда сапёров. Все поражаются, как без капли страха за свою жизнь он обезвреживает бомбы, он совсем не боится смерти. Однажды он спасает тонущую девушку Акиру, репортёра Discovery Channel, и нечаянно забывает у неё свою куртку. Акира находит в ней его дневник и узнаёт историю о Самаре, его единственной любви Мире и одной клятве, которая перевернула всю его жизнь.\n\n***Год:***  2012\n\n***Жанр:*** драма, мелодрама\n\n***Страна:*** Индия\n\n***Режиссёр:*** Яш Чопра\n\n***Длительность:*** 176 мин.', 'История о Самар Ананде, майоре индийской армии из отряда сапёров. Все поражаются, как без капли страха за свою жизнь он обезвреживает бомбы, он совсем не боится смерти. Однажды он спасает тонущую девушку Акиру, репортёра Discovery Channel, и нечаянно забывает у неё свою куртку. Акира находит в ней его дневник и узнаёт историю о Самаре, его единственной любви Мире и одной клятве, которая перевернула всю его жизнь.\n\n***Год:***  2012\n\n***Жанр:*** драма, мелодрама\n\n***Страна:*** Индия\n\n***Режиссёр:*** Яш Чопра\n\n***Длительность:*** 176 мин.'),
(376, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-14 15:00:00', '2020-05-14 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 17:58:41', '2020-05-05 17:58:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Жил-был тигр', 'Жил-был тигр', 'Индийский спецагент по прозвищу Тигр во время очередной миссии влюбляется в очаровательную танцовщицу Зою - помощницу ученого, который подозревается в продаже секретных технологий пакистанской разведке.\n\n***Год:*** 2012\n\n***Жанр:***  боевик, триллер, мелодрама\n\n***Страна:***  Индия\n\n***Режиссёр:***  Кабир Кхан\n\n***Длительность:***  132 мин.', 'Индийский спецагент по прозвищу Тигр во время очередной миссии влюбляется в очаровательную танцовщицу Зою - помощницу ученого, который подозревается в продаже секретных технологий пакистанской разведке.\n\n***Год:*** 2012\n\n***Жанр:***  боевик, триллер, мелодрама\n\n***Страна:***  Индия\n\n***Режиссёр:***  Кабир Кхан\n\n***Длительность:***  132 мин.'),
(377, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-13 15:00:00', '2020-05-13 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 18:09:24', '2020-05-05 18:09:27', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Вир – герой народа', 'Вир – герой народа', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...\n\n***Год:***  2010\n\n***Жанр:***  боевик, драма, мелодрама, приключения\n\n***Страна:***  Индия\n\n***Режиссёр:***  Анил Шарма\n\n***Длительность:*** 163 мин.', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира