(379, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-11 15:00:00', '2020-05-11 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-05 18:22:30', '2020-05-05 18:22:33', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Султан', 'Султан', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Год:***  2016\n\n***Жанр:*** боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:*** 170 мин.', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Год:***  2016\n\n***Жанр:*** боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:*** 170 мин.'),
(380, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-24 17:00:00', '2020-05-24 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 13:57:17', '2020-05-13 13:57:20', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Бадшах', 'Бадшах', 'Весельчак и балагур Бадшах становится частным детективом для того, чтобы бороться с несправедливостью и помогать людям. Однажды, занимаясь розыском похищенного ребенка, он сталкивается с террористами, вынашивающими планы покушения на премьер-министра. Ситуация складывается так, что его ставят перед выбором: или он сам станет непосредственным исполнителем этой акции, или будут убиты его друзья, оказавшиеся в заложниках...\n\n***Год:***  1999\n\n***Жанр:***  боевик, триллер, комедия, преступление\n\n***Страна:***  Индия\n\n***Режиссёры:***  Аббас Алибхай Бурмавалла, Мастан Алибхай Бурмавалла\n\n***Длительность:*** 175 мин.', 'Весельчак и балагур Бадшах становится частным детективом для того, чтобы бороться с несправедливостью и помогать людям. Однажды, занимаясь розыском похищенного ребенка, он сталкивается с террористами, вынашивающими планы покушения на премьер-министра. Ситуация складывается так, что его ставят перед выбором: или он сам станет непосредственным исполнителем этой акции, или будут убиты его друзья, оказавшиеся в заложниках...\n\n***Год:***  1999\n\n***Жанр:***  боевик, триллер, комедия, преступление\n\n***Страна:***  Индия\n\n***Режиссёры:***  Аббас Алибхай Бурмавалла, Мастан Алибхай Бурмавалла\n\n***Длительность:*** 175 мин.'),
(381, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-19 15:00:00', '2020-05-19 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 14:01:30', '2020-05-13 14:01:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Свадьба моего отца', 'Свадьба моего отца', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***  2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Приядаршан\n\n***Длительность:*** 163 мин.', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***  2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Ин