(382, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-18 17:00:00', '2020-05-18 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 14:04:53', '2020-05-13 14:04:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Король Сингх', 'Король Сингх', 'Все начинается в тот день, когда жители маленькой пенджабской деревушки, решив отдохнуть от «благодеяний» Хэппи, чье постоянное стремление всем помогать приносит кучу неприятностей и массу разрушений, отсылают его в Австралию с заведомо невыполнимой миссией - вернуть на родную землю Лакхана Сингха, или Лаки, который несколько лет назад уехал из деревни и стал королем австралийских гангстеров. Но Хэппи, с которым вечно что-то приключается, садится не на тот самолет и вместо Австралии оказывается в Египте. В стране пирамид он встречает девушку своей мечты – Сонию. Кто мог подумать, что судьба приготовила им еще одну встречу – Сония приезжает в Австралию со своим женихом…\n\n***Год:*** 2008\n\n***Жанр:***  боевик, драма, мелодрама, комедия, преступление\n\n***Страны:***  Австралия, Индия\n\n***Режиссёр:***  Анис Базми\n\n***Длительность:***  135 мин.', 'Все начинается в тот день, когда жители маленькой пенджабской деревушки, решив отдохнуть от «благодеяний» Хэппи, чье постоянное стремление всем помогать приносит кучу неприятностей и массу разрушений, отсылают его в Австралию с заведомо невыполнимой миссией - вернуть на родную землю Лакхана Сингха, или Лаки, который несколько лет назад уехал из деревни и стал королем австралийских гангстеров. Но Хэппи, с которым вечно что-то приключается, садится не на тот самолет и вместо Австралии оказывается в Египте. В стране пирамид он встречает девушку своей мечты – Сонию. Кто мог подумать, что судьба приготовила им еще одну встречу – Сония приезжает в Австралию со своим женихом…\n\n***Год:*** 2008\n\n***Жанр:***  боев