(385, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-21 17:00:00', '2020-05-21 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 14:16:25', '2020-05-13 14:16:28', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Свадьба моей любимой', 'Свадьба моей любимой', 'Ловелас и балагур по натуре, Санджай из телефонного разговора со своей старой подружкой Анджали узнает, что она скоро выходит замуж. Неожиданно для него самого это сообщение выводит Санджая из душевного равновесия. Проведя в размышлениях весь день, он осознает, что очень сильно любит Анджали. Не теряя ни минуты, Санджай отправляется в Дехрадун, чтобы по возможности сорвать свадьбу…\n\n***Год:*** 2002\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Гадхви\n\n***Длительность:***  158 мин.', 'Ловелас и балагур по натуре, Санджай из телефонного разговора со своей старой подружкой Анджали узнает, что она скоро выходит замуж. Неожиданно для него самого это сообщение выводит Санджая из душевного равновесия. Проведя в размышлениях весь день, он осознает, что очень сильно любит Анджали. Не теряя ни минуты, Санджай отправляется в Дехрадун, чтобы по возможности сорвать свадьбу…\n\n***Год:*** 2002\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Гадхви\n\n***Длительность:***  158 мин.'),
