(387, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-22 17:00:00', '2020-05-22 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 14:42:35', '2020-05-13 14:42:44', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Супер бабушка', 'Супер бабушка', 'Бхарти Бхатия, чей каждый час жизни посвящен заботам о своей семье, её мелким нуждам и прихотям, включая властного мужа, сына, играющего на фондовом рынке на повышение, сноху, которая стремится стать звездой мыльной оперы и дочь с ультра современными ценностями. Она самоотверженно выполняет свои обязанности, но в награду получает только насмешки и унижения. В семье все относятся к ней как к коврику у порога. Захватывающая история начинается, когда в Индию неожиданно приезжает внук Манн. Вопреки своим ожиданиям увидеть сильную леди, главу дома, он видит мягкую и дремлющую женщину, которой все помыкают. Это раздражает его, и он решает превратить печальную и скучную жизнь своей бабушки в весёлое катание на американских горках.\n\n***Год:*** 2014\n\n***Жанр:***  драма, комедия, семейный\n\n***Страна:***  Индия\n\n***Режиссёр:*** Индра Кумар\n\n***Длительность:*** 133 мин.', 'Бхарти Бхатия, чей каждый час жизни посвящен заботам о своей семье, её мелким нуждам и прихотям, включая властного мужа, сына, играющего на фондовом рынке на повышение, сноху, которая стремится стать звездой мыльной оперы и дочь с ультра современными ценностями. Она самоотверженно выполняет свои обязанности, но в награду получает только насмешки и унижения. В семье все относятся к ней как к коврику у порога. Захватывающая история начинается, когда в Индию неожиданно приезжает внук Манн. Вопреки своим ожиданиям увидеть сильную леди, главу дома, он видит мягкую и дремлющую женщину, которой все помыкают. Это раздражает его, и он решает превратить печальную и скучную жизнь своей бабушки в