(388, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-24 19:00:00', '2020-05-24 21:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 14:48:50', '2020-05-13 14:48:53', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Рецепт любви: без сахара!', 'Рецепт любви: без сахара!', 'Два абсолютно разных человека, два противоположных мира, закоренелый холостяк Бадхадев и очаровательная, утонченная Нина, столкнувшись случайно несколько раз, чувствуют, что их взаимная симпатия усиливается и перерастает в нечто большее. Они решают пожениться, и Бадхадев едет в Индию просить руки своей возлюбленной у ее отца. Есть только одно небольшое препятствие - будущий тесть младше своего зятя на шесть лет...\n\n***Год:***  2017\n\n***Жанр:*** мелодрама, комедия\n\n***Страны:*** Индия, Великобритания\n\n***Режиссёр:*** Балки\n\n***Длительность:*** 140 мин.', 'Два абсолютно разных человека, два противоположных мира, закоренелый холостяк Бадхадев и очаровательная, утонченная Нина, столкнувшись случайно несколько раз, чувствуют, что их взаимная симпатия усиливается и перерастает в нечто большее. Они решают пожениться, и Бадхадев едет в Индию просить руки своей возлюбленной у ее отца. Есть только одно небольшое препятствие - будущий тесть младше своего зятя на шесть лет...\n\n***Год:***  2017\n\n***Жанр:*** мелодрама, комедия\n\n***Страны:*** Индия, Великобритания\n\n***Режиссёр:*** Балки\n\n***Длительность:*** 140 мин.'),
(389, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-24 15:00:00', '2020-05-24 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 14:52:29', '2020-05-13 14:52:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Робот', 'Робот', 'Он умеет многое - драться, петь и танцевать, он водонепроницаемый и огнестойкий. Он может делать все, что может человек, и даже больше! Он дословно выполняет инструкции. Если человек может солгать, чтобы спасти себя, то этот робот лгать не умеет. У него острая как бритва память, и он запоминает весь телефонный справочник, едва пробежав по нему глазами. Его имя - Читти. Однажды доктор Васигаран, модернизируя процессор робота, добавляет ему имитатор человеческих эмоций. Читти полностью меняется. Теперь он может чувствовать, и первое чувство, которое он открывает для себя - это любовь.\n\n***Год:*** 2010\n\n***Жанр:*** фантастика, боевик\n\n***Страна:*** Индия\n\n***Режиссёр:*** Шанмугам Шанкар\n\n***Длительность:*** 165 мин.', 'Он умеет многое - драться, петь и танцевать, он водонепроницаемый и огнестойкий. Он может делать все, что может человек, и даже больше! Он дословно выполняет инструкции. Если человек может солгать, чтобы спасти себя, то этот робот лгать не умеет. У него острая как бритва память, и он запоминает весь телефонный справочник, едва пробежав по нему глазами. Его имя - Читти. Однажды доктор Васигаран, модернизируя процессор робота, добавляет ему имитатор человеческих эмоций. Читти полностью меняется. Теперь он может чувствовать, и первое чувство, которое он открывает для себя - это любовь.\n\n***Год:*** 2010\n\n***Жанр:*** фантастика, боевик\n\n***Страна:*** Индия\n\n***Режиссёр:*** Шанмугам Шанкар\n\n***Длительность:*** 165 мин.');
