(390, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-24 13:00:00', '2020-05-24 15:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-13 15:48:42', '2020-05-13 15:51:05', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, '7-ой гном', '7-ой гном', 'В замке Фантабулараса большой переполох: принцесса Роза празднует свой 18-й день рождения. Приняты самые строгие меры безопасности, ведь злобная Колдунья Делламорта, которая прокляла Розу на ее крестинах, не позволит проклятию раствориться в воздухе. Семеро гномов - Умник, Рыжик, Ворчун, Соня, Силач, Бодряк и Бобо - ничего не знают об этом, когда отправляются на праздник в замок, мечтая повеселиться… Бобо, самый маленький гном, случайно запускает тайный механизм в кольце Колдуньи, и принцесса вместе со всеми гостями замерзает. Гномы спасаются в самую последнюю секунду. Теперь, чтобы все исправить, им придется отправиться в опасное путешествие и найти возлюбленного принцессы, похищенного драконом злобной Делламорты.\n\n***Год:*** 2014\n\n***Жанр:*** мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:*** Германия\n\n***Режиссёр:*** Борис Альинович\n\n***Длительность:*** 90 мин.', 'В замке Фантабулараса большой переполох: принцесса Роза празднует свой 18-й день рождения. Приняты самые строгие меры безопасности, ведь злобная Колдунья Делламорта, которая прокляла Розу на ее крестинах, не позволит проклятию раствориться в воздухе. Семеро гномов - Умник, Рыжик, Ворчун, Соня, Силач, Бодряк и Бобо - ничего не знают об этом, когда отправляются на праздник в замок, мечтая повеселиться… Бобо, самый маленький гном, случайно запускает тайный механизм в кольце Колдуньи, и принцесса вместе со всеми гостями замерзает. Гномы спасаются в самую последнюю секунду. Теперь, чтобы все исправить, им придется отправиться в опасное путешествие и найти возлюбленного принцессы, похищенного драконом злобной Делламорты.\n\n***Год:*** 2014\n\n***Жанр:*** мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:*** Германия\n\n***Режиссёр:*** Борис Альинович\n\n***Длительность:*** 90 мин.'),
(391, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-25 19:00:00', '2020-05-25 21:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-21 19:49:04', '2020-05-21 19:49:06', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Верю в любовь', 'Верю в любовь', 'Когда Джереми встречает Мелиссу, он сразу понимает, что она – Та Самая. Но хватит ли у него сил, чтобы побороться за любимую в самой безнадежной ситуации? Одна любовь может изменить твою жизнь. Одна жизнь может изменить целый мир.\n\n***Год:***  2020\n\n***Жанр:***  музыка, мелодрама, драма\n\n***Страна:***  США\n\n***Режиссёры:***  Джон Эрвин, Эндрю Эрвин\n\n***Длительность:***  115 мин.', 'Когда Джереми встречает Мелиссу, он сразу понимает, что она – Та Самая. Но хватит ли у него сил, чтобы побороться за любимую в самой безнадежной ситуации? Одна любовь может изменить твою жизнь. Одна жизнь может изменить целый мир.\n\n***Год:***  2020\n\n***Жанр:***  музыка, мелодрама, драма\n\n***Страна:***  США\n\n***Режиссёры:***  Джон Эрвин, Эндрю Эрвин\n\n***Длительность:***  115 мин.'),
(392, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-25 17:00:00', '2020-05-25 19:00:00', NULL, 10, 9, NULL, '0.00', '0.00', '0.00', '0.000', 12, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-21 19:55:08', '2020-05-21 19:55:10', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 11, 3, 'Бабушка лёгкого поведения 2. Престарелые мстители', 'Бабушка лёгкого поведения 2. Престарелые мстители', 'В продолжении популярной комедии зрителей вновь ждет встреча с обаятельным аферистом Сашей Рубенштейном и командой пенсионеров, которые теперь перебрались в Москву. Но их счастливой жизни приходит конец, когда банк, в котором хранятся все сбережения стариков, банкротит беспринципный олигарх Бородин. Саша и «ОПГ – организованная пенсионная группировка» опять объединяются, чтобы отомстить обидчику.\n\n***Год:***  2019\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***  Марюс Вайсберг\n\n***Длительность:***  87 мин.', 'В продолжении популярной комедии зрителей вновь ждет встреча с обаятельным аферистом Сашей Рубенштейном и командой пенсионеров, которые теперь перебрались в Москву. Но их счастливой жизни приходит конец, когда банк, в котором хранятся все сбережения стариков, банкротит беспринципный олигарх Бородин. Саша и «ОПГ – организованная пенсионная группировка» опять объединяются, чтобы отомстить обидчику.\n\n***Год:***  2019\n\n***Жанр:***  комедия\n\n***Страна:***  Россия\n\n***Режиссёр:***  Марюс Вайсберг\n\n***Длительность:***  87 мин.'),
