(396, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-26 17:00:00', '2020-05-26 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 19:09:23', '2020-05-22 19:09:26', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Сильное влечение', 'Сильное влечение', 'Арджун приезжает с отцом на свадьбу, где знакомится с Кхушбу. Для Арджуна это просто приятное знакомство, в то время как Кхушбу всерьез увлечена им, но никак не решается ему об этом сказать. Арджун считая, что из этого мимолетного увлечения ничего серьезного не выйдет, возвращается в Мумбай. Не получив никаких известий от парня, которого она всерьез полюбила, девушка решается на отчаянный шаг: она сама едет к Арджуну, чтобы поставить все точки над «i»...\n\n***Год:***  2004\n\n***Жанр:***  мелодрама\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дж. Кришна\n\n***Длительность:***  148 мин.', 'Арджун приезжает с отцом на свадьбу, где знакомится с Кхушбу. Для Арджуна это просто приятное знакомство, в то время как Кхушбу всерьез увлечена им, но никак не решается ему об этом сказать. Арджун считая, что из этого мимолетного увлечения ничего серьезного не выйдет, возвращается в Мумбай. Не получив никаких известий от парня, которого она всерьез полюбила, девушка решается на отчаянный шаг: она сама едет к Арджуну, чтобы поставить все точки над «i»...\n\n***Год:***  2004\n\n***Жанр:***  мелодрама\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дж. Кришна\n\n***Длительность:***  148 мин.'),
