(402, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-26 15:00:00', '2020-05-26 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 19:41:42', '2020-05-22 19:41:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Я рядом с тобой!!!', 'Я рядом с тобой!!!', 'Рам Прасад мечтает об окончании давнишней вражды между двумя странами. Но есть силы, которые противостоят этому. Под угрозой жизнь Саньяны, дочери генерала. Чтобы защитить девушку, Рам Прасад появляется в ее школе под видом студента.\n\n***Год:***  2004\n\n***Жанр:***  мюзикл, мелодрама, боевик, драма, комедия, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Фара Кхан\n\n***Длительность:***  179 мин.', 'Рам Прасад мечтает об окончании давнишней вражды между двумя странами. Но есть силы, которые противостоят этому. Под угрозой жизнь Саньяны, дочери генерала. Чтобы защитить девушку, Рам Прасад появляется в ее школе под видом студента.\n\n***Год:***  2004\n\n***Жанр:***  мюзикл, мелодрама, боевик, драма, комедия, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Фара Кхан\n\n***Длительность:***  179 мин.'),
(403, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-27 15:00:00', '2020-05-27 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 19:45:21', '2020-05-26 18:26:13', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Вир – герой народа', 'Wiý-halk gahrymany', 'Taryhyň sahypalaryndan görülmedik edermenlik, tekepbirlik we ajy söýgi barada rowaýat gelip ýetdi. Gadymy geçmişde Hindistan Britaniýanyň koloniýasy wagty basybalyjylar «böl we höküm sür» syýasaty bilen ýurdy togtatdylar. Patyşalaryň köpüsi ýalan wadalara aldanyp öz mülklerini we şalyklaryny daşary ýurt basybalyjylaryna berdiler. Ýöne Prithwi Singhanyň maşgalasy däl.  Onuň ogullary soňky damja ganyna çenli uruşarlar. Iň güýçlisi we batyry – Wir. Ol duşmany Madhawgarhanyň gyzy Ýaşodra aşyk, şonuň üçin kakasynyň peseldilen mertbesiniň aryny almaly. Galyberse-de ortada – onuň öz durmuşy...\n\n***Ýyly:*** 2010\n\n***Žanr:*** boýewik, drama, melodrama, başdangeçirmeler\n\n***Ýurdy:*** Hindistan\n\n***Režissýor:*** Anil Şarma\n\n***Dowamlylygy:*** 163 min          \n', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...\n\n***Год:*** 2010\n\n***Жанр:***  боевик, драма, мелодрама, приключения\n\n***Страна:***  Индия\n\n***Режиссёр:***  Анил Шарма\n\n***Длительность:***  163 мин.'),
(404, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-28 15:00:00', '2020-05-28 17:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 19:49:53', '2020-05-22 19:49:56', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Волшебник', 'Волшебник', 'Шанкар возвращается из-за границы и узнает, что его отец Жагат Нараян взял на себя роль человека-Бога и грабит доверчивых людей, исполняя пустячные фокусы и выдавая их за чудеса. Все преступления совершаются во имя религии. Шанкар восстает против своего отца и требует, чтобы богатство Ашрама было потрачено на людей. Отец отказывается от Шанкара. Для того, чтобы покончить с предрассудками и лишить отца власти, Шанкар нанимает известного фокусника Гога и привозит его в Дарампур. Жагат Нараян не выдерживает соперничества с Гога и храм переходит к Гога. Тут то и выясняется, что Гога не желает уезжать. Вскоре сталкиваются силы добра и зла, и из этого конфликта становится ясно, что никакой человек не может быть Богом.\n\n***Год:***  1989\n\n***Жанр:***  фэнтези, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Пракаш Мехра\n\n***Длительность:***  174 мин.', 'Шанкар возвращается из-за границы и узнает, что его отец Жагат Нараян взял на себя роль человека-Бога и грабит доверчивых людей, исполняя пустячные фокусы и выдавая их за чудеса. Все преступления совершаются во имя религии. Шанкар восстает против своего отца и требует, чтобы богатство Ашрама было потрачено на людей. Отец отказывается от Шанкара. Для того, чтобы покончить с предрассудками и лишить отца власти, Шанкар нанимает известного фокусника Гога и привозит его в Дарампур. Жагат Нараян не выдерживает соперничества с Гога и храм переходит к Гога. Тут то и выясняется, что Гога не желает уезжать. Вскоре сталкиваются силы добра и зла, и из этого конфликта становится ясно, что никакой человек не может быть Бог