(405, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-31 17:00:00', '2020-05-31 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 19:54:18', '2020-05-22 19:54:21', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Хатико: Самый верный друг', 'Хатико: Самый верный друг', 'В основе сюжета - реальная история, случившаяся в Японии и потрясшая весь мир. Однажды, возвращаясь с работы, профессор колледжа нашел на вокзале симпатичного щенка породы акита-ину. Профессор и Хатико стали верными друзьями. Каждый день пес провожал и встречал Профессора на вокзале. И даже потеря хозяина не остановила пса в его надежде, что друг вернется.\n\n***Год:***  2009\n\n***Жанр:***  драма, семейный\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:*** Лассе Халльстрём\n\n***Длительность:***  89 мин.', 'В основе сюжета - реальная история, случившаяся в Японии и потрясшая весь мир. Однажды, возвращаясь с работы, профессор колледжа нашел на вокзале симпатичного щенка породы акита-ину. Профессор и Хатико стали верными друзьями. Каждый день пес провожал и встречал Профессора на вокзале. И даже потеря хозяина не остановила пса в его надежде, что друг вернется.\n\n***Год:***  2009\n\n***Жанр:***  драма, семейный\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:*** Лассе Халльстрём\n\n***Длительность:***  89 мин.'),
(406, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-27 19:00:00', '2020-05-27 21:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 19:58:15', '2020-05-22 19:58:18', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Большой переполох', 'Большой переполох', 'Нитин Банкар работает в Сингапуре. Его обязанности многогранны: личный дворецкий, повар, водитель, сторож и даже садовник. А вот хозяйка одна – богатая предпринимательница. Как и любой молодой человек, Нитин, разумеется, мечтает о более привлекательной доле. Но куда подеваться от постоянных неудач и суровой реальности нелегкого ежедневного труда под началом строгой работодательницы? Главный герой отчаянно желает разбогатеть и жениться на своей любимой девушке Анияли Каккад, которая сегодня вынуждена финансово поддерживать юношу.\n\n***Год:***  2009\n\n***Жанр:***  комедия, преступление\n\n***Страна:***  Индия\n\n***Режиссёр:***  Приядаршан\n\n***Длительность:***  162 мин.', 'Нитин Банкар работает в Сингапуре. Его обязанности многогранны: личный дворецкий, повар, водитель, сторож и даже садовник. А вот хозяйка одна – богатая предпринимательница. Как и любой молодой человек, Нитин, разумеется, мечтает о более привлекательной доле. Но куда подеваться от постоянных неудач и суровой реальности нелегкого ежедневного труда под началом строгой работодательницы? Главный герой отчаянно желает разбогатеть и жениться на своей любимой девушке Анияли Каккад, которая сегодня вынуждена финансово поддерживать юношу.\n\n***Год:***  2009\n\n***Жанр:***  комедия, преступление\n\n***Страна:***  Индия\n\n***Режиссёр:***  Приядаршан\n\n***Длительность:***  162 мин.'),
(407, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-25 19:00:00', '2020-05-25 21:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 20:02:43', '2020-05-22 20:02:45', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'До встречи с тобой', 'До встречи с тобой', 'Лу Кларк знает, сколько шагов от автобусной остановки до ее дома. Она знает, что ей очень нравится работа в кафе и что, скорее всего, она не любит своего бойфренда Патрика. Но Лу не знает, что вот-вот потеряет свою работу и что в ближайшем будущем ей понадобятся все силы, чтобы преодолеть свалившиеся на нее проблемы. Уилл Трейнор знает, что сбивший его мотоциклист отнял у него желание жить. И он точно знает, что надо сделать, чтобы положить конец всему этому. Но он не знает, что Лу скоро ворвется в его мир буйством красок. И они оба не знают, что навсегда изменят жизнь друг друга.\n\n***Год:***  2016\n\n***Жанр:***  драма, мелодрама\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:*** Теа Шэррок\n\n***Длительность:*** 106 мин.', 'Лу Кларк знает, сколько шагов от автобусной остановки до ее дома. Она знает, что ей очень нравится работа в кафе и что, скорее всего, она не любит своего бойфренда Патрика. Но Лу не знает, что вот-вот потеряет свою работу и что в ближайшем будущем ей понадобятся все силы, чтобы преодолеть свалившиеся на нее проблемы. Уилл Трейнор знает, что сбивший его мотоциклист отнял у него желание жить. И он точно знает, что надо сделать, чтобы положить конец всему этому. Но он не знает, что Лу скоро ворвется в его мир буйством красок. И они оба не знают, что навсегда изменят жизнь друг друга.\n\n***Год:***  2016\n\n***Жанр:***  драма, мелодрама\n\n***Страны:***  Великобритания, США\n\n***Режиссёр:*** Теа Шэррок\n\n***Длительность:*** 106 мин.'),
(408, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-25 17:00:00', '2020-05-25 19:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 20:06:00', '2020-05-22 20:06:03', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Тайлер Рейк: Операция по спасению', 'Тайлер Рейк: Операция по спасению', 'Группировка наёмников берётся освободить из заложников сына сидящего в тюрьме индийского наркобарона. Подростка похитили конкуренты и держат его в столице Бангладеш Дакке - городе, состоящем из трущоб и практически полностью окружённом реками. Ответственное задание поручатся бывшему военному Тайлеру Рейку. Он легко расправляется с вооружённой охраной и быстро освобождает пленника, но доставить парня в безопасное место и выбраться из города, где на тебя объявлена охота, оказывается не так-то просто.\n\n***Год:***  2020\n\n***Жанр:***  боевик\n\n***Страна:***  США\n\n***Режиссёр:***  Сэм Харгрейв\n\n***Длительность:***  116 мин.', 'Группировка наёмников берётся освободить из заложников сына сидящего в тюрьме индийского наркобарона. Подростка похитили конкуренты и держат его в столице Бангладеш Дакке - городе, состоящем из трущоб и практически полностью окружённом реками. Ответственное задание поручатся бывшему военному Тайлеру Рейку. Он легко расправляется с вооружённой охраной и быстро освобождает пленника, но доставить парня в безопасное место и выбраться из города, где на тебя объявлена охота, оказывается не так-то просто.\n\n***Год:***  2020\n\n***Жанр:***  боевик\n\n***Страна:***  США\n\n***Режиссёр:***  Сэм Харгрейв\n\n***Длительность:***  116 мин.'),
(409, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-05-24 19:00:00', '2020-05-24 21:00:00', NULL, 9, 8, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-22 20:10:40', '2020-05-22 20:10:42', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Верю в любовь', 'Верю в любовь', 'Когда Джереми встречает Мелиссу, он сразу понимает, что она – Та Самая. Но хватит ли у него сил, чтобы побороться за любимую в самой безнадежной ситуации? Одна любовь может изменить твою жизнь. Одна жизнь может изменить целый мир.\n\n***Год:***  2020\n\n***Жанр:***  музыка, мелодрама, драма\n\n***Страна:***  США\n\n***Режиссёры:***  Джон Эрвин, Эндрю Эрвин\n\n***Длительность:***  115 мин.', 'Когда Джереми встречает Мелиссу, он сразу понимает, что она – Та Самая. Но хватит ли у него сил, чтобы побороться за любимую в самой безнадежной ситуации? Одна любовь может изменить твою жизнь. Одна жизнь может изменить целый мир.\n\n***Год:***  2020\n\n***Жанр:***  музыка, мелодрама, драма\n\n***Страна:***  США\n\n***Режиссёры:***  Джон Эрвин, Эндрю Эрвин\n\n***Длительность:***  115 мин.'),
(410, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-02 19:00:00', '2020-06-02 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-29 15:57:12', '2020-05-29 15:57:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Три брата', 'Три брата', 'Сатьядеви, офицер полиции и мать двух сыновей Шакти и Ананда, попавшая в тюрьму на длительный срок по ложному обвинению в убийстве, рожает здесь третьего сына, Роми. Не желая, находясь за решеткой, вмешиваться в жизнь своих сыновей, она переправляет новорожденного двум старшим братьям с наказом вырастить его в духе их семьи. При этом она просит брата сказать сыновьям, что она погибла. Взяв на себя заботу по воспитанию Роми, братья, имея разные взгляды на жизнь, ссорятся, и Ананд уходит из дому. Много лет спустя судьба вновь сводит их вместе. К этому времени выходит из тюрьмы и мать…\n\n***Год:***  1995\n\n***Жанр:***  драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Мукул Ананд\n\n***Длительность:***  187 мин.', 'Сатьядеви, офицер полиции и мать двух сыновей Шакти и Ананда, попавшая в тюрьму на длительный срок по ложному обвинению в убийстве, рожает здесь третьего сына, Роми. Не желая, находясь за решеткой, вмешиваться в жизнь своих сыновей, она переправляет новорожденного двум старшим братьям с наказом вырастить его в духе их семьи. При этом она просит брата сказать сыновьям, что она погибла. Взяв на себя заботу по воспитанию Роми, братья, имея разные взгляды на жизнь, ссорятся, и Ананд уходит из дому. Много лет спустя судьба вновь сводит их вместе. К этому времени выходит из тюрьмы и мать…\n\n***Год:***  1995\n\n***Жанр:***  драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Мукул Ананд\n\n***Длительность:***  187 мин.'),
(411, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-07 19:00:00', '2020-06-07 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-29 16:05:42', '2020-05-29 16:10:02', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Любовный треугольник', 'Любовный треугольник', 'Иногда мы связываем себя отношениями, в которых оказываемся как в плену. Это происходит по разным причинам. Но если вы встретите свою настоящую любовь - бегите! Бегите ей навстречу со всех ног! Не нужно терпеть отношения, в которых вы несчастны! Этой теме посвящены три новеллы фильма. В комедии «Половинки» к герою накануне свадьбы в буквальном смысле слова примагничивается незнакомая девушка. Разъединить их не представляется возможным - медицина бессильна. В притче «Чистый взгляд» обычная примерка очков в оптике превращается в философский диспут о природе любви...\n\n***Год:***  2019\n\n***Жанр:***  мелодрама, комедия\n\n***Страна:***  Россия\n\n***Режиссёры:***  Наталья Назарова, Александр Ермолин, Байбулат Батуллин\n\n***Длительность:***  70 мин.', 'Иногда мы связываем себя отношениями, в которых оказываемся как в плену. Это происходит по разным причинам. Но если вы встретите свою настоящую любовь - бегите! Бегите ей навстречу со всех ног! Не нужно терпеть отношения, в которых вы несчастны! Этой теме посвящены три новеллы фильма. В комедии «Половинки» к герою накануне свадьбы в буквальном смысле слова примагничивается незнакомая девушка. Разъединить их не представляется возможным - медицина бессильна. В притче «Чистый взгляд» обычная примерка очков в оптике превращается в философский диспут о природе любви...\n\n***Год:***  2019\n\n***Жанр:***  мелодрама, комедия\n\n***Страна:***  Россия\n\n***Режиссёры:***  Наталья Назарова, Александр Ермолин, Байбулат Батуллин\n\n***Длительность:***  70 мин.'),
(412, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-07 15:00:00', '2020-06-07 17:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-29 16:14:35', '2020-05-29 16:14:36', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Бен 10: Инопланетное нашествие', 'Бен 10: Инопланетное нашествие', 'Прошло 5 лет с тех пор, как Бен Тенннисон нашел инопланетные часы Омнитрикс и превратился в супер-героя. Теперь Бену 15 лет, и он обычный подросток, который давно уже не надевал Омнитрикс. Его приключения и превращения в супер-героев остались в прошлом. После победы над злым Вилгаксом Бен снял свои супер-часы и с тех пор не прибегал к их помощи. Меньше всего Бену хочется снова попасть в опасное приключение, но неожиданно он узнает, что дедушка Макс пропал. Он спешит рассказать об этом своей кузине Гвен. Бен решает снова надеть Омнитрикс и выяснить, куда исчез дедушка Макс. Бен и Гвен начинают расследование и обнаруживают, что инопланетяне снова строят коварные планы...\n\n***Год:***  2009\n\n***Жанр:***  фантастика, боевик, семейный\n\n***Страна:***  США\n\n***Режиссёр:***  Алекс Уинтер\n\n***Длительность:***  90 мин.', 'Прошло 5 лет с тех пор, как Бен Тенннисон нашел инопланетные часы Омнитрикс и превратился в супер-героя. Теперь Бену 15 лет, и он обычный подросток, который давно уже не надевал Омнитрикс. Его приключения и превращения в супер-героев остались в прошлом. После победы над злым Вилгаксом Бен снял свои супер-часы и с тех пор не прибегал к их помощи. Меньше всего Бену хочется снова попасть в опасное приключение, но неожиданно он узнает, что дедушка Макс пропал. Он спешит рассказать об этом своей кузине Гвен. Бен решает снова надеть Омнитрикс и выяснить, куда исчез дедушка Макс. Бен и Гвен начинают расследование и обнаруживают, что инопланетяне снова строят коварные планы...\n\n***Год:***  2009\n\n***Жанр:*