(413, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-03 19:00:00', '2020-06-03 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-29 16:19:03', '2020-05-29 16:19:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Желаю удачи!', 'Желаю удачи!', 'Вики – начинающий певец. Саба – успешный менеджер по связям с общественностью в рекламном агентстве. Сколько бы Вики не старался, удача обходит его стороной. Чего не скажешь о Сабе – она с фортуной на «ты». Случайная встреча на вечеринке и непреднамеренный поцелуй полностью перевернули жизнь этих двоих...\n\n***Год:*** 2008\n\n***Жанр:***  драма, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Адитья Датт\n\n***Длительность:***  140 мин.', 'Вики – начинающий певец. Саба – успешный менеджер по связям с общественностью в рекламном агентстве. Сколько бы Вики не старался, удача обходит его стороной. Чего не скажешь о Сабе – она с фортуной на «ты». Случайная встреча на вечеринке и непреднамеренный поцелуй полностью перевернули жизнь этих двоих...\n\n***Год:*** 2008\n\n***Жанр:***  драма, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Адитья Датт\n\n***Длительность:***  140 мин.'),
(414, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-04 19:00:00', '2020-06-04 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-05-29 16:23:45', '2020-05-29 16:23:47', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Султан', 'Султан', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Год:***  2016\n\n***Жанр:***  боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:***  170 мин.', 'Султан Али Хан - местный чемпион по борьбе, мечтающий представлять Индию и победить на Олимпийских играх. Афра - напористая молодая девушка из того же маленького городка, что и Султан, со своим собственным набором амбиций. Когда две «звезды» местного значения сталкиваются лбами, расцветают романтические отношения, и их мечты и устремления переплетаются и выравниваются. Однако, путь к славе тернист, и нужно много раз упасть, прежде чем стать победителем. Чаще всего, этот путь может занять всю жизнь.\n\n***Год:***  2016\n\n***Жанр:***  боевик, драма\n\n***Страна:***  Индия\n\n***Режиссёр:***  Али Аббас Зафар\n\n***Длительность:***  170 мин.'),
(415, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-14 19:00:00', '2020-06-14 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-03 20:22:31', '2020-06-03 20:22:33', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Свадьба моего отца', 'Свадьба моего отца', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***  2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Приядаршан\n\n***Длительность:***  163 мин.', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***  2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  И