(417, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-14 17:00:00', '2020-06-14 19:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-03 20:30:23', '2020-06-03 20:30:24', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Рецепт любви: без сахара!', 'Рецепт любви: без сахара!', 'Два абсолютно разных человека, два противоположных мира, закоренелый холостяк Бадхадев и очаровательная, утонченная Нина, столкнувшись случайно несколько раз, чувствуют, что их взаимная симпатия усиливается и перерастает в нечто большее. Они решают пожениться, и Бадхадев едет в Индию просить руки своей возлюбленной у ее отца. Есть только одно небольшое препятствие - будущий тесть младше своего зятя на шесть лет...\n\n***Год:***  2007\n\n***Жанр:***  мелодрама, комедия\n\n***Страны:***  Индия, Великобритания\n\n***Режиссёр:***  Балки\n\n***Длительность:***  140 мин.', 'Два абсолютно разных человека, два противоположных мира, закоренелый холостяк Бадхадев и очаровательная, утонченная Нина, столкнувшись случайно несколько раз, чувствуют, что их взаимная симпатия усиливается и перерастает в нечто большее. Они решают пожениться, и Бадхадев едет в Индию просить руки своей возлюбленной у ее отца. Есть только одно небольшое препятствие - будущий тесть младше своего зятя на шесть лет...\n\n***Год:***  2007\n\n***Жанр:***  мелодрама, комедия\n\n***Страны:***  Индия, Великобритания\n\n***Режиссёр:***  Балки\n\n***Длительность:***  140 мин.'),
(418, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-11 19:00:00', '2020-06-11 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-03 20:35:17', '2020-06-03 20:35:19', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Супер бабушка', 'Супер бабушка', 'Бхарти Бхатия, чей каждый час жизни посвящен заботам о своей семье, её мелким нуждам и прихотям, включая властного мужа, сына, играющего на фондовом рынке на повышение, сноху, которая стремится стать звездой мыльной оперы и дочь с ультра современными ценностями. Она самоотверженно выполняет свои обязанности, но в награду получает только насмешки и унижения. В семье все относятся к ней как к коврику у порога. Захватывающая история начинается, когда в Индию неожиданно приезжает внук Манн. Вопреки своим ожиданиям увидеть сильную леди, главу дома, он видит мягкую и дремлющую женщину, которой все помыкают. Это раздражает его, и он решает превратить печальную и скучную жизнь своей бабушки в весёлое катание на американских горках.\n\n***Год:***  2014\n\n***Жанр:***  драма, комедия, семейный\n\n***Страна:***  Индия\n\n***Режиссёр:***  Индра Кумар\n\n***Длительность:***  133 мин.', 'Бхарти Бхатия, чей каждый час жизни посвящен заботам о своей семье, её мелким нуждам и прихотям, включая властного мужа, сына, играющего на фондовом рынке на повышение, сноху, которая стремится стать звездой мыльной оперы и дочь с ультра современными ценностями. Она самоотверженно выполняет свои обязанности, но в награду получает только насмешки и унижения. В семье все относятся к ней как к коврику у порога. Захватывающая история начинается, когда в Индию неожиданно приезжает внук Манн. Вопреки своим ожиданиям увидеть сильную леди, главу дома, он видит мягкую и дремлющую женщину, которой все помыкают. Это раздражает его, и он решает превратить печальную и скучную жизнь своей бабушки в весёлое катание на американских горках.\n\n***Год:***  2014\n\n***Жанр:***  драма, комедия, семейный\n\n***Страна:***  Индия\n\n***Режиссёр:***  Индра Кумар\n\n***Длительность:***  133 мин.');
