(419, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-09 19:00:00', '2020-06-09 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-03 20:38:51', '2020-06-03 20:38:52', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Сильное влечение', 'Сильное влечение', 'Арджун приезжает с отцом на свадьбу, где знакомится с Кхушбу. Для Арджуна это просто приятное знакомство, в то время как Кхушбу всерьез увлечена им, но никак не решается ему об этом сказать. Арджун считая, что из этого мимолетного увлечения ничего серьезного не выйдет, возвращается в Мумбай. Не получив никаких известий от парня, которого она всерьез полюбила, девушка решается на отчаянный шаг: она сама едет к Арджуну, чтобы поставить все точки над «i»...\n\n***Год:***  2004\n\n***Жанр:***  мелодрама\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дж. Кришна\n\n***Длительность:***  148 мин.', 'Арджун приезжает с отцом на свадьбу, где знакомится с Кхушбу. Для Арджуна это просто приятное знакомство, в то время как Кхушбу всерьез увлечена им, но никак не решается ему об этом сказать. Арджун считая, что из этого мимолетного увлечения ничего серьезного не выйдет, возвращается в Мумбай. Не получив никаких известий от парня, которого она всерьез полюбила, девушка решается на отчаянный шаг: она сама едет к Арджуну, чтобы поставить все точки над «i»...\n\n***Год:***  2004\n\n***Жанр:***  мелодрама\n\n***Страна:***  Индия\n\n***Режиссёр:***  Дж. Кришна\n\n***Длительность:***  148 мин.'),
(420, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-14 15:00:00', '2020-06-14 17:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-03 20:42:31', '2020-06-03 20:44:45', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, '7-ой гном', '7-ой гном', 'В замке Фантабулараса большой переполох: принцесса Роза празднует свой 18-й день рождения. Приняты самые строгие меры безопасности, ведь злобная Колдунья Делламорта, которая прокляла Розу на ее крестинах, не позволит проклятию раствориться в воздухе. Семеро гномов - Умник, Рыжик, Ворчун, Соня, Силач, Бодряк и Бобо - ничего не знают об этом, когда отправляются на праздник в замок, мечтая повеселиться… Бобо, самый маленький гном, случайно запускает тайный механизм в кольце Колдуньи, и принцесса вместе со всеми гостями замерзает. Гномы спасаются в самую последнюю секунду. Теперь, чтобы все исправить, им придется отправиться в опасное путешествие и найти возлюбленного принцессы, похищенного драконом злобной Делламорты.\n\n***Год:***  2014\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:***  Германия\n\n***Режиссёр:***  Борис Альинович\n\n***Длительность:***  90 мин.', 'В замке Фантабулараса большой переполох: принцесса Роза празднует свой 18-й день рождения. Приняты самые строгие меры безопасности, ведь злобная Колдунья Делламорта, которая прокляла Розу на ее крестинах, не позволит проклятию раствориться в воздухе. Семеро гномов - Умник, Рыжик, Ворчун, Соня, Силач, Бодряк и Бобо - ничего не знают об этом, когда отправляются на праздник в замок, мечтая повеселиться… Бобо, самый маленький гном, случайно запускает тайный механизм в кольце Колдуньи, и принцесса вместе со всеми гостями замерзает. Гномы спасаются в самую последнюю секунду. Теперь, чтобы все исправить, им придется отправиться в опасное путешествие и найти возлюбленного пр