(421, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-04 18:13:00', '2023-06-04 18:13:00', NULL, 1, 1, NULL, '0.10', '0.20', '0.20', '0.000', 7, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-05 15:34:42', '2023-05-09 19:43:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 12, 4, 'Алита: Боевой ангел', 'Алита: Боевой ангел', 'Действие фильма происходит через 300 лет после Великой войны в XXVI веке. Доктор Идо находит останки женщины-киборга. После починки киборг ничего не помнит, но обнаруживает, что в состоянии пользоваться боевыми приемами киборгов. Начинаются поиски утерянных воспоминаний.\n\n***Год:***  2019\n\n***Жанр:***  фантастика, боевик, триллер, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Роберт Родригес\n\n***Длительность:***  121 мин.', 'Действие фильма происходит через 300 лет после Великой войны в XXVI веке. Доктор Идо находит останки женщины-киборга. После починки киборг ничего не помнит, но обнаруживает, что в состоянии пользоваться боевыми приемами киборгов. Начинаются поиски утерянных воспоминаний.\n\n***Год:***  2019\n\n***Жанр:***  фантастика, боевик, триллер, приключения\n\n***Страна:***  США\n\n***Режиссёр:***  Роберт Родригес\n\n***Длительность:***  121 мин.'),
(422, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-21 19:00:00', '2020-06-21 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 13:31:05', '2020-06-10 13:33:15', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Элвин и бурундуки 3', 'Элвин и бурундуки 3', 'Приключения троицы непоседливых братьев-бурундуков продолжаются! Элвин, Саймон и Теодор, а также их подруги бурундушки, просто не могут оставаться в стороне от различного рода неприятностей, сулящих им новые увлекательные приключения. Что на этот раз уготовила судьба нашим героям, и как они выпутаются из очередной передряги — вот в чём вопрос.\n\n***Год:***  2011\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёр:***  Майк Митчелл\n\n***Длительность:***  84 мин.', 'Приключения троицы непоседливых братьев-бурундуков продолжаются! Элвин, Саймон и Теодор, а также их подруги бурундушки, просто не могут оставаться в стороне от различного рода неприятностей, сулящих им новые увлекательные приключения. Что на этот раз уготовила судьба нашим героям, и как они выпутаются из очередной передряги — вот в чём вопрос.\n\n***Год:***  2011\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный, музыка\n\n***Страна:***  США\n\n***Режиссёр:***  Майк Митчелл\n\n***Длительность:***  84 мин.'),
(423, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-16 19:00:00', '2020-06-16 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 13:37:07', '2020-06-10 13:44:22', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 1, 10, 2, 'Вир – герой народа', 'Вир – герой народа', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...\n\n***Год:***  2010\n\n***Жанр:***  боевик, драма, мелодрама, приключения\n\n***Страна:***  Индия\n\n***Режиссёр:***  Анил Шарма\n\n***Длительность:***  163 мин.', 'С пыльных страниц истории приходит в нашу жизнь рассказ о небывалой отваге, жестокой гордости и мучительной любви. В далеком прошлом, когда Индия превратилась в колонию Британии, завоеватели взбудоражили страну своей несправедливой политикой «разделяй и властвуй!». Многие славные короли и набобы поддались обманчивым обещаниям и отдали свои плодородные земли и королевства иностранным захватчикам. Исключением стало отважное семейство Прит-хви Сингха, Сыновья Притхви Сингха будут драться до последней капли крови. Самый сильный и смелый - Вир. На кону - его любовь к дочери заклятого врага Мадхавгарха, принцессе Яшодра... На кону - жажда мести за поруганную честь отца... На кону - сама жизнь Вира...\n\n***Год:***  2010\n\n***Жанр:***  боевик, драма, мелодрама, приключения\n\n***Страна:***  Индия\n\n***Режиссёр:***  Анил Шарма\n\n***Длительность:***  163 мин.'),
(424, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-18 19:00:00', '2020-06-18 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 14:55:00', '2020-06-10 14:56:50', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Постояльцы', 'Постояльцы', 'Четыре молодых парня ищут, где бы снять себе жилье. Но кому нужны такие проблемные клиенты? Домовладелец Баллу вроде бы не прочь взять себе постояльцев, но с одним условием - квартиранты должны быть семейными парами. Кому-то придется играть женщин.\n\n***Год:***  2009\n\n***Жанр:***  драма, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Паритош Пайнтер\n\n***Длительность:***  120 мин.', 'Четыре молодых парня ищут, где бы снять себе жилье. Но кому нужны такие проблемные клиенты? Домовладелец Баллу вроде бы не прочь взять себе постояльцев, но с одним условием - квартиранты должны быть семейными парами. Кому-то придется играть женщин.\n\n***Год:***  2009\n\n***Жанр:***  драма, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Паритош Пайнтер\n\n***Длительность:***  120 мин.'),
