(426, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-21 17:00:00', '2020-06-21 19:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 15:07:04', '2020-06-10 15:09:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Тайная суперзвезда', 'Тайная суперзвезда', '14-летняя девочка из Гуджарата хочет стать певицей. Отец против, но героиня не отказывается от своей мечты - она записывает видео с песней под гитару, где скрывает лицо паранджой, и выкладывает в Интернет. Ролик становится невероятно популярным.\n\n***Год:***  2017\n\n***Жанр:***  драма, семейный, музыка\n\n***Страна:***  Индия\n\n***Режиссёр: *** Адваит Чандан\n\n***Длительность:***  150 мин.', '14-летняя девочка из Гуджарата хочет стать певицей. Отец против, но героиня не отказывается от своей мечты - она записывает видео с песней под гитару, где скрывает лицо паранджой, и выкладывает в Интернет. Ролик становится невероятно популярным.\n\n***Год:***  2017\n\n***Жанр:***  драма, семейный, музыка\n\n***Страна:***  Индия\n\n***Режиссёр: *** Адваит Чандан\n\n***Длительность:***  150 мин.'),
(427, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-17 19:00:00', '2020-06-17 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 15:11:17', '2020-06-10 15:13:23', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Робот', 'Робот', 'Он умеет многое - драться, петь и танцевать, он водонепроницаемый и огнестойкий. Он может делать все, что может человек, и даже больше! Он дословно выполняет инструкции. Если человек может солгать, чтобы спасти себя, то этот робот лгать не умеет. У него острая как бритва память, и он запоминает весь телефонный справочник, едва пробежав по нему глазами. Его имя - Читти. Однажды доктор Васигаран, модернизируя процессор робота, добавляет ему имитатор человеческих эмоций. Читти полностью меняется. Теперь он может чувствовать, и первое чувство, которое он открывает для себя - это любовь.\n\n***Год:***  2010\n\n***Жанр:***  фантастика, боевик\n\n***Страна:***  Индия\n\n***Режиссёр:***  Шанмугам Шанкар\n\n***Длительность:*** 165 мин.', 'Он умеет многое - драться, петь и танцевать, он водонепроницаемый и огнестойкий. Он может делать все, что может человек, и даже больше! Он дословно выполняет инструкции. Если человек может солгать, чтобы спасти себя, то этот робот лгать не умеет. У него острая как бритва память, и он запоминает весь телефонный справочник, едва пробежав по нему глазами. Его имя - Читти. Однажды доктор Васигаран, модернизируя процессор робота, добавляет ему имитатор человеческих эмоций. Читти полностью меняется. Теперь он может чувствовать, и первое чувство, которое он открывает для себя - это любовь.\n\n***Год:***  2010\n\n***Жанр:***  фантастика, боевик\n\n***Страна:***  Индия\n\n***Режиссёр:***  Шанмугам Шанкар\n\n***Длительность:*** 165 мин.'),
(428, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-14 19:00:00', '2020-06-14 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 17:15:39', '2020-06-10 17:17:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Удивительное путешествие доктора Дулиттла', 'Удивительное путешествие доктора Дулиттла', 'Семь лет назад доктор Дулиттл, прославленный врач-ветеринар, живущий в викторианской Англии, потерял свою жену. Теперь он ведет затворнический образ жизни, скрывшись за высокими стенами своего поместья. Экзотические животные из его коллекции – его единственная компания. Но когда неизвестная болезнь становится угрозой для жизни молодой королевы, доктору Дулиттлу приходится покинуть свое убежище и отправиться в невероятное путешествие к мифическому острову. В поисках лекарства для королевы он вступит в схватку с беспощадными врагами, познакомится с диковинными существами и будет вынужден проявить недюжинное мужество и смекалку.\n\n***Год:***  2020\n\n***Жанр:***  фэнтези, комедия, приключения, семейный\n\n***Страны:***  США, Китай, Великобритания, Япония\n\n***Режиссёр:***  Стивен Гейган\n\n***Длительность:***  101 мин.', 'Семь лет назад доктор Дулиттл, прославленный врач-ветеринар, живущий в викторианской Англии, потерял свою жену. Теперь он ведет затворнический образ жизни, скрывшись за высокими стенами своего поместья. Экзотические животные из его коллекции – его единственная компания. Но когда неизвестная болезнь становится угрозой для жизни молодой королевы, доктору Дулиттлу приходится покинуть свое убежище и отправиться в невероятное путешествие к мифическому острову. В поисках лекарства для королевы он вступит в схватку с беспощадными врагами, познакомится с диковинными существами и будет вынужден проявить недюжинное мужество и смекалку.\n\n***Год:***  2020\n\n***Жанр:***  фэнтези, комедия,