(429, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-14 15:00:00', '2020-06-14 17:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 17:19:57', '2020-06-10 17:21:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Красные туфельки и семь гномов', 'Красные туфельки и семь гномов', 'Давным-давно в сказочном королевстве жила-была девушка. И однажды она нашла пару волшебных туфелек: стоит их надеть – превращаешься в классическую красавицу-принцессу… Семь принцев, заколдованных злой ведьмой, стали уродливыми зелеными гномами. Чтобы вернуть себе человеческий облик, им нужен один поцелуй прекрасной девушки. В один день пути героев пересекутся, и они узнают, что такое настоящая дружба, любовь и красота.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, фэнтези, мелодрама, комедия, приключения, семейный\n\n***Страна:***  Республика Корея\n\n***Режиссёр:***  Хон Сон-хо\n\n***Длительность:***  92 мин.', 'Давным-давно в сказочном королевстве жила-была девушка. И однажды она нашла пару волшебных туфелек: стоит их надеть – превращаешься в классическую красавицу-принцессу… Семь принцев, заколдованных злой ведьмой, стали уродливыми зелеными гномами. Чтобы вернуть себе человеческий облик, им нужен один поцелуй прекрасной девушки. В один день пути героев пересекутся, и они узнают, что такое настоящая дружба, любовь и красота.\n\n***Год:***  2019\n\n***Жанр:***  мультфильм, фэнтези, мелодрама, комедия, приключения, семейный\n\n***Страна:***  Республика Корея\n\n***Режиссёр:***  Хон Сон-хо\n\n***Длительность:***  92 мин.'),
