(432, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-05 09:29:00', '2023-05-15 09:29:00', NULL, 9, 1, NULL, '0.00', '0.00', '0.00', '0.000', 11, '', '', NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-10 17:34:29', '2023-05-05 13:36:04', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, '', NULL, 1, 10, 2, 'Рок-звезда', 'Рок-звезда', 'Он начал за ней ухаживать, чтобы стать знаменитым как Джим Моррисон, но прославившись на весь мир, послал все к черту ради одной её улыбки. Она дышала полной грудью только рядом с ним, а вдали от него медленно погибала в золотой клетке.\n\n***Год:***  2011\n\n***Жанр:***  мюзикл, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Имтиаз Али\n\n***Длительность:*** 159 мин.', 'Он начал за ней ухаживать, чтобы стать знаменитым как Джим Моррисон, но прославившись на весь мир, послал все к черту ради одной её улыбки. Она дышала полной грудью только рядом с ним, а вдали от него медленно погибала в золотой клетке.\n\n***Год:***  2011\n\n***Жанр:***  мюзикл, мелодрама, музыка\n\n***Страна:***  Индия\n\n***Режиссёр:***  Имтиаз Али\n\n***Длительность:*** 159 мин.'),
(433, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-28 19:00:00', '2020-06-28 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-18 14:21:15', '2020-06-18 14:47:29', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Свадьба моей любимой', 'Söýgülimiň toýy', 'Degişgen Sanjaý köne dosty Anjaliniň ýakyn wagtda durmuşa çykýanyny öwrenýär. Bu habar ony howsala düşürýär. Uzak gün pikirlerde geçirip, ol Anjalini söýýänligine düşünýär. Bir minudam ýitirmän, ol Dehraduna toýy ýatyrmaga ugraýar...\n\n***Ýyly:***  2002\n\n***Žanr:***  komediýa, melodrama\n\n***Ýurdy:***  Hindistan\n\n***Režissýor:***  Sanjay Gadwi\n\n***Dowamlylygy:*** 158 min  ', 'Ловелас и балагур по натуре, Санджай из телефонного разговора со своей старой подружкой Анджали узнает, что она скоро выходит замуж. Неожиданно для него самого это сообщение выводит Санджая из душевного равновесия. Проведя в размышлениях весь день, он осознает, что очень сильно любит Анджали. Не теряя ни минуты, Санджай отправляется в Дехрадун, чтобы по возможности сорвать свадьбу…\n\n***Год:***  2002\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Санджай Гадхви\n\n***Длительность:***  158 мин.'),
(434, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-06-25 19:00:00', '2020-06-25 21:00:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-06-18 14:27:18', '2020-06-18 14:52:32', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Свадьба моего отца', 'Kakamyň toýy', 'Janaradhan Wişwanbar Rane – iki çagany Çiragi we Gaurawy ýetişdiren dul adam. Ol perzentleri üçin hemme zat etdi. Çagalar ýetişensoň, kakalaryna seredip başlaýar - biznes bilen meşgullanyp, öý hojalygy ýöredýär. Kiçi ogly Gauraw esasy jogapkärçiligi alýar. Indi ol öz kakasy üçin kaka. Ýöne kollej dosty Şikha Kapur onuň üstünden gülip başlaýar. Şikha Janaradhanyň ilkinji sögüsi Anuradha bilen ýaşaýar. Ogly kakasynyň Anuradha bilen duşuşykdan soň üýtgänine göz ýetirip, kakasynyň ýitiren söýgüsine gowuşmagyny isleýär.\n\n***Ýyly:***  2008\n\n***Žanr:***  komediýa, melodrama\n\n***Ýurdy:***  Hindistan\n\n***Režissýor:***  Priyadarshan\n\n***Dowamlylygy:*** 163 min  \n', 'Джанарадхан Вишванбар Ране - вдовец, вырастивший двоих детей: Чирага и Гаурава. Джанарадхан сделал все, чтобы воспитать своих детей как можно лучше. Теперь, когда ребята повзрослели, они начинают сами ухаживать за отцом. Сыновья ведут бизнес и следят за домашним хозяйством. Хотя Гаурав - младший сын, именно он берет основную ответственность на себя. Теперь он - словно отец для своего отца. Однако вскоре он становится жертвой добрых шуток своей подруги по колледжу Шикхи Капур. Шикха живет с опекуншей Анурадхой, первой любовью Джанарадхана. Сын замечает перемены в отце после встречи с Анурадхой и хочет, чтобы его отец наконец-то обрел свою потерянную любовь...\n\n***Год:***  2008\n\n***Жанр:***  драма, мелодрама, комедия\n\n***Страна:***  Индия\n\n***Режиссёр:***  Приядаршан\n\n***Длительность:***  163 мин.'),
