(440, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-07-12 12:55:00', '2020-07-12 14:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-07-08 19:23:19', '2020-07-08 19:25:11', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Кунг-фу Панда 3', 'Кунг-фу Панда 3', 'Воссоединившись со своим давно потерянным отцом, По отправляется в тайный рай для панд, где его ожидает встреча с множеством веселых сородичей. Однако вскоре злодей Кай начинает зачистку - он уничтожает кунг-фу мастеров по всему Китаю. По предстоит сделать невозможное - обучить боевому искусству деревню, полную его веселых, неуклюжих собратьев, и тем самым превратить их в отряд кунг-фу панд.\n\n***Год:*** 2016\n\n***Жанр:***  мультфильм, фэнтези, боевик, комедия, приключения, семейный\n\n***Страны:***  США, Китай\n\n***Режиссёры:***  Дженнифер Ю, Алессандро Карлони\n\n***Длительность:***  95 мин.', 'Воссоединившись со своим давно потерянным отцом, По отправляется в тайный рай для панд, где его ожидает встреча с множеством веселых сородичей. Однако вскоре злодей Кай начинает зачистку - он уничтожает кунг-фу мастеров по всему Китаю. По предстоит сделать невозможное - обучить боевому искусству деревню, полную его веселых, неуклюжих собратьев, и тем самым превратить их в отряд кунг-фу панд.\n\n***Год:*** 2016\n\n***Жанр:***  мультфильм, фэнтези, боевик, комедия, приключения, семейный\n\n***Страны:***  США, Китай\n\n***Режиссёры:***  Дженнифер Ю, Алессандро Карлони\n\n***Длительность:***  95 мин.'),
(441, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-07-12 16:55:00', '2020-07-12 18:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-07-08 19:27:44', '2020-07-08 19:29:40', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Дозор джунглей', 'Дозор джунглей', 'Пингвин Морис тигрового окраса уверен, что он и в самом деле тигр – герой, в котором нуждаются джунгли. Вместе со своей энергичной командой разношерстных животных под названием «Дозор джунглей» он неусыпно стоит на страже справедливости и покоя. С переменным успехом, конечно, но они стараются. Однако вскоре ему предстоит столкнуться с невероятно коварным и безжалостным врагом – коалой Игорем и его армией туповатых бабуинов...\n\n***Год:***  2017\n\n***Жанр:*** мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:*** Франция\n\n***Режиссёр:***  Давид Ало\n\n***Длительность:*** 97 мин.', 'Пингвин Морис тигрового окраса уверен, что он и в самом деле тигр – герой, в котором нуждаются джунгли. Вместе со своей энергичной командой разношерстных животных под названием «Дозор джунглей» он неусыпно стоит на страже справедливости и покоя. С переменным успехом, конечно, но они стараются. Однако вскоре ему предстоит столкнуться с невероятно коварным и безжалостным врагом – коалой Игорем и его армией туповатых бабуинов...\n\n***Год:***  2017\n\n***Жанр:*** мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страна:*** Франция\n\n***Режиссёр:***  Давид Ало\n\n***Длительность:*** 97 мин.'),
(442, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-07-12 14:55:00', '2020-07-12 16:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-07-08 19:32:13', '2020-07-08 19:34:50', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 5, 9, 2, 'Тэд-путешественник и тайна царя Мидаса', 'Тэд-путешественник и тайна царя Мидаса', 'Тэд, не самый удачливый и ловкий исследователь и путешественник, и его странноватые друзья, в числе которых настоящая мумия и смышленый пес Джефф, отправляются на розыски злобного богача Джека Рэкхема, похитившего Сару. Любимая Тэда обнаружила, где спрятаны сокровища легендарного царя Мидаса, и злодей надеется их заполучить. Но Тэд и его команда должны разрушить планы беспринципного богача и освободить Сару!\n\n***Год:***  207\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страны:***  Испания, США\n\n***Режиссёры:*** Энрике Гато, Давид Алонсо\n\n***Длительность:*** 85 мин.', 'Тэд, не самый удачливый и ловкий исследователь и путешественник, и его странноватые друзья, в числе которых настоящая мумия и смышленый пес Джефф, отправляются на розыски злобного богача Джека Рэкхема, похитившего Сару. Любимая Тэда обнаружила, где спрятаны сокровища легендарного царя Мидаса, и злодей надеется их заполучить. Но Тэд и его команда должны разрушить планы беспринципного богача и освободить Сару!\n\n***Год:***  207\n\n***Жанр:***  мультфильм, фэнтези, комедия, приключения, семейный\n\n***Страны:***  Испания, США\n\n***Режиссёры:*** Энрике Гато, Давид Алонсо\n\n***Длительность:*** 85 мин.'),
(443, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2020-07-12 18:55:00', '2020-07-12 20:55:00', NULL, 9, 1, NULL, '0.00', '0.00', '1.00', '0.000', 11, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 1, '2020-07-08 19:36:44', '2020-07-08 19:44:38', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'После', 'После', 'Случайная встреча перевернула их привычный мир. Она – прилежная студентка и образцовая дочь, а он – притягательный бунтарь с непростым прошлым. Живя в параллельных вселенных, они бы вряд ли даже взглянули друг на друга. Однако этому знакомству суждено разделить жизнь влюбленных на до и после.\n\n***Год:*** 2019\n\n***Жанр:*** драма, мелодрама\n\n***Страна:*** США\n\n***Режиссёр:*** Дженни Гейдж\n\n***Длительность:*** 105 мин.', 'Случайная встреча перевернула их привычный мир. Она – прилежная студентка и образцовая дочь, а он – притягательный бунтарь с непростым прошлым. Живя в параллельных вселенных, они бы вряд ли даже взглянули друг на друга. Однако этому знакомству суждено разделить жизнь влюбленных на до и после.\n\n***Год:*** 2019\n\n***Жанр:*** драма, мелодрама\n\n***Страна:*** США\n\n***Режиссёр:*** Дженни Гейдж\n\n***Длительность:*** 105 мин.'),
(444, '', NULL, 'image', '#B23333', 'assets/images/public/EventPage/backgrounds/5.jpg', '', '2023-05-05 10:13:00', '2023-05-06 10:13:00', NULL, 1, 1, NULL, '0.00', '0.00', '0.00', '0.000', 6, NULL, NULL, NULL, 1, 1, 1, 1, 1, 0, 0, '2023-05-05 14:14:16', '2023-05-05 14:14:16', NULL, 'QRCODE', '#000000', '#FFFFFF', '#000000', '#999999', NULL, 1, 'buyer', 8, 0, 0, NULL, NULL, 1, 10, 2, 'Ford против Ferrari', 'Ford против Ferrari', 'Сюжет повествует о группе американских инженеров и дизайнеров. В 1960-х под руководством конструктора Кэрролла Шелби и при поддержке британского гонщика Кена Майлса они должны были с нуля сделать абсолютно новый спорткар, способный опередить Феррари — непобедимого чемпиона 24-часовой гонки на выносливость Ле-Ман.\r\nПремьера: 2019 г. (США)\r\nРежиссер: Джеймс Мэнголд\r\nГод: 2019', 'Сюжет повествует о группе американских инженеров и дизайнеров. В 1960-х под руководством конструктора Кэрролла Шелби и при поддержке британского гонщика Кена Майлса они должны были с нуля сделать абсолютно новый спорткар, способный опередить Феррари — непобедимого чемпиона 24-часовой гонки на выносливость Ле-Ман.\r\nПремьера: 2019 г. (США)\r\nРежиссер: Джеймс Мэнголд\r\nГод: 2019'),
