(1, 'about_us', 'introduction tk', 'Bilettm.com bilen tanyşlyk', 'introduction_tk', '<p><strong>Bilettm.com</strong> &ndash; bu bilet operatorydyr. Ol islendik &ccedil;&auml;relere &ndash; konsertlere, festiwallara, filmlere, teatrlara, sergilere, biznes-konferensi&yacute;alara, &ccedil;agalar &uuml;&ccedil;in shoulara we sport &ccedil;&auml;relere resmi biletleri satmak bilen meşgullan&yacute;ar.</p>\r\n\r\n<p>Biz elektron bilet tehnologi&yacute;asyny tutuş &yacute;urt bo&yacute;un&ccedil;a &yacute;ola go&yacute;up, iň uly distrib&yacute;utor ulgamyny d&ouml;retdik. Programmanyň g&uuml;nde t&auml;zelenip durmagy Size T&uuml;rkmenistanda bolup ge&ccedil;&yacute;&auml;n &auml;hli &ccedil;&auml;relerden habarly bolmaga m&uuml;mkin&ccedil;ilik ber&yacute;&auml;r. Serwisiň k&ouml;megi bilen biletleri islendik &yacute;erlere we senelere alyp bil&yacute;&auml;ňiz.</p>\r\n\r\n<p>Biziň işimiz m&uuml;şderileriň rahatlygyna we howpsuzlygyna g&ouml;n&uuml;kdirilendir. Şonuň &uuml;&ccedil;in has gowy bolmak &uuml;&ccedil;in biz yzygiderli k&auml;milleş&yacute;&auml;ris. Biziň &uuml;&ccedil;in iň m&ouml;h&uuml;m zat &ndash; Siziň ynamyňyzdyr.</p>\r\n\r\n<p>Biziň ulgamymyzdan bilet almak bilen, Siz</p>\r\n\r\n<ul>\r\n	<li>&Ouml;z&uuml;ňizi &yacute;asama biletlerden gora&yacute;aňyz;</li>\r\n	<li>Iň &yacute;okary hyzmat al&yacute;aňyz;</li>\r\n	<li>&Yacute;urduň iň gyzykly wakalarynyň şa&yacute;ady bol&yacute;aňyz;</li>\r\n	<li>Biletleri yzyna wagtynda tabşyryp bil&yacute;&auml;ňiz;</li>\r\n	<li>Biziň hema&yacute;atk&auml;rlerimiziň ba&yacute;raklary ugrunda &yacute;aryşlara gatnaş&yacute;aňyz.</li>\r\n</ul>\r\n\r\n<p>Sa&yacute;ta girip &yacute;a-da telefon programmasyny gurnamak bilen, Siz gowy g&ouml;r&yacute;&auml;n artislteriňiziň konsertlerine gatnaşarsyňyz, m&ouml;h&uuml;m teatr o&yacute;nunyň ilkinji g&ouml;rkezilişine tomaşa edip &yacute;a-da &ccedil;agalar &uuml;&ccedil;in şou me&yacute;illeşdirip bilersiziňiz.</p>\r\n\r\n<p>Biz diňe bir bilet satman e&yacute;sem, Sizi ruhlandyrjak du&yacute;gulary ber&yacute;&auml;ris.</p>\r\n', NULL, '2019-12-23 23:19:14', '2020-03-05 15:27:37', NULL),
(2, 'about_us', 'introduction ru', 'ЗНАКОМСТВО С BILETTM.COM', 'introduction_ru', '<p>Billettm.com &ndash; это билетный оператор, который занимается продажей официальных билетов на любые мероприятия: концерты, фестивали, кино, театр, выставки, бизнес-конференции, детские шоу и спортивные события.</p>\r\n\r\n<p>Мы внедрили технологию электронных билетов по всей стране и создали самую большую дистрибьюторскую сеть. Ежедневное обновление программы позволяет быть в курсе всех культурных событий Туркменистана. С помощью сервиса вы можете приобретать билеты на любые места и даты.</p>\r\n\r\n<p>Наша работа направлена на комфорт и безопасность клиентов, поэтому мы совершенствуемся, чтобы быть еще лучше. Для нас самое важное &ndash; ваше доверие.</p>\r\n\r\n<p>Покупая билеты на нашем сервисе, вы гарантированно:</p>\r\n\r\n<ul>\r\n	<li>Защищаете себя от подделок.</li>\r\n	<li>Получаете лучший сервис.</li>\r\n	<li>Имеете доступ к самым ярким событиям страны.</li>\r\n	<li>Имеете возможность быстрого возврата билетов.</li>\r\n	<li>Принимаете участие в розыгрыше призов от наших спонсоров.</li>\r\n</ul>\r\n\r\n<p>Посетив сайт или установив мобильное приложение, вы не пропустите концерт с участием любимых звезд, сможете попасть на важную театральную премьеру или запланировать визит на шоу для детей. Мы не просто продаем билеты, а дарим эмоции, которые вдохновляют.</p>\r\n', NULL, '2020-02-26 01:40:33', '2020-03-05 15:25:29', NULL),
(3, 'about_us', 'partners ru', 'ПАРТНЁРАМ', 'partners_ru', '<p>По вопросам сотрудничества и размещения рекламы на сайте пишите:<br />\r\nmaglumat@bilettm.com</p>\r\n', NULL, '2020-02-26 01:41:52', '2020-03-05 15:28:56', NULL),
(4, 'about_us', 'contacts ru', 'Контакты', 'contacts_ru', '<p>&nbsp;</p>\r\n\r\n<p>Туркменистан, Ашхабад,</p>\r\n\r\n<p>ул. Анкара, 18</p>\r\n\r\n<p>Телефон: +(993) 12 60-60-60</p>\r\n\r\n<p>Все замечания и предложения Вы можете писать нам на почту: maglumat@bilettm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Помощь</strong></p>\r\n\r\n<p>Если в разделе &laquo;Вопросы и ответы&raquo; Вам не удалось найти ответ на свой вопрос, можете обратиться в службу поддержки по телефону: +(993) 12 60-60-60 или написать письмо на электронный адрес: maglumat@bilettm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Время работы </strong><strong>call-центра:</strong></p>\r\n\r\n<p>Ежедневно: 9:00 - 18:00</p>\r\n', NULL, '2020-02-26 01:42:47', '2020-03-05 15:33:44', NULL),
(5, 'about_us', 'how_to_buy ru', 'Как купить билет', 'how_to_buy_ru', '<p><strong>Способы покупки</strong></p>\r\n\r\n<p>Для вас доступны современные способы покупки билетов на сайте или в мобильном приложении Billettm.com.</p>\r\n\r\n<p>На сайте вы можете приобрести электронный билет в любое удобное время при помощи компьютера или смартфона. После заказа необходимо его распечатать и предъявить на входе. Плюсы такого билета - экономия время и денег (не нужно оплачивать доставку).</p>\r\n\r\n<p>Приложение дает возможность купить мобильный билет, который сочетает в себе плюсы электронного билета и снимает необходимость печати билета на принтере. Достаточно при входе на мероприятие предъявить билет на экране телефона.</p>\r\n\r\n<p><strong>Как приобрести</strong></p>\r\n\r\n<p>Чтобы приобрести билет, Вам необходимо выбрать мероприятие, его дату и время, а затем нажать кнопку &laquo;Купить&raquo;. &nbsp;</p>\r\n\r\n<p>Откроется страница со списком билетов, которые выставлены для on-line продажи. Вы можете приобрести стандартные или VIP-билеты, выбрав в специальном поле. Затем выберите свободные места, отметив их. Обращаем внимание на то, что Вы можете просмотреть схему зала. После выбора всех мест, нажмите &laquo;Подтвердите ваши места&raquo;.</p>\r\n\r\n<p><strong>ВНИМАНИЕ!!! </strong>После перехода на страницу заказа, у вас есть 30 минут для его оформления. После &ndash; все места снова станут доступны на сайте, и Вам необходимо будет заново их выбирать и заполнять форму. Таймер времени Вы можете увидеть в правой стороне экрана под информацией о стоимости заказа.</p>\r\n\r\n<p>На странице &laquo;Информация для заказа&raquo; заполните обязательные поля, отмеченные звездочкой (*), с указанием Вашего имени, фамилии и электронной почты. Затем скопируйте эти данные для всех билетов или введите данные их владельцев. Затем нажмите кнопку &laquo;Оплатить&raquo;.</p>\r\n\r\n<p>Обратите внимание, что воспользоваться билетом сможет любой человек, не зависимо от того, какое имя записано на нем.</p>\r\n\r\n<p>После выбора, Вы переходите на сайт обработки электронных платежей банка &laquo;Altyn Asyr&raquo;. Заполните требуемые поля и нажмите кнопку &laquo;Оплатить&raquo;. При успешной операции откроется окно с информацией по платежу, и появятся ссылки, по которым вы сможете скачать билеты (ссылки станут недоступны, как только вы покинете страницу).</p>\r\n\r\n<p><strong>Оплата</strong></p>\r\n\r\n<p>Оплата заказа осуществляется с помощью банковской карты Altyn Asyr. После оплаты электронный билет будет отправлен на тот электронный адрес, который Вы указали при оформлении заказа.</p>\r\n\r\n<p><strong>Получение билета</strong></p>\r\n\r\n<p>После успешного завершения заказа, электронный билет в формате PDF автоматически придет на указанную электронную почту в течение нескольких минут. Если Вы не получили письмо, обратитесь в нашу службу поддержки.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Внимание! </strong></p>\r\n\r\n<ul>\r\n	<li>В процессе поиска и заказа билетов нужно учитывать, что информация о наличии билетов в списке соответствует действительности лишь в момент перехода на страницу со списком. Если Вы долго находитесь на этой странице, билеты на свободные места за это время могут быть зарезервированы другим покупателем.</li>\r\n	<li>Один клиент одновременно может заказать (забронировать) не более &nbsp;5 (пяти) билетов.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Заказав мобильный билет через приложение,&nbsp; нет необходимости его печати на принтере. Достаточно при входе на мероприятие предъявить билет на экране телефона.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Администрация сайта оставляет за собой право отказать пользователю в создании заказа при наличии признаков злоупотребления в использовании сервиса.</li>\r\n</ul>\r\n\r\n<p>Если у Вас возникли вопросы, Вы можете обратиться в службу поддержки по тел.: +(993) 12 60-60-60 или написать письмо на электронный адрес: maglumat@bilettm.com</p>\r\n', NULL, '2020-02-26 01:44:45', '2020-03-05 15:41:35', NULL),
(6, 'about_us', 'questions ru', 'ВОПРОСЫ И ОТВЕТЫ', 'questions_ru', '<p><strong>1. Как приобрести билет на сайте?</strong></p>\r\n\r\n<p>Для вас доступны современные способы покупки билетов на сайте или в мобильном приложении Billettm.com.</p>\r\n\r\n<p>Подробнее читайте в разделе <a href="https://bilettm.com/how_to_buy">&laquo;Как купить билет&raquo;</a>.</p>\r\n\r\n<p><strong>2. Как вернуть билет?</strong></p>\r\n\r\n<p>В случае отказа клиента от посещения соответствующего мероприятия организатор осуществляет возврат денежных средств лицу, зарегистрированному в заказе, при соблюдении условий, указанных на сайте.</p>\r\n\r\n<p>Подробнее читайте в разделе &laquo;Возврат билетов&raquo;.</p>\r\n\r\n<p><strong>3. Как оплатить заказ?</strong></p>\r\n\r\n<p>Оплата заказа осуществляется с помощью банковской карты национального оператора Altyn Asyr.</p>\r\n\r\n<p>Подробнее читайте в разделе &laquo;Как купить билет&raquo;.</p>\r\n\r\n<p><strong>4. Если билет не пришел на </strong><strong>email</strong><strong>?</strong></p>\r\n\r\n<p>Если оплата прошла успешно, но билет на эл. почту не пришел, обратитесь в нашу службу поддержки по телефону +(993) 12 60-60-60 или напишите письмо на почту maglumat@bilettm.com с адреса, который был указан при оформлении заказа.</p>\r\n\r\n<p><strong>5.</strong><strong> </strong><strong>Какую сумму я могу</strong><strong> вернуть за билет?</strong></p>\r\n\r\n<p>100% номинальной стоимости билета можно получить при обращении за возвратом денежных средств не позднее, чем за 10 (десять) календарных дней до даты проведения мероприятия.&nbsp; При обращении менее, чем за 3 (три) календарных дня до даты проведения мероприятия, возврат денежных средств не производится.</p>\r\n\r\n<p>Полное описание сроков и стоимости возврата денежных средств читайте в разделе &laquo;Возврат билетов&raquo;.</p>\r\n\r\n<p><strong>6. </strong><strong>Могу ли я докупить места рядом с моим местом?</strong></p>\r\n\r\n<p>Только в случае, если эти места свободны и доступны к резервированию. В ином случае, Вам придется сделать возврат билетов и купить необходимое количество новых на свободные места. Внимание! Рекомендуем внимательно ознакомиться с правилами возврата билета во избежание разногласий.</p>\r\n\r\n<p><strong>7. Я не успел оплатить билет, что делать?</strong></p>\r\n\r\n<p>Если Вы не успели оплатить зарезервированные билеты в течении 30 (тридцати) минут, Вам необходимо обновить страницу сайта и повторить порядок действий для заказа билета.</p>\r\n\r\n<p>Подробнее читайте в разделе &laquo;Как купить билет&raquo;.</p>\r\n\r\n<p><strong>8. Почему возврату подлежит не вся сумма?</strong></p>\r\n\r\n<p>В соответствии с п. 4.3., п. 4.5., п.4.6 &nbsp;Публичной оферты не подлежит возврату сумма сервисного сбора (если она взималась с клиента при покупке билетов) и фактически понесенные расходы согласно Закона Туркменистана &nbsp;&laquo;О защите прав потребителей&raquo;.</p>\r\n\r\n<p>Подробнее читайте в разделе &laquo;Возврат билетов&raquo;.</p>\r\n\r\n<p><strong>9. Когда деньги за возврат билета вернутся на мою банковскую карту?</strong></p>\r\n\r\n<p>Как правило, возврат средств занимает от нескольких часов до трёх дней. В редких случаях возврат может занимать до 30 дней (зависит от Банка, выпустившего вашу карту).</p>\r\n\r\n<p><strong>10. Почему нельзя вернуть билет в день мероприятия?</strong></p>\r\n\r\n<p>Компания осуществляет возврат денежных средств при отказе покупателя от посещения мероприятия до его начала согласно условиям Публичной оферты, размещенной на сайте, с которой клиент соглашается перед совершением покупки билетов. Возврат денежных средств осуществляется не позднее, чем за 3 (три) рабочих дня до даты мероприятия (пункт 4.3. Публичной оферты).</p>\r\n\r\n<p><strong>11. Можно ли поменять приобретенный билет на другую дату или на другое мероприятие?</strong></p>\r\n\r\n<p>Приобретенный билет обмену не подлежит. Вы можете осуществить возврат приобретенного билета в соответствии с условиями Публичной оферты и приобрести билет на иную дату или иное мероприятие. Внимание! Рекомендуем ознакомиться с условиями возврата билета во избежание разногласностей.</p>\r\n\r\n<p><strong>12. Достаточно ли распечатать электронный билет и пойти на мероприятие?</strong></p>\r\n\r\n<p>Да. Чтобы попасть на мероприятие, достаточно распечатать электронный билет, который Вы получили на электронную почту после онлайн покупки.</p>\r\n\r\n<p><strong>13. Как воспользоваться мобильным билетом?</strong></p>\r\n\r\n<p>Мобильный билет, приобретенный через приложение, снимает необходимость печати билета на принтере. Достаточно при входе на мероприятие предъявить билет на экране телефона.</p>\r\n\r\n<p><strong>14. Как получить оплаченный онлайн билет?</strong></p>\r\n\r\n<p>После успешного завершения заказа, электронный билет в формате PDF автоматически придет на указанную электронную почту в течение нескольких минут.</p>\r\n\r\n<p><strong>15. Сколько раз можно получить билет на почту?</strong></p>\r\n\r\n<p>На электронную почту билет можно получить только один раз. В особых случаях Вы можете обратиться в нашу службу поддержки.</p>\r\n\r\n<p><strong>16. Я организатор мероприятия. Как зарегистрироваться на сайте? </strong></p>\r\n\r\n<p>Для регистрации необходимо выбрать пункт &laquo;Добавить событие&raquo; на главной странице сайта. Затем заполнить заявку и получить доступ к аккаунту от администратора. Вы получите письмо подтверждения на Вашу электронную почту. Когда вы пройдете по ссылке из письма &ndash; регистрация окончена.</p>\r\n', NULL, '2020-02-26 01:45:07', '2020-03-05 15:47:16', NULL),
(8, 'about_us', 'organizers ru', 'Организаторам', 'organizers_ru', '<p>Наша площадка предоставляет замечательную возможность, чтобы о Вашем мероприятии узнали все. Приглашаем к сотрудничеству организаторов мероприятий. Предоставляем услуги:</p>\r\n\r\n<ul>\r\n	<li>Продажа билетов через сервис (веб-сайт и мобильное приложение);</li>\r\n	<li>Продвижение мероприятий через социальные сети и с помощью email-рассылок;</li>\r\n	<li>Наружная реклама мероприятий.</li>\r\n</ul>\r\n\r\n<p>Наш сервис позволяет увеличить продажу билетов и снизить расходы на продвижение и рекламу. Все мероприятия, представленные на сайте, сгрупированы по жанрам, сопровождаются подробным описанием, фото- и видеоматериалами, информацией о месте проведении с указанием его адреса.</p>\r\n\r\n<p><strong>Система работы с нами: </strong></p>\r\n\r\n<p>Для начала сотрудничества необходимо заключить с нами договор. Договор и условия размера коммисионной выгоды отправляется по запросу в ответ на предоставление информации о мероприятии.</p>\r\n\r\n<p><strong>Внимание!</strong> Организатором может выступать только юридическое лицо.</p>\r\n\r\n<p>После заключения договора организатор заполняет заявку на сайте в пункте &laquo;Добавить событие&raquo;. После рассмотрения ее администратором, организатор получит эл. письмо с логином и паролем для входа в Личный кабинет. В административной панели организатор подробно излагает информацию о мероприятии, включая</p>\r\n\r\n<ul>\r\n	<li>афишу в .jpg формате, в слоях Photoshop или .tiff без рекламных логотипов;</li>\r\n	<li>информация о событии или пресс-релиз для сайта;</li>\r\n	<li>фото и видеоматериалы, которые могут быть интересны покупателям билетов, для размещения в социальных сетях и email-рассылках;</li>\r\n	<li>интересные факты о выступающих.</li>\r\n</ul>\r\n\r\n<p>Личный кабинет позволяет организатору:</p>\r\n\r\n<ul>\r\n	<li>устанавливать количество и ценовую категорию билетов;</li>\r\n	<li>просмотреть статистику продаж;</li>\r\n	<li>просмотреть общую сумму проданных билетов;</li>\r\n	<li>техническую и информационную поддержку.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Порядок расчета с каждым организатором оговаривается индивидуально.</p>\r\n\r\n<p>По вопросам сотрудничества обращайтесь по телефону: +(993) 12 60-60-60 или напишите письмо на эл. адрес support@bilettm.</p>\r\n', NULL, '2020-02-26 01:50:29', '2020-03-02 03:08:09', NULL),
(9, 'about_us', 'oferta ru', 'УСЛОВИЯ ПРЕДОСТАВЛЕНИЯ УСЛУГ (ПУБЛИЧНАЯ ОФЕРТА)', 'oferta_ru', '<p><strong>ТЕРМИНЫ И ОПРЕДЕЛЕНИЯ</strong></p>\r\n\r\n<p><strong>Организатор </strong>&ndash; юридическое лицо или индивидуальный предприниматель, осуществляющие в соответствии с законодательством Туркменистана деятельность по организации и (или) проведению Мероприятий;</p>\r\n\r\n<p><strong>Агент</strong> &ndash; Хозяйственное общество &laquo;Тапылгысыз Махабат&raquo; (ИНК: 101&nbsp;131&nbsp;003&nbsp;020, юридический адрес: 744017, Туркменистан, город Ашхабад, Копетдагский этрап, микрорайон Парахат 3/2 дом №18), от имени и по поручению Организатора, оказывает услуги по продаже Билетов посредством Сайта и ПО;</p>\r\n\r\n<p><strong>Мероприятие </strong>&ndash; массовые мероприятия культуры, проводимые Организатором;</p>\r\n\r\n<p><strong>Билет</strong> &ndash; документ, оформленный в соответствии с требованиями законодательства Туркменистана, дающий право посещения Мероприятия;</p>\r\n\r\n<p><strong>Сайт</strong> &ndash; веб-ресурс, принадлежащий Агенту и имеющий адрес в сети интернет &laquo;<em>bilettm.com</em>&raquo;, на котором Агент размещать информацию о проводимых Организатором Мероприятиях с целью последующего ознакомления Клиентами с информацией и возможности, в последующем, принятия участия в таких Мероприятиях Клиентами Сайта и ПО;</p>\r\n\r\n<p><strong>ПО</strong> &ndash; программное обеспечение принадлежащий Агенту &laquo;<em>biletTm</em>&raquo;;</p>\r\n\r\n<p><strong>Клиент &ndash; </strong>физическое лицо, достигшее восемнадцатилетнего возраста, пользователь сети интернет, Сайта и ПО, осуществляющий резервирование и покупку Билета;</p>\r\n\r\n<p>Агент в лице Сайта и ПО, размещенного в глобальной сети Интернет, публикует оферту, являющийся публичной офертой (далее по тексу &ndash; &laquo;Оферта) в адрес Клиентов о нижеследующем:</p>\r\n\r\n<p><strong>1. Предмет Оферты</strong></p>\r\n\r\n<p>1.1. Агент от имени и по поручению Организатора осуществляет Клиенту следующие действия по продаже Билетов посредством Сайта и ПО:</p>\r\n\r\n<p>Устанавливает причитающиеся вознаграждение Агенту: Сервисный сбор.<br />\r\nСамостоятельно распространяет Билеты с использованием средств Сайта и ПО.</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp;&nbsp; Момент заключения Оферты</strong></p>\r\n\r\n<p>2.1. Текст настоящей Оферты является публичной офертой.</p>\r\n\r\n<p>2.2. Акцепт Оферты - получение или оплата Клиентом заказанных услуг в порядке, определяемым условиями и тарифами Агента.</p>\r\n\r\n<p>2.3. Факт заказа услуг Клиентом Агенту, является безоговорочным принятием условий настоящей Оферты, т.е. Клиент, заказавший Билеты либо воспользовавшийся услугами Агента, рассматривается как лицо, вступившее с Агентом в договорные отношения.</p>\r\n\r\n<p><strong>3. Права и обязанности сторон</strong></p>\r\n\r\n<p><strong>3.1. Агент обязуется:</strong></p>\r\n\r\n<p>3.1.1.&nbsp;&nbsp; С момента заключения настоящей Оферты предоставлять Клиенту услуги, &nbsp;в соответствии с их перечнем и требованиями качества, определенными в настоящей Оферте.</p>\r\n\r\n<p>3.1.2.&nbsp;&nbsp; Согласовывать с Клиентам условия услуг по Оферте.</p>\r\n\r\n<p>3.1.3.&nbsp;&nbsp; Не разглашать любую личную информацию Клиента и не предоставлять доступ к этой информации третьим лицам, иначе как в порядке, предусмотренным настоящей Офертой и за исключением случаев, предусмотренных законодательством Туркменистана.</p>\r\n\r\n<p>3.1.4.&nbsp;&nbsp; Предоставить Клиентам возможность получения бесплатных телефонных консультаций по телефонам, указанным на Сайте и ПО. Объем консультаций ограничивается конкретными вопросами, связанными с предоставлением услуг по настоящей Оферте.</p>\r\n\r\n<p>3.1.5.&nbsp;&nbsp; Выполнять взятые на себя обязанности по предоставлению услуг Клиенту. Агент оставляет за собой право невыполнения услуг в случае возникновения форс-мажорных ситуаций.</p>\r\n\r\n<p>​​​​​​​3.2.&nbsp;<strong>Агент имеет право:</strong></p>\r\n\r\n<p>3.2.1.&nbsp;&nbsp; Изменять условия Оферты и тарифы на услуги в одностороннем порядке, размещая их на Сайте и ПО не менее чем за 10 (Десять) дней до начала их действия.</p>\r\n\r\n<p>3.2.2.&nbsp;&nbsp; Имеет право отказать в заключении Оферты на предоставление услуг, уведомив об этом Клиента.</p>\r\n\r\n<p>​​​​​​​3.3.&nbsp;<strong>Клиент обязуется:</strong></p>\r\n\r\n<p>3.3.1.&nbsp;&nbsp; До момента заключения Оферты ознакомиться с содержанием Оферты, условиями реализации Билетов и тарифами Агента в соответствии с пунктом 4.1. Оферты.</p>\r\n\r\n<p>3.3.2.&nbsp;&nbsp; Своевременно оплачивать услуги, оказанные Клиенту.</p>\r\n\r\n<p><strong>4. Финансовые взаимоотношения</strong></p>\r\n\r\n<p>4.1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Услуги Клиенту оказываются на основании тарифов и условиях продажи Агента: Сервисного сбора от установленной номинальной стоимости, проданного Билета на Сайте и ПО.</p>\r\n\r\n<p>4.2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; При отмене, замене или переносе Организатором Мероприятий возврат осуществляется Организатором Мероприятия, указанном на Билете, в устанавливаемом&nbsp;им порядке, месте и срок.</p>\r\n\r\n<p>4.3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Выплата номинальной стоимости Билета при его возврате Клиентом, осуществляется Организатором в устанавливаемом им порядке, месте и сроках.</p>\r\n\r\n<p>4.4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Сервисный сбор Агента не возвращается.</p>\r\n\r\n<p>4.5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; От имени Агента, заявление на возврат номинальной стоимости Билета принимается на e-mail: maglumat@bilettm.com. В выходные и праздничные дни возврат номинальной стоимости Билетов не осуществляется.</p>\r\n\r\n<p><strong>5.&nbsp; Отказ от предоставления гарантий</strong></p>\r\n\r\n<p>5.1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Агент делает все возможное, чтобы обеспечить от имени Организатора качественное предоставление услуг Клиенту. Советы и информация, даваемые Клиенту, не могут рассматриваться как гарантии.</p>\r\n\r\n<p>5.2.&nbsp; &nbsp; &nbsp;Агент ни при каких обстоятельствах не несет ответственности за неисполнение или ненадлежащее исполнение Организатором своих обязательств по организации и проведению Мероприятия, либо отмену или перенос Мероприятия Организатором.</p>\r\n\r\n<p>5.3.&nbsp; &nbsp; Агент не несет никакой ответственности за достижение или не достижение Клиентом результата, которого Клиент рассчитывал достичь, используя Сайт и ПО.</p>\r\n\r\n<p>5.4.&nbsp; &nbsp; Агент не отвечает за неисправности, ошибки и сбои в работе программных и/или аппаратных средств, обеспечивающих функционирование Сайта и ПО, возникшие по причинам, не зависящим от Агента.</p>\r\n\r\n<p>5.5.&nbsp; &nbsp; Агент не несет ответственности за какие-либо косвенные/непрямые убытки и/или упущенную выгоду Клиента и/или третьих лиц, утрату информации в результате использования или невозможности использования Сайта и ПО.</p>\r\n\r\n<p>5.6.&nbsp; &nbsp;Агент не отвечает за убытки Клиента, возникшие в результате неправомерных действий третьих лиц, в том числе связанных с неправомерным доступом к личному Аккаунту Клиента. Агент не несет ответственность за убытки, причиненные Клиента в результате разглашения третьим лицам учетных данных, произошедшего не по вине Агента.</p>\r\n\r\n<p>5.7.&nbsp; &nbsp;Стороны освобождаются от ответственности за неисполнение или ненадлежащее исполнение обязательств по Оферте на время действия непреодолимой силы. Под непреодолимой силой понимаются чрезвычайные и непреодолимые при данных условиях обстоятельства, препятствующие исполнению своих обязательств сторонами по Оферты. К ним относятся стихийные явления (землетрясения, наводнения и т.п.), обстоятельства общественной жизни (военные действия, чрезвычайные положения, крупнейшие забастовки, эпидемии и т. п.), запретительные меры государственных органов (запрещение перевозок, валютные ограничения, международные санкции запрета на торговлю и т.п.). В течение этого времени стороны не имеют взаимных претензий, и каждая из сторон принимает на себя свой риск последствия форс-мажорных обстоятельств.</p>\r\n\r\n<p><strong>6. Срок действия, порядок изменения условий и расторжения Оферты</strong></p>\r\n\r\n<p>6.1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Стороны признают, что исполнение обязательств по Оферте начинается с момента обращения Агенту и заканчивается фактом получения Клиентом Билетов по итогам исполнения Агентом услуг, перечисленных в пункте 1.1. Оферты.</p>\r\n\r\n<p>6.2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Все споры и разногласия, возникающие при исполнении сторонами обязательств&nbsp; по Оферте, решаются путем переговоров. В случае невозможности их устранения, стороны имеют право обратиться за судебной защитой своих интересов в соответствие действующему законодательству Туркменистана.</p>\r\n\r\n<p><strong>7. Прочие условия</strong></p>\r\n\r\n<p>7.1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Клиент даёт Агенту добровольное информированное согласие на обработку его личных данных, включая фамилию, имя, отчество, номер телефона, адрес электронной почты в целях исполнения Оферты, а также предоставляет право передачи указанных личных данных третьим лицам, взаимодействующих с Агентом, и их использования последними исключительно и только в целях, предусмотренных пунктами 7.4. и 7.5. Оферты.</p>\r\n\r\n<p>7.2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Обработка личных данных Клиента включает их накопление, хранение, обработку, использование, распространение, обезличивание, уточнение, блокирование и уничтожение.</p>\r\n\r\n<p>7.3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; IP-адрес, тип браузера и операционная система, дата и время посещения собирается и сохраняется Агентом в деперсонализированном виде для ведения статистики посещаемости и оптимизации работы поисковых алгоритмов Сайта.</p>\r\n\r\n<p>7.4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Агент использует личные данные Клиента в маркетинговых, рекламных и информационных целях, включая:</p>\r\n\r\n<p>информирование Клиента о сделанных им заказах, отмене, замене или переносе Мероприятия, на которое Клиентом приобретены Билеты;<br />\r\nрассылку новостей Сайта;</p>\r\n\r\n<p>7.5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Клиент имеет право рассылать SMS-сообщения, связанные с предложениями, размещаемыми на Сайте, в том числе содержащие:</p>\r\n\r\n<p>новости;<br />\r\nрекламные акции;<br />\r\n​​​​​​​уведомления о событиях.</p>\r\n\r\n<p>7.6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Клиент вправе в любое время отказаться от получения рассылки и (или) потребовать от Клиента уничтожения всех собранных ею личных данных Клиента, уведомив об этом Агента в разумный срок.</p>\r\n', NULL, '2020-02-26 01:51:49', '2020-05-06 15:11:50', NULL),
(10, 'about_us', 'partners tk', 'Hyzmatdaşlar üçin', 'partners_tk', '<pre>\r\nHyzmatdaşlyk we sa&yacute;tda mahabat &yacute;erleşdirmek soraglary bo&yacute;un&ccedil;a bize maglumat@bilettm.com  elektron po&ccedil;tamyza &yacute;azyň. \r\n</pre>\r\n', NULL, '2020-02-26 01:57:07', '2020-03-05 15:31:09', NULL),
(11, 'about_us', 'contacts tk', 'Habarlaşmak üçin', 'contacts_tk', '<p>T&uuml;rkmenistan, Aşgabat ş&auml;heri,</p>\r\n\r\n<p>Ankara k&ouml;&ccedil;., j. 18</p>\r\n\r\n<p>Telefon: +(993) 12 60-60-60</p>\r\n\r\n<p>&Auml;hli pikirleriňizi we teklipleriňizi biziň maglumat@bilettm.com elektron po&ccedil;tamyza &yacute;azyp bilersiňiz.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>K&ouml;mek</strong></p>\r\n\r\n<p>Eger-de Siz &quot;Soraglar we jogaplar&quot; b&ouml;l&uuml;minde &ouml;z soragyňyza jogap tapyp bilmedik bolsaňyz, +(993) 12 60-60-60 telefon belgimiz&nbsp;&yacute;a-da maglumat@bilettm.com elektron po&ccedil;tamyz arkaly biziň goldaw gullugymyza &yacute;&uuml;z tutup bilersiňiz.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Call-merkeziniň iş wagty:</strong></p>\r\n\r\n<p>Her g&uuml;n: 9:00 - 18:00</p>\r\n', NULL, '2020-02-26 01:57:33', '2020-03-05 15:40:41', NULL),
(12, 'about_us', 'how_to_buy tk', 'Bileti nädip satyn almaly', 'how_to_buy_tk', '<p><strong>Satyn almagyň usullary </strong></p>\r\n\r\n<p>Size Bilettm.com sa&yacute;tynda &yacute;a-da telefon programmasynda bilet almagyň iň t&auml;ze usullary h&ouml;d&uuml;rlenil&yacute;&auml;r.</p>\r\n\r\n<p>Sa&yacute;tda bileti komp&yacute;uteriň &yacute;a-da smartfonyň &uuml;sti bilen islendik wagt alyp bil&yacute;&auml;ňiz. Bu&yacute;urma edilenden soň, bileti kagyza &ccedil;ykaryp girelgede g&ouml;rkezmeli. Onuň gowy tarapy &ndash; Siz wagtyňyzy we pulyňyzy tygşytla&yacute;aňyz.</p>\r\n\r\n<p>Telefon programma bolsa mobil bilet almaga m&uuml;mkin&ccedil;ilik d&ouml;red&yacute;&auml;r. Ol bileti printerden &ccedil;ykarmak zerurlygy aradan a&yacute;yr&yacute;ar. Bileti diňe telefonyň ekranynda g&ouml;rkezmek &yacute;eterlik.</p>\r\n\r\n<p><strong>N&auml;dip satyn almaly&nbsp; </strong></p>\r\n\r\n<p>Bileti almak &uuml;&ccedil;in, Siz &ccedil;&auml;r&auml;ni, onuň wagtyny we senesini sa&yacute;lamaly. Soňra bolsa &ldquo;Satyn almak&rdquo; d&uuml;wmesine basmaly.&nbsp;</p>\r\n\r\n<p>&Ouml;ň&uuml;ňizde online satyl&yacute;an biletleriň sanawy &yacute;erleşdirilen penjire a&ccedil;ylar. Siz adaty &yacute;a-da VIP-biletleri alyp bil&yacute;&auml;ňiz. Indi bolsa boş &yacute;erleri sa&yacute;laň - olary bell&auml;ň. &Uuml;ns &ccedil;ekesimiz gel&yacute;&auml;n zat &ndash; Siz zalyň shemasyny hem g&ouml;r&uuml;p bil&yacute;&auml;ňiz. &Yacute;erleri sa&yacute;laňyzdan soň, &ldquo;&Yacute;erleriňizi tassyklaň&rdquo; d&uuml;wmesine basyň.</p>\r\n\r\n<p><strong>&Uuml;ns beriň!!!</strong> Bu&yacute;urmanyň sahypasyna ge&ccedil;eniňizden soň, ony resmileşdirmek &uuml;&ccedil;in Siziň 30 minudyňyz bar. Şondan soň &ndash; sa&yacute;tdaky &auml;hli &yacute;erler &yacute;ene el&yacute;eter bolar we olary t&auml;zeden sa&yacute;lap, formany doldurmaly bolarsyňyz. Ta&yacute;meri ekranyň sag tarapynda bu&yacute;urmanyň bahasy baradaky maglumatyň aşagynda g&ouml;r&uuml;p bilersiňiz.</p>\r\n\r\n<p>&ldquo;Bu&yacute;urma &uuml;&ccedil;in maglumat&rdquo; atly sahypasynda &yacute;yldyzjyk bilen bellenen gerekli boşluklary dolduryň. Adyňyzy, famili&yacute;aňyzy we elektron po&ccedil;taňyzy g&ouml;rkeziň. Soňra bu maglumatlary &auml;hli biletler &uuml;&ccedil;in g&ouml;&ccedil;&uuml;riň &yacute;a-da e&yacute;eleri baradaky maglumatlary girizip, &ldquo;T&ouml;lemek&rdquo; d&uuml;wmesini basyň.</p>\r\n\r\n<p>&Yacute;&uuml;z&uuml;nde kimiň ady &yacute;azylanyna garamazdan, bileti islendik kişi ulanyp biler. &nbsp;</p>\r\n\r\n<p>Siz bankyň elektron t&ouml;legleri işle&yacute;&auml;n sa&yacute;tyna ge&ccedil;&yacute;&auml;ňiz. Gerekli boşluklary dolduryň we &ldquo;T&ouml;lemek&rdquo; d&uuml;wmesini basyň. Amal &uuml;st&uuml;nlikli &yacute;erine &yacute;etirilende t&ouml;leg bo&yacute;un&ccedil;a maglumat &yacute;erleşdirilen penjire a&ccedil;ylar we ssylkalar &ccedil;ykar. Olar bo&yacute;un&ccedil;a biletleri alyp bilersiňiz (sahypadan &ccedil;ykanyňyzda, ssylkakar işlemez).</p>\r\n\r\n<p><strong>T&ouml;leg</strong></p>\r\n\r\n<p>Bu&yacute;urmanyň t&ouml;legi Altyn Asyr bank kartyň k&ouml;megi bilen &yacute;erine &yacute;etiril&yacute;&auml;r. T&ouml;leg amala aşyrylandan soň elektron bilet bu&yacute;urma resmileşdirilen wagtynda g&ouml;rekezilen e-mail salga ugradyl&yacute;ar.</p>\r\n\r\n<p><strong>Bileti kabul etmek &nbsp;&nbsp;&nbsp;</strong></p>\r\n\r\n<p>Bu&yacute;urma &uuml;st&uuml;nlikli &yacute;erine &yacute;etirilenden soň, bilet birn&auml;&ccedil;e minudyň dowamynda PDF formatda g&ouml;rkezilen elektron po&ccedil;ta geler. Eger Size hat gelmese, biziň k&ouml;mek gullugymyza &yacute;&uuml;z tutuň.</p>\r\n\r\n<p><strong>&Uuml;ns beriň!&nbsp; </strong></p>\r\n\r\n<ul>\r\n	<li>Bilet g&ouml;zlenilende we bu&yacute;rulanda, onuň sanawda barlygy baradaky maglumat diňe degişli sahypa ge&ccedil;ilende m&auml;lim bol&yacute;andygyny g&ouml;z &ouml;ň&uuml;ne tutuň. Eger Siz sahypada k&ouml;p wagtlap saklansaňyz, boş &yacute;erlere biletler başga satyn alyjy tapyndan e&yacute;elenip bilner.</li>\r\n	<li>Bir m&uuml;şderi şol bir wagtda b&auml;ş biletden k&ouml;p bu&yacute;urmak rugsat edilme&yacute;&auml;r.</li>\r\n	<li>Programmanyň &uuml;sti bilen mobil bilet bu&yacute;urmak, ony printerde &ccedil;ap etmek zerurlygy aradan a&yacute;ryl&yacute;ar. Bileti girelgede telefonyň ekranynda g&ouml;rkezseň bol&yacute;ar.</li>\r\n	<li>Sa&yacute;tyň administrasi&yacute;asy ulgamy hy&yacute;anat&ccedil;ylykly pe&yacute;dalanmagyň alamatlary &yacute;&uuml;ze &ccedil;ykan &yacute;agda&yacute;ynda ulanyjynyň bu&yacute;urmasyny ret etmek hukugyny galdyr&yacute;ar.</li>\r\n</ul>\r\n\r\n<p>Soraglar &yacute;&uuml;ze &ccedil;ykan &yacute;agda&yacute;ynda, k&ouml;mek gullugyna &yacute;&uuml;z tutup bilersiňiz: + (993) 12 60-60-60 jaň edip &yacute;a-da maglumat@bilettm.com elektron salgysyna &yacute;azyp bilersiňiz.</p>\r\n', NULL, '2020-02-26 01:57:54', '2020-03-05 15:45:01', NULL),
(13, 'about_us', 'questions tk', 'SORAGLAR WE JOGAPLAR', 'questions_tk', '<p><strong>1.Sa&yacute;tyň &uuml;sti bilen bileti n&auml;dip</strong><strong> sat</strong><strong>yn almaly</strong><strong>?</strong></p>\r\n\r\n<p>Size Bilettm.com sa&yacute;tynda &yacute;a-da telefon programmasynda bilet almagyň iň t&auml;ze usullary h&ouml;d&uuml;rlenil&yacute;&auml;r.</p>\r\n\r\n<p>Giňişle&yacute;in &ldquo;N&auml;dip satyn almaly&rdquo; b&ouml;l&uuml;minde okaň.</p>\r\n\r\n<p><strong>2. Bileti n&auml;dip yzyna tabşyrmaly?</strong></p>\r\n\r\n<p>M&uuml;şderiniň degişli &ccedil;&auml;r&auml; barmadyk &yacute;agda&yacute;ynda pul serişdeler bu&yacute;urmada hasaba alynan şahsa ga&yacute;taryl&yacute;ar. Sa&yacute;tda g&ouml;rekezilen &auml;hli şertler &yacute;erine &yacute;etiril&yacute;&auml;r.</p>\r\n\r\n<p>Giňişle&yacute;in &ldquo;Bileti yzyna tabşyrmak&rdquo; b&ouml;l&uuml;minde okaň.</p>\r\n\r\n<p><strong>3.Bu&yacute;urmanyň t&ouml;legini n&auml;dip &yacute;erine &yacute;etirmeli</strong><strong>?</strong></p>\r\n\r\n<p>Bu&yacute;urmanyň t&ouml;legi Altyn Asyr bank kartynyň k&ouml;megi bilen &yacute;erine &yacute;etiril&yacute;&auml;r.</p>\r\n\r\n<p>Giňişle&yacute;in &ldquo;N&auml;dip satyn almaly&rdquo; b&ouml;l&uuml;minde okaň.</p>\r\n\r\n<p><strong>4. Bilet e-mail </strong><strong>salga</strong><strong> gelmedik bolsa? </strong></p>\r\n\r\n<p>T&ouml;leg &uuml;st&uuml;nlikli &yacute;erine &yacute;etirilse, emma bilet elektron po&ccedil;ta gelmedik &yacute;agda&yacute;ynda, k&ouml;mek gullugyna &yacute;&uuml;z tutup bilersiňiz: + (993) 12 60-60-60 jaň edip &yacute;a-da maglumat@bilettm.com elektron salgysyna &yacute;azyp bilersiňiz.</p>\r\n\r\n<p><strong>5.Biletiň bahasynyň n&auml;&ccedil;e m&ouml;&ccedil;berini yzyna alyp bil&yacute;&auml;n? </strong></p>\r\n\r\n<p>&Ccedil;&auml;reden 10 (on) kalendar g&uuml;n &ouml;ň yzyna ga&yacute;tarmak bo&yacute;un&ccedil;a &yacute;&uuml;z tutulanda biletiň bahasynyň 100% yzyna alyp bil&yacute;&auml;ňiz. &Ccedil;&auml;reden 3 (&uuml;&ccedil;) g&uuml;n &ouml;ň &yacute;&uuml;z tutulanda pul serişdeleri yzyna ga&yacute;tarylma&yacute;ar.</p>\r\n\r\n<p>Pul serişdeleriniň ga&yacute;tarylmagynyň wagty we m&ouml;&ccedil;beri baradaky maglumatlar bilen &ldquo;Biletleri yzyna ga&yacute;tarmak&rdquo; b&ouml;l&uuml;minde tanyşyp bilersiňiz. &nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>6.&Yacute;anymdaky &yacute;erleri goşma&ccedil;a alyp bil&yacute;&auml;nmi?</strong></p>\r\n\r\n<p>Diňe &yacute;erleriň boş bolan &yacute;agda&yacute;ynda. Başga &yacute;agda&yacute;da biletleri yzyna tabşyryp, t&auml;zesini almaly bol&yacute;aňyz.</p>\r\n\r\n<p>&Uuml;ns beriň! D&uuml;ş&uuml;nişmezliklere &yacute;ol bermezlik &uuml;&ccedil;in biletleri yzyna tabşyrmagyň kadalary bilen jikme-jik tanyş bolmagy maslahat ber&yacute;&auml;ris.</p>\r\n\r\n<p><strong>7. Men biletiň t&ouml;legini edip &yacute;etişmedim. N&auml;me etmeli?</strong></p>\r\n\r\n<p>Eger rezerwirlenen biletleriň t&ouml;legini 30 minudyň i&ccedil;inde etmedik bolsaňyz, Siz sa&yacute;tyň sahypasyny t&auml;zelemeli we degişli tertipde ga&yacute;tadan bu&yacute;urma etmeli.</p>\r\n\r\n<p>Giňişle&yacute;in &ldquo;N&auml;dip satyn almaly&rdquo; b&ouml;l&uuml;minde okaň.</p>\r\n\r\n<p><strong>8. N&auml;me &uuml;&ccedil;in biletiň bahasynyň tutuş m&ouml;&ccedil;berini ga&yacute;taryp bolma&yacute;ar?</strong></p>\r\n\r\n<p>K&ouml;p&ccedil;&uuml;lik &uuml;&ccedil;in ni&yacute;etlenen ofertanyň 4.3, 4.5, 4.6 b&ouml;l&uuml;mlerine la&yacute;yklykda hyzmat &yacute;ygymlarynyň m&ouml;&ccedil;beri (eger ol m&uuml;şderiden bilet satyn alanda saklanylan bolsa), şe&yacute;le hem &ldquo;Sarp edijileriň hukuklaryny goramak&rdquo; baradaky T&uuml;rkmenistanyň Kanynyna la&yacute;yklykda &ccedil;ekilen &ccedil;ykda&yacute;jylary yzyna ga&yacute;tarylma&yacute;ar.</p>\r\n\r\n<p><strong>9.Ha&ccedil;an ga&yacute;tarylan pul m&ouml;&ccedil;beri bank kartyma ge&ccedil;er?</strong></p>\r\n\r\n<p>Kada bolşy &yacute;aly, serişdeleriň yzyna ga&yacute;tarylyp berilmegi bir iş g&uuml;ninden d&ouml;rt iş g&uuml;nine &ccedil;enli &ccedil;ek&yacute;&auml;r. Se&yacute;rek &yacute;agda&yacute;larda bu &yacute;agda&yacute; 30 g&uuml;nl&auml;p dowam ed&yacute;&auml;r (kartyňyzy beren banka bagly).</p>\r\n\r\n<p><strong>10. N&auml;me &uuml;&ccedil;in bileti &ccedil;&auml;r&auml;niň ge&ccedil;&yacute;&auml;n g&uuml;ninde tabşyryp bolmaz?</strong></p>\r\n\r\n<p>Satyn alyjynyň &ccedil;&auml;r&auml; barmadyk &yacute;agda&yacute;ynda K&ouml;p&ccedil;&uuml;lik &uuml;&ccedil;in ni&yacute;etlenen ofertanyň şertlerine la&yacute;yklykda k&auml;rhana &ccedil;&auml;re başlamazdan &ouml;ň pul serişdeleri yzyna ga&yacute;tar&yacute;ar. Pul serişdeleri &ccedil;&auml;r&auml;niň gecirilmeli senesinden &uuml;&ccedil; iş g&uuml;ninden gija galman yzyna ga&yacute;taryl&yacute;ar (K&ouml;p&ccedil;&uuml;lik &uuml;&ccedil;in ni&yacute;etlenen ofertanyň 4.3 b&ouml;l&uuml;mi).&nbsp; &nbsp;</p>\r\n\r\n<p><strong>11.Alynan bileti başga sen&auml; &yacute;a-da &ccedil;&auml;r&auml; &ccedil;alşyp bolarmy</strong><strong>?</strong><strong> </strong></p>\r\n\r\n<p>Alynan bilet &ccedil;alşylmaga degişli d&auml;ldir. Siz K&ouml;p&ccedil;&uuml;lik &uuml;&ccedil;in ni&yacute;etlenen ofertanyň şertlerine la&yacute;yklykda bileti yzyna ga&yacute;taryp, başga sen&auml; &yacute;a-da &ccedil;&auml;r&auml; t&auml;ze bilet alyp bilersiňiz. &Uuml;ns beriň!&nbsp; D&uuml;ş&uuml;nişmezliklere &yacute;ol bermezlik &uuml;&ccedil;in biletleri yzyna tabşyrmagyň kadalary bilen jikme-jik tanyş bolmagy maslahat ber&yacute;&auml;ris.</p>\r\n\r\n<p><strong>12. &Ccedil;&auml;r&auml; elektron bileti &ccedil;ap edip gitmek &yacute;eterlikmi?&nbsp; </strong></p>\r\n\r\n<p>Hawa. &Ccedil;&auml;r&auml; girmek &uuml;&ccedil;in onla&yacute;n s&ouml;wdadan soň elektron po&ccedil;ta gelen bileti printerden &ccedil;ykarmak &yacute;eterlik.&nbsp;</p>\r\n\r\n<p><strong>13. Mobil bilet n&auml;dip pe&yacute;dalanmaly?</strong></p>\r\n\r\n<p>Programmanyň &uuml;sti bilen alynan mobil bilet ony printerden &ccedil;ykarmak zerurlygy aradan a&yacute;yr&yacute;ar. Bileti diňe telefonyň ekranynda g&ouml;rkezmek &yacute;eterlik.</p>\r\n\r\n<p><strong>14.T&ouml;legi edilen onla&yacute;n bileti n&auml;dip almaly?</strong></p>\r\n\r\n<p>Bu&yacute;urma &uuml;st&uuml;nlikli &yacute;erine &yacute;etirilenden soň, bilet birn&auml;&ccedil;e minudyň dowamynda PDF formatda g&ouml;rkezilen elektron po&ccedil;ta gel&yacute;&auml;r.</p>\r\n\r\n<p><strong>15. Bilet elektron po&ccedil;ta n&auml;&ccedil;e gezek gelip bil&yacute;&auml;r?</strong></p>\r\n\r\n<p>Elektron po&ccedil;ta bilet diňe bir gezek gel&yacute;&auml;r. A&yacute;ratyn &yacute;agda&yacute;larda k&ouml;mek gullugyna &yacute;&uuml;z tutup bilersiňiz.</p>\r\n\r\n<p><strong>16. Men &ccedil;&auml;r&auml;ni gurna&yacute;jy. Sa&yacute;tda n&auml;dip hasaba alynmaly?</strong></p>\r\n\r\n<pre>\r\nHasaba alynmak &uuml;&ccedil;in sa&yacute;tyň esasy sahypasynda &Ccedil;&auml;re goşmak b&ouml;l&uuml;mini sa&yacute;lamaly. Soňra talapnama dolduryp, administratordan akkaunta bolan rugsat almaly. Elektron po&ccedil;taňyza tassyklama haty geler. Hatdaky salgylanma bo&yacute;un&ccedil;a ge&ccedil;eniňizde, hasaba alynyşyk tamamlan&yacute;ar.</pre>\r\n', NULL, '2020-02-26 01:58:50', '2020-03-05 15:51:26', NULL),
(15, 'about_us', 'organizers tk', 'Guramaçylara', 'organizers_tk', '<p>Biziň me&yacute;dan&ccedil;amyz Siziň &ccedil;&auml;r&auml;ňiz barada hemmeleriň bilmegi &uuml;&ccedil;in aja&yacute;yp m&uuml;mkin&ccedil;ilikdir. Şe&yacute;lelikde, &ccedil;&auml;re gurna&yacute;jylary hyzmatdaşlyga &ccedil;agyr&yacute;as.</p>\r\n\r\n<p>Biz aşakdaky hyzmatlary h&ouml;d&uuml;rle&yacute;&auml;ris:</p>\r\n\r\n<ul>\r\n	<li>Biletleri bir ulgamyň &uuml;sti bilen satmak (web-sa&yacute;t &yacute;a-da telefon programmasy);</li>\r\n	<li>&Ccedil;&auml;reler baradaky maglumatlary jemgy&yacute;et&ccedil;ilik torlaryň &yacute;a-da e-mail arkaly k&ouml;p&ccedil;&uuml;lige &yacute;etirmek;</li>\r\n	<li>&Ccedil;&auml;releriň daşky mahabaty.</li>\r\n</ul>\r\n\r\n<p>Biziň ulgamymyz biletleriň satuw derejesini &yacute;okarlandyryp, mahabata edil&yacute;&auml;n &ccedil;ykda&yacute;jylary azaltmaga m&uuml;mkin&ccedil;ilik ber&yacute;&auml;r. Sa&yacute;tda g&ouml;rkezilen &auml;hli &ccedil;&auml;reler žanrlar bo&yacute;un&ccedil;a toparlanyp, olara giňişle&yacute;in d&uuml;ş&uuml;ndiriş beril&yacute;&auml;r, foto we wideo materiallar bilen &uuml;pj&uuml;n edil&yacute;&auml;r, şe&yacute;le hem &ccedil;&auml;r&auml;niň ge&ccedil;&yacute;&auml;n &yacute;eri baradaky maglumat salgysy bilen bilelikde &yacute;erleşdiril&yacute;&auml;r.</p>\r\n\r\n<p><strong>Biziň bilen işle&yacute;iş tertibi:</strong></p>\r\n\r\n<p>Hyzmatdaşlygyň ilkinji &auml;dimi &ndash; &nbsp;şertnama baglaşmak. Şertnama we girde&yacute;jileriň m&ouml;&ccedil;beri &ccedil;&auml;re baradaky maglumatlara jogap edip ugradyl&yacute;ar.</p>\r\n\r\n<p><strong>&Uuml;ns beriň!</strong> Gurama&ccedil;y h&ouml;km&uuml;nde diňe &yacute;uridiki şahs &ccedil;ykyş edip bil&yacute;&auml;r.</p>\r\n\r\n<p>Şertnama baglaşandan soň, gurama&ccedil;y sa&yacute;tyň &ldquo;&Ccedil;&auml;re goşmak&rdquo; b&ouml;l&uuml;minde talapnama (za&yacute;awka) doldur&yacute;ar. Ol administrator tarapyndan seredilenden soň, gurama&ccedil;ynyň elektron po&ccedil;tasyna şahsy kabinete girmek &uuml;&ccedil;in parol we login ugradyl&yacute;ar. Gurama&ccedil;y &ouml;z gezeginde &ccedil;&auml;re baradaky maglumatlary jikme-jik be&yacute;an ed&yacute;&auml;r. Şol sanda:</p>\r\n\r\n<ul>\r\n	<li>afişa jpg formatda, Photoshop &yacute;a-da .tiff &nbsp;gatlagynda;</li>\r\n	<li>&ccedil;&auml;re barada maglumat &yacute;a-da sa&yacute;t &uuml;&ccedil;in press-reliz;</li>\r\n	<li>bilet satyn alyjylar &uuml;&ccedil;in gyzykly boljak surat we wideo materiallar; jemgy&yacute;et&ccedil;ilik torlarda &yacute;a-da e-mail hatlarda &yacute;erleşdirmek &uuml;&ccedil;in;</li>\r\n	<li>&ccedil;ykyş ed&yacute;&auml;nler barada gyzykly maglumatlar.</li>\r\n</ul>\r\n\r\n<p>Şahsy kabinet gurama&ccedil;a şu m&uuml;mkin&ccedil;ilikeri ber&yacute;&auml;r:</p>\r\n\r\n<ul>\r\n	<li>biletleriň sanyny we bahasyny kesgitlemek;</li>\r\n	<li>satuwlaryň statistikasyny g&ouml;rmek;</li>\r\n	<li>satylan biletleriň umumy bahasyny g&ouml;rmek;</li>\r\n	<li>tehniki we maglumat goldawy.</li>\r\n</ul>\r\n\r\n<p>Hasaplaşyk her gurna&yacute;jy bilen a&yacute;ratynlykda ge&ccedil;iril&yacute;&auml;r. Hyzmatdaşlyk &uuml;&ccedil;in + (993) 12 60-60-60 jaň edip &yacute;a-da maglumat@bilettm.com elektron salgysyna &yacute;azyp bilersiňiz.</p>\r\n', NULL, '2020-02-26 01:59:39', '2020-03-05 15:52:54', NULL);
INSERT INTO `pages` (`id`, `template`, `name`, `title`, `slug`, `content`, `extras`, `created_at`, `updated_at`, `deleted_at`) VALUES
(16, 'about_us', 'oferta tk', 'HYZMATLARY BERJAÝ ETMEGIŇ ŞERTLERI (KÖPÇÜLIK ÜÇIN NIÝETLENEN OFERTA)', 'oferta_tk', '<p><strong>ADALGALAR WE KESGITLEMELER</strong></p>\r\n\r\n<p><strong>Gurama&ccedil;y </strong>&ndash; &Ccedil;&auml;releri guramak we (&yacute;a-da) ge&ccedil;irmek bo&yacute;un&ccedil;a işi T&uuml;rkmenistanyň kanun&ccedil;ylygyna la&yacute;yklykda amala aşyr&yacute;an &yacute;uridiki tarap &yacute;a-da hususy teleke&ccedil;i;</p>\r\n\r\n<p><strong>Agent</strong> &ndash; &ldquo;Tapylgysyz Mahabat&rdquo; (SSB: 101&nbsp;131&nbsp;003&nbsp;020, hukuk salgysy: 744017, T&uuml;rkmenistan, Aşgabat ş&auml;heri, K&ouml;petdag etraby, Parahat ki&ccedil;ietrap&ccedil;a 3/2 №18 ja&yacute;), Gurama&ccedil;ynyň adyndan we onuň tabşyrygy bo&yacute;un&ccedil;a Sa&yacute;t we P&Uuml; arkaly, Biletleri satmak bo&yacute;un&ccedil;a hyzmatlary berja&yacute; ed&yacute;&auml;r;</p>\r\n\r\n<p><strong>&Ccedil;&auml;re</strong> &ndash; Gurama&ccedil;y tarapyndan ge&ccedil;iril&yacute;&auml;n k&ouml;p&ccedil;&uuml;likle&yacute;in medeni &ccedil;&auml;reler;</p>\r\n\r\n<p><strong>Bilet</strong> &ndash; T&uuml;rkmenistanyň kanun&ccedil;ylygynyň talaplaryna la&yacute;yklykda resmileşdirilen we &Ccedil;&auml;r&auml; barmaga hukuk ber&yacute;&auml;n resminama;</p>\r\n\r\n<p><strong>Sa&yacute;t </strong>&ndash; Agente degişli bolan we internet ulgamynda &ldquo;bilettm.com&rdquo; salgysy &yacute;erleşdirilen web-resurs bolup, şonda Agent Gurama&ccedil;y tarapyndan ge&ccedil;ir&yacute;&auml;n &Ccedil;&auml;releri we wagtyň ge&ccedil;megi bilen, Sa&yacute;tyň we P&Uuml; M&uuml;şderileriniň şonuň &yacute;aly &Ccedil;&auml;relere gatnaşmagynyň m&uuml;mkin&ccedil;ilikleri barada M&uuml;şderilerini tanyşdyrmak maksady bilen, &ouml;z maglumatlaryny &yacute;erleşdirmegine m&uuml;mki&ccedil;ilik d&ouml;re&yacute;&auml;r;</p>\r\n\r\n<p><strong>P&Uuml;</strong> &ndash; Agente degişli bolan programma &uuml;pj&uuml;n&ccedil;iligi &ldquo;biletTm&rdquo;.</p>\r\n\r\n<p><strong>M&uuml;şderi</strong> &ndash; on sekiz &yacute;aşyna &yacute;eten we internet ulgamyndan, Sa&yacute;tdan we Programma &uuml;pj&uuml;n&ccedil;iliginden (P&Uuml;) pe&yacute;dalanmak arkaly, rezerwirlemegi amala aşyr&yacute;an we Biledi satyn al&yacute;an hususy tarap;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Agent global Internet ulgamynda &yacute;erleşdirilen Sa&yacute;t we Programma &uuml;pj&uuml;n&ccedil;iligi (P&Uuml;) arkaly, aşakda g&ouml;rkezilenler barada M&uuml;şderiler &uuml;&ccedil;in, k&ouml;p&ccedil;&uuml;lige ni&yacute;etlenen oferta di&yacute;lip hasaplan&yacute;an (mundan be&yacute;l&auml;k &ndash; &laquo;Оferta&raquo;) şu Оfertany neşir ed&yacute;&auml;r:</p>\r\n\r\n<p><strong>1. Oferta bo&yacute;un&ccedil;a predmeti</strong></p>\r\n\r\n<p>1.1. Agent Gurama&ccedil;ynyň adyndan we onuň tabşyrygy bo&yacute;un&ccedil;a Sa&yacute;t we PO arkaly M&uuml;şderilere Biletleri satmak bo&yacute;un&ccedil;a şu aşakdaky hereketleri amala aşyr&yacute;ar:</p>\r\n\r\n<p>Agente degişli sylagy kesgitle&yacute;&auml;r: Serwis &yacute;ygymy. Sa&yacute;ty we PO serişdelerini ulanmak bilen Biletleri &ouml;zbaşdak &yacute;a&yacute;rad&yacute;ar.</p>\r\n\r\n<p><strong>2. О</strong><strong>fertanyň baglaşyl&yacute;an pursady</strong></p>\r\n\r\n<p>2.1.&nbsp; Şu şertnamanyň teksti k&ouml;p&ccedil;&uuml;lik &uuml;&ccedil;in ni&yacute;etlenen oferta bolup dur&yacute;ar.</p>\r\n\r\n<p>2.2.&nbsp; Ofertanyň aksepti - Agentiň şertleri we tarifleri arkaly kesgitlen&yacute;&auml;n tertipde sargalan hyzmatlaryň berja&yacute; edilmegi we bular bo&yacute;un&ccedil;a M&uuml;şderi tarapyndan t&ouml;leg ge&ccedil;irilmelidir.</p>\r\n\r\n<p>2.3.&nbsp; &nbsp;Şu Оfertanyň şertleriň hi&ccedil; hili şertsiz kabul edilmegi M&uuml;şderiniň Agente hyzmatlary bu&yacute;randygy g&ouml;rkez&yacute;&auml;n &yacute;agda&yacute;dyr, &yacute;agny biletleri sargan &yacute;a-da Agentiň hyzmatlaryndan pe&yacute;dalanan M&uuml;şder&auml; Agent bilen şertnamala&yacute;yn gatnaşyklary amala aşyryp başlan tarap h&ouml;km&uuml;nde garal&yacute;ar.</p>\r\n\r\n<p><strong>3. Taraplaryň hukuklary we bor&ccedil;lary</strong></p>\r\n\r\n<p><strong>3.1.&nbsp; &nbsp; Agent şulary bor&ccedil; edin&yacute;&auml;r:</strong></p>\r\n\r\n<p>3.1.1. Şu Оfertanyň baglaşylan pursadyndan başlap, M&uuml;şderi &uuml;&ccedil;in hyzmatlary şu Оfertada kesgitlenen hyzmatlaryň sanawyna we hil bo&yacute;un&ccedil;a bildiril&yacute;&auml;n talaplara la&yacute;yklykda, &yacute;erine &yacute;etirmegi.</p>\r\n\r\n<p>3.1.2. Şu Оferta bo&yacute;un&ccedil;a huzmatlaryň şertlerini M&uuml;şderi bilen ylalaşmagy.</p>\r\n\r\n<p>3.1.3. Şu Оfertada g&ouml;z g&ouml;z &ouml;ň&uuml;nde tutulan tertipden we T&uuml;rkmenistanyň kanun&ccedil;ylygynda g&ouml;z &ouml;ň&uuml;nde tutulan halatlardan başga &yacute;agda&yacute;larda M&uuml;şderiniň şahsy maglumatyny a&yacute;an etmezligi we şol maglumatyň &uuml;&ccedil;&uuml;nji taraplar &uuml;&ccedil;in el&yacute;eterli etmezligi.</p>\r\n\r\n<p>3.1.4. M&uuml;şderilere Sa&yacute;tda we P&Uuml; g&ouml;rkezilen telefonlar arkaly, maslahatlary muzdsuz almaga m&uuml;mkin&ccedil;ilik d&ouml;retmegi. Maslahatlaryň &ccedil;ygry şu Оferta bo&yacute;un&ccedil;a hyzmatlary berja&yacute; etmek bilen bagly anyk meseleler barada maslahat bermek arkaly &ccedil;&auml;klendiril&yacute;&auml;r.</p>\r\n\r\n<p>3.1.5. M&uuml;şderi &uuml;&ccedil;in hyzmatlary berja&yacute; etmek bo&yacute;un&ccedil;a bo&yacute;un alan bor&ccedil;laryny &yacute;erine &yacute;etirmegi. Agent fors-mažor &yacute;agda&yacute;lar &yacute;&uuml;ze &ccedil;ykan halatynda hyzmatlary berja&yacute; etmezlik bo&yacute;un&ccedil;a hukugyny &ouml;z&uuml;nde saklap gal&yacute;ar.</p>\r\n\r\n<p>3.2.&nbsp;<strong>Agent şulara hukuklydyr:</strong></p>\r\n\r\n<p>3.2.1. &Uuml;&yacute;tgetmeleriň hereket edip ugramagyna &ccedil;enli azyndan 10 (on) g&uuml;n &ouml;ň&uuml;nden Sa&yacute;tda we P&Uuml; g&ouml;rkezmek arkaly, şu Ofertanyň&nbsp;şertlerini we hyzmatlar bo&yacute;un&ccedil;a tarifleri bir tarapla&yacute;yn tertipde &uuml;&yacute;tgetm&auml;ge.</p>\r\n\r\n<p>3.2.2. M&uuml;şder&auml; m&auml;lim etmek arkaly, hyzmatlary berja&yacute; etmek bo&yacute;un&ccedil;a şu Оfertany baglaşmakdan &yacute;&uuml;z &ouml;w&uuml;rm&auml;ge hukuklydyr.</p>\r\n\r\n<p>​​​​​​​3.3.&nbsp;<strong>M&uuml;şderi bor&ccedil; edin&yacute;&auml;r:</strong></p>\r\n\r\n<p>3.3.1. Şu Оfertanyň baglaşyl&yacute;an pursadyna &ccedil;enli Ofertanyň mazmuny, Ofertanyň 4.1-nji bendine la&yacute;yklykda Biletleri &yacute;erlemegiň şertleri we Agentiň tarifleri bilen tanyşmagy.</p>\r\n\r\n<p>3.3.2. M&uuml;şderi &uuml;&ccedil;in berja&yacute; edilen hyzmatlar bo&yacute;un&ccedil;a t&ouml;legleri bellenilen m&ouml;hletde ge&ccedil;irmegi.</p>\r\n\r\n<p><strong>4. &Ouml;zara mali&yacute;e gatnaşyklary</strong></p>\r\n\r\n<p>4.1.&nbsp;&nbsp;M&uuml;şderi &uuml;&ccedil;in hyzmatlar Agentiň tarifleri we şertleri esasynda berja&yacute; edil&yacute;&auml;r: Sa&yacute;tda we PO-da her satylan Bilet &uuml;&ccedil;in Biletiň nominal bahasyndan bellenilenen serwis &yacute;ygymy.</p>\r\n\r\n<p>4.2.&nbsp;Gurama&ccedil;y tarapyndan &Ccedil;&auml;reler &yacute;atyrylanda, &ccedil;alşyrylanda &yacute;a-da başga wagta ge&ccedil;irilende, puly yzyna ga&yacute;tarmak Biletde g&ouml;rkezilen &Ccedil;&auml;r&auml;ni Gurna&yacute;jy tarapyndan we onuň bell&auml;n tertibinde, &yacute;erinde we m&ouml;hletinde amala aşyryl&yacute;ar.</p>\r\n\r\n<p>4.3.&nbsp;Bilet M&uuml;şder&auml; ga&yacute;tarylyp berlende Bilediň nominal bahasyny t&ouml;lemek Gurama&ccedil;y tarapyndan onuň bell&auml;n tertibi, &yacute;eri we m&ouml;hletleri bo&yacute;un&ccedil;a amala aşyryl&yacute;ar.</p>\r\n\r\n<p>4.4.&nbsp;Agentiň Serwis &yacute;ygymy ga&yacute;tarylyp berilme&yacute;&auml;r.</p>\r\n\r\n<p>4.5.&nbsp;&nbsp; Bilediň nominal bahasyny ga&yacute;taryp bermek baradaky arza Agentiň adyndan <a href="mailto:maglumat@bilettm.com">maglumat@bilettm.com</a> e-mail arkaly kabul edil&yacute;&auml;r. Dyn&ccedil; alyş we ba&yacute;ram&ccedil;ylyk g&uuml;nlerinde Bilediň nominal bahasyny ga&yacute;taryp bermek amala aşyrylma&yacute;ar.</p>\r\n\r\n<p><strong>5. Kepillendirmeleri bermekden &yacute;&uuml;z &ouml;w&uuml;rmek</strong></p>\r\n\r\n<p>5.1. Agent Gurama&ccedil;ynyň adyndan M&uuml;şder&auml; hyzmatlarynyň<a name="_Hlk38096154">g&ouml;wneja&yacute; hilli &yacute;erine &yacute;etirilmegi &uuml;&ccedil;in </a>&auml;hli m&uuml;mkin&ccedil;ilikleri d&ouml;red&yacute;&auml;r. M&uuml;şder&auml; beril&yacute;&auml;n maslahatlara we maglumatlara kepillendirmeler h&ouml;km&uuml;nde garalmaly d&auml;ldir.</p>\r\n\r\n<p>5.2. Agent Gurama&ccedil;ynyň &Ccedil;&auml;r&auml;ni guramak we ge&ccedil;irmek bo&yacute;un&ccedil;a &ouml;z bor&ccedil;namasyny &yacute;erine &yacute;etirm&auml;ndigi &yacute;a-da g&ouml;wneja&yacute; hilli &yacute;erine &yacute;etirm&auml;ndigi &yacute;a-da Gurama&ccedil;ynyň &Ccedil;&auml;r&auml;niň ge&ccedil;irm&auml;ndigi &yacute;a-da başga wagta ge&ccedil;irendigi &uuml;&ccedil;in, ha&yacute;sydyr bir g&ouml;rn&uuml;şde jogapk&auml;r&ccedil;ilik &ccedil;ekme&yacute;&auml;r.</p>\r\n\r\n<p>5.3. Agent Sa&yacute;tdan we P&Uuml;-den pe&yacute;dalanmak arkaly isl&auml;n netijesini gazanmadygy ha&yacute;sydyr bir g&ouml;rn&uuml;şde <a name="_Hlk38096898">jogapk&auml;r&ccedil;ilik &ccedil;ekme&yacute;&auml;r</a>.</p>\r\n\r\n<p>5.4. Agent Agente bagly bolmadyk seb&auml;plere g&ouml;r&auml;, Sa&yacute;tyň we P&Uuml;-niň işlemegini &uuml;pj&uuml;n ed&yacute;&auml;n programma we/&yacute;a-da apparata degişli serişdeleriň işinde d&ouml;r&auml;n n&auml;sazlyklar, &yacute;alňyşlyklar we b&ouml;kden&ccedil;likler &uuml;&ccedil;in jogap berme&yacute;&auml;r.</p>\r\n\r\n<p>5.5. Agent Sa&yacute;tdan we P&Uuml;-den pe&yacute;dalanmagyň netijesinde &yacute;a-da pe&yacute;dalanmaga m&uuml;mkin&ccedil;iligiň bolmandygy &uuml;&ccedil;in, M&uuml;şderiniň we/&yacute;a-da &uuml;&ccedil;&uuml;nji taraplaryň gytakla&yacute;yn/g&ouml;ni bolmadyk g&ouml;rn&uuml;şde &yacute;itgileri &ccedil;ekendigi we/&yacute;a-da pe&yacute;dany elden giderendigi hem-de maglumatyň &yacute;itirilendigi &uuml;&ccedil;in jogapk&auml;r&ccedil;ilik &ccedil;ekme&yacute;&auml;r.</p>\r\n\r\n<p>5.6. Agent M&uuml;şderiniň &uuml;&ccedil;&uuml;nji taraplaryň bikanun hereketleriniň we şol sanda M&uuml;şderiniň şahsy Akkauntyna bikanuň aralaşylmagy bilen bagly hereketleriň netijesinde <a name="_Hlk38097380">M&uuml;şderiniň &yacute;itg&auml; sezewar bolandygy &uuml;&ccedil;in jogap berme&yacute;&auml;r</a>. Agent &uuml;&ccedil;&uuml;nji taraplara hasaba alnyş maglumatlarynyň Agente dahylsyz &yacute;agda&yacute;da a&yacute;an edilendigi zerarly, M&uuml;şderiniň &yacute;itg&auml; sezewar bolandygy &uuml;&ccedil;in jogapk&auml;r&ccedil;ilik &ccedil;ekme&yacute;&auml;r.</p>\r\n\r\n<p>5.7. Taraplar &ouml;ň&uuml;ni alyp bolma&yacute;an g&uuml;&yacute;&ccedil;li &yacute;agda&yacute;laryň &ouml;z t&auml;sirini &yacute;etir&yacute;&auml;n d&ouml;wr&uuml;nde Oferta bo&yacute;un&ccedil;a bor&ccedil;namalaryň &yacute;eriken &yacute;etirilm&auml;ndigi &yacute;a-da g&ouml;wneja&yacute; hilli berja&yacute; edilm&auml;ndigi &uuml;&ccedil;in jogapk&auml;r&ccedil;ilikden boşadyl&yacute;ar. &Ouml;ň&uuml;ni alyp bolma&yacute;an g&uuml;&yacute;&ccedil;li &yacute;agda&yacute;lar di&yacute;lip, taraplaryň Oferta bo&yacute;u&ccedil;a &ouml;z bor&ccedil;namalaryny berja&yacute; etmegine p&auml;sgel ber&yacute;&auml;n adatdan daşary we &ouml;ň&uuml;ni alyp bolma&yacute;an &yacute;agda&yacute;lara d&uuml;ş&uuml;nil&yacute;&auml;r. Bu &yacute;agda&yacute;lara tebigy betbat&ccedil;ylyklar (&yacute;er yranma, suwuň joşmagy), jemgy&yacute;et&ccedil;ilik durmuşyndaky &yacute;agda&yacute;lar (harby hereketler, adatdan daşary &yacute;agda&yacute;lar, giň gerimli iş taşla&yacute;yşlar, epidemi&yacute;alar we be&yacute;lekiler), d&ouml;wlet edaralarynyň gadagan ed&yacute;&auml;n &ccedil;&auml;releri (daşalmagyny gadagan etmek, wal&yacute;uta bo&yacute;un&ccedil;a &ccedil;&auml;klendirmeler, s&ouml;wdany gadagan etmek baradaky halkara sanksi&yacute;alar we be&yacute;lekiler) degişli edil&yacute;&auml;r. Şol d&ouml;wr&uuml;ň dowamynda taraplar birek-birege n&auml;gilelik bildirme&yacute;&auml;r hem-de taraplaryň hersi fors-mažor &yacute;agda&yacute;laryň netijeleri bilen bagly t&ouml;wekgel&ccedil;iligi &ouml;z bo&yacute;nuna al&yacute;ar.</p>\r\n\r\n<p><strong>6. Şu Ofertanyň hereket ed&yacute;&auml;n m&ouml;hleti, şertleri &uuml;&yacute;tgetmegiň we &yacute;atyrmagyň tertibi</strong></p>\r\n\r\n<p>6.1.&nbsp;&nbsp; Taraplar şu Oferta bo&yacute;un&ccedil;a bor&ccedil;namalaryň Agente &yacute;&uuml;z tutulan pursadyndan başlan&yacute;andygyny hem-de şu Ofertanyň 1.1-nji bendinde be&yacute;an edilen hyzmatlaryň Agent tarapyndan &yacute;erine &yacute;etirilmeginiň netijesi bo&yacute;un&ccedil;a M&uuml;şderiniň hakykatdan-da Biletleri almagy bilen tamamlan&yacute;ar.</p>\r\n\r\n<p>6.2.&nbsp;&nbsp; Taraplar şu Ofertany berja&yacute; eden mahalynda &yacute;&uuml;ze &ccedil;yk&yacute;an &auml;hli <a name="_Hlk33792701">jedeller we d&uuml;ş&uuml;nişmezlikler </a>gepleşikleri ge&ccedil;irmek arkaly &ccedil;&ouml;z&uuml;l&yacute;&auml;r. Jedelleri we d&uuml;ş&uuml;nişmezlikleri aradan a&yacute;yrmak m&uuml;mkin bolmadyk halatynda, taraplar T&uuml;rkmenistanyň hereket ed&yacute;&auml;n kanun&ccedil;ylygyna la&yacute;yklykda &ouml;z b&auml;hbitleriniň goralmagy &uuml;&ccedil;in kazy&yacute;ete &yacute;&uuml;z tutmaga hukuklydyr.</p>\r\n\r\n<p><strong>7. Be&yacute;leki şertler</strong></p>\r\n\r\n<p>7.1.&nbsp;&nbsp; Şu Ofertany berja&yacute; etmek maksady bilen, M&uuml;şderi Agente &ouml;z şahsy maglumatlarynyň, şol sanda famili&yacute;asynyň, adynyň, atasynyň adynyň, telefon belgisiniň, elektron po&ccedil;tasynyň ulanylmagyna me&yacute;letin razylydygy baradaky namany ber&yacute;&auml;r, şe&yacute;le hem g&ouml;rkezilen şahsy maglumatlarynyň Agent bilen &ouml;zara gatnaşyk sakla&yacute;an &uuml;&ccedil;&uuml;nji taraplara ge&ccedil;irilmegine we &uuml;&ccedil;&uuml;nji taraplaryň bu maglumatlaryň diňe Ofertanyň 7.4-nji we 7.5-nji bentlerinde g&ouml;z &ouml;ň&uuml;nde tutulan maksatlar &uuml;&ccedil;in ulanmagyna hukuk ber&yacute;&auml;r.</p>\r\n\r\n<p>7.2.&nbsp;&nbsp; M&uuml;şderiniň şahsy maglumatlarynyň ulanylmagy bu maglumatlaryň toplanmagyny, saklanmagyny, işlenip ta&yacute;&yacute;arlanmagyny, pe&yacute;dalanylmagyny, &yacute;a&yacute;radylmagyny, takyklanmagyny, blokirlenmegini we &yacute;atyrylmagyny aňlad&yacute;ar.</p>\r\n\r\n<p>7.3.&nbsp;&nbsp; IP-salgy, brauzeriň g&ouml;rn&uuml;şi we operasion ulgam, g&ouml;rmek &uuml;&ccedil;in aralaşylan senesi we wagty Sa&yacute;ta aralaşmak bo&yacute;un&ccedil;a statistikany &yacute;&ouml;retmek we Sa&yacute;tyň g&ouml;zleg algoritmelriniň işini oňa&yacute;laşdyrmak maksady bilen, Agent tarapyndan toplan&yacute;ar we depersonalizirlenen g&ouml;rn&uuml;şde saklan&yacute;ar.</p>\r\n\r\n<p>7.4.&nbsp;&nbsp; Agent M&uuml;şderiniň şahsy maglumatlaryny marketinge, reklama we maglumat berilmegine degişli maksatlar we aşakda g&ouml;rkezilenler &uuml;&ccedil;in ulan&yacute;ar:</p>\r\n\r\n<p>&nbsp; &nbsp;M&uuml;şder&auml; onuň sargytlary, M&uuml;şderiniň alan Biletleri bo&yacute;un&ccedil;a &Ccedil;&auml;r&auml;niň &yacute;atyryl&yacute;andygy, &ccedil;alşyryl&yacute;andygy&nbsp; &nbsp; &nbsp; &nbsp;&yacute;a-da başga wagta ge&ccedil;iril&yacute;&auml;ndigi barada maglumat bermek &uuml;&ccedil;in;<br />\r\n&nbsp;&nbsp;Sa&yacute;tda t&auml;zelikleri &yacute;a&yacute;ratmak &uuml;&ccedil;in.</p>\r\n\r\n<p>7.5.M&uuml;şderi Sa&yacute;tda &yacute;erleşdiril&yacute;&auml;n teklipler bilen bagly SMS-habarlary, şol sanda aşakda g&ouml;rkezilenleri &yacute;a&yacute;ratmaga hukuklydyr:</p>\r\n\r\n<p>t&auml;zelikleri;<br />\r\nreklama aksi&yacute;alaryny;<br />\r\n&yacute;agda&yacute;lary m&auml;lim ed&yacute;&auml;n habarlary.</p>\r\n\r\n<p>7.6. M&uuml;şderi Agente o&yacute;lanyşykly m&ouml;hletde m&auml;lim etmek arkaly, islendik wagtda iberil&yacute;&auml;n habarlary almakdan &yacute;&uuml;z &ouml;w&uuml;rm&auml;ge we (&yacute;a-da) M&uuml;şder&auml; degişli toplanan &auml;hli şahsy maglumatlaryň &yacute;atyrylmagyny talap etm&auml;ge hukuklydyr.</p>\r\n', NULL, '2020-02-26 01:59:59', '2020-05-06 15:02:56', NULL),
(17, 'about_us', 'refund ru', 'ВОЗВРАТ БИЛЕТОВ', 'refund_ru', '<p>Правила возврата электронных и мобильных билетов на сайте <a href="http://www.bilettm.com">www.bilettm.com</a></p>\r\n\r\n<p>Перед осуществлением возврата клиент должен ознакомиться с условиями Публичной оферты. Осуществление возврата клиентом электронных и/или мобильных билетов, денежных средств за приобретенные клиентом электронные и/или мобильные билеты означает ознакомление и полное согласие клиента с условиями Публичной оферты. Услуги клиенту оказываются на основании тарифов и условиях компании, о которых клиент узнает до оплаты заказа из содержания сайта или мобильного приложения.</p>\r\n\r\n<p>Билеты, приобретенные клиентом в рамках специальных программ и акций, объявленных организатором применительно к тому или иному мероприятию, и предусматривающие особые условия их приобретения (в том числе льготы, скидки), по решению организатора могут не приниматься к возврату. Об условиях приобретения билетов в рамках специальных программ, клиент обязуется узнавать из содержания страницы сайта или мобильного приложения, посвященного мероприятию до момента их заказа и оплаты.</p>\r\n\r\n<p>Билеты, полученные клиентом в обмен на участие в программах лояльности, в качестве стимулирующих или поощрительных призов и иных случаях, предполагающих их получение на безвозмездной основе, не принимаются к возврату. Об условиях соответствующих акций клиент узнает из содержания программ лояльности, в которых принимает участие.</p>\r\n\r\n<p>При отмене, замене или переносе мероприятий возврат осуществляется организатором мероприятия, указанном на билете, в устанавливаемом им порядке, месте и срок.</p>\r\n\r\n<p>Возврат денежных средств, ошибочно перечисленных через электронные платежные системы в адрес компании, осуществляется безналичным перечислением по заполненному и подписанному заявлению клиента. Подписанное заявление может быть передано представителю компании лично или по e-mail: maglumat@bilettm.com. Срок возврат денежных средств 3 (три) банковских дня, с момента поступления заявления от клиента.</p>\r\n\r\n<p>Выплата номинальной стоимости билета при его возврате клиентом, осуществляется организатором в устанавливаемом им порядке, месте и сроках.</p>\r\n\r\n<p>От имени компании, заявление на возврат номинальной стоимости билета принимает по e-mail: maglumat@bilettm.com. В выходные и праздничные дни возврат номинальной стоимости билетов не осуществляется.</p>\r\n\r\n<p><strong>Обратите внимание! </strong>Клиент может сделать возврат денежных средств за созданный им заказ. Частично вернуть заказ невозможно (напр., один билет из двух билетов в заказе).</p>\r\n\r\n<p>Возврат денежных средств клиенту осуществляется по тем же банковским реквизитам, с которых была произведена покупка электронного и/или мобильного билета.</p>\r\n\r\n<p>Время возврата (поступления) денежных средств клиенту, как правило, занимает от нескольких часов до трёх дней. В редких случаях возврат может занимать до 30 дней (зависит от Банка, выпустившего вашу карту). Сроки возврата клиент уточняет дополнительно в банке, держателем карты которого он является.</p>\r\n\r\n<p>Данные правила вступают в силу с даты их размещения на сайте и действуют бессрочно.</p>\r\n\r\n<p>Компания заявляет, что не имеет своей целью ущемить или иным образом ограничить гарантированные действующим законодательством права потребителя, имеющего возможность обратиться к непосредственному исполнителю услуги &ndash; организатору соответствующего зрелищного мероприятия с требованием о расторжении договора возмездного оказания услуги и выплатой ее стоимости, уменьшенной на сумму фактически понесенным им расходов.</p>\r\n', NULL, '2020-03-01 07:17:57', '2020-05-06 14:25:40', NULL),
(18, 'about_us', 'refund tk', 'BILEDI YZYNA TABŞYRMAK', 'refund_tk', '<p><a href="https://bilettm.com/tk/refund_tk">BILEDI YZYNA GA&Yacute;TARMAK</a></p>\r\n', NULL, '2020-03-01 07:18:45', '2020-03-05 16:22:03', NULL),
(19, 'about_us', 'privacy & policy', 'Политика конфиденциальности', 'privacy_policy_ru', '<ol>\r\n	<li>ОСНОВНЫЕ ПОНЯТИЯ</li>\r\n</ol>\r\n\r\n<p><strong>Сайт</strong>&nbsp;&ndash; личный сайт, расположенный в сети Интернет по адресу:&nbsp;<a href="https://bilettm.com/" target="_blank">https://bilettm.com/</a><br />\r\n<strong>Администрация Сайта</strong>&nbsp;&ndash; &quot;Tapylgysyz Mahabat&quot; (ХО), email:&nbsp;maglumat@bilettm.com.<br />\r\n<strong>Пользователь</strong>&nbsp;&ndash; физическое или юридическое лицо, разместившее свою персональную информацию посредством Формы обратной связи на сайте с последующей целью передачи данных&nbsp;&nbsp;Администрации Сайта.<br />\r\n<strong>Форма обратной связи</strong>&nbsp;&ndash; специальная форма, где Пользователь размещает свою персональную информацию с целью передачи данных&nbsp;&nbsp;Администрации Сайта.</p>\r\n\r\n<p>2. ОБЩИЕ ПОЛОЖЕНИЯ</p>\r\n\r\n<p>2.1. Настоящая Политика конфиденциальности является официальным типовым документом Администрации Сайта и определяет порядок обработки и защиты информации о физических и юридических лицах, использующих Форму обратной связи на Сайте.<br />\r\n2.2. Целью настоящей Политики конфиденциальности является обеспечение надлежащей защиты информации о Пользователе, в т.ч. его персональных данных от несанкционированного доступа и разглашения.<br />\r\n2.3. Отношения, связанные со сбором, хранением, распространением и защитой информации о пользователях регулируются настоящей Политикой конфиденциальности и действующим законодательством Туркменистана.<br />\r\n2.4. Действующая редакция Политики конфиденциальности, является публичным документом, разработана Администрацией Сайта и доступна любому Пользователю сети Интернет при переходе по гипертекстовой ссылке &laquo;Политика конфиденциальности&raquo;.<br />\r\n2.5. Администрация Сайта вправе вносить изменения в настоящую Политику конфиденциальности.<br />\r\n2.6. При внесении изменений в Политику конфиденциальности, Администрация Сайта уведомляет об этом Пользователя путём размещения новой редакции Политики конфиденциальности на Сайте&nbsp;<a href="https://bilettm.com/" target="_blank">https://bilettm.com/</a>.<br />\r\n2.7. При размещении новой редакции Политики конфиденциальности на Сайте, предыдущая редакция хранятся в архиве документации Администрации Сайта.<br />\r\n2.8. Используя Форму обратной связи, Пользователь выражает свое согласие с условиями настоящей Политики конфиденциальности.<br />\r\n2.9. Администрация Сайта не проверяет достоверность получаемой (собираемой) информации о Пользователе.</p>\r\n\r\n<p>3. УСЛОВИЯ И ЦЕЛИ СБОРА И ОБРАБОТКИ ПЕРСОНАЛЬНЫХ ДАННЫХ ПОЛЬЗОВАТЕЛЕЙ</p>\r\n\r\n<p>3.1. Персональные данные Пользователя такие как: имя, фамилия, отчество, e-mail, телефон и др., передаются Пользователем&nbsp;&nbsp;Администрации Сайта с согласия Пользователя.&nbsp;&nbsp;<br />\r\n3.2. Передача персональных данных Пользователем Администрации Сайта, через Форму обратной связи&nbsp;&nbsp;означает согласие Пользователя на передачу его персональных данных.<br />\r\n3.3. Администрация Сайта осуществляет обработку информации о Пользователе, в т.ч. его персональных данных, таких как: имя, фамилия, отчество, e-mail, телефон и др., а также дополнительной информации о Пользователе, предоставляемой им по своему желанию: организация, город, должность и др. в целях выполнения обязательств перед Пользователем Сайта.<br />\r\n3.4. Обработка персональных данных осуществляется на основе принципов:<br />\r\nа) законности целей и способов обработки персональных данных и добросовестности;<br />\r\nб) соответствия целей обработки персональных данных целям, заранее определенным и заявленным при сборе персональных данных;<br />\r\nв) соответствия объёма и характера обрабатываемых персональных данных способам обработки персональных данных и целям обработки персональных данных;<br />\r\nг) недопустимости объединения созданных для несовместимых между собой целей баз данных, содержащих персональные данные.<br />\r\n3.5. Администрация Сайта осуществляет обработку персональных данных Пользователя с его согласия в целях оказания услуг/продажи товаров, предлагаемых на Сайте.</p>\r\n\r\n<p>4. ХРАНЕНИЕ И ИСПОЛЬЗОВАНИЕ ПЕРСОНАЛЬНЫХ ДАННЫХ</p>\r\n\r\n<p>Персональные данные Пользователя хранятся исключительно на электронных носителях и используются строго по назначению, оговоренному в п.3 настоящей Политики конфиденциальности.</p>\r\n\r\n<p>5. ПЕРЕДАЧА ПЕРСОНАЛЬНЫХ ДАННЫХ</p>\r\n\r\n<p>5.1. Персональные данные Пользователя не передаются каким-либо третьим лицам, за исключением случаев, прямо предусмотренных настоящей Политикой конфиденциальности, указанных в&nbsp;<a href="http://elenagordeeva.com/%D0%B2%D1%81%D1%82%D0%B0%D0%B2%D1%8C%D1%82%D0%B5" target="_blank">Согласии с рассылкой</a>.<br />\r\n<br />\r\n5.2. Предоставление персональных данных Пользователя по запросу государственных органов, органов местного самоуправления осуществляется в порядке, предусмотренном законодательством Туркменистана.</p>\r\n\r\n<p>6. СРОКИ ХРАНЕНИЯ И УНИЧТОЖЕНИЕ ПЕРСОНАЛЬНЫХ ДАННЫХ</p>\r\n\r\n<p>6.1. Персональные данные Пользователя хранятся на электронном носителе сайта бессрочно.<br />\r\n6.2. Персональные данные Пользователя уничтожаются при желании самого пользователя на основании его обращения, либо по инициативе Администратора сайта без объяснения причин путём удаления Администрацией Сайта информации, размещённой Пользователем.</p>\r\n\r\n<p>7. ПРАВА И ОБЯЗАННОСТИ ПОЛЬЗОВАТЕЛЕЙ</p>\r\n\r\n<p>Пользователи вправе на основании запроса получать от Администрации Сайта информацию, касающуюся обработки его персональных данных.</p>\r\n\r\n<p>8. МЕРЫ ПО ЗАЩИТЕ ИНФОРМАЦИИ О ПОЛЬЗОВАТЕЛЯХ</p>\r\n\r\n<p>Администратор Сайта принимает технические и организационно-правовые меры в целях обеспечения защиты персональных данных Пользователя от неправомерного или случайного доступа к ним, уничтожения, изменения, блокирования, копирования, распространения, а также от иных неправомерных действий.</p>\r\n\r\n<p>9. ОБРАЩЕНИЯ ПОЛЬЗОВАТЕЛЕЙ</p>\r\n\r\n<p>9.1. Пользователь вправе направлять Администрации Сайта свои запросы, в т.ч. относительно использования/удаления его персональных данных, предусмотренные п.3 настоящей Политики конфиденциальности в письменной форме по адресу, указанному в п.1.<br />\r\n9.2. Запрос, направляемый Пользователем, должен содержать следующую информацию:<br />\r\n<strong>для физического лица:</strong><br />\r\n&ndash; номер основного документа, удостоверяющего личность Пользователя или его представителя;<br />\r\n&ndash; сведения о дате выдачи указанного документа и выдавшем его органе;<br />\r\n&ndash; дату регистрации через Форму обратной связи;<br />\r\n&ndash; текст запроса в свободной форме;<br />\r\n&ndash; подпись Пользователя или его представителя.<br />\r\n<strong>для юридического лица:</strong><br />\r\n&ndash; запрос в свободной форме на фирменном бланке;<br />\r\n&ndash; дата регистрации через Форму обратной связи;<br />\r\n&ndash; запрос должен быть подписан уполномоченным лицом с приложением документов, подтверждающих полномочия лица.<br />\r\n9.3. Администрация Сайта обязуется рассмотреть и направить ответ на поступивший запрос Пользователя в течение 30 дней с момента поступления обращения.<br />\r\n9.4. Вся корреспонденция, полученная Администрацией от Пользователя (обращения в письменной/электронной форме) относится к информации ограниченного доступа и без письменного согласия Пользователя разглашению не подлежит. Персональные данные и иная информация о Пользователе, направившем запрос, не могут быть без специального согласия Пользователя использованы иначе, как для ответа по теме полученного запроса или в случаях, прямо предусмотренных законодательством.</p>\r\n', NULL, '2020-03-03 22:48:23', '2020-04-14 19:05:07', NULL),
