INSERT INTO `venues` (`id`, `venue_name`, `venue_name_full`, `location_address`, `location_address_line_1`, `location_address_line_2`, `location_country`, `location_country_code`, `location_state`, `location_post_code`, `location_street_number`, `location_lat`, `location_long`, `location_google_place_id`, `seats_image`, `active`, `address`, `venue_name_ru`, `venue_name_tk`, `description_ru`, `description_tk`, `images`) VALUES
(1, 'Berkarar kinoteatry', NULL, NULL, '', '', NULL, NULL, '', '', NULL, NULL, NULL, NULL, 'venues/31ce6d196bf17f26ca84adb623ec55b9.jpg', 0, '{"value": "Berkarar söwda dynç alyş merkezi, Ашхабад, Туркменистан", "latlng": {"lat": 37.9006627, "lng": 58.33695480000006}, "country": "Туркменистан", "locality": "Ашхабад", "sublocality_level_1": "Арчабильский этрап", "administrative_area_level_1": "Ashgabat"}', 'Berkarar kinoteatry', 'Berkarar kinoteatry', '> # *asdadsadasd*', 'TEst', '["venues\\/Images\\/2e671e80dc87f061bba56f946cb4a722.jpg"]'),
(2, 'Киноконцертный  зал "Туркменистан"', NULL, NULL, '', '', NULL, NULL, '', '', NULL, NULL, NULL, NULL, 'venues/b81313143b696d3c5bec928d70c4dfa8.jpg', 1, '{"route": "Oguzhan Köçesi", "value": "\\"Turkmenistan\\"Kinokonsert Merkezi, Oguzhan Köçesi, Ашхабад, Туркменистан", "latlng": {"lat": 37.9096815, "lng": 58.40698359999999}, "country": "Туркменистан", "locality": "Aşgabat", "administrative_area_level_1": "Aşgabat", "administrative_area_level_2": "Berkararlyk etraby"}', 'Киноконцертный зал «Туркменистан»', '"Türkmenistan" Kinokonsert merkezi', 'В столичном киноконцертном зале «Туркменистан» всегда можно посмотреть не только самые интересные музыкальные мероприятия города, но и зарубежные кинофильмы и мультфильмы.\r\n\r\nКинотеатр оснащен уютным залом с большим экраном, хорошей звуковой аппаратурой, которая позволяет зрителю полностью окунуться в мир кино. \r\n\r\n**Адрес:** г. Ашхабад, улица Огузхана, 13\r\n**Телефон**: 49-26-58, (+993)65 53-33-59\r\n', NULL, '[]'),
(3, 'Кинотеатр "Ашхабад"', NULL, NULL, '', '', NULL, NULL, '', '', NULL, NULL, NULL, NULL, 'venues/f0ed70e131a4c00ac602f7ef49a2a4b2.jpg', 1, '{"route": "Magtymguly şaýoly", "value": "Aşgabat kinoteatry, проспект Махтумкули, Ашхабад, Туркменистан", "latlng": {"lat": 37.94940399999999, "lng": 58.373027200000024}, "country": "Туркменистан", "locality": "Aşgabat", "street_number": "115", "sublocality_level_1": "Köpetdag etraby", "administrative_area_level_1": "Aşgabat"}', 'Киноконцертный зал «Ашхабад»', '"Aşgabat" Kinokonsert merkezi', 'Первый 3D-кинотеатр в Туркменистане был открыт 29 июня 2011 года. В кинотеатре два зала: большой (500 зрительных мест) и малый (70 зрительных мест). Общая площадь киноцентра составляет около 4,5 тыс. кв. м.\r\n\r\nВ комплексе функционирует интернет-кафе, магазин для продажи книг и сувениров, летнее кафе. Перед главным входом располагается площадь для торжественных мероприятий.\r\n\r\nВ кинотеатре демонстрируются преимущественно документальные фильмы о Туркменистане. Показ осуществляется на туркменском языке.\r\n\r\n**Адрес:** г. Ашхабад, просп. Махтумкули, 115 \r\n\r\n**Телефон:** 93-44-83\r\n', NULL, '{"3":"venues\\/Images\\/ad211ce5fbbed92f019534cda7d31863.jpg","4":"venues\\/Images\\/6b42c6be9b0a00e27964e629b97eb21d.jpg"}'),
(4, 'Киноконцертный зал "Ватан"', NULL, NULL, '', '', NULL, NULL, '', '', NULL, NULL, NULL, NULL, 'venues/c0472adf51c8c1881b4e700b5171f5c7.jpg', 1, '{"route": "Azadi St", "value": "Watan, Azadi St, Ашхабад, Туркменистан", "latlng": {"lat": 37.9395737, "lng": 58.3796233}, "country": "Туркменистан", "locality": "Aşgabat", "sublocality_level_1": "Köpetdag etraby", "administrative_area_level_1": "Aşgabat"}', 'Киноконцертный зал «Ватан»', '"Watan" kinokonsert merkezi', 'Обновленный зал после реконструкции открылся в 2010 году.  Здесь вы можете просмотреть фильмы производства Туркменистана и Индии, посетить концерты мастеров современной эстрады и послушать выступления камерного оркестра.\r\n\r\n**Адрес:** г. Ашхабад, улица Гёроглы, 3\r\n\r\n**Телефон:** (+993) 12 92-00-00\r\n', NULL, '["venues\\/Images\\/930f1192e355103757b49996f073f0e7.jpg","venues\\/Images\\/32b4f7889140d90b79438a71e3bc3bce.jpg"]'),
(5, NULL, NULL, NULL, '', '', NULL, NULL, '', '', NULL, NULL, NULL, NULL, 'venues/6a6445f2adb83e959c24d5eed5a76aa0.jpg', 0, '{"route": "Arçabil şaýoly", "value": "Aziya Hotel, Arçabil şaýoly, Ashgabat, Turkmenistan", "latlng": {"lat": 37.8840093, "lng": 58.3623251}, "country": "Turkmenistan", "locality": "Aşgabat", "sublocality_level_1": "Arçabil etraby", "administrative_area_level_1": "Aşgabat"}', 'Test Venue 01', 'Test Venue 01 TKM', '**Test Venue 01, delete after test!**\r\n', '**Test Venue 01, delete after test!** TKM ', '["venues\\/Images\\/2269a25cabff1737cab401fac2d8a7b9.jpg"]');
